var book = {
	"name": "၅ မိစ့ၭ",
	"numChapters": 34,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> အယီၩမွဲဆၧချဲၩ့လၧစမိစ့ၭချဲၩ့ဆၧ လၧအံၫစရ့လၭ ထီးအလူၬ လၧထံၫယီၫဒၫ့ လၧအယီၩလခီၫ လၧၡါမု နၧၫ့ဖၫလၧဆၧပျၩ့ဖၧၩ့ ဆဲၫဎၩ့လၧဇုၭ, လၧပၫရၫ့ဒဲထိ",
			"2": "<sup>2</sup> ဖလၭဒဲလၫဘၫ့,- ဒဲဟၫဇရီၭ, ဒဲဒံၭဇဟၭအဘိၩ့ဆၧၩ့ (လၧဟိရ့ၭဖိးလၧကၫဒ့ၭဘၫန့အၫ လၧခိၪလီၩ့စံအၫ အဖၧၩ့ၥၭနီၪ အီၪဝ့ၫအၥၫ့လဆံၫလၥၫ့ ဖၧၩ့ၥၭလီၫ.)",
			"3": "<sup>3</sup> တၭဆၧမၩအၥၭလၧအနံၪ့လံဆံၫအနံၪ့နီၪ လၩလဆံၫ လဘံၪ့လၩထၪ့ၥၫ့လနံၩနီၪ, စမိစ့ၭ ချဲၩ့ဆၧလၧၦအံၫ စရ့လၭဖိၪ, ဘဲၫကယဲဆၧလၧယဟိဝၩ မၪလူၬဝ့ၫလၧ",
			"4": "<sup>4</sup> အဝ့ၫၥံၪအဂးအၥိၭနီၪလီၫ.- မွဲလၧအမၩၥံၫစဎွၩၥံၪ အလးခဲၫ့နီၪ, ၦအၫမိၫဖိၪအစဎွၩ စဲဟၫ့လၧအအီၪလၧ ဟ့ၭၡဘၫ့အဖၧၩ့, ဒဲဘၫၡၫ့အစဎွၩအီၭလၧအအီၪလၧ အၭစတြီၭလၧအ့ဒအဲၫ အဖၧၩ့နီၪလီၫ.",
			"5": "<sup>5</sup> အီၪဝ့ၫလၧထံၫယီၫဒၫ့ လၧအယီၩလခီၫ, လၧခးမိအၭ အဖၧၩ့တၭ, စမိစ့ၭဒုၭနဲၪၥၫ့ဆၧၥီၪ့ဆၧၥၫ့ယီၩတၭ,",
			"6": "<sup>6</sup> စံၭဝ့ၫဒၪ,- ယဟိဝၩ ပယွၩချဲၩ့ဆၧ လၧပၧၩ လၧဟိ ရ့ၭအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, နၥံၪအီၪလၧခိၪလီၩ့အလီၩ့",
			"7": "<sup>7</sup> ယီၩအၪယူၭ.- ကၠၪထဲၩ့နၥံၪအၥၭ စဲၪ့ထၪ့ခွံၬတၭ, လ့ၩ ထၪ့လၧၦအၫမိၫဖိၪ အခိၪလီၩ့ထိၩ့ချိၬတၭ, ကယဲအ အီၪအလးလၧဆၧပျၩ့ဖၧၩ့, လၧခိၪလီၩ့ထိၩ့ချိၬ, လၧ ခိၪလီၩ့ဆူၭ, ဒဲလၧမုခံၫ့လခီၫ, ဒဲလၧမၫဆၧမံၭနဲၩ့, လၧ ၦကၫနအၫ့ဖိၪအခး, ဒဲလၧလ့ၭဘနၧၫ့, ဖိးလၧထံၫမိၡါ",
			"8": "<sup>8</sup> ဖၭဒိၪ, ထံၫယုဖ့တံၫနီၪလီၫ.- ယိခွါ, ယအီၪက့ၪထံၫ ၥံၪခးၥံၪလၧနၥံၪအမ့ၬယၫ, ခးလၧယဟိဝၩဆိၪလၩ့ အၥၭလၧနၥံၪအဖါလဖၪ စအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစ ယၫကူၭ လၧအမိဖ့ၪလၫ့ဝ့ၫ, ဒဲလၧအချံၫအၥၪ လၧအ လးခဲၫ့နီၪတၭ, လ့ၩနုၬမၩန့ခးနီၪဘီၪ.",
			"9": "<sup>9</sup> အဆၧၫ့အထီထီးနီၪ ယချဲၩ့ဆၧလၧနၥံၪတၭ, ယစံၭ,",
			"10": "<sup>10</sup> ယဝ့ၫဒၪယထိးနၥံၪအဆၧဎၧၫ့ လဂၩဎးၥ့ၪအ့ၬ,- ယဟိ ဝၩနၥံၪအယွၩနီၪ မၩအၪထၪ့ယူၭနၥံၪယူၭတၭ, ယိခွါ, လၧမုဆၫလနံၩယီၩ, နၥံၪအီၪအၪအၪလ့ၬ ဘဲၫမူၭခိၪ",
			"11": "<sup>11</sup> အၡၪၥံၪဖီၫၥံၪအၥိၭနီၪလီၫ.- (မွဲယဟိဝၩနၥံၪအဖါ လဖၪအယွၩနီၪ မၩအၪထၪ့နၥံၪအစၩအထီၫ့ၥံၪ, ဒဲဆိၪ",
			"12": "<sup>12</sup> ဂ့ၩနၥံၪဘဲၫအစံၭဝဲၩဆၧ အၥိၭနီၪဆံၭၬ)- နၥံၪအဆၧ အွံၪဆၧယိၭ, ဒဲဆၧဆိၬ, ဒဲနၥံၪချဲၩ့ခွးနီၪယဝ့ၫဒၪလဂၩ",
			"13": "<sup>13</sup> ဎးယမိထိးနၧၩ့ဘဲၫၥ့ၪလဲၪ.- အၪ့မၩန့ၦလၧအကိၪ့ဆၧ ၥ့ၪ, ဒဲအၥၭဆၭ, ဒဲအမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့ လၧနၥံၪအ ၡၩအဒီၪ့ၥံၪအကျၩနီၪဆံၭ. တၭယမိအီၪက့ၪဝ့ၫလၧ",
			"14": "<sup>14</sup> နၥံၪအခိၪလဖၪလီၫ.- နၥံၪချဲၩ့ဆၧၫ့ယၧၩတၭ, စံၭ, ဆၧ",
			"15": "<sup>15</sup> လၧနစံၭဆၧနီၪဂ့ၩလၧပမၩလီၫ.- တၭယမၩန့နၥံၪအ ဒီၪ့ၥံၪအခိၪလဖၪ, ၦလၧအကိၪ့ဘၪကိၪ့ၥ့ၪ, ဒဲၦလၧအ မံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့လဖၪတၭ, ယအီၪက့ၪအဝ့ၫၥံၪလၧ နၥံၪအခိၪလဖၪ, ၦအထီၫ့ၥံၪအခိၪလဖၪ, ဒဲၦအယၩၥံၪ အခိၪလဖၪ, ဒဲၦယဲဆံၫအခိၪလဖၪ, ဒဲၦလဆံၫအခိၪလ",
			"16": "<sup>16</sup> ဖၪ, ဒဲၦဒိၪလဖၪလၧနၥံၪအၡၩလဒီၪ့အကျၩလီၫ.- အ ဆၧၫ့အထီထီးနီၪ ယမၪလူၬနၥံၪအၡၩ စ့ၩရၫ့ခွးလဖၪ တၭ,ယစံၭ, ခိၭနၪဆၧလၧအမူၭအရါ လၧနၥံၪအထၧၫ့ ဖုဝဲအကျၩတၭ, စ့ၩရၫ့ဆၧတီၩလၧၦလဂၩ ဒဲအထၧၫ့ ဖုဝဲလဂၩအဘိၩ့ဆၧၩ့, ဒဲၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪ",
			"17": "<sup>17</sup> လၧအဝ့ၫၥံၪအၥိၭနီၪဆ့ဆံၭ.- နၥံၪယိမ့ၬဘၪဆၧလၧ ဆၧစ့ၩရၫ့အဖၧၩ့အ့ၬး နၥံၪဘၪခိၭနၪၦအဆံၭ, ဘဲၫၦ အဒိၪအၥိၭနီၪလီၫ. တၭထီးၥၭမဲၩၦၡၩအမ့ၬလဂ့ၩး အဂဲးဘဲၫယီၩ ဆၧစ့ၩရၫ့နီၪဘၪဆဲၫ့လၧယွၩလီၫ. တၭ ဆၧလၧနၥံၪစ့ၩရၫ့ နၥံၪဝ့ၫလၥ့ၪဘၪ လဖၪနီၪ ဂဲၫဆိၬ",
			"18": "<sup>18</sup> လၧယအီၪတၭ ယမိခိၭနၪယဝ့ၫလီၫ.- လၧအဆၧၫ့အ ထီထီးနီၪ ယမၪလူၬနၥံၪ လၧကယဲဆၧလၧနၥံၪမိမၩ ထီးအလူၬလီၫ.",
			"19": "<sup>19</sup> ပစဲၪ့ထၪ့ခွံၬလၧဟိရ့ၭတၭ, ပလ့ၩဆၧလၧၡါမုနၧၫ့ ဖၫဖၭဒိၪနီၪ, အီၪလၧဆၧၥၭမဲၪၥၭဖျဲၩ့အလး, လၧနၥံၪ ဒၪဘၪၦအၫမိၫဖိၪအခိၪလီၩ့ထိၩ့ချိၬ အဖၧၩ့ၥၭဘဲၫယ ဟိဝၩပယွၩ မၪလူၬပၧၩအၥိၭနီၪတၭ, ပဂဲၫထီၩ့ယူၭ",
			"20": "<sup>20</sup> လၧကၫဒ့ၭဘၫန့အၫနီၪလီၫ.- တၭယစံၭနၥံၪ, မွဲနၥံၪ ဂဲၫထီၩ့လၧၦအၫမိၫဖိၪအခိၪလီၩ့ထိၩ့ချိၬ လၧယဟိဝၩ",
			"21": "<sup>21</sup> ပယွၩဖ့ၪလၫ့ပၧၩလီၫ.- ယိခွါ, ယဟိဝၩနယွၩနီၪအီၪ က့ၩလၩ့ထံၫၥံၪခးၥံၪ လၧနၥံၪအမ့ၬယၫနီၪလီၫ. လ့ၩ ထၪ့မၩန့ဝ့ၫ, ဘဲၫယဟိဝၩနဖါအယွၩစံၭနၧၩအၥိၭနီၪဆံၭ, ၥၭမဲၪလဂ့ၩ, ထိၪလၩ့ဆါနဂဲးနဘၭလဂ့ၩ.",
			"22": "<sup>22</sup> နၥံၪဂဲၫဘူၭလၧယၧၩကိၭဂၩဒ့ၭတၭ, နၥံၪစံၭ, ပမိ အၪ့မၧၫ့လၩ့ၦလ့ၩလၧပမ့ၬယၫတၭ, အဝ့ၫၥံၪမိယိနဲၪ့ ခးလၧပဂး, လၧပမိလ့ၩဖၧၩ့ၥၭ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ, ပမိလ့ၩနုၬလၧဒိၩ့ နီၫလဲၪနီၫလဲၪနီၪ, မိဂဲၫထဲၩ့ဆိၬန့ပၧၩ",
			"23": "<sup>23</sup> လၧဆၧချဲၩ့လီၫ.- ဆၧချဲၩ့နီၪ ဂ့ၩလၧယမ့ၬယၫတၭ, ယမၩန့ၦလဆံၫနံၫဂၩ လၧနၥံၪအကျၩ လဒီၪ့လဂၩလ",
			"24": "<sup>24</sup> ဒီၪ့လဂၩလီၫ.- အဝ့ၫၥံၪကၠၪပဲၩဝ့ၫ, ဒဲလ့ၩထၪ့လၧခိၪ လီၩ့ထိၩ့ချိၬတၭ, လ့ၩနုၬလၧအ့ၡကီၫလၭအခိၪလီၩ့",
			"25": "<sup>25</sup> ဆူၭဖၧၩ့တၭ, အၪ့ဎူၫအၪ့ဎၬယိဝ့ၫလီၫ.- အဝ့ၫၥံၪမၩ န့ခးအဆၧၥၪလၧအစူၪဖၧၩ့တၭ, ဂဲၫထဲၩ့ဆိၬဝ့ၫလၧပ အီၪ,ဒဲဂဲၫထဲၩ့ဆိၬဆၧချဲၩ့တၭ, စံၭဝ့ၫဒၪ, ထံၫၥံၪခးၥံၪ လၧယဟိဝၩပယွၩ ဖ့ၪလၫ့ပၧၩနီၪ မွဲအဂ့ၩလီၫ.",
			"26": "<sup>26</sup> မွဲလါနၫ့ဘိၩနၥံၪလ့ၩထၪ့နီၪ နၥံၪအၥၭအီၪအ့ၬ, န ၥံၪပိၩ့ထၪ့လၧယဟိဝၩ နၥံၪအယွၩအဆၧမၪလူၬလီၫ.",
			"27": "<sup>27</sup> တၭနၥံၪၥူၭဝံၪၥူၭလၩဆၧ လၧနၥံၪအတဲၩဖၧၩ့တၭ, စံၭ, ယဟိဝၩမ့ၬလဲၩပၧၩအကၠီၩ့တၭ, ဒုၭစဲၪ့ထၪ့ခွံၬ ပၧၩလၧအံဇံၭအဖၧၩ့, ဘဲၫၥိၭအမိဖ့ၪလၫ့ပၧၩလၧၦ အၫမိၫဖိၪအစူၪဖၧၩ့ လၧအမိမၩဂၭဂီၩ့ပၧၩ အဂဲးလီၫ.",
			"28": "<sup>28</sup> ပမိလ့ၩထၪ့ ဘဲၫၥ့ၪလဲၪ, ပထၧၫ့ဖုဝဲလဖၪနီၪ ထိၪလၩ့ ဆါပၥၭလီၫ. စံၭဝ့ၫ, ၦခမျၧးနီၪဒိၪနဲၩ့ပၧၩ, ဒဲအဂၩ့ ထီၫနဲၪ့ပၧၩဒံၭလီၫ. ဒိၩ့ၥံၪတဝၫ့ၥံၪဒိၪဝ့ၫ, ဒဲအခိၪဒၧၩ့ ထၪ့ဘၭလၧမူၭခိၪလီၫ. တၭပဒၪဘၪၦအၫနၭဖိၪ ထီး နီၪဆ့လီၫ.",
			"29": "<sup>29</sup> တၭယစံၭနၥံၪ, ထီးအၪ့ယိၪဆၧလဂ့ၩ, ဒဲၥၭမဲၪဆၧ လဂ့ၩ, ယဟိဝၩ နၥံၪအယွၩလၧအလ့ၩဆၧ လၧနၥံၪ အမ့ၬယၫနီၪ, မိဒုၭဆၧလၧနၥံၪအဂး ဘဲၫကယဲဆၧလၧ",
			"30": "<sup>30</sup> အမၩဝဲၩဝ့ၫ ထီးအလူၬ လၧနၥံၪအဂး လၧအံဇံၭအ",
			"31": "<sup>31</sup> ဖၧၩ့,လၧနၥံၪအမ့ၬယၫအၥိၭနီၪ,- ဒဲလၧၡါမုနၧၫ့ဖၫ ထီးဒၪလၧယဟိဝၩနယွၩ ဆိၬနၧၩဘဲၫအဖါဆိၬအဖိၪ အၥိၭ လၧဖၧၩ့ၥၭလၧနၥံၪဖိၬထၧၫ့ဘီၩ့ယၫ ထီးနၥံၪ ဂဲၫထီၩ့လၧအလးထီးယီၩလီၫ.",
			"32": "<sup>32</sup> မွဲလါနၫ့ လၧဆၧလမံၩ့နီၪ အဂဲးအကၠီၪ့ နၥံၪလနဲၩ",
			"33": "<sup>33</sup> ဘၪယဟိဝၩနၥံၪအယွၩ, လၧအလ့ၩဆၧလၧနၥံၪအ မ့ၬယၫ, လၧမုနၩလခီၫလၧမ့ၪ ဘဲၫၥိၭအမိအၪ့ဎၬန့နၥံၪ အလးထီးနၥံၪမိၥုၪ့တဲၩ, ဒဲလၧမုဆၫလခီၫ လၧဆၧ အုၪ့ဘဲၫၥိၭ အမိဒုၭနဲၪနၥံၪအဖၧၩ့ၥၭ လၧနၥံၪမိလ့ၩ ဆၧလီၫ.",
			"34": "<sup>34</sup> ယဟိဝၩနါဂၧၫ့နၥံၪအဆၧချဲၩ့အလူတၭ, အၥၭထၪ့",
			"35": "<sup>35</sup> ဒဲဆိၪလၩ့အၥၭတၭ, စံၭဝ့ၫဒၪ,- ထံၫၥံၪခးၥံၪအဂ့ၩ လၧယဆိၪလၩ့ယၥၭ လၧယမိဖ့ၪလၫ့ နၥံၪအဖါလဖၪ နီၪ,မွဲမၬ, ၦအအၧၩ့လဆိၩယီၩ မိဒၪဘၪနးဂၩအ့ၬ.",
			"36": "<sup>36</sup> မိဒၪဘၪန့ၫစယဖၧၫနံၫအဖိၪခွၫ စကၫလ့ၭနီၪလီၫ. အ ဝ့ၫနီၪမိဒၪဘၪဝ့ၫ, ဒဲယမိဖ့ၪလၫ့ဝ့ၫ လၧခးလၧအယဲးထဲး",
			"37": "<sup>37</sup> ဝ့ၫ, ဒဲလၧအဖိၪလဖၪဆ့လီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫနီၪ ဖိၬယဟိဝၩအဖၧၩ့ၥၭ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩလီၫ. ယဟိ ဝၩအၥၭထၪ့ယၧၩ လၧနၥံၪအကၠီၩ့တၭ, စံၭဝ့ၫဒၪ,",
			"38": "<sup>38</sup> နလ့ၩနုၬဘၪထီးနီၪအ့ၬ.- အ့ၪမွဲစနိၫ့အဖိၪခွၫစယီရှုၫ အ့ၫလၧအဆၧၫ့ထုၪ့ လၧနမ့ၬယၫလဂၩ, အဝ့ၫနီၪမိ လ့ၩနုၬထီးနီၪလီၫ. ဒုၭဆီၪ့ထၪ့အဂဲးအဘၭဆံၭး အ ဂဲးဘဲၫယီၩ အဝ့ၫနီၪမိဒုၭန့ၥၫဝ့ၫ လၧအံၫစရ့လၭလီၫ.",
			"39": "<sup>39</sup> တၭနၥံၪအဖိၪအဆံၭလဖၪ လၧနၥံၪစံၭမိကဲၪထၪ့ဆၧ အၪ့ဂူၬန့, ဒဲနၥံၪအဖိၪၥၪၥံၪ လၧအဆၧၫ့အထီနီၪလၥ့ၪ ယၫအၪ့နၩ့ဖၭဆၧဂ့ၩ ဒဲဆၧအၧၩ့အဆၧၫ့တၭ, အဝ့ၫ ၥံၪမိလ့ၩနုၬဘၪထီးနီၪတၭ, ယမိဖ့ၪလၫ့ဝ့ၫဆၧနီၪတၭ,",
			"40": "<sup>40</sup> အဝ့ၫၥံၪနီၪမိန့ၥၫဝ့ၫလီၫ. အ့ၪမွဲနၥံၪဝ့ၫလဖၪယီၩကၠၪ ထဲၩ့နၥံၪဝ့ၫတၭ, စဲၪ့ထၪ့လၧၡါမုနၧၫ့ဖၫ လၧမၫဆမံၭ ဝီၩအဖၧၩ့ၥၭနီၪဆံၭ.",
			"41": "<sup>41</sup> နၥံၪစံၭဆၧၫ့ဆၧတၭ, စံၭယၧၩ, ပမၩမၪဘၪယူၭ ယဟိဝၩယူၭ, ပမိလ့ၩထၪ့ဒဲဒုၭၥုၭဘဲၫကယဲဆၧလၧယ ဟိဝၩယွၩမၪလူၬပၧၩအၥိၭနီၪလီၫ. တၭထီးနၥံၪခဲး ထူၬနၥံၪအယးဒံၩ့အီၪလၧနၥံၪအစူၪဝဲၩတၭ, နၥံၪဒူၩ",
			"42": "<sup>42</sup> ယၪ့ဆၧအ့ၬ,ဒဲနၥံၪမိလ့ၩထၪ့လၧခိၪလီၩ့နီၪလီၫ.- ယ ဟိဝၩစံၭယၧၩ, စံၭအဝ့ၫၥံၪ, လ့ၩထၪ့လဂ့ၩ, ဒဲဒုၭဆၧ လဂ့ၩ, အဂဲးဘဲၫယီၩ ယအီၪလၧနၥံၪအကျၩအ့ၬ. န ၥံၪမိဘၪဆၧကျီၪ့ခွံၬဘၪခိၬနၥံၪ လၧနၥံၪအဒုၪအဒၩ",
			"43": "<sup>43</sup> အမ့ၬယၫလီၫ.- ယချဲၩ့ဆၧလၧနၥံၪတၭ, နၥံၪမိခိၭနၪ ဆၧအ့ၬး နၥံၪမိပိၩ့ထၪ့ယဟိဝၩအဆၧမၪလူၬ, ဒဲနၥံၪ အီၪက့ၪဂုးခၧၫ့နၥံၪအၥၭထၪ့တၭ လ့ၩထၪ့လၧခိၪလီၩ့",
			"44": "<sup>44</sup> ထိၩ့ချိၬလီၫ.- တၭၦအၫမိၫဖိၪလၧအအီၪလၧခိၪလီၩ့ လဖျိၪ့အလီၩ့နီၪ ဂဲၫထၪ့ထၫ့ဒုၪဒၩနၥံၪတၭ, လီၩ့ဆီး နၥံၪ,ဘဲၫန့ၫအၥိၭနီၪတၭ, အဝ့ၫၥံၪမၩဂၭဂီၩ့နၥံၪလၧ",
			"45": "<sup>45</sup> စံအၫဖိးလၧဟီမၫလီၫ.- နၥံၪဂဲၫထဲၩ့တၭ, နၥံၪဂၪ့လၧ ယဟိဝၩအမ့ၬယၫလီၫ. မွဲလါနၫ့ယဟိဝၩလခိၭနၪဘၪ နၥံၪအလူ, ဒဲဒိၭလၧၩ့အနါ လၧနၥံၪအလူလၧၩ့အ့ၬ.",
			"46": "<sup>46</sup> တၭနၥံၪအီၪအၪနံၩအၪၥၫ့ လၧကၫဒ့ၭအဖၧၩ့, ဘဲၫမု နံၩလၧနၥံၪအီၪဝ့ၫ အၥိၭနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ပကၠၪထဲၩ့တၭ, ပစဲၪ့ထၪ့လၧၡါမုနၧၫ့ ဖၫလၧမၫဆမံၭဝီၩအဖၧၩ့ၥၭ, ဘဲၫယဟိဝၩ ချဲၩ့ဆၧ လၧယၧၩအၥိၭနီၪတၭ, ပလ့ၩဎဲၪ့ဝၬခိၪလီၩ့စံအၫအၪ",
			"2": "<sup>2</sup> နံၩအၪၥၫ့လီၫ.- ယဟိဝၩချဲၩ့ဆၧလၧယၧၩတၭ, စံၭ,",
			"3": "<sup>3</sup> နၥံၪလ့ၩဎဲၪ့ဝၬခိၪလီၩ့ယီၩ အၪယူၭဘၪယူၭး ကၠၪ",
			"4": "<sup>4</sup> ထဲၩ့နၥံၪဝ့ၫလၧမုဖၩလခီၫဆံၭ.- နဝ့ၫဒၪမၪလူၬၦခမျၧး တၭ,စံၭအဝ့ၫၥံၪ, နၥံၪမိခၫ့ဂၬနၥံၪအထၧၫ့ဖုဝဲ, စအံစီၫ အဖိၪလဖၪ အခးနဲၩ့ထံၭလၧအအီၪလၧစံအၫတၭ, အ ဝ့ၫၥံၪမိၥၭမဲၪနၥံၪတၭ, ထီးလၩ့တၡါနၥံၪအၥၭဆံၭ.",
			"5": "<sup>5</sup> ထီးမၩခိမၩဝီၩ အဝ့ၫၥံၪလဂ့ၩး အဂဲးဘဲၫယီၩ ယဖ့ၪ လၫ့နၥံၪလၧအဝ့ၫၥံၪအခးအ့ၬ, နးဎီၩ့ခၪ့ယၫၥၭအလး ယဖ့ၪလၫ့အ့ၬ. အဂဲးဘဲၫယီၩ ယဖ့ၪလၫ့ယူၭ ခိၪလီၩ့",
			"6": "<sup>6</sup> စံအၫလၧစအံစီၫ လၧဆၧန့ၥၫအဂးယူၭ.- နၥံၪမိဘၪ ဎွ့ၩဆၧအၪ့လၧစ့ၩလၧအဝ့ၫၥံၪ အစူၪဖၧၩ့, ဘဲၫၥိၭနၥံၪ မိအၪ့ဆၧတၭ, နၥံၪမိဘၪဎွ့ၩဆ့ထံၫလၧစ့ၩ လၧအဝ့ၫ",
			"7": "<sup>7</sup> ၥံၪအစူၪဖၧၩ့, ဘဲၫၥိၭနၥံၪမိအီၩဆၧလီၫ.- အဂဲးဘဲၫ ယီၩလၧကယဲနမၩဆၧလၧနစူၪနီၪ ယဟိဝၩနယွၩဆိၪ ဂ့ၩယူၭနၧၩယူၭး နလ့ၩဆၧလၧၡါမုနၧၫ့ဖၫဖၭဒိၪယီၩ, အဝ့ၫဒၪၥ့ၪယၫဝ့ၫလီၫ. အနံၪ့လံဆံၫယီၩ ယဟိဝၩန ယွၩအီၪယူၭလၧနၥိၭယူၭ, နဆံၭလၩ့နၡၩလၩ့ဘၪနး မံၩ့အ့ၬ.",
			"8": "<sup>8</sup> ထီးပလ့ၩဖီၩ့ခွံၬ ပထၧၫ့ဖုဝဲ စအံစီၫအဖိၪၥံၪလၧအ အီၪဝ့ၫလၧစံအၫအဖၧၩ့ၥၭ လၧဆၧပျၩ့ဖၧၩ့လၧအံလၭ, ဒဲအံဇအၧၫ့ဂံဘၧၫနီၪ, ပကၠၪပၥၭတၭ, လ့ၩဖိၬဖၧၩ့ၥၭ",
			"9": "<sup>9</sup> လၧၡါမုနၧၫ့ဖၫမိအၭနီၪလီၫ.- တၭယဟိဝၩစံၭယၧၩ, ထီးမၩခိမၩဝီၩ ၦမိအၭဖိၪၥံၪလဂ့ၩ, ဒဲဒုၭဆၧလၧအ ဝ့ၫၥံၪလဂ့ၩး အဂဲးဘဲၫယီၩ ယဖ့ၪလၫ့နၧၩလၧအဝ့ၫၥံၪ အခးလၧဆၧန့ၥၫအဂးအ့ၬ, အဂဲးဘဲၫယီၩ ယဖ့ၪလၫ့ ယူၭအါလၧစလီၭအဖိၪၥံၪ လၧအဆၧန့ၥၫအဂးယူၭ.",
			"10": "<sup>10</sup> (ၦအံမံၫ့ဖိၪအီၪဝ့ၫထီးနီၪ လၧဖျိၩ့ယူၭ, ၦလဆၨၩလၧ အဂၩ့ဒိၪ, ဒဲၦအၪဝ့ၫ ဒဲအဂၩ့ထီၫဝ့ၫ, ဘဲၫၦအၫနၭဖိၪ",
			"11": "<sup>11</sup> အၥိၭနီၪလီၫ.- ၦအီၪက့ၪဝ့ၫဘဲၫၦအဂၩ့ဒိၪ ဘဲၫၦအၫ နၭဖိၪအၥိၭနီၪလီၫ. အ့ၪမွဲၦမိအၭဖိၪ ကိၭဝ့ၫလၧအံမံၫ့",
			"12": "<sup>12</sup> ဖိၪလီၫ.- တၭၦဟီရံၫ့ဖိၪအီၪဝ့ၫ လၧစံအၫလၧဖျိၩ့လီၫ. အ့ၪမွဲစအံစီၫအဖိၪ, ထီးအမၩဂၭဂီၩ့ဝ့ၫလၧအမ့ၬယၫ တၭ,အီၪဝ့ၫလၧအလးနီၪတၭ, န့ၥၫအဆၧဘဲၫအံၫစရ့ လၭမၩခးလၧအန့ၥၫဆၧ လၧယဟိဝၩဖ့ၪလၫ့ဝ့ၫလီၫ.)",
			"13": "<sup>13</sup> ဘိၩ့နဲၪ့ယီၩ ဂဲထုၪ့တၭ, ခၫ့ဂၬထံၫဇၫရ့ၭအချိၬဆံၭ, တၭပခၫ့ဂၬထံၫဇၫရ့ၭအချိၬလီၫ.",
			"14": "<sup>14</sup> တၭမုနံၩမုနၩလဖၪ လၧပစဲၪ့ထၪ့ခွံၬလၧကၫဒ့ၭဘၫ န့အၫထီးပခၫ့ဂၬထံၫ, ဇၫရ့ၭအချိၬနီၪ, မွဲၥၧၫ့ဆံၫဎိၭ နံၪ့ထီးကယဲၦၥုၭဖိၪလဆိၩ လူၬဝ့ၫလၧၦၥုၭမုအကျၩ လဂၩလါလါနီၪ, ဘဲၫယဟိဝၩ ဆိၪလၩ့အၥၭလၧအ",
			"15": "<sup>15</sup> ဝ့ၫၥံၪအၥိၭနီၪလီၫ.- မွဲမၬယဟိဝၩ အစူၪအီၪလၧအ လီၩ့, ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခွံၬဝ့ၫ လၧၦၥုၭမုအကျၩ ထီးအလူၬလီၫ.",
			"16": "<sup>16</sup> ထီးၦၥုၭမုနီၪအ့ၪလူၬဝ့ၫ, ဒဲၥံၫဝ့ၫလၧၦခမျၧးအကျၩ",
			"17": "<sup>17</sup> တၭ,- ဆၧမၩအၥၭ လၧယဟိဝၩ ချဲၩ့ဆၧလၧယၧၩ",
			"18": "<sup>18</sup> တၭ,စံၭဝ့ၫဒၪ,- မုဆၫလနံၩယီၩ နမိဘၪခၫ့ဂၬအါ, လၧ",
			"19": "<sup>19</sup> မိအၭအနဲၩ့တၭ,- ထီးနလ့ၩထီၩ့လၧၦအၫမၧၫ့ဖိၪအ မ့ၬယၫတၭ, ထီးမၩခိမၩဝီၩအဝ့ၫၥံၪလဂ့ၩး ဒဲမၩအဝ့ၫ ၥံၪလၧဆၧနးမံၩ့လဂ့ၩ, အဂဲးဘဲၫယီၩ ယဖ့ၪလၫ့နၧၩ လၧဆၧန့ၥၫလၧၦအၫမၧၫ့ဖိၪအခးအ့ၬး အဂဲးဘဲၫယီၩ ယဖ့ၪလၫ့ယူၭဝ့ၫလၧစလီၭအဖိၪ လဖၪလၧဆၧန့ၥၫအ ဂးယူၭ.",
			"20": "<sup>20</sup> (ၦအီၪက့ၪဆ့အဝ့ၫနီၪ လၧၦအဂၩ့ဒိၪအခးလီၫ.ၦ အဂၩ့ဒိၪလဖၪအီၪဝ့ၫထီးနီၪ လၧဖျိၩ့တၭ, ၦအၫမၧၫ့ဖိၪ",
			"21": "<sup>21</sup> ကိၭဝ့ၫလၧၦဇၫ့ဇၧၫ့မံၫ့ဖိၪလီၫ.- ၦလဆၨၩအဂၩ့ဒိၪ, ဒဲအၪဝ့ၫဒဲအဂၩ့ထီၫ ဘဲၫၦအၫနၭဖိၪအၥိၭနီၪလီၫ. အ့ၪ မွဲယဟိဝၩ မၩဂၭဂီၩ့အဝ့ၫၥံၪ လၧအမ့ၬယၫတၭ, အ",
			"22": "<sup>22</sup> ဝ့ၫၥံၪန့ၥၫအဆၧတၭ, အီၪဝ့ၫလၧအလး,- ဘဲၫအမၩ စအံစီၫအဖိၪၥံၪအၥိၭ, လၧအအီၪဝ့ၫလၧစံအၫအဖၧၩ့ လၧအမၩဂၭဂီၩ့ယူၭ ၦဟိရံၫ့ဖိၪ လၧအမ့ၬယၫတၭ, န့ၥၫဝ့ၫလၧအဆၧတၭ, အီၪဝ့ၫလၧအလးလၧမုဆၫလ",
			"23": "<sup>23</sup> နံၩယီၩအၥိၭနီၪလီၫ.- တၭဘဲၫၦအၫဝံၫ့ဖိၪ အီၪလၧ ဟဇံရံၫ့, ထီးလၧအၭဇၫ ၦကၭဖတရံၫ့ဖိၪ လၧအဂဲၫ ထၪ့လၧကၭဖတၧၫနီၪ မၩဂၭဂီၩ့ဝ့ၫတၭ, အီၪဝ့ၫလၧအ",
			"24": "<sup>24</sup> လးအၥိၭနီၪလီၫ.)- ဂဲထုၪ့စဲၪ့ထၪ့တၭ, ခၫ့ဂၬထံၫအၫ နၫ့ဆံၭး ယိခွါ, ယဖ့ၪလၫ့ၦအၫမိၫဖိၪ, ဟ့ၭၡဘၫ့အ စဎွၩစဲဟၫ့ဒဲ အခးလၧနစူၪဖၧၩ့ယူၭလီၫ. မၩန့ၥၫ့တၭ,",
			"25": "<sup>25</sup> ဒုၭၥုၭလၧအဝ့ၫဒၪဆံၭ.- လၧမုဆၫလနံၩယီၩ ယမိအီၪ က့ၪၥၫ့ဆၧဘၪယိၪလၧနကၠီၩ့, ဒဲဆၧၥၭမဲၪနၧၩ လၧၦ ဆၨၩလဖၪ လၧမူၭခိၪထီးအလူၬ အဖၫ့လၬ အလီၩ့, လၧအမိနါဂၧၫ့နပရၧၫ့တၭ, အၥၭမိဝၭထိၬနီၪ မိဘၪ ဆၧခိဆၧဝီၩလၧနကၠီၩ့လီၫ.",
			"26": "<sup>26</sup> တၭယအၪ့မၧၫ့လၩ့ၥီၫ့လဖၪ လၧၡါမုနၧၫ့ဖၫက့ဒမီၭ လၧဟ့ၭၡဘၫ့အစဎွၩ စဲဟၫ့အအီၪ, အီၪလၧဆၧဘၪ",
			"27": "<sup>27</sup> လိၬအိၭလိၬ အဆၧချဲၩ့လဖၪတၭ, စံၭဝ့ၫဒၪ,- ဒုၭခၫ့ဂၬ ယၧၩလၧနခးဖၧၩ့ဆံၭ, ယမိလ့ၩဆၧလၧဖၧၩ့ၥုၪ့ဖၧၩ့ ၥၭလီၫ. လၧစူၪထွ့ၪမွဲဂ့ၩ, လၧစူၪစ့ၪမွဲဂ့ၩ, ယကၠၪယ",
			"28": "<sup>28</sup> ၥၭအ့ၬ.- နမိဘၪအၪ့ဆၫယၧၩ ဆၧအၪ့လၧစ့ၩအဂး, ဘဲၫၥိၭယမိအၪ့ဆၧတၭ, နမိဘၪဖ့ၪလၫ့ယၧၩ ထံၫလၧ စ့ၩအဂး ဘဲၫၥိၭယမိအီၩဆၧလီၫ. န့ၫယမိခၫ့ဂၬဆၧ",
			"29": "<sup>29</sup> လၧယခၪ့,- (ဘဲၫစအံစီၫအဖိၪၥံၪ လၧအအီၪဝ့ၫလၧစံ အၫ, ဒဲၦမိအၭဖိၪလၧအအီၪ လၧအါအၥိၭနီၪ,) ထီး ယခၫ့ဂၬယီၫဒၫ့ လၧခးလၧယဟိဝၩ ပယွၩဖ့ၪလၫ့ပၧၩ လီၫ.",
			"30": "<sup>30</sup> မွဲလါနၫ့ဟ့ၭၡဘၫ့အစဎွၩ စဲဟၫ့ဒုၭခၫ့ဂၬပၧၩအၥၭ အီၪအ့ၬ. အဂဲးဘဲၫယီၩ ယဟိဝၩနယွၩဒုၭနီၩ့ထၪ့အ ၥၭ,ဒဲဒုၭကၪအၥၭ, ဘဲၫၥိၭအမိဖ့ၪလၫ့ဝ့ၫလၧနစူၪဖၧၩ့ ဘဲၫလၧမုဆၫလနံၩယီၩအၥိၭနီၪလီၫ.",
			"31": "<sup>31</sup> တၭယဟိဝၩစံၭယၧၩ, ယိခွါ, ယဖ့ၪလၫ့ၥၫ့စစဲဟၫ့ ဒဲအခးလၧနမ့ၬယၫလီၫ. မၩန့ၥၫ့ဘဲၫၥိၭနမိန့ၥၫအခး",
			"32": "<sup>32</sup> နီၪဘီၪ.- တၭစစဲဟၫ့ဂဲၫထၪ့ထၫ့ဒၩပၧၩ, အဝ့ၫဒၪဒဲအ ၡၩခမျၧးထီးအလူၬ, ဘဲၫၥိၭအမိဒုၭၥုၭလၧယၫဟၭ",
			"33": "<sup>33</sup> အဖၧၩ့လီၫ.- တၭယဟိဝၩ နယွၩဖ့ၪလၫ့ခွံၬ အဝ့ၫဒၪ",
			"34": "<sup>34</sup> လၧပမ့ၬယၫတၭ,- ပကျီၪ့ခွံၬဝ့ၫဒဲအဖိၪခွၫလဖၪ, ဒဲအ ၡၩခမျၧးထီးအလူၬလီၫ. အဆၧၫ့အထီထီးနီၪပမၩန့ အဒိၩ့ၥံၪတဝၫ့ၥံၪထီးအလူၬ, ဒဲၦခွၫ, ဒဲၦမုၪ, ဒဲဖိၪဒံၩ ဖိၪၥၪလၧဒိၩ့ကိၭစီၪ့ဒ့ၭအဖၧၩ့ ပမၩဂၭဂီၩ့ခွံၬ ထီးအ",
			"35": "<sup>35</sup> လူၬလီၫ.- ပအီၪက့ၪလၩ့ထးနးဂၩအ့ၬ, န့ၫပမၩန့ဆၧ ဖိၪဆၧဎါအဒိၩ့ လၧဆၧအၪ့ဂူၬန့လၧပဂး, ဒဲဒိၩ့လၧပ မၩန့ဝ့ၫအဆၧဖိၪဆၧလံၩလီၫ.",
			"36": "<sup>36</sup> လၧအရိအၧၫ လၧအအီၪလၧထံၫအၫနၫ့ ဒဲလၧဒိၩ့ အီၪလၧထံၫချိၬနဲၩ့ ဖိးလၧဂံလအၭနီၪ လၧအဆီၪ့နဲၪ့ ပၧၩအီၪနးဖျိၪ့အ့ၬ. ယဟိဝၩပယွၩဖ့ၪလၫ့ခွံၬ ထီးအ",
			"37": "<sup>37</sup> လူၬလၧပဂးလီၫ.- န့ၫလၧနလ့ၩနုၬဘၪ လၧၦအၫမၧၫ့ ဖိၪအခးဖၧၩ့, လၧအလးဘၪဆဲၫ့ လၧထံၫယၫဘီၭနးစီၪ့ အ့ၬ,ဒဲလၧဒိၩ့လဖၪ အီၪလၧခိၪလီၩ့ခိၪ, ဒဲထီးဒၪအလး လၧယဟိဝၩပယွၩစံၭ, နုၬလဂ့ၩနီၪလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ပကၠၪပၥၭဖိၬထၪ့ဖၧၩ့ၥၭလ့ၩစိၩဘၫ ၡၫ့တၭ, ဘၫၡၫ့အစဎွၩအီၭဂဲၫထၪ့ထၫ့ဒုၪဒၩပၧၩ, အ ဝ့ၫဒၪ ဒဲအၡၩခမျၧးထီးအလူၬ ဘဲၫၥိၭအမိဒုၭဆၧလၧ",
			"2": "<sup>2</sup> အ့ဒအဲၫအဖၧၩ့နီၪလီၫ.- တၭယဟိဝၩစံၭယၧၩ, ထီး ၥၭမဲၪအဝ့ၫဒၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ယမိဖ့ၪလၫ့အဝ့ၫ, ဒဲအၡၩခမျၧးထီးအလူၬ, ဒဲအခးလၧနစူၪဖၧၩ့တၭ, နမိ မၩဝ့ၫဘဲၫနမၩၦအၫမိၫဖိၪ အစဎွၩစဲဟၫ့ လၧအအီၪဝ့ၫ",
			"3": "<sup>3</sup> လၧဟ့ၭၡဘၫ့အၥိၭနီၪလီၫ.- တၭယဟိဝၩပယွၩဖ့ၪ လၫ့ဆ့ဘၫၡၫ့ အစဎွၩအီၭ, ဒဲအၡၩခမျၧး ထီးအလူၬ လၧပစူၪဖၧၩ့တၭ, ပကျီၪ့ခွံၬဝ့ၫထီးအၡၩ အီၪလၩ့ထး",
			"4": "<sup>4</sup> နးဂၩအ့ၬ.- လၧအဆၧၫ့အထီထီးနီၪ ပမၩန့အဒိၩ့အ တဝၫ့ထီးအလူၬ, ဒိၩ့လၧပလမၩန့ဘၪနီၪ အီၪနးဖျိၪ့ အ့ၬ,ဒိၩ့ဎူၫဆံၫ, ခးအၫဂီၭထၧၫ့ဘံၪ့ယၫ, စအီၭအဘၩ့",
			"5": "<sup>5</sup> အမုးလၧဘၫၡၫ့အဖၧၩ့လီၫ.- ဒိၩ့ထီးအလူၬနီၪ အီၪ လၧအခိၪဒၧၩ့ထီၫ, ဒဲတရၫ့လဖၪ, ဒဲနိၪဘီၩ့လဖၪလီၫ. လၧနီၪအမ့ၬယၫ, တဝၫ့လၧအခိၪဒၧၩ့ လအီၪဘၪနီၪ",
			"6": "<sup>6</sup> အီၪဝ့ၫအၪအၪလ့ၬလီၫ.- တၭပမၩဂၭဂီၩ့လူၬထူၬဆံၫ့ ဘၩ့ဘဲၫပမၩဟ့ၭၡဘၫ့အစဎွၩ စဲဟၫ့အၥိၭနီၪ, ပမၩ ဂၭဂီၩ့လူၬထူၬဆံၫ့ဘၩ့, ၦခွၫဒဲၦမုၪ, ဒဲဖိၪဒံၩဖိၪၥၪလၧ",
			"7": "<sup>7</sup> ဒိၩ့ကိၭစီၪ့ဒ့ၭအဖၧၩ့လီၫ.- အ့ၪမွဲဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲဒိၩ့လဖၪအဆၧဖိၪဆၧလံၩနီၪ, ပမၩန့ဆၧအၪ့ဂူၬန့",
			"8": "<sup>8</sup> လၧပဂးလီၫ.- တၭလၧအဆၧၫ့အထီထီးနီၪ ပမၩန့လၧ ၦအၫမိၫဖိၪအစဎွၩ နံၫဂၩအစူၪဖၧၩ့ခးလၧ အအီၪလၧ ယီၫဒၫ့လၧအယီၩလခီၫ လၧထံၫအၫနၫ့ဖိးလၧခိၪလီၩ့",
			"9": "<sup>9</sup> ဟၧမၧၫ့လီၫ.- (ဟၧမၧၫ့နီၪ ၦစဲဒၧၫ့ဖိၪကိၭဝ့ၫလၧစံရ",
			"10": "<sup>10</sup> အၧၫ့တၭ, ၦအၫမိၫဖိၪကိၭဝ့ၫ လၧၡံနၧၫလီၫ.)- တၭ ကယဲဒိၩ့ၥံၪ လၧဆၧပျၩ့ဖၧၩ့, ဒဲဂံလအၭ ထီးအလူၬ, ဒဲဘၫၡၫ့ ထၧၫ့ဘံၪ့ယၫ ဖိးလၧစၫလကၫ, ဒဲအ့ဒအဲၫ, ဒိၩ့လဖၪ လၧစအီၭအဘၩ့အမုး လၧဘၫၡၫ့ အဖၧၩ့နီၪ",
			"11": "<sup>11</sup> လီၫ.- အဂဲးဘဲၫယီၩ အီၪလၩ့ထး လၧၦအဂၩ့ဒိၪန့ၫ ဘၫၡၫ့အစဎွၩအီၭလဂၩနီၪလီၫ. ယိခွါ, အလးမံၫနီၪ မွဲလးမံၫထၭလီၫ. အီၪဝ့ၫလၧၦအၫမၧၫ့ဖိၪအၫရၭဘၭ အဖၧၩ့နီၪမွဲအ့ၬဧၪး အဖၭထီၫမွဲခွံၫဖျါဒဲအဒၪ့ဎၩ့လံဖျါ ဘဲၫၦၡၩအဖျါအၥိၭနီၪလီၫ.",
			"12": "<sup>12</sup> တၭအဆၧၫ့အထီထီးနီၪ ခးလၧပမၩန့လၧအရိအၧၫ လၧအအီၪလၧထံၫအၫနၫ့, ဒဲခိၪလီၩ့ဂံလအၭလခီၫ, ဒဲ အဒိၩ့လဖၪနီၪ, ယဖ့ၪလၫ့ၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪလီၫ.",
			"13": "<sup>13</sup> တၭဆၧအီၪလၩ့ထးလၧဂံလအၭ, ဒဲဘၫၡၫ့ထၧၫ့ဘံၪ့ ယၫ,စအီၭအဘၩ့အမုးနီၪ, ယဖ့ၪလၫ့စမနၭစ့ၫအလ ခီၫဒီၪ့,ခးအၫဂီၭထၧၫ့ဘံၪ့ယၫ, ဒဲဘၫၡၫ့ထၧၫ့ဘံၪ့ယၫ",
			"14": "<sup>14</sup> လၧအဘၪဆၧကိၭဝ့ၫလၧၦအဂၩ့ဒိၪအခးလီၫ.- စမနၭ စ့ၫအဖိၪခွၫ စယၫအၧၫနီၪ မၩန့အၫဂီၭအခးထၧၫ့ဘံၪ့ ယၫဖိးလၧၦဂ့ၭရှုၫရဲၫဖိၪ, ဒဲၦမၫခၭၥဲၭဖိၪ အခးနဲၩ့ လဖၪနီၪတၭ, ကိၭဝ့ၫဘဲၫအမံၩ့ဒၪဝ့ၫအၥိၭနီၪ ဘၫၡၫ့",
			"15": "<sup>15</sup> ဟၫဝီၭယၫအၧၫထီးမုဆၫလနံၩယီၩလီၫ.- တၭယဖ့ၪ",
			"16": "<sup>16</sup> လၫ့ဂံလအၭ လၧစမၫခၧၫလီၫ.- တၭၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭ ဖိၪနီၪယဖ့ၪလၫ့ယူၭ လၧဂံလအၭဖိးလၧထံၫအၫနၫ့ခိၪ လီၩ့ဆူၭဖိၭဖၫ့နီၪ, ဒဲခးလၧအနဲၩ့ထံၭဖိးလၧယၫဘီၭ,",
			"17": "<sup>17</sup> ၦအၫမၧၫ့ဖိၪအခးနဲၩ့ထံၭနီၪလီၫ.- ဒဲဆၧပျၩ့ဖၧၩ့ဆ့, ဒဲယီၫဒၫ့, ဒဲခးလၧအနဲၩ့ထံၭလၧခံၫ့နရ့ၭ, ဒဲဖိးလၧဆၧ ပျၩ့ဖၧၩ့ အမၫဆမံၭ, မၫဆမံၭထံၫဂၫ့ လၧအၭၡဒီၭပံ",
			"18": "<sup>18</sup> စဂၫအခၪ့ထံၭလၧမုထၪ့လခီၫ,- အဆၧၫ့အထီထီးနီၪ ယမၪလူၬနၥံၪတၭ, ယစံၭ, ယဟိဝၩနၥံၪအယွၩဖ့ၪ လၫ့နၥံၪလၧခးယီၩ ဘဲၫၥိၭနၥံၪမိမၩန့ဝ့ၫလီၫ. နၥံၪမိ ဘၪလ့ၩခၫ့ဂၬ ဆၧအီၪလၧနၥံၪအစူၪဝဲၩ လၧနၥံၪအ ထၧၫ့ဖုဝဲၦအံၫစရ့လၭဖိၪ အမ့ၬယၫကယဲၦၥုၭဖိၪထီး",
			"19": "<sup>19</sup> အလူၬလီၫ.- အ့ၪမွဲနၥံၪအဖိၪအမၫ, ဒဲနၥံၪအဖိၪဒံၩဖိၪ ၥၪ,ဒဲနၥံၪအဆၧဖိၪဆၧဎါအဒိၩ့, (ယၥ့ၪယၫလၧနၥံၪ အဆၧဖိၪဆၧဎါၥံၪအီၪအၪ,) မိအီၪဘၪလၧနၥံၪအဒိၩ့",
			"20": "<sup>20</sup> အတဝၫ့အဖၧၩ့ လၧယဖ့ၪလၫ့ယူၭနၥံၪယူၭ,- ထီးယ ဟိဝၩဒုၭအီၪပွံၭနၥံၪအထၧၫ့ဖုဝဲ, ဘဲၫနၥံၪဝ့ၫအၥိၭ, ဒဲအဝ့ၫၥံၪမၩန့ခး လၧယဟိဝၩနၥံၪအယွၩ ဖ့ၪလၫ့လၧ ထံၫယီၫဒၫ့ဝါလခီၫလီၫ. ထီးနီၪလဖၧၫ့ နၥံၪမိဂဲၫထဲၩ့ ထဲၩ့ဘၪလဂၩ လၧအဆၧန့ၥၫ, လဂၩလၧအဆၧန့ၥၫ လၧယဖ့ၪလၫ့ယူၭနၥံၪယူၭလီၫ.",
			"21": "<sup>21</sup> အဆၧၫ့အထီထီးနီၪ ယမၪလူၬစယီရှုၫအ့ၫတၭ,ယ စံၭ, နမ့ၬၥၪဒၪဘၪယူၭ ကယဲဆၧလၧယဟိဝၩနၥံၪအ ယွၩမၩယူၭစဎွၩနံၫဂၩနီၪယူၭ, ယဟိဝၩမိမၩ ကယဲ",
			"22": "<sup>22</sup> ဘၩ့မုးထီးနခၫ့ဂၬဘဲၫနီၪၥိၭလီၫ.- ထီးၥၭမဲၪအဝ့ၫၥံၪ လဂ့ၩ, အဂဲးဘဲၫယီၩ ယဟိဝၩနၥံၪအယွၩ မိဒုၭၥုၭလၧ နၥံၪအဂးလီၫ.",
			"23": "<sup>23</sup> အဆၧၫ့အထီထီးနီၪ ယအၪ့ကံၩ့အၪ့ယၫ ယဟိဝၩ တၭ,ယစံၭ, ယဟိဝၩယွၩဧ့, နဒုၭနဲၪၥၫ့နဆၧဒိၪ, နစူၪ",
			"24": "<sup>24</sup> ဆီၪ့လၧနၡၩလီၫ.- အဂဲးဘဲၫယီၩ ယွၩလၧမူၭခိၪမွဲဂ့ၩ, လၧဂၪ့ခိၪမွဲဂ့ၩ, လၧအမၩဆၧၥ့ၪဘဲၫနမၩဆၧအၥိၭ,",
			"25": "<sup>25</sup> ဘဲၫနစီၩ့နမၩ့အၥိၭနီၪ အီၪဝ့ၫမွဲပလၫလဂၩလဲၪ.- ဒုၭ ခၫ့ဂၬယၧၩ, ဒဲဒုၭဒၪဘၪယၧၩ, လၧထံၫၥံၪခးၥံၪအဂ့ၩ လၧအအီၪ လၧယီၫဒၫ့ဝါလခီၫ, ခိၪလီၩ့ထိၩ့ချိၬ ဂ့ၩလ",
			"26": "<sup>26</sup> ဖျိၪ့နီၪ, လ့ၭဘနၧၫ့ဒၪလ့ၬနီၪဆံၭ.- မွဲလါနၫ့ယဟိဝၩ ၥၭထၪ့ယၧၩ လၧနၥံၪအကၠီၩ့တၭ, ခိၭနၪယလူအ့ၬး တၭယဟိဝၩစံၭယၧၩ, အၪယူၭလၧနဂးယူၭ, လၧဆၧ",
			"27": "<sup>27</sup> လမံၩ့နီၪအဂဲးအကၠီၪ့ချဲၩ့လၧၩ့ လၧယၧၩလဂ့ၩ,- လ့ၩ ထၪ့ဘၭလၧပံစဂၫအဒၩ့ခိၪတၭ, ကျဲၪ့ထၪ့နမ့ၬလၧမု နုၬ, ဒဲလၧမုဖၩ, ဒဲလၧမုခံၫ့, ဒဲလၧမုထၪ့တၭ, ယိဆၧ",
			"28": "<sup>28</sup> လၧနမ့ၬၥၪဆံၭ.- အဂဲးဘဲၫယီၩ နခၫ့ဂၬဘၪယီၫဒၫ့နီၪ အ့ၬး အ့ၪမွဲမၪလူၬစယီရှုၫအ့ၫ, ဒဲဒုၭဆီၪ့ထၪ့ အဂဲးအ ဘၭ, ဒဲပဂၨၪထၪ့အခဲၫ့ဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫဒၪနီၪ မိခၫ့ဂၬဆၧလၧၦခမျၧးယီၩ အမ့ၬယၫတၭ, မိဒုၭမၩန့",
			"29": "<sup>29</sup> ဝ့ၫလၧထံၫၥံၪခးၥံၪ လၧနမိဒၪဘၪလီၫ.- တၭပအီၪလၧ ခိၪလီၩ့ဆူၭလၧဘ့ၭၥပံအီၫအမ့ၬယၫလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> အခိးမွဲဘိၩ့နဲၪ့ယီၩ, အံၫစရ့လၭဧ့, ခိၭနၪဆၧမၪ လူၬဒဲဆၧစ့ၩရၫ့လဖၪ လၧယၥီၪ့လိၪနၥံၪလၧနၥံၪမိထီး န့ဝ့ၫအဂဲးဆံၭ. ဘဲၫၥိၭနၥံၪမိမၧၫ့, ဒဲလ့ၩနုၬ, ဒဲမၩန့ခး လၧယဟိဝၩနၥံၪအဖါလဖၪအယွၩ ဖ့ၪလၫ့လၧနၥံၪအ",
			"2": "<sup>2</sup> ဂးလီၫ.- မွဲနၥံၪထီးမၩအၪထၪ့ဆၧချဲၩ့ လၧယမၪလူၬ နၥံၪလဂ့ၩး ဒဲနၥံၪထီးမၩန့ခွံၬ ဆၧလၧအဝ့ၫလဂ့ၩး ဘဲၫၥိၭနၥံၪမိထီးန့ ယဟိဝၩနၥံၪအယွၩ အဆၧမၪလူၬ",
			"3": "<sup>3</sup> လဖၪလၧယမၪလူၬနၥံၪလီၫ.- ဆၧလၧယဟိဝၩမၩဝ့ၫ လၧဘၫအလၭပံအီၫအကၠီၩ့နီၪ, နၥံၪအမ့ၬၥၪဒၪဘၪ ယူၭ, အဂဲးဘဲၫယီၩ ကယဲၦလၧအလ့ၩဖိၬဘၫအလၭ ပံအီၫအခဲၫ့ထီးအလူၬနီၪ ယဟိဝၩနယွၩမၩဂၭဂီၩ့ခွံၬ",
			"4": "<sup>4</sup> ယူၭဝ့ၫလၧနၥံၪအကျၩယူၭ,- အ့ၪမွဲနၥံၪလၧအဖီၪ့ထၬ ယဟိဝၩနၥံၪအယွၩနီၪ, မၧၫ့ဒံၭကိၭဂၩဒ့ၭလၧမုဆၫ လနံၩယီၩလီၫ.",
			"5": "<sup>5</sup> ယိခွါ, ယၥီၪ့လိၪနၥံၪလၧဆၧမၪလူၬ, ဒဲဆၧစ့ၩရၫ့, ဘဲၫယဟိဝၩမၪလူၬယၧၩအၥိၭနီၪ, ဘဲၫၥိၭနၥံၪမိမၩ",
			"6": "<sup>6</sup> ဘဲၫနီၪလၧခးဖၧၩ့ထီးနၥံၪလ့ၩမၩန့ဝ့ၫလီၫ.- ထီးန့တၭ မၩဆံၭး အဂဲးဘဲၫယီၩအဝ့ၫနီၪ မွဲနၥံၪအဆၧကိၪ့ၥ့ၪ ကိၪ့ဘၪ, ဒဲနၥံၪအၥုၪ့ဆၭအၥၭဆၭ, လၧၦဆၨၩလဖၪ အမ့ၬယၫ, လၧအမိနါဂၧၫ့ ဆၧမၪလူၬ ထီးအလူၬနီၪ တၭ, မိစံၭဝ့ၫ, မွဲမၬၦခမျၧးအဒိၪ အအၪယီၩ မွဲၦလ ဆၨၩလၧအကိၪ့ဆၧၥ့ၪကိၪ့ဆၧဘၪ ဒဲအၥုၪ့ဆၭအၥၭ",
			"7": "<sup>7</sup> ဆၭလီၫ.- အဂဲးဘဲၫယီၩ ၦလဆၨၩဒိၪဝ့ၫ, လၧအယွၩ အီၪဘူၭဝ့ၫ ဒဲန့ၫဎီၩ့လၧယဟိဝၩ ပယွၩလၧကယဲဆၧ",
			"8": "<sup>8</sup> လၧပကိၭထၪ့ လၧပဂးတၭ, မွဲၦလဆၨၩလဲၪ.- ၦလ ဆၨၩဒိၪဝ့ၫ လၧအအီၪ လၧဆၧမၪလူၬ ဒဲဆၧစ့ၩရၫ့ တီၩ, ဘဲၫကယဲဆၧၥီၪ့ဆၧၥၫ့ လၧယအီၪက့ၪလၩ့လၧ နၥံၪအမ့ၬယၫ လၧမုဆၫလနံၩယီၩအၥိၭနီၪ, မွဲၦလ ဆၨၩလဲၪ.",
			"9": "<sup>9</sup> အ့ၪမွဲထီးလၩ့နၥၭဆံၭ, ခိၭနၥၭလၩ့ထံးလၩ့ဆ့ၭ ဆံၭ, ဘဲၫၥိၭနၥံၪထီးၥၭနၪ့ဆၧ လၧနမ့ၬၥၪဒၪဘၪယူၭ, ဒဲဘဲၫၥိၭ အထီးစဲၪ့ထၪ့ခွံၬ လၧနၥၭလဆိၩဒၪနၧၩလ",
			"10": "<sup>10</sup> ဂ့ၩး- အ့ၪမွဲဒုၭၥ့ၪယၫအဝ့ၫၥံၪ လၧနဖိၪခွၫအဖိၪခွၫလ ဖၪနီၪဆံၭ. မုနံၩလၧနၥံၪဆၧၫ့ထုၪ့ လၧဟိရ့ၭအဖၧၩ့ လၧယဟိဝၩ နၥံၪအယွၩအမ့ၬယၫ ထီးယဟိဝၩစံၭ ယၧၩ, ဒုၭအီၪကီၪ့ၦခမျၧးလၧယဂးဆံၭ, ယမိဒုၭနါ ဂၧၫ့အဝ့ၫၥံၪ လၧယလူယထၫ, ဘဲၫၥိၭအမိမၩလိၪဆၧ ၥၭမဲၪယၧၩလဆိၩဒၪဝ့ၫ လၧအအီၪမၧၫ့ဝ့ၫ လၧဂၪ့ခိၪ",
			"11": "<sup>11</sup> ချိၫ့, ဒဲလၧအမိၥီၪ့လိၪအဖိၪအလံၩနီၪလီၫ.- တၭနၥံၪ ၥုၭဘူၭနၥံၪအၥၭ ဒဲဆၧၫ့ထုၪ့လၧခိၪလီၩ့နီၪ အခၪ့ထံၭ တၭ, ခိၪလီၩ့နီၪခဲၩထၪ့လၧမ့ၪ ထီၩ့လၧမူၭခိၪအၥၭခံ",
			"12": "<sup>12</sup> ဖၧၩ့တၭ, ဆၧခံၭဒဲဆၧအုၪ့ဒဲဆၧခံၭၥၧၫ့လီၫ.- တၭယ ဟိဝၩချဲၩ့ဆၧလၧ နၥံၪလၧမ့ၪအကျၩလီၫ. နၥံၪနါဂၧၫ့ ဆၧချဲၩ့အၥီၫတၭး အ့ၪမွဲဆၧအခံးအဂၩ့ၥံၪ ဒၪဘၪ",
			"13": "<sup>13</sup> အ့ၬ, န့ၫဆၧအၥီၫဂၧၫ့ထၪ့နီၪလီၫ.- တၭအဝ့ၫဒၪဒုၭနဲၪ နၥံၪလၧအဆၧအုၩ့လၩ့ လၧအမၪလူၬ လၧနၥံၪမိဘၪ ထီးန့နီၪ, ဆၧမၪလူၬဆံၫထံၪ, ဒဲအကွ့ၭဝ့ၫလၧလိးပၪနံၫ",
			"14": "<sup>14</sup> ဘံၪ့အလီၩ့လီၫ.- တၭအဆၧၫ့အထီထီးနီၪ ယဟိဝၩ မၪလူၬယၧၩ, ဘဲၫၥိၭယမိၥီၪ့လိၪဆၧမၪလူၬ, ဒဲဆၧစ့ၩ ရၫ့လဖၪ လၧနၥံၪမိဘၪထီးန့ လၧခးဖၧၩ့ထီးနၥံၪမိခၫ့ ဂၬမၩန့ဝ့ၫလီၫ.",
			"15": "<sup>15</sup> အခိးမွဲထီးလၩ့နၥံၪအၥၭ လၩ့ထံးလၩ့ဆ့ၭဆံၭ,အ ဂဲးဘဲၫယီၩ မုလနံၩလၧယဟိဝၩချဲၩ့ဆၧ လၧနၥံၪလၧ ဟိရ့ၭအလီၩ့လၧမ့ၪအကျၩနီၪ, နၥံၪဒၪဘၪဆၧအခံး",
			"16": "<sup>16</sup> အဂၩ့နးမံၩ့အ့ၬး နၥံၪမိမၩစံၪစၪဘၪခိၬနၥံၪအၥၭ, ဒဲမၩ ဆၧဂၩ့ဆၧဖၪ့ လမံၩ့မံၩ့ လၧနၥံၪအဂး, ၦခွၫအဂၩ့မွဲ",
			"17": "<sup>17</sup> ဂ့ၩ, ၦမုၪအဂၩ့မွဲဂ့ၩ,- ဆၧဖိၪဆၧဎါလၧဂၪ့ခိၪချိၫ့အ ဂၩ့မွဲဂ့ၩ, ထိၪဖိၪလံၪဖိၪလၧအယူၩဝ့ၫ လၧဆၧဖိၭဖၫ့",
			"18": "<sup>18</sup> လမံၩ့မံၩ့အဂၩ့မွဲဂ့ၩ,- ဆၧစွၩလၧဂၪ့ခိၪလမံၩ့မံၩ့အ ဂၩ့မွဲဂ့ၩ, ဒ့ၪၥံၪယၪၥံၪလၧအအီၪဝ့ၫ လၧထံၫကျၩလၧ ဂၪ့ခိၪအဖၫ့လၬလမံၩ့မံၩ့အဂၩ့မွဲဂ့ၩ, နၥံၪမိမၩဘၪခိၬ ဆၧစိၭဖျၩအၥၭ လၩ့ဂၬလၧဆၧလမံၩ့မံၩ့ နီၪလီၫ.",
			"19": "<sup>19</sup> ဘၪလဘၪနမိကျဲၪ့ထၪ့ဘၪခိၬနမ့ၬလၧမူၭခိၪတၭ, ထီးန ဒၪဘၪမု, ဒဲလၩ, ဒဲၡၪၥံၪဖီၫၥံၪ, မူၭခိၪအၥုၭမုထီးအ လူၬတၭ, နမိဘၪဘၪခိၬဆၧအၪ့လီၫနၧၩ ဘဲၫၥိၭနမိဘၩ ထၪ့ဝ့ၫ, ဒဲမၩအဆၧလီၫ. ဆၧလဖၪနီၪယဟိဝၩနယွၩ အၪ့နၩ့ဖၭဖ့ၪလၫ့ ကယဲၦအဆၨၩလဖၪ လၧအအီၪဝ့ၫ",
			"20": "<sup>20</sup> လၧမူၭခိၪထၧၫ့ဘံၪ့ယၫ အဖၫ့လၬလီၫ.- အ့ၪမွဲယဟိ ဝၩမၩန့ထၪ့ခွံၬနၥံၪ, ဒဲဂဲၫဆိၬထၪ့ခွံၬနၥံၪ လၧဖံၫ့ချၪ ထၭအဖၧၩ့နီၪ, လၧအံဇံၭဒၪလ့ၬ ဘဲၫၥိၭနၥံၪမိကဲၪထၪ့ ဆၧန့ၥၫလၧအဂး, ဘဲၫလၧမုဆၫလနံၩယီၩ အၥိၭနီၪ လီၫ.",
			"21": "<sup>21</sup> လၧနီၪအမ့ၬယၫ ယဟိဝၩအၥၭထၪ့ယၧၩ လၧနၥံၪ အကၠီၩ့တၭ, ဆိၪလၩ့အၥၭလၧယလခၫ့ဂၬဘၪယီၫ ဒၫ့, ဒဲလၧယလလ့ၩနုၬဘၪထံၫၥံၪခးၥံၪအဂ့ၩနီၪ လၧ",
			"22": "<sup>22</sup> ယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩ လၧဆၧန့ၥၫအဂးလီၫ.- တၭ ယဝ့ၫဒၪယီၩ, ယဘၪၥံၫလၧခးယီၩလီၫ. ယခၫ့ဂၬဘၪ ယီၫဒၫ့အ့ၬး အ့ၪမွဲနၥံၪမိခၫ့ဂၬ ဒဲမၩန့ထံၫၥံၪခးၥံၪအ ဂ့ၩလဘံၪ့နီၪလီၫ.",
			"23": "<sup>23</sup> ထီးလၩ့နၥံၪအၥၭ ဘဲၫၥိၭနၥံၪထီးၥၭနၪ့ယဟိဝၩန ၥံၪအယွၩအဆၧအုၩ့လၩ့လၧနၥံၪလဂ့ၩ, တၭထီးတဲၩ့ ဆၧဂၩ့စိၭဖျၩအၥၭ လၧဆၧလၩ့ဂၬ လၧဆၧလမံၩ့မံၩ့ လၧယဟိဝၩ နယွၩမၪလူၬပဒၩ့ထၬနၧၩ လၧအဂဲးနီၪ",
			"24": "<sup>24</sup> လဂ့ၩ.- အဂဲးဘဲၫယီၩ ယဟိဝၩနယွၩနီၪ မွဲမ့ၪအၪ့ဆၧ တၭ, မွဲယွၩလၧအၥၭကဲၪ့ဆၧလဂၩလီၫ.",
			"25": "<sup>25</sup> ထီးနအ့ၪထၪ့ဖိၪ, ဒဲနဖိၪလဖၪအဖိၪအီၪ, ဒဲအီၪယူၭ လၧအခးဖၧၩ့ယံၬတၭ, မၩစံၪစၪဆၧဒဲတဲၩ့ဆၧဂၩ့စိၭ ဖျၩအၥၭလၩ့ဂၬ လၧဆၧလမံၩ့မံၩ့, ဒဲမၩဆၧအၧၩ့လၧ ယဟိဝၩ နယွၩ အမ့ၬယၫ လၧအထိၪဂဲၩ အၥၭထၪ့",
			"26": "<sup>26</sup> တၭ,- ယဒုၭထိးမူၭခိၪ ဒဲဂၪ့ခိၪအၥၭ လၧနၥံၪအဂး လၧမုဆၫလနံၩယီၩ, လၧနၥံၪမိဂၭဂီၩ့ ချဲၫ့ချံၭတၡါလၧ ထံၫၥံၪခးၥံၪထီးနၥံၪအ့ၪခၫ့ဂၬယီၫဒၫ့ လၧနၥံၪမိမၩန့ ဘၪဝ့ၫအဖၧၩ့လီၫ. နၥံၪထုၭထီၫထၪ့ဘၪ နၥံၪအနံၩအ ၥၫ့အ့ၬ, မွဲနၥံၪမိထီၩ့လၧဆၧဂၭဂီၩ့ဂၭစၪ တၡါလီၫ.",
			"27": "<sup>27</sup> ယဟိဝၩ မိဒုၭလၩ့မုလၩ့ဖၭနၥံၪ လၧၦဆၨၩဂူၫဂၩလ ဖၪအကျၩတၭ, နၥံၪမိအီၪလၩ့ထးၡၩခိၬဂၩ လၧၦဆၨၩ လဖၪအကျၩ, ထီးဒၪအလး လၧယဟိဝၩ မိၥိၫ့နၥံၪ",
			"28": "<sup>28</sup> လီၫ.- ထီးနီၪနၥံၪမိမၩယွၩၥံၪအဆၧမၩ ယွၩလၧၦတဲၩ့ ဝ့ၫလၧအစူၪလဖၪ လၧၥံၪ့ၥံၪဝၪၥံၪ, ဒဲလိးၥံၪလဲၫ့ၥံၪ, လၧအလဒၪဘၪဆၧ, ဒဲလနါဂၧၫ့ဘၪဆၧ, ဒဲလအၪ့ဘၪ ဆၧ, ဒဲလနၧၫ့ဘၪဆၧလီၫ.",
			"29": "<sup>29</sup> မွဲလါနၫ့ နအ့ၪအၪ့ဎၬန့ယဟိဝၩ နယွၩထီးနီၪတၭ, ထီးနအ့ၪအၪ့ဎၬအဝ့ၫ လၧနၥၭထၧၫ့ဖျိၪ့ယၫ ဒဲလၧနၥၭ",
			"30": "<sup>30</sup> ၡီၩ့ထီးအလူၬတၭ, နမိဒၪဘၪနဝ့ၫလီၫ.- ထီးနအ့ၪဘၪ ဆၧခိဆၧဝီၩ, ဒဲဆၧနီၪလဖၪထီးအလူၬဘၪနၧၩ, လၧမု နံၩလၧခဲၫ့ လၧယၫလဖၪတၭ, နအ့ၪကၠၪလီၩ့နၥၭလၧ",
			"31": "<sup>31</sup> ယဟိဝၩနယွၩ, ဒဲခိၭနၪအလူတၭ,- (အဂဲးဘဲၫယီၩ ယဟိဝၩနယွၩ မွဲယွၩလၧအယၫ့ၥၭဆၧလဂၩ,) အဝ့ၫ လ့ၩဒၪနၧၩအ့ၬး ဒဲမၩဂၭဂီၩ့နၧၩအ့ၬး တၭမွဲအၥၭနၪ့ နဖါလဖၪအဆၧအုၩ့လၩ့ လၧအဆိၪလၩ့အၥၭလၧအ ဝ့ၫဒၪဆ့အ့ၬ.",
			"32": "<sup>32</sup> အဂဲးဘဲၫယီၩ အၪ့စၪ့လါမုနံၩမုနၩ လၧအခၪ့ထံၭ, လၧအအီၪယူၭ လၧနလချႃၭ အီၪဒံၭဘၪ လၧမုလနံၩ လၧယွၩမၩကဲၪထၪ့ၦၡၩ လၧဂၪ့ခိၪချိၫ့တၭ, အၪ့စၪ့ဆၧ လၧမူၭခိၪအယီၩ လခီၫဒဲဖိးလၧမူၭခိၪအနီၪလခီၫ, ဆၧ မၩအၥၭဘဲၫဆၧဒိၪလမံၩ့ယီၩအၥိၭ, ဆၧနါဂၧၫ့ဆၧ",
			"33": "<sup>33</sup> ဘဲၫအဝ့ၫနီၪအၥိၭအီၪဆ့ဧၪ,- မွဲၦခမျၧးနါဂၧၫ့ယွၩ အလူချဲၩ့ဆၧလၧမ့ၪအကျၩ, ဘဲၫနနါဂၧၫ့ အၥိၭနီၪ,",
			"34": "<sup>34</sup> ဒဲမၧၫ့ဝ့ၫဆ့ဧၪ.- တၭယွၩလခီၫမွဲအမၩန့ၫၦလဆၨၩ လၧအနၫ့ဆါအဂး လၧၦလဆၨၩအဂူၫဂၩအကျၩနီၪ, မၩခွါဝ့ၫ လၧဆၧမၩခွါၥံၪ, လၧဆၧမၩနဲၪ့လၩ့လၭ, ဒဲဆၧလၩ့လိလၩ့လၭ, လၧဆၧဒုၭၥုၭ, ဒဲလၧအစူၪဆီၪ့, ဒဲလၧအစူၪယၩ့ထၪ့အၥၭ, ဒဲလၧၥၭမဲၪဆၧအလးဖၭဒိၪ ဘဲၫကယဲဆၧလၧယဟိဝၩ နၥံၪအယွၩ မၩလၧနၥံၪအ ဂးလၧအံဇံၭအဖၧၩ့ လၧနၥံၪအမ့ၬယၫ အၥိၭနီၪဆ့",
			"35": "<sup>35</sup> ဧၪ.- ဆၧဒုၭနဲၪနၧၩ ဘဲၫၥိၭနမိၥ့ၪယၫ လၧယဟိဝၩမွဲ ယွၩလီၫ. အ့ၪလမွဲဘၪအဝ့ၫဒၪတၭ, ယွၩအဂူၫဂၩအီၪ",
			"36": "<sup>36</sup> အ့ၬ.- အဝ့ၫဒၪဒုၭနါဂၧၫ့နၧၩ လၧအလူလၧမူၭခိၪဘဲၫ ၥိၭအမိၥီၪ့ထဲၩ့နၧၩတၭ, လၧဂၪ့ခိၪချိၫ့ယီၩ ဒုၭနဲၪနၧၩ လၧအမ့ၪဖၭဒိၪတၭ, နနါဂၧၫ့အလူလၧအဂဲၫထၪ့လၧ",
			"37": "<sup>37</sup> မ့ၪအကျၩနီၪလီၫ.- မွဲအအဲၪနဖါလဖၪအကၠီၩ့တၭ, ရွံန့ အဝ့ၫၥံၪအချံၫအၥၪ လၧအဝ့ၫၥံၪအလးခဲၫ့နီၪတၭ, ဒုၭ စဲၪ့ထၪ့ခွံၬနၧၩ လၧအံဇံၭလၧအမ့ၬယၫ လၧအစီၩ့ဒိၪ အမၩ့ဒိၪ, ဘဲၫၥိၭအမိနၫ့ထၪ့ခွံၬ ၦဆၨၩလဖၪဒိၪနဲၪ့",
			"38": "<sup>38</sup> ဒဲဆီၪ့နဲၪ့နၧၩဒံၭ, လၧနမ့ၬယၫ,- ဘဲၫၥိၭအမိဒုၭလ့ၩနုၬ နၧၩ, ဘဲၫၥိၭအမိဖ့ၪလၫ့နၧၩ လၧထံၫၥံၪခးၥံၪလၧဆၧန့",
			"39": "<sup>39</sup> ၥၫအဂး, ဘဲၫလၧမုဆၫလနံၩယီၩ အၥိၭနီၪလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, ၥ့ၪယၫလၧမုဆၫလနံၩယီၩ, ဒဲဆီၫ့ မီၪ့လၧနၥၭခံဖၧၩ့ လၧယဟိဝၩမွဲယွၩ လၧမူၭခိၪနီၪ,",
			"40": "<sup>40</sup> ဒဲလၧဂၪ့ခိၪလၬနီၪဆံၭ. အဂူၫဂၩအီၪအ့ၬ.- တၭနမိဘၪ ထီးန့အၥနိၫလဖၪ, ဒဲအဆၧမၪလူၬလဖၪ လၧယမၪလူၬ နၧၩ လၧမုဆၫလနံၩယီၩ, ဘဲၫၥိၭဆၧမိဂ့ၩထၪ့လၧန ဂး, ဒဲလၧနဖိၪနလံၩလၧနလးခဲၫ့အဂး, ဒဲဘဲၫၥိၭမိမၩ အၪထၪ့နမုနံၩ လၧခးဖၧၩ့လၧယဟိဝၩ နယွၩဖ့ၪလၫ့ နၧၩလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"41": "<sup>41</sup> ထီးနီၪလဖၧၫ့ စမိစ့ၭ အၪ့နၩ့ဖၭဒိၩ့ၥၧၫ့ဒိၩ့လၧယီၫ",
			"42": "<sup>42</sup> ဒၫ့အယီၩလခီၫ လၧမုထၪ့လခီၫ,- ဘဲၫၥိၭၦမၩၥံၫဆၧ, ၦလၧ အမၩၥံၫၦလၧအနဲၩ့ထံၭ လၧအမၩၥံၫရှုၭဆၧ အကၠီၩ့တၭ, လမ့ၬလဲၩဝဲၩဘၪဝ့ၫလဂၩနီၪ, မိစဲၪ့ဝ့ၫထီး နီၪတၭး ဘဲၫၥိၭအမိစဲၪ့နုၬ လၧဒိၩ့လဖျိၪ့ဖျိၪ့နီၪတၭ,",
			"43": "<sup>43</sup> မိမၧၫ့ဝ့ၫလီၫ,- ဘံဇၧၫလၧၡါမုနၧၫ့ဖၫ, လၧဆၧပျၩ့ဖၧၩ့ လၧၦရုဘံၫ့ဖိၪအခးဖၧၩ့လဖျိၪ့, ဒဲရၫမီၭလၧဂံလအၭ အဖၧၩ့ဘၪဆဲၫ့လၧၦဂၭဖိၪလဖျိၪ့, ဒဲဂိလၫ့လၧဘၫၡၫ့ အဖၧၩ့ဘၪဆဲၫ့လၧၦမနၭစ့ၫဖိၪလဖျိၪ့လီၫ.",
			"44": "<sup>44</sup> အယီၩမွဲဆၧၥီၪ့ဆၧၥၫ့ လၧစမိစ့ၭအီၪက့ၪလၩ့ဝ့ၫ",
			"45": "<sup>45</sup> လၧၦအံၫစရ့လၭဖိၪအမ့ၬယၫလီၫ.- အယီၩမွဲဆၧထိး အၥၭ, ဒဲဆၧမၪလူၬ, ဒဲဆၧစ့ၩရၫ့လၧစမိစ့ၭလီၩဘၪၦ အံၫစရ့လၭဖိၪ လၧအစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭအလးခဲၫ့",
			"46": "<sup>46</sup> နီၪ,- အီၪဝ့ၫလၧယီၫဒၫ့အယီၩလခီၫ လၧခိၪလီၩ့ဆူၭ အဖၧၩ့ဆဲၫဎၩ့လၧဘ့ၭၥပံအီၫ, လၧၦအၫမိၫဖိၪအစဎွၩ စဲဟၫ့အခးဖၧၩ့, ၦလၧအအီၪဝ့ၫလၧဟ့ၭၡဘၫ့လၧစမိ စ့ၭဒဲၦအံၫစရ့လၭဖိၪကျီၪ့ခွံၬ လၧအစဲၪ့ထၪ့ခွံၬ လၧ",
			"47": "<sup>47</sup> အံဇံၭအလးခဲၫ့နီၪလီၫ.- တၭအဝ့ၫၥံၪမၩန့အခး, ဒဲဘၫ ၡၫ့အစဎွၩအီၭအခး, ၦအၫမိၫဖိၪ အစဎွၩနံၫဂၩလၧ",
			"48": "<sup>48</sup> အအီၪလၧယီၫဒၫ့အယီၩလခီၫ လၧမုထၪ့လခီၫ,- လၧ အရိအၧၫ လၧအအီၪ လၧထံၫအၫနၫ့အနဲၩ့ဖိးလၧခိၪ",
			"49": "<sup>49</sup> လီၩ့ဇံအိၫ့လၧအမွဲဟၧမၧၫ့,- လၧယီၫဒၫ့အယီၩလ ခီၫလၧဆၧပျၩ့ဖၧၩ့ထၧၫ့ဘံၪ့ယၫ ဖိးလၧဆၧပျၩ့ဖၧၩ့ အမၫဆမံၭလၧအၫၡဒီၭပံစဂၫအခၪ့ထံၭလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> စမိစ့ၭကိၭန့ၦအံၫစရ့လၭထီးအလူၬတၭ, စံၭအဝ့ၫ ၥံၪ, အံၫစရ့လၭဧ့, ဆၧမၪလူၬလဖၪဒဲဆၧစ့ၩရၫ့လဖၪ လၧယချဲၩ့လၧနၥံၪအနါဖၧၩ့ လၧမုဆၫလနံၩယီၩ, ဘဲၫ ၥိၭနၥံၪမိမၩလိၪဝ့ၫ, ဒဲထီးန့ဝ့ၫ, ဒဲမၩဝ့ၫနီၪခိၭနၪနၥံၪ",
			"2": "<sup>2</sup> ဝ့ၫဆံၭ.- ယဟိဝၩပယွၩမၩဆၧအုၩ့လၩ့ လၧပၥိၭလၧ",
			"3": "<sup>3</sup> ဟိရ့ၭအလီၩ့လီၫ.- ယဟိဝၩမၩဆၧအုၩ့လၩ့နီၪလၧ ပဖါလဖၪမွဲအ့ၬး မွဲလၧပၧၩ, ၦလၧအအီၪမၧၫ့ဒံၭလၧ",
			"4": "<sup>4</sup> မုဆၫလနံၩယီၩ ထီးအလူၬလီၫ.- ယဟိဝၩချဲၩ့ဆၧလၧ အယိဆၧၫ့ယၫနၥံၪ, လၧခိၪလီၩ့ခိၪ, လၧမ့ၪအကျၩ,",
			"5": "<sup>5</sup> နီၪ,-(အဆၧၫ့အထီထီးနီၪယဝ့ၫဒၪယီၩယဆၧၫ့ထုၪ့ လၧယဟိဝၩ ဒဲနၥံၪအဘိၩ့ဆၧၩ့, ဘဲၫၥိၭယမိဒုၭၥ့ၪ ယၫနၥံၪလၧယဟိဝၩ အလူအထၫလီၫ. အဂဲးဘဲၫယီၩ နၥံၪၥၭမဲၪ ဆၧလၧမ့ၪအကၠီၩ့တၭ, နၥံၪလ့ၩထၪ့ဘၭ",
			"6": "<sup>6</sup> ခိၪလီၩ့အ့ၬ.) စံၭဝ့ၫဒၪ,- ယဝ့ၫဒၪယီၩယမွဲ ယဟိဝၩန ယွၩလၧအဒုၭစဲၪ့ထၪ့ခွံၬနၧၩ လၧအံဇံၭအဖၧၩ့, လၧ",
			"7": "<sup>7</sup> ၦဎီးဖိၪအဂံၪ့ဖၧၩ့လီၫ.- အ့ၪလမွဲဘၪယၧၩတၭ, ထီး အီၪလၧနယွၩဂူၫဂၩလဖၪ နးဂၩလဂ့ၩ.",
			"8": "<sup>8</sup> ထီးတဲၩ့ဆၧဂၩ့ဆၧဖၪ့လၧနဂးလဂ့ၩ, ဆၧအီၪလၧ မူၭခိၪထၭမွဲဂ့ၩ, ဆၧအီၪလၧဂၪ့ခိၪချိၫ့မွဲဂ့ၩ, ဆၧအီၪ လၧထံၫကျၩလၧဂၪ့ခိၪအဖၫ့လၬမွဲဂ့ၩ, ထီးတဲၩ့အခံး",
			"9": "<sup>9</sup> အဂၩ့လၧနဂးနးမံၩ့လဂ့ၩ, ထီးဘၩထၪ့လဂ့ၩ, ထီး မၩအဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယဟိဝၩနယွၩ ယီၩ, ယမွဲယွၩလၧအၥၭကဲၪ့ဆၧလၧအဒုၭအီၪထၪ့ဖါ လဖၪအဆၧဒဲၩဘၭလၧဖိၪလဖၪ အလီၩ့ထီၩ့လၩ့လၧ",
			"10": "<sup>10</sup> ၦၥၭဂဲၫ့ယၧၩၥၧၫ့ဆိၩလဆိၩ, ဒဲလံဆိၩလဆိၩ,- ဒဲလၧ ဆၧမၩခိးမၩတၩ ၦအထီၫ့လဖၪ, လၧၦလၧအအဲၪ ယၧၩ, ဒဲထီးန့ယဆၧမၪလူၬ လဖၪနီၪလီၫ.",
			"11": "<sup>11</sup> ထီးကိၭထၪ့ယဟိဝၩ နယွၩအမံၩ့ပျီၩပျီၩလဂ့ၩး အဂဲးဘဲၫယီၩ ၦလၧအကိၭထၪ့အမံၩ့ပျီၩပျီၩနီၪ, ယ ဟိဝၩအီၪက့ၪဝ့ၫ ဘဲၫၦလၧအဆၧဒဲၩဘၭလအီၪဘၪ နီၪမွဲအ့ၬ.",
			"12": "<sup>12</sup> ထီးန့မးၥံၫအနံၩ ဘဲၫနမိအီၪက့ၪဆံၫ့ဎံၪဝ့ၫအၥိၭနီၪ,",
			"13": "<sup>13</sup> ဘဲၫယဟိဝၩနယွၩမၪလူၬနၧၩအၥိၭနီၪဆံၭ.- နမိမၩ",
			"14": "<sup>14</sup> ဘၪဆၧဎူၫနံၩတၭ, မၩနဆၧမၩထီးအလူၬလီၫ.- အ့ၪ မွဲနွ့ၫနံၩလနံၩနီၪ မွဲယဟိဝၩနယွၩ အမးၥံၫအနံၩလီၫ. နဝ့ၫဒၪမွဲဂ့ၩ, နဖိၪခွၫမွဲဂ့ၩ, နဖိၪမုၪမွဲဂ့ၩ, နဎီးနၡၩခွၫမွဲ ဂ့ၩ, နဎီးနၡၩမုၪမွဲဂ့ၩ, နချီမွဲဂ့ၩ, နကၥ့ၪယီၩ့မွဲဂ့ၩ, န ဆၧဖိၪဆၧဎါအဒိၩ့မွဲဂ့ၩ, ၦလခီၫဘၩ့မုးဖိၪလၧအအီၪ လၧနတရၫ့အဖၧၩ့မွဲဂ့ၩ, ထီးမၩဆၧနးမံၩ့လဂ့ၩ, ဘဲၫ ၥိၭနဎီးနၡၩခွၫ, ဒဲနဎီးနၡၩအမုၪ မိအီၪပွံၭဘဲၫနၧၩအ ၥိၭအဂဲးလီၫ.",
			"15": "<sup>15</sup> နၪ့ထၪ့ထဲၩ့လၧနမွဲဆၧအဎီးအၡၩ လၧခးအံဇံၭအ ဖၧၩ့တၭ, ယဟိဝၩနယွၩဒုၭစဲၪ့ထၪ့ခွံၬ နၧၩထီးနီၪလၧ အစူၪဆီၪ့, ဒဲအယၩ့ထၪ့အၥၭနီၪဆံၭ, မၩအၥၭဘဲၫ နီၪတၭယဟိဝၩနယွၩမၪလူၬနၧၩ လၧနမိဘၪထီးန့မး ၥံၫအနံၩလီၫ.",
			"16": "<sup>16</sup> ဘဲၫယဟိဝၩ ယွၩမၪလူၬနၧၩအၥိၭနီၪ, ဘဲၫၥိၭနမု နံၩလဖၪမိအၪထၪ့, ဒဲဆၧမိဂ့ၩထၪ့လၧနဂး, လၧခးဖၧၩ့ လၧယဟိဝၩ နယွၩဖ့ၪလၫ့နၧၩတၭ, ယူၭယၪ့နမိနဖါ ဆံၭ.",
			"17": "<sup>17</sup> ထီးမၩၥံၫၦၡၩလဂ့ၩ.",
			"18": "<sup>18</sup> ထီးအဲၪဘိၩ့မၫအဲၪဘိၩ့ဝၩလဂ့ၩ.",
			"19": "<sup>19</sup> ထီးအၪ့ဂူၪဆၧလဂ့ၩ.",
			"20": "<sup>20</sup> ထီးထိးနၥၭလၧဆၧကဘျံၭကဘျၪ ထၫ့ဒုၪဒၩၦလၧ နနဲၩ့ထံၭလဂ့ၩ.",
			"21": "<sup>21</sup> ထီးဆိၫ့န့ဘၪ ၦလၧနနဲၩ့ထံၭအမၫလဂ့ၩ, ၦလၧန နဲၩ့ထံၭအဂံၪ့မွဲဂ့ၩ, အဆံၬအနၩမွဲဂ့ၩ, အဎီးအၡၩခွၫ မွဲဂ့ၩ, အဎီးအၡၩမုၪမွဲဂ့ၩ, အချီမွဲဂ့ၩ, အကၥ့ၪယီၩ့မွဲ ဂ့ၩ, ထီးဒၪၦလၧနနဲၩ့ထံၭ အဆၧလမံၩ့မံၩ့မွဲဂ့ၩ, ထီးၥၭ ကွံၩလဂ့ၩ.",
			"22": "<sup>22</sup> ဆၧချဲၩ့လဖၪနီၪ ယဟိဝၩချဲၩ့ လၧနၥံၪအဆၧ အီၪ ကီၪ့ထီးအလူၬလၧခိၪလီၩ့ခိၪ, လၧမ့ၪအကျၩ, လၧဆၧ အုၪ့ဒဲဆၧခံၭၥၧၫ့အကျၩလၧအလူဖၭဒိၪလီၫ. တၭအီၪ က့ၪအၪနဲၪ့အနီၪမွဲအ့ၬ. ကွ့ၭဝ့ၫ လၧလိးပၪနံၫဘံၪ့အ လီၩ့တၭ, ဖ့ၪလၫ့ဝ့ၫလၧယၧၩလီၫ.",
			"23": "<sup>23</sup> တၭထီးနၥံၪနါဂၧၫ့ဆၧၥီၫလၧဆၧခံၭကျၩတၭ,(အ ဂဲးဘဲၫယီၩခိၪလီၩ့ခဲၩထၪ့လၧမ့ၪ,) ဆၧမၩအၥၭလၧန ဂဲၫဘူၭလၧယၧၩ, အဒီၪ့လဖၪအခိၪထီးအလူၬ, ဒဲနၥံၪ",
			"24": "<sup>24</sup> အၥုၪ့က့ၭၥၭၡါလဖၪ,- တၭနၥံၪစံၭ, ယိခွါ, ယဟိဝၩပ ယွၩနဲၪဖျီၪထၪ့ယူၭအလၩအဖၩ့ ဒဲအဆၧဒိၪလၧပမ့ၬ ယၫယူၭတၭ, ပနါဂၧၫ့ယူၭအလူလၧအဂဲၫထၪ့လၧမ့ၪ ကျၩယူၭ, ပဒၪဘၪယူၭလၧမုဆၫလနံၩယီၩ လၧယွၩ",
			"25": "<sup>25</sup> ချဲၩ့ဆၧလၧၦၡၩတၭ, ၦၡၩနီၪမၧၫ့ဒံၭလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭဘိၩ့နဲၪ့ယီၩ, ပမိၥံၫမွဲဘၪလဲၪး အဂဲးဘဲၫ ယီၩမ့ၪဖၭဒိၪယီၩမိအၪ့ခွံၬပၧၩလီၫ. ပအ့ၪနါဂၧၫ့ဒံၭ",
			"26": "<sup>26</sup> ယဟိဝၩပယွၩအလူတၭ, ပမိၥံၫပဝ့ၫလီၫ.- အဂဲးဘဲၫ ယီၩလၧကယဲဆၧယၪအကျၩနီၪ, ၦနါဂၧၫ့ယွၩမၧၫ့ဝ့ၫ လဂၩအလူချဲၩ့ဆၧလၧမ့ၪအကျၩ ဘဲၫပဝ့ၫဒၪအၥိၭ, ဒဲ",
			"27": "<sup>27</sup> မၧၫ့ဝ့ၫနီၪမွဲၦလဂၩလဲၪ.- လ့ၩဘူၭနဝ့ၫ, ဒဲခိၭနၪကယဲ ဆၧလၧယဟိဝၩ ပယွၩမိစံၭတၭ, လီၩထဲၩ့ပၧၩ လၧ ကယဲဆၧလၧယဟိဝၩပယွၩ မိချဲၩ့ဆၧလၧနၧၩတၭ,ပမိ ခိၭနၪ, ဒဲမၩပဝ့ၫဆ့လီၫ.",
			"28": "<sup>28</sup> ထီးနၥံၪချဲၩ့ဆၧလၧယၧၩတၭ, ယဟိဝၩနါဂၧၫ့နၥံၪ အဆၧချဲၩ့အၥီၫနီၪ, ယဟိဝၩစံၭယၧၩ, ယနါဂၧၫ့ယူၭ ၦခမျၧးအဆၧချဲၩ့အၥီၫ လၧအချဲၩ့ဆၧ လၧနၧၩယူၭ, ကယဲဆၧလၧအစံၭယူၭထီးအလူၬနီၪ, မွဲအဂ့ၩလီၫ.",
			"29": "<sup>29</sup> မွဲအဝ့ၫၥံၪအီၪလါ လၧအၥၭယီၫလၧအဖၧၩ့ လၧအမိ ၥၭမဲၪယၧၩ, ဒဲထီးန့ယဆၧမၪလူၬ ထီးအလူၬကိၭမုနံၩ ကိၭမုနၩဒ့ၭဆံၭၬ မွဲဘဲၫၥိၭဆၧမိဂ့ၩထၪ့ လၧအဝ့ၫၥံၪ အဂး, ဒဲလၧအဖိၪအလံၩအဂး အဆိၩဆိၩအကၠၪကၠၪ",
			"30": "<sup>30</sup> နီၪလီၫ.- လ့ၩဘီၪ, စံၭအဝ့ၫၥံၪ, ထဲၩ့ထဲၩ့ဒီၭလၧနၥံၪ",
			"31": "<sup>31</sup> အတဲၩလဖၪအဖၧၩ့ဆံၭ,- အ့ၪမွဲနနၫ့ဆါဒၪနဝ့ၫဆၧၫ့ ထုၪ့နဝ့ၫ လၧယနဲၩ့ထံၭယီၩဘီၪး တၭယမိလီၩဘၪ နၧၩ လၧဆၧမၪလူၬ, ဒဲၥနိၫလဖၪ, ဒဲဆၧစ့ၩရၫ့လဖၪ ထီးအလူၬလၧနမိၥီၪ့လိၪအဝ့ၫၥံၪ, ဘဲၫၥိၭအမိထီးန့ဝ့ၫ လၧအခးဖၧၩ့ လၧယမိဖ့ၪလၫ့ အဝ့ၫၥံၪ လၧဆၧန့ၥၫ",
			"32": "<sup>32</sup> အဂးလီၫ.- တၭနၥံၪမိဘၪထီးန့ဘဲၫၥိၭနၥံၪမိမၩဆၧ, ဘဲၫယဟိဝၩနၥံၪအယွၩ မၪလူၬနၥံၪအၥိၭနီၪဆံၭ. လၧ စူၪထွ့ၪမွဲဂ့ၩ, လၧစူၪစ့ၪမွဲဂ့ၩ, ထီးကၠၪပဲၩနၥံၪဝ့ၫလ",
			"33": "<sup>33</sup> ဂ့ၩ.- နၥံၪမိဘၪလ့ၩဖိၬကယဲဖၧၩ့ၥၭၥံၪလၧယဟိဝၩ နၥံၪအယွၩမၪလူၬနၥံၪ ထီးအလူၬလီၫ. မွဲဘဲၫနီၪၥိၭ နၥံၪမိမၧၫ့, ဒဲဆၧမိဂ့ၩထၪ့လၧနၥံၪအဂး, တၭနၥံၪမိ မၩအၪထၪ့နၥံၪအနံၩအၥၫ့ လၧနၥံၪမိမၩန့ဝ့ၫလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> တၭအယီၩမွဲဆၧမၪလူၬၥံၪ, ဒဲၥနိၫၥံၪ, ဒဲဆၧစ့ၩရၫ့ ၥံၪလၧယဟိဝၩနၥံၪအယွၩနီၪ မၪလူၬလၧယမိဘၪၥီၪ့ လိၪနၥံၪ, ဘဲၫၥိၭနၥံၪမိထီးန့ဝ့ၫလၧခးဖၧၩ့ ထီးနၥံၪ",
			"2": "<sup>2</sup> လ့ၩမၩန့ဝ့ၫ,- ဘဲၫၥိၭနမိၥၭမဲၪယဟိဝၩနယွၩ လၧနမိ ထီးန့ကယဲအၥနိၫလဖၪ ဒဲအဆၧမၪလူၬလဖၪလၧယ မၪလူၬနၧၩ, နဝ့ၫဒၪ, ဒဲနဖိၪခွၫ, ဒဲနဖိၪခွၫအဖိၪခွၫ, လ ဆိၩဒၪနၧၩ, ဒဲလၧနနံၩနၥၫ့လဖၪ မိအၪထၪ့အဂဲးလီၫ.",
			"3": "<sup>3</sup> အခိးမွဲဘဲၫနီၪတၭ, ခိၭနၪ အံၫစရ့လၭဧ့း ထီးန့ဘဲၫ ၥိၭနမိမၩဝ့ၫ, ဘဲၫၥိၭဆၧမိဂ့ၩထၪ့လၧနဂး, ဒဲဘဲၫၥိၭ နၥံၪမိအၪထၪ့အၪအၪလ့ၬ, ဘဲၫယဟိဝၩ နဖါလဖၪအ ယွၩစံၭဝဲၩနၧၩအၥိၭ, လၧခးဖၧၩ့ လၧအယွၩလၩ့ဝ့ၫ လၧဆၧနူထံၫ ဒဲန့ၫစၩ့လီၫ.",
			"4": "<sup>4</sup> ခိၭနၪဆံၭ, အံၫစရ့လၭဧ့, ယဟိဝၩပယွၩနီၪ, မွဲယ",
			"5": "<sup>5</sup> ဟိဝၩလဂၩဎးလီၫ.- တၭနဘၪအဲၪယဟိဝၩနယွၩလၧ နၥၭထၧၫ့ဖျိၪယၫ, ဒဲလၧနၥၭၡီၩ့ထီးအလူၬ, ဒဲလၧနဂဲး နဘၭထီးအလူၬလီၫ.",
			"6": "<sup>6</sup> တၭဆၧချဲၩ့လဖၪနီၪ လၧယမၪလူၬနၧၩ လၧမုဆၫ",
			"7": "<sup>7</sup> လနံၩယီၩမိဘၪအီၪလၧနၥၭခံဖၧၩ့နီၪလီၫ.- နဘၪၥီၪ့ ထဲၩ့ၥၫ့ထဲၩ့ဆီၪ့ နဖိၪနလံၩ လၧဆၧမၪလူၬ လဖၪနီၪ တၭ, ထီးနဆၧၫ့နၩ့လၧနဂံၪ့ဖၧၩ့, ဒဲထီးနလ့ၩဆၧလၧ ဖၧၩ့ၥၭနီၪ, ဒဲထီးနမံၫနၩ့, ဒဲထီးနဂဲထုၪ့တၭ, နမိဘၪ",
			"8": "<sup>8</sup> ချဲၩ့ဆၧလၧအဂဲးအကၠီၪ့နီၪလီၫ.- နဘၪခဲးနစူၪ လၧ ဆၧနီၪလဖၪ, လၧဆၧမၩနဲၪ့အဂးတၭ, ဆၧမိကဲၪထၪ့",
			"9": "<sup>9</sup> ဆၧကွ့ၭနဲၪ့လၧနမ့ၬၥၪ အဘိၩ့ဆၧၩ့တၭ,- နမိဘၪကွ့ၭ ဝ့ၫလၧဂံၪ့ထုၪ့အလီၩ့ ဒဲလၧနတရၫ့အလီၩ့လီၫ.",
			"10": "<sup>10</sup> တၭဆၧမိမၩအၥၭ ထီးယဟိဝၩနယွၩမိဒုၭလ့ၩနုၬ နၧၩလၧခးဖၧၩ့ လၧအဆိၪလၩ့အၥၭ လၧနဖါလဖၪ, လၧစအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစယၫကူၭ လၧအမိဖ့ၪ လၫ့နၧၩ ဒိၩ့ဖၭဒိၪဒဲဂ့ၩဝ့ၫလဖၪ, လၧနလမၩကဲၪထၪ့",
			"11": "<sup>11</sup> ဘၪ,- ဒဲဂံၪ့လဖၪဎွ့ၩလၧဆၧဂ့ၩ လၧနလမၩဎွ့ၩဘၪ, ဒဲထံၫဖၧၩ့ ဘၪဆၧခုၪ့လၩ့ဝ့ၫ, လၧနလခုၪ့လၩ့ဘၪ, ဒဲ စဘံၭမုအလး, ဒဲအလဲအိၫ့ လၧနလၥုၪ့လၩ့ဘၪထီး",
			"12": "<sup>12</sup> နအၪ့ဘျဲၩအၪ့အဘိၩ့ဘၭတၭ,- ထီးလၩ့နၥၭဘဲၫၥိၭ နထီးၥၭနၪ့ယဟိဝၩ လၧအဒုၭစဲၪ့ထၪ့ခွံၬနၧၩ လၧခး",
			"13": "<sup>13</sup> အံဇံၭအဖၧၩ့, လၧၦဎီးဖိၪအဂံၪ့ဖၧၩ့နီၪလဂ့ၩ,- နမိ ဘၪၥၭမဲၪယဟိဝၩနယွၩ ဒဲမၩန့ၫအဝ့ၫနီၪအဆၧ, ဒဲဆိၪ",
			"14": "<sup>14</sup> လၩ့နၥၭလၧအမံၩ့လီၫ.- ထီးလ့ၩဖိၬ ယွၩအဂူၫဂၩ အခဲၫ့, ၦခမျၧးလၧအအီၪဝၬဖီၩ့နၥံၪအယွၩ လဖၪနီၪ",
			"15": "<sup>15</sup> လဂ့ၩ.- (အဂဲးဘဲၫယီၩ, ယဟိဝၩနယွၩနီၪ မွဲယွၩလၧ အၥၭကဲၪ့ဆၧလဂၩလၧနၥံၪအကျၩ,) ယဟိဝၩနယွၩ အၥၭထၪ့မိခဲၩထၪ့ဘၪခိၬနၧၩ, ဒဲမိမၩဂၭဂီၩ့ ဘၪခိၬ နၧၩလၧဂၪ့ခိၪချိၫ့လီၫ.",
			"16": "<sup>16</sup> ထီးမၩခွါယဟိဝၩနယွၩ, ဘဲၫနၥံၪမၩခွါဝ့ၫလၧမၭ",
			"17": "<sup>17</sup> စၫအဖၧၩ့အၥိၭနီၪလဂ့ၩ.- နၥံၪဘၪထီးန့တၡါယဟိ ဝၩနၥံၪအယွၩ အဆၧမၪလူၬလဖၪ, ဒဲအဆၧထိးအၥၭ",
			"18": "<sup>18</sup> လဖၪ, ဒဲအၥနိၫလဖၪ လၧယမၪလူၬယူၭနၧၩလီၫ.- တၭ နဘၪမၩဆၧလၧအတီၩ, ဒဲအဂ့ၩလၧယဟိဝၩ အမ့ၬ ယၫ, ဘဲၫၥိၭဆၧမိဂ့ၩထၪ့လၧနဂး, ဒဲဘဲၫၥိၭနမိလ့ၩနုၬ ဒဲမၩန့ခးအဂ့ၩ လၧယဟိဝၩ ဆိၪလၩ့အၥၭ လၧနဖါ",
			"19": "<sup>19</sup> လဖၪ,- လၧအမိနၫ့ထၪ့ခွံၬနဒုၪနဒၩ ထီးအလူၬလၧနမ့ၬ",
			"20": "<sup>20</sup> ယၫ, ဘဲၫယဟိဝၩချဲၩ့ဆၧအၥိၭနီၪလီၫ.- လၧခဲၫ့ထဲၩ့ ထီးနဖိၪခွၫအ့ၪအၪ့စၪ့နၧၩတၭ, စံၭဝ့ၫ, ဆၧထိးအၥၭ ဒဲဆၧမၪလူၬလဖၪ, ဒဲဆၧစ့ၩရၫ့လဖၪ လၧယဟိဝၩပ",
			"21": "<sup>21</sup> ယွၩမၪလူၬနၥံၪနီၪ မွဲဘဲၫၥ့ၪလဲၪနီၪတၭး- နမိဘၪစံၭ နဖိၪခွၫ, ပမွဲယူၭဖၫရိၫအဎီးအၡၩလဖၪ လၧအံဇံၭအ ဖၧၩ့း တၭယဟိဝၩ ဒုၭစဲၪ့ထၪ့ခွံၬပၧၩ လၧအံဇံၭအ",
			"22": "<sup>22</sup> ဖၧၩ့လၧအစူၪဆီၪ့လီၫ.- တၭယဟိဝၩဖ့ၪလၫ့ဆၧမၩ နဲၪ့လၩ့လၭ, ဒဲဆၧလၩ့လိလၩ့လၭ လၧအဒိၪအအၧၩ့ နီၪလၧအံဇံၭအဖၫ့ခိၪ, လၧဖၫရိၫအလီၩ့, ဒဲလၧအၡၩ",
			"23": "<sup>23</sup> ဂံၪ့ဖိၪအလီၩ့နီၪ လၧပမ့ၬယၫလီၫ.- တၭအဝ့ၫဒုၭစဲၪ့ ထၪ့ခွံၬပၧၩထီးနီၪဘဲၫၥိၭအမိဒုၭလ့ၩနုၬပၧၩ, ဘဲၫၥိၭ အမိဖ့ၪလၫ့ပၧၩ လၧထံၫၥံၪခးၥံၪ လၧအဆိၪလၩ့အၥၭ",
			"24": "<sup>24</sup> လၧပဖါလဖၪအဂဲးအကၠီၪ့လီၫ.- တၭယဟိဝၩမၪလူၬ ပၧၩဘဲၫၥိၭပမိထီးန့ဆၧမၪလူၬလဖၪ ထီးအလူၬ, ဘဲၫ ၥိၭပမိၥၭမဲၪယဟိဝၩ ပယွၩလၧပဆၧဂ့ၩအဂး ကိၭမု နံၩကိၭမုနၩဒ့ၭ, ဘဲၫၥိၭအမိဒုၭမၧၫ့ထၪ့ဒံၭပၧၩ, ဘဲၫ",
			"25": "<sup>25</sup> လၧမုဆၫလနံၩယီၩအၥိၭနီၪလီၫ.- တၭပအ့ၪထီးလၩ့ ပၥၭဘဲၫၥိၭပမိထီးန့ ကယဲဆၧမၪလူၬ ထီးအလူၬနီၪ လၧယဟိဝၩ ပယွၩအမ့ၬယၫ, ဘဲၫအမၪလူၬပၧၩအ ၥိၭနီၪတၭ, မွဲအမိကဲၪထၪ့ဆၧတီၩဆၧလီၩ့ လၧပဂး လီၫ."
		},
		"7": {
			"1": "<sup>1</sup> ထီးယဟိဝၩနယွၩ မိဒုၭလ့ၩနုၬနၧၩ လၧခးဖၧၩ့ထီး နလ့ၩမၩန့ဝ့ၫ, ဒဲနၫ့ထၪ့ခွံၬ ၦအၪဆၨၩ လၧနမ့ၬယၫ, ၦဟံၥၭဖိၪ, ဒဲၦဂၧဂၫဖိၪ, ဒဲၦအၫမိၫဖိၪ, ဒဲၦကၫနအၫ့ ဖိၪ, ဒဲၦပံရ့ၭဖိၪ, ဒဲၦဟံဝဲၫဖိၪ, ဒဲၦယ့ဘုၫဖိၪ, ၦနွ့ၫဆၨၩ",
			"2": "<sup>2</sup> ဒိၪနဲၪ့ဆီၪ့နဲၪ့နၧၩဒံၭ,- တၭထီးယဟိဝၩ နယွၩနီၪမိ ဖ့ၪလၫ့ခွံၬဝ့ၫလၧနမ့ၬယၫတၭ, နမိဘၪကျီၪ့ခွံၬဝ့ၫ, မၩ ဂၭဂီၩ့ခွံၬဝ့ၫ လူၬထူၬဆံၫ့ဘၩ့လီၫ. ဆၧအုၩ့လၩ့လမံၩ့ မံၩ့နီၪနဘၪအုၩ့လၩ့ လၧအဝ့ၫၥံၪအၥိၭလဂ့ၩတၭ, န",
			"3": "<sup>3</sup> ဘၪယၫ့ၥၭအဝ့ၫၥံၪလဂ့ၩး- တၭထီးအီၪဎုၬလိၬနၥံၪ အၥၭလၧအဝ့ၫၥံၪလဂ့ၩ. နဖိၪမုၪနီၪ ထီးဖ့ၪလၫ့လၧ အဝ့ၫဒၪအဖိၪခွၫလဂ့ၩ, ဒဲအဝ့ၫဒၪအဖိၪမုၪနီၪထီးမၩ",
			"4": "<sup>4</sup> န့ဘၪလၧနဖိၪခွၫအမၫ အဂးလဂ့ၩ.- အဂဲးဘဲၫယီၩ မိဒုၭကၠၪခွံၬနဖိၪခွၫအၥၭ လၧအဖိၬယခဲၫ့, ဘဲၫၥိၭအမိ မၩယွၩအဂူၫဂၩလဖၪအဆၧတၭ, ယဟိဝၩအၥၭထၪ့",
			"5": "<sup>5</sup> မိခဲၩထၪ့ဘၪနၥံၪ, ဒဲမိမၩဂၭဂီၩ့ခွံၬရှုၭနၧၩလီၫ.- အ့ၪ မွဲနၥံၪမိဘၪမၩအဝ့ၫၥံၪဘဲၫယီၩ, နၥံၪဘၪမၩဂၭဂီၩ့ခွံၬ အဆၧလုလး, ဒဲမၩခါခွံၬ အဆၧဂၩ့လဖၪ, ဒဲခူၬခွံၬ အၡ့ရိၫၥံၪ, ဒဲဆူၭထၪ့ခွံၬ အဆၧဂၩ့စိၭဖျၩအၥၭလဖၪ လၧမ့ၪလီၫ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩ နမွဲၦဆံၫ့ဎံၪလဆၨၩ လၧယဟိဝၩ နယွၩအဂးလီၫ. ယဟိဝၩ နယွၩရွံန့နၧၩ, ဘဲၫၥိၭနမိ ကဲၪထၪ့ၦလဆၨၩ လၧအလၩ့မဲၩဒၪဆၧလၧအဂး, လၧ",
			"7": "<sup>7</sup> ၦကိၭဆၨၩဒ့ၭ လၧဂၪ့ခိၪချိၫ့အဖၫ့ခိၪလီၫ.- မွဲနၥံၪအၪ နဲၪ့ၦဆၨၩဂူၫဂၩလဖၪအကၠီၩ့နီၪ, ဘၪယဟိဝၩအၥၭ လၧနၥံၪ, ဒဲရွံန့နၥံၪမွဲအ့ၬ, အဂဲးဘဲၫယီၩ နၥံၪၡၩနဲၪ့",
			"8": "<sup>8</sup> ၦဆၨၩဂူၫဂၩထီးအလူၬဒံၭလီၫ.- အ့ၪမွဲလၧယဟိဝၩ အဲၪနၥံၪအကၠီၩ့တၭ, မွဲအထီးန့အဆၧဆိၪလၧအဆိၪ လၩ့အၥၭလၧနၥံၪအဖါလဖၪတၭ, ယဟိဝၩဒုၭစဲၪ့ထၪ့ ခွံၬနၥံၪလၧအစူၪဆီၪ့, ဒဲဎွ့ၩန့ထဲၩ့နၥံၪ လၧဆၧအဎီး အၡၩအဂံၪ့ဖၧၩ့ လၧအံဇံၭအစဎွၩ ဖၫရိၫအစူၪဖၧၩ့",
			"9": "<sup>9</sup> လီၫ.- အခိးမွဲၥ့ၪယၫနဝ့ၫ လၧယဟိဝၩနယွၩနီၪအဝ့ၫ ဒၪမွဲယွၩလီၫ. ယွၩလၧအလူတီၩ, လၧအထီးန့ဆၧအုၩ့ လၩ့ဒဲဆၧယၫ့ၥၭလၧၦလၧအအဲၪဝ့ၫ, ဒဲထီးန့အဆၧမၪ",
			"10": "<sup>10</sup> လူၬလဖၪနီၪထီၩ့လၩ့လၧ ၦအဆိၩလထီၫ့လီၫ.- ဒဲဖ့ၪ လၫ့ထဲၩ့ ဆၧလၧၦလၧအၥၭဂဲၫ့ဝ့ၫ လၧအဝ့ၫၥံၪအမ့ၬ ယၫ,ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခွံၬဝ့ၫလီၫ. တၭအၥၭလၩ့ ဆါထဲၩ့လၧၦလၧအၥၭဂဲၫ့ဝ့ၫနီၪအ့ၬ, မိဖ့ၪလၫ့ထဲၩ့",
			"11": "<sup>11</sup> ဆၧလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နဘၪထီးန့ဆၧမၪလူၬလဖၪ, ဒဲၥနိၫလဖၪ ဒဲဆၧစ့ၩရၫ့ လဖၪလၧယမၪလူၬနၧၩ လၧမုဆၫလနံၩယီၩလၧနဘၪ မၩနဝ့ၫလီၫ.",
			"12": "<sup>12</sup> ဆၧမိမၩအၥၭ လၧနၥံၪအ့ၪခိၭနၪဆၧစ့ၩ ရၫ့လဖၪ ယီၩ, ဒဲထီးန့ဒဲမၩဝ့ၫတၭ, ယဟိဝၩနယွၩနီၪ မိထီး န့ဆၧအုၩ့လၩ့ ဒဲဆၧအခိးအတၩ လၧနဂးလၧအဆိၪ",
			"13": "<sup>13</sup> လၩ့အၥၭလၧနဖါလဖၪလီၫ.- ဒဲမိအဲၪနၧၩ, ဒဲဆိၪဂ့ၩနၧၩ, ဒဲမၩအၪထၪ့နၧၩလီၫ. တၭမွဲအမိဆိၪဂ့ၩနဒၧၩ့လးအၥၪ, ဒဲဂၪ့ခိၪအဆၧၥၪ, နဘုၪၥံၪဂူၫၥံၪ, ဒဲနစဘံၭထံၫ, ဒဲနၥိၪ, ချီၥံၪအဆၧအၪထၪ့, ဒဲနၥိၪအဆၧ အၪထၪ့လၧထံၫၥံၪ ခးၥံၪအဖၧၩ့ လၧအဆိၪလၩ့အၥၭလၧနဖါလဖၪ လၧအမိ",
			"14": "<sup>14</sup> ဖ့ၪလၫ့နၧၩလီၫ.- နမိဘၪဆၧဆိၪဂ့ၩနၧၩ လၧၦဆၨၩထီး အလူၬအဖၫ့ခိၪလီၫ. ၦမုၪမွဲဂ့ၩ, ၦခွၫမွဲဂ့ၩ, အထူၬဖိၪ လၧနၥံၪအကျၩမွဲဂ့ၩ, လၧနၥံၪအဆၧဖိၪဆၧဎါအဒိၩ့",
			"15": "<sup>15</sup> အကျၩမွဲဂ့ၩ, အီၪဘၪအ့ၬ.- တၭယဟိဝၩမိဒုၭစဲၪ့ထၪ့ ခွံၬ ကယဲဆၧစူၭဆၧဆၫထီး အလူၬလၧနအီၪ, ဒဲ အံဇံၭအဆၧစူၭဆၧဆၫ အအၧၩ့ အၥၫ့လၧနၥ့ၪယၫနီၪ အီၪက့ၪဝ့ၫလၧကယဲၦလၧအမ့ၬ လဲၩနၧၩအလီၩ့ လခီၫနီၪလီၫ.",
			"16": "<sup>16</sup> တၭနဘၪမၩဂၭဂီၩ့လူၬခွံၬ ကယဲၦဆၨၩလၧယဟိ ဝၩနယွၩမိဖ့ၪလၫ့နၧၩ ထီးအလူၬလီၫ. နမ့ၬၥၪမိယၫ့ ၥၭဘၪအဝ့ၫၥံၪအ့ၬး ဒဲနမၩဘၪအဝ့ၫၥံၪအယွၩလဖၪ အဆၧအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧနီၪမိကဲၪထၪ့ဆၧဖျံၩ",
			"17": "<sup>17</sup> ခွၩ့လၧနဂးလီၫ.- နအ့ၪစံၭလၧနၥၭခံဖၧၩ့နီၪ, ၦဆၨၩ လဖၪယီၩ အၪနဲၪ့ယၧၩဒံၭ, ယနၫ့ထၪ့ခွံၬ မိၥ့ၪဘဲၫၥ့ၪ",
			"18": "<sup>18</sup> လဲၪနီၪတၭ,- ထီးၥၭမဲၪအဝ့ၫၥံၪလဂ့ၩ, နဘၪနၪ့ထၪ့ ထဲၩ့တၡါဆၧလၧယဟိဝၩ နယွၩမၩလၧဖၫရိၫ ဒဲၦအံ",
			"19": "<sup>19</sup> ဇံၭဖိၪထီးအလူၬ,- ဆၧမၩခွါဖၭဒိၪၥံၪလၧနမ့ၬၥၪဒၪ ဘၪ, ဒဲဆၧလၩ့လၭအဆၧမၩနဲၪ့, ဒဲဆၧလၩ့လိလၩ့ လၭ, ဒဲဆၧအစူၪဆီၪ့, ဒဲအစူၪယၩ့ထၪ့အၥၭ လၧယဟိ ဝၩနယွၩဒုၭစဲၪ့ထၪ့ခွံၬနၧၩနီၪလီၫ. တၭယဟိဝၩနယွၩ မိမၩကယဲၦဆၨၩ လၧနၥၭမဲၪဝ့ၫနီၪ ဘဲၫနီၪအၥိၭဆ့",
			"20": "<sup>20</sup> လီၫ.- တၭယဟိဝၩ နယွၩမိအၪ့မၧၫ့လၩ့ဆ့ ဖျၧၫ့ၥံၪ လၧအကျၩ ထီးၦလၧအအီၪလၩ့ထး, ဒဲအီၪက့ၪၥူၪအ",
			"21": "<sup>21</sup> ၥၭလၧနမ့ၬယၫနီၪ မိထီၩ့လၧဆၧဂၭဂီၩ့လီၫ.- ထီးၥၭ မဲၪဆၧလၧအဝ့ၫၥံၪ အမ့ၬယၫလဂ့ၩး အဂဲးဘဲၫယီၩ, ယဟိဝၩ နၥံၪအယွၩအီၪဝ့ၫလၧနၥံၪအကျၩ, ယွၩလၧ",
			"22": "<sup>22</sup> အဒိၪဝ့ၫဒဲဆၧၥၭမဲၪဖၭဒိၪအလးလီၫ.- တၭယဟိဝၩ နယွၩနီၪမိနၫ့ထၪ့ခွံၬ ၦဆၨၩလဖၪလၧနမ့ၬယၫလၧလ ဆံၭဘၪလဆံၭလီၫ. နမၩလူၬခွံၬဝ့ၫစီၪ့ဎးအ့ၬ. အ့ၪ လမွဲဘၪဘဲၫနီၪတၭ, ဆၧဖိၪဆၧဎါလၧမံၩ့လၬကျၩနီၪ",
			"23": "<sup>23</sup> မိအၪထၪ့ဘၪခိၬ လၧနဖၫ့ခိၪလီၫ.- မွဲလါနၫ့ ယဟိဝၩ နယွၩမိဖ့ၪလၫ့အဝ့ၫၥံၪ လၧနစူၪဖၧၩ့, ဒဲနမိမၩဂၭဂီၩ့ခွံၬ ဝ့ၫလၧဆၧမၩဂၭဂီၩ့ဖၭဒိၪ ထီးအဝ့ၫၥံၪလူၬခွံၬဝ့ၫဒၪ",
			"24": "<sup>24</sup> လီၫ.- မွဲအမိဖ့ၪလၫ့ခွံၬ အဝ့ၫၥံၪအစဎွၩ လၧနစူၪဖၧၩ့ တၭ, နဘၪမၩဂၭဂီၩ့ခွံၬ အဝ့ၫၥံၪအမံၩ့လၧမူၭခိၪအဖၫ့ လၬလီၫ. ထီးနလမၩဂၭဂီၩ့ခွံၬဒံၭဘၪအဝ့ၫၥံၪနီၪ, ၦ",
			"25": "<sup>25</sup> ဆၧၫ့ထုၪ့လၧနမ့ၬယၫၥ့ၪနးဂၩအ့ၬ.- အဝ့ၫၥံၪအယွၩ လဖၪအဆၧဂၩ့စိၭဖျၩအၥၭလဖၪနီၪ နၥံၪဘၪဆူၭထၪ့ ခွံၬလၧမ့ၪလီၫ. ထီးၥၭကွံၩကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫ ၥံၪ,လၧအအီၪလၧအလီၩ့လဂ့ၩ, ဒဲမၩန့ဝ့ၫလၧနဂးလ ဂ့ၩ, မွဲနမိဘၪဘၪခိၬဆၧဖျံၩခွၩ့ လၧအဝ့ၫၥံၪအကၠီၩ့ လီၫ. အဂဲးဘဲၫယီၩ မွဲဆၧဘၪၥၭလိၪ လၧယဟိဝၩန",
			"26": "<sup>26</sup> ယွၩအမ့ၬယၫလီၫ.- တၭနဂဲၫဆိၬဘၪဆၧဘၪၥၭလိၪ လၧနဂံၪ့ဖၧၩ့အ့ၬ, နမိကဲၪထၪ့ဘၪခိၬ ဆၧဆိၪအၧၩ့ ဘဲၫအဝ့ၫနီၪအၥိၭလီၫ. နဘၪမ့ၬလဲၩတၡါဝ့ၫ, ဒဲနဘၪ ၥၭလိၪတၡါဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ မွဲဆၧလၧအဘၪ ဆိၪအၧၩ့ဝ့ၫလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ကယဲဆၧမၪလူၬလၧယမၪလူၬနၧၩ လၧမုဆၫလနံၩ ယီၩနၥံၪဘၪထီးန့ ဒဲမၩဘဲၫၥိၭနၥံၪမိမၧၫ့ထၪ့, ဒဲအၪ ထၪ့, ဒဲလ့ၩနုၬ, ဒဲမၩန့ထံၫၥံၪခးၥံၪ လၧယဟိဝၩဆိၪ",
			"2": "<sup>2</sup> လၩ့အၥၭလၧနၥံၪအဖါလဖၪအဂဲးလီၫ.- တၭနဘၪ နၪ့ထၪ့ထဲၩ့ဖၧၩ့ၥၭ ထၧၫ့ဘီၩ့ယၫ လၧယဟိဝၩနယွၩ ဒုၭဖိၬနၧၩ အနံၪ့လံဆံၫလဖၪယီၩ လၧၡါမုနၧၫ့ဖၫဘဲၫ ၥိၭအမိဒုၭဆၪ့လၩ့နၥၭ, ဘဲၫၥိၭအမိမၩခွါနၧၩ, နမိ ထီးန့အဆၧမၪလူၬ, နလထီးန့ဘၪလဲၪနီၪ, ဘဲၫၥိၭအမိ",
			"3": "<sup>3</sup> ၥ့ၪယၫဆၧအီၪလၧနၥၭခံဖၧၩ့လီၫ.- တၭအဝ့ၫဒၪဒုၭ ဆၪ့လၩ့နၥၭ, ဒဲဒုၭၥၭဝံနၥၭ, ဒဲဒုၭအၪ့နၧၩ လၧမၪ့နၫ လၧနလၥ့ၪယၫဘၪဝ့ၫ, ဒဲနဖါလဖၪ လၥ့ၪယၫဘၪဝ့ၫ, ဘဲၫၥိၭအမိဒုၭၥ့ၪယၫနၧၩ လၧၦၡၩမၧၫ့ဝ့ၫ န့ၫကိၪလ မံၩ့မွဲအ့ၬး မွဲထီးဒၪဆၧချဲၩ့လၧအဂဲၫထၪ့ လၧယဟိဝၩ အနိၭဖၧၩ့ ကိၭထံၪဒ့ၭအကၠီၩ့နီၪ, ၦၡၩမၧၫ့ဝ့ၫလီၫ.",
			"4": "<sup>4</sup> နကီၩ့နၥိၭလးလံၩဝ့ၫလၧနလီၩ့အ့ၬ, ဒဲနခၪ့လယိၭထၪ့",
			"5": "<sup>5</sup> ဘၪလၧအနံၪ့လံဆံၫအထးဖၧၩ့လီၫ.- နဘၪၥ့ၪယၫဆ့ လၧနၥၭခံဖၧၩ့, ဘဲၫၦအၪ့ၥီၪ့အဖိၪခွၫအၥိၭနီၪ, ယဟိ",
			"6": "<sup>6</sup> ဝၩနယွၩအၪ့ၥီၪ့နၧၩဘဲၫနီၪအၥိၭလီၫ.- မၩအၥၭဘဲၫ နီၪတၭ, နမိဘၪထီးန့ယဟိဝၩ နယွၩအဆၧမၪလူၬ လဖၪ, ဘဲၫၥိၭနမိဖိၬအဖၧၩ့ၥၭလဖၪ, ဒဲၥၭမဲၪအဝ့ၫဒၪ လီၫ.",
			"7": "<sup>7</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩနယွၩဒုၭလ့ၩနုၬနၧၩလၧထံၫ ၥံၪခးၥံၪအဂ့ၩအဖၧၩ့, ခးလဘံၪ့အီၪလၧထံၫချိၬ, ဒဲထံၫ မၧၫ့ထၪ့ဖျိၭ, ဒဲနီၪ့လၧအထံၫထၪ့ဖျိၭ လၧခိၪလီၩ့ဆူၭ,",
			"8": "<sup>8</sup> ဒဲလၧခိၪလီၩ့ထိၩ့ချိၬ,- ခးလဘံၪ့အီၪလၧဘုၪကၠိၩ့, ဒဲဘုၪ မုယီၩ, ဒဲစဘံၭမု, ဒဲချိၪ့ဒိၩ့ၥံၪ, ဒဲၥံၪ့ၥလဲၩ, ခးလဘံၪ့",
			"9": "<sup>9</sup> အီၪလၧၥံၪ့ အလဲအိၫ့အၥိၪ, ဒဲန့ၫစၩ့,- ခးလဘံၪ့အီၪ လၧကိၪလၧနမိအၪ့ဘၪလၧၫ့ဎွ့ၩလီၫ. နဆိၫ့န့ဘၪဆၧ လမံၩ့မံၩ့လၧအလအီၪဘၪ လၧအဖၧၩ့နီၪ နးမံၩ့အ့ၬး ခးလဘံၪ့လၧအလိးလဖၪ မွဲထၭ, ဒဲလၧအခိၪလီၩ့ထိၩ့ ချိၬအဖၧၩ့နီၪ နမိခုၪ့ထၪ့န့ထီးၥံၪၡၬၥံၪလီၫ.",
			"10": "<sup>10</sup> ထီးနအၪ့ဆၧနီၪ နဘျဲၩအၪ့တၭ, နဘၪစံၭထၪ့အၪ့ အူၭယဟိဝၩ နယွၩလၧထံၫၥံၪခးၥံၪအဂ့ၩ လၧအဖ့ၪ",
			"11": "<sup>11</sup> လၫ့နၧၩအကၠီၩ့နီၪလီၫ.- ထီးလၩ့နၥၭဘဲၫၥိၭနထီးၥၭ နၪ့ယဟိဝၩနယွၩ ဒဲလထီးန့ဘၪ အဆၧမၪလူၬလဖၪ, ဒဲအဆၧစ့ၩရၫ့လဖၪ, ဒဲအၥနိၫလဖၪ, လၧယမၪလူၬ",
			"12": "<sup>12</sup> နၧၩလၧမုဆၫလနံၩယီၩလဂ့ၩ.- ထီးနအၪ့ဆၧတၭဘျဲၩ",
			"13": "<sup>13</sup> အၪ့, ဒဲၥုၪ့ဂံၪ့ၥံၪ့လၧအဂ့ၩ, ဒဲအီၪလၧအဖၧၩ့း- ဒဲနချီ ၥံၪ, ဒဲနၥိၪၥံၪနဘ့ၪၥံၪအၪထၪ့, ဒဲနကျိၪၥံၪစ့ၩၥံၪ, ဒဲန ထီၫ့ၥံၪလွ့ၫၥံၪအၪထၪ့, ဒဲကယဲဆၧအီၪ လၧနစူၪဖၧၩ့",
			"14": "<sup>14</sup> အၪထၪ့တၭ,- နမိအီၪက့ၪထၪ့ထီၫဘၪခိၬနၥၭ, ဒဲနမိၥၭ နၪ့ဘၪခိၬယဟိဝၩနယွၩ လၧအဒုၭစဲၪ့ထၪ့ခွံၬနၧၩလၧ",
			"15": "<sup>15</sup> အံဇံၭအဖၧၩ့, လၧၦဎီးဖိၪအဂံၪ့ဖၧၩ့,- ၦလၧအဒုၭလ့ၩ နၧၩလၧၡါမုနၧၫ့ဖၫဖၭဒိၪ, အီၪလၧဆၧၥၭမဲၪအလး, ဂူစရၭ, ဒဲဆၧကဲၪ့မ့, ဒဲအလးဎဲၫ့ထၬ ထီးထံၫလအီၪ ဘၪ, လၧအဒုၭဂဲၫထၪ့ထံၫ လၧနဂးလၧလိးမ့ၪအဖၧၩ့,",
			"16": "<sup>16</sup> လၧအဒုၭအၪ့နၧၩလၧၡါမုနၧၫ့ဖၫအဖၧၩ့ လၧမၪ့နၫလၧ နဖါလဖၪလၥ့ၪယၫဘၪဝ့ၫ, ဘဲၫၥိၭအမိဒုၭဆၪ့လၩ့န ၥၭ,ဘဲၫအမိမၩခွါနၧၩ, ဒဲမၩဂ့ၩနၧၩလၧနမုနံၩထုၬနီၪ",
			"17": "<sup>17</sup> လီၫ.- တၭနမိစံၭဘၪခိၬလၧနၥၭခံဖၧၩ့, ယမၩန့ယစူၪ လးယခၪ့ခိၪယီၩ လၧယစီၩ့ယမၩ့ဒၪယဝ့ၫ ဒဲလၧယစူၪ",
			"18": "<sup>18</sup> ဒၪယဝ့ၫအဂဲးဆီၪ့အဘၭဆီၪ့အကၠီၩ့နီၪလီၫ.- အ့ၪမွဲ နမိဘၪနၪ့ထၪ့ထဲၩ့ ယဟိဝၩနယွၩလီၫ. အဂဲးဘဲၫယီၩ မွဲအဝ့ၫဒၪနီၪဖ့ၪလၫ့နၧၩ လၧဆၧအစီၩ့အမၩ့လၧနမိန့ ဘၪနစူၪလးနခၪ့ခိၪ, ဘဲၫၥိၭအမိဒုၭအီၪဂုးအီၪခၧၫ့အ ဆၧအုၩ့လၩ့လၧအဆိၪလၩ့အၥၭ လၧနဖါလဖၪ, ဘဲၫ လၧမုဆၫလနံၩယီၩ အၥိၭနီၪလီၫ.",
			"19": "<sup>19</sup> တၭနအ့ၪၥၭနၪ့တၡါ ယဟိဝၩနယွၩ, ဒဲဖိၬယွၩအဂူၫ ဂၩလဖၪအခဲၫ့, ဒဲမၩအဆၧ, ဒဲဘၩထၪ့ဝ့ၫတၭ, ယထိး ယၥၭလၧနၥံၪအဂဲးအကၠီၪ့ လၧမုဆၫလနံၩယီၩ, လၧ ဆၧမိမၩအၥၭ လၧနၥံၪမိထီၩ့တၡါ လၧဆၧဂၭဂီၩ့ဂၭ",
			"20": "<sup>20</sup> စၪလီၫ.- ဘဲၫၦဆၨၩလဖၪ လၧယဟိဝၩမၩဂၭဂီၩ့ဝ့ၫ လၧနၥံၪအမ့ၬယၫအၥိၭနီၪ, နမိထီၩ့လၧဆၧဂၭဂီၩ့ဂၭ စၪဘဲၫနီၪအၥိၭလီၫ. အဂဲးဘဲၫယီၩ နၥံၪခိၭနၪယဟိ ဝၩနၥံၪအယွၩအလူအ့ၬ."
		},
		"9": {
			"1": "<sup>1</sup> ခိၭနၪဘီၪ, အံၫစရ့လၭဧ့း လၧမုဆၫလနံၩယီၩ, နမိ ခၫ့ဂၬထံၫယီၫဒၫ့, ဘဲၫၥိၭနမိလ့ၩနုၬမၩန့ၦဆၨၩလဖၪ လၧအဒိၪနဲၪ့, ဒဲဆီၪ့နဲၪ့နၧၩဒံၭ, ဒိၩ့ဖၭဒိၪလဖၪ, ဒဲအ",
			"2": "<sup>2</sup> ခိၪဒၧၩ့ထၪ့ဘၭလၧမူၭခိၪလီၫ.- ၦခမျၧးလၧအမိၡါဒိၪ ဒဲအဂၩ့ထီၫ, ၦအၫနၭဖိၪလၧနၥ့ၪယၫဝ့ၫ, ဒဲနနါဂၧၫ့ၦ ၡၩစံၭ, မွဲၦဆၧၫ့ထုၪ့လၧၦအၫနၭဖိၪအမ့ၬယၫမိၥ့ၪလ",
			"3": "<sup>3</sup> ဂၩနီၪလဲၪ.- တၭလၧမုဆၫလနံၩယီၩၥ့ၪယၫလၧယဟိ ဝၩနယွၩ, ုၦလၧအခၫ့ဂၬဝ့ၫလၧနမ့ၬယၫနီၪ, မွဲမ့ၪလၧ အအၪ့ဆၧလီၫ. အဝ့ၫဒၪမိမၩဂၭဂီၩ့ခွံၬဝ့ၫ, ဒဲမိဒုၭလၩ့ ထံၩဖါဝ့ၫလၧနမ့ၬယၫး ဒဲနမိနၫ့ထၪ့ခွံၬဝ့ၫတၭ, မၩဂၭ ဂီၩ့ခွံၬဝ့ၫချဲၫ့ချံၭ, ဘဲၫယဟိဝၩစံၭယူၭနၧၩ အၥိၭနီၪ လီၫ.",
			"4": "<sup>4</sup> ထီးယဟိဝၩ နယွၩနၫ့ထၪ့ခွံၬ အဝ့ၫၥံၪလၧနမ့ၬယၫ အလးခဲၫ့နီၪ, ထီးဆီၫ့မီၪ့ဆၧလၧနၥၭခံဖၧၩ့, ဒဲစံၭ, မွဲလၧယဆၧတီၩဆၧလီၩ့အကၠီၩ့တၭ, ယဟိဝၩဒုၭ လ့ၩနုၬမၩန့ယၧၩ လၧခးနီၪလဂ့ၩး အ့ၪမွဲစံၭ, လၧၦ ဆၨၩလဖၪအဆၧဒဲၩဘၭအကၠီၩ့တၭ, ယဟိဝၩနၫ့ထၪ့",
			"5": "<sup>5</sup> ခွံၬအဝ့ၫၥံၪ လၧနမ့ၬယၫနီၪဆံၭ.- လၧနဆၧတီၩဆၧ လီၩ့အကၠီၩ့, လၧနၥုၪ့တီၩနၥၭလီၩ့အကၠီၩ့တၭ, နလ့ၩ မၩန့အဝ့ၫၥံၪအခးမွဲအ့ၬး အ့ၪမွဲလၧၦဆၨၩလဖၪအ ဆၧဒဲၩဘၭအကၠီၩ့, ယဟိဝၩနယွၩ နၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ လၧနမ့ၬယၫ, ဘဲၫၥိၭအမိမၩတီၩအလူလၧအဆိၪလၩ့ အၥၭလၧနဖါလဖၪ, စအၫဘြဟၫ့, စအံစၭ, ဒဲစယၫ ကူၭနီၪလီၫ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, ၥ့ၪယၫလၧယဟိဝၩနယွၩဖ့ၪ လၫ့နၧၩလၧထံၫၥံၪခးၥံၪအဂ့ၩ ဘဲၫယီၩဘဲၫၥိၭနမိမၩ န့ဝ့ၫလၧနတီၩနလီၩ့ဒၪနဝ့ၫအကၠီၩ့အ့ၬ. အဂဲးဘဲၫယီၩ",
			"7": "<sup>7</sup> နမွဲၦလၧအခိၬဆီၪ့လဆၨၩလီၫ.- လၧနမၩၥၭထၪ့ယ ဟိဝၩနယွၩလၧၡါမုနၧၫ့ဖၫနီၪ နၪ့ထၪ့ထဲၩ့ဆံၭ. ၥၭနၪ့ လဂ့ၩ. လၧမုလနံၩလၧနၥံၪစဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭ အဖၧၩ့ထီးနၥံၪဂဲၫထီၩ့လၧအလးယီၩတၭ, နၥံၪမွဲၦအ",
			"8": "<sup>8</sup> ပိၩ့ထၪ့ယဟိဝၩလဆၨၩလီၫ.- လၧဟိရ့ၭအဖၧၩ့ဒၪ လ့ၬနၥံၪမၩၥၭထၪ့ယဟိဝၩ ထီးယဟိဝၩၥၭထၪ့နၥံၪ ထီးအမိမၩဂၭဂီၩ့နၥံၪလီၫ.",
			"9": "<sup>9</sup> ထီးယလ့ၩထၪ့လၧခိၪလီၩ့ခိၪ, ဘဲၫၥိၭယမိမၩန့လိး ပၪၥံၪ, လိးပၪဘၪဆဲၫ့ လၧဆၧအုၩ့လၩ့ လၧနၥံၪနီၪ တၭ, ယအီၪလၧခိၪလီၩ့ခိၪ အနံၩလံဆံၫဒဲအနၩလံဆံၫ",
			"10": "<sup>10</sup> တၭ, ယအၪ့ဘၪကိၪအ့ၬ, ဒဲယအီၩဘၪထံၫအ့ၬ.- တၭ ယဟိဝၩဖ့ၪလၫ့ယၧၩ လၧလိးပၪနံၫဘံၪ့ ကွ့ၭအၥၭလၧ ယွၩအစူၪနိၩ့နီၪ, ဒဲဆၧအီၪလၧအလီၩ့ မွဲဘဲၫကယဲဆၧ ချဲၩ့လၧယဟိဝၩချဲၩ့ဆၧ လၧနၥံၪလၧခိၪလီၩ့ခိၪ, လၧ မ့ၪကျၩ, လၧဆၧအီၪကီၪ့အမုနံၩ လနံၩအထးဖၧၩ့ အ",
			"11": "<sup>11</sup> ၥိၭနီၪလီၫ.- ဆၧမၩအၥၭလၧအနံၩလံဆံၫအနၩလံဆံၫ ဖီၩ့ခွံၬတၭ, ယဟိဝၩဖ့ၪလၫ့ယၧၩ လၧလိးပၪနံၫဘံၪ့,",
			"12": "<sup>12</sup> ဆၧအုၩ့လၩ့အလိးပၪနီၪလီၫ.- တၭယဟိဝၩစံၭယၧၩ ဂဲထုၪ့ထဲၩ့လၩ့ခွံၬ လၧယီၩချဲၫ့ချဲၫ့ဘီၪး အဂဲးဘဲၫယီၩ နၡၩခမျၧးလၧနၥိၫ့ထၪ့ခွံၬ လၧအံဇံၭ အဖၧၩ့နီၪမၩ ဘၪၥၭလိၪယူၭအၥၭယူၭ, ကၠၪခွံၬယူၭအၥၭလၧဖၧၩ့ ၥၭလၧယမၪလူၬဝ့ၫနီၪ ချဲၫ့ချံၭယူၭ, တဲၩ့ယူၭဆၧဂၩ့ၥိၫ့ အၥၭလဒုၩ လၧအဂးယူၭ.",
			"13": "<sup>13</sup> ယဟိဝၩချဲၩ့ဆၧလၧယၧၩတၭစံၭဝ့ၫဒၪ, ယဒၪဘၪ ယူၭၦခမျၧးယီၩယူၭတၭ, ယိခွါ, မွဲဝ့ၫလၧၦလၧအခိၬ",
			"14": "<sup>14</sup> ဆီၪ့ဝ့ၫလဆၨၩနီၪလီၫ.- မၩဘူၭယၧၩလဂ့ၩ, တၭယ မိမၩဂၭဂီၩ့ခွံၬအဝ့ၫၥံၪ, ဒဲထူၭခွံၬအမံၩ့လၧမူၭခိၪအ ဖၫ့လၬတၭ, ယမိမၩနၧၩ လၧၦလဆၨၩဆီၪ့နဲၪ့, ဒဲအၪ နဲၪ့အဝ့ၫၥံၪနီၪဒံၭလီၫ.",
			"15": "<sup>15</sup> ယကၠၪယၥၭတၭ ယဂဲၫထဲၩ့လၩ့လၧခိၪလီၩ့ခိၪတၭ, ခိၪလီၩ့ခဲၩထၪ့လၧမ့ၪတၭ, ဆၧအုၩ့လၩ့အလိးပၪနံၫ",
			"16": "<sup>16</sup> ဘံၪ့အီၪဝ့ၫလၧယစူၪဖၧၩ့လီၫ.- ယယိဆၧတၭ, ယိခွါ, နၥံၪမၩမၪဘၪယူၭယဟိဝၩ နၥံၪအယွၩယူၭ, နၥံၪတဲၩ့ ယူၭချီဖိၪ, လၧအဘၪဆၧၥိၫ့ဝ့ၫ လၧနၥံၪအဂးယူၭး ဖၧၩ့ၥၭလၧယဟိဝၩ မၪလူၬနၥံၪနီၪ နၥံၪကၠၪခွံၬယူၭန",
			"17": "<sup>17</sup> ၥံၪအၥၭချဲၫ့ချံၭယူၭလီၫ.- ယမၩန့လိးပၪနံၫဘံၪ့တၭ, ယခွံၬၡိၭခွံၬဝ့ၫ လၧယစူၪဖၧၩ့တၭ, မၩထ့ဖၭခွံၬ လၧ",
			"18": "<sup>18</sup> နၥံၪအမ့ၬယၫလီၫ.- တၭယထိၪလၩ့ထံၩဖါယၥၭလၧ ယဟိဝၩအမ့ၬယၫ, ဘဲၫလၧအခၪ့ထံၭအၥိၭနီၪ, အနံၩ လံဆံၫ, ဒဲအနၩလံဆံၫ, ယအၪ့ဘၪကိၪအ့ၬ, ဒဲယအီၩ ဘၪထံၫဆ့အ့ၬ, အဂဲးဘဲၫယီၩ မွဲလၧနၥံၪအဆၧမၪလၧ နၥံၪမၩမၪဆၧ, လၧနၥံၪမၩဆၧအၧၩ့ လၧယဟိဝၩအ",
			"19": "<sup>19</sup> မ့ၬယၫတၭ, မၩၥၭထၪ့ဝ့ၫအကၠီၩ့နီၪလီၫ.- အဂဲးဘဲၫ ယီၩယၥၭမဲၪဆၧအၥၭထၪ့, ဒဲဆၧၥၭခိလူၬလၧယဟိ ဝၩၥၭထၪ့နၥံၪ ဘဲၫၥိၭအမိမၩဂၭဂီၩ့နၥံၪလီၫ. မွဲလါ နၫ့အဆၧၫ့အထီထီးနီၪ ယဟိဝၩခိၭနၪယလူဆ့လီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩ ၥၭထၪ့စအၫရၧၫ့ ထီးအမိမၩဂၭဂီၩ့ဝ့ၫတၭ, ယဘၩဆိၪဖၪန့စအၫရၧၫ့အဂး လၧအဆၧၫ့အထီထီး",
			"21": "<sup>21</sup> နီၪဆ့လီၫ.- ယမၩန့နၥံၪအဆၧဒဲၩဘၭ, ချီဖိၪလၧနၥံၪ တဲၩ့ဝ့ၫလဒုၩတၭ, ယဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪတၭ, ယ အၪ့ထီးဝ့ၫတၭ, ယဂူၬဝ့ၫဂ့ၩဂ့ၩထီးအပြံၩကဒံၩ, ထီး အကဲၪထၪ့ဆၧအမုၬတၭ, ယခွံၬၡိၭဝ့ၫလၧထံၫချိၬဖၧၩ့ လၧအဂဲၫလၩ့ယွၩဝ့ၫ လၧခိၪလီၩ့ခိၪလီၫ.",
			"22": "<sup>22</sup> တၭနၥံၪမၩၥၭထၪ့ယဟိဝၩ လၧတဘံရၫအဖၧၩ့, ဒဲလၧမၭစၫအဖၧၩ့, ဒဲလၧကံၭဘြိၫဟၭတဝၫ အဖၧၩ့",
			"23": "<sup>23</sup> လီၫ.- လၧယဟိဝၩ အၪ့မၧၫ့လၩ့နၥံၪ စဲၪ့ထၪ့ခွံၬလၧ ကၫဒ့ၭဘၫန့အၫနီၪ, စံၭဝ့ၫ, လ့ၩထၪ့မၩန့ခးလၧယဖ့ၪ လၫ့နၥံၪနီၪဘီၪး တၭနၥံၪပိၩ့ထၪ့ယဟိဝၩနၥံၪအယွၩ အဆၧမၪလူၬ, ဒဲလနဲၩဘၪဝ့ၫတၭ, လခိၭနၪဘၪအလူ",
			"24": "<sup>24</sup> လီၫ.- လၧမုလနံၩလၧယၥ့ၪယၫ နၥံၪလံၩလံၩခီးဘိၩ့ နဲၪ့ယီၩ နၥံၪမွဲၦလၧအပိၩ့ထၪ့ယဟိဝၩလီၫ.",
			"25": "<sup>25</sup> တၭယထိၪလၩ့ထံၩဖါယၥၭ လၧယဟိဝၩအမ့ၬ ယၫအနံၩလံဆံၫ, ဒဲအနၩလံဆံၫ,ဘဲၫယထိၪလၩ့ထံၩ ဖါယၥၭလၧအခၪ့ထံၭအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ",
			"26": "<sup>26</sup> ယဟိဝၩ စံၭလၧအမိမၩဂၭဂီၩ့နၥံၪလီၫ.- အခိးမွဲယ ဘၩဆိၪဖၪယဟိဝၩတၭ, ယစံၭ,ယဟိဝၩယွၩဧ့,မွဲန ထီးမၩဂၭဂီၩ့နၡၩခမျၧး, နဆၧန့ၥၫ,လၧနဎွ့ၩန့ထဲၩ့လၧ နဆၧဒိၪဆၧထီၫ, လၧနဒုၭစဲၪ့ထၪ့ခွံၬလၧအံဇံၭအဖၧၩ့",
			"27": "<sup>27</sup> လၧနစူၪဆီၪ့နီၪလဂ့ၩ.- နၪ့ထၪ့ထဲၩ့နခ့ၫနၡၩစအၫဘြ ဟၫ့, ဒဲစအံစၭ, ဒဲစယၫကူၭနီၪဆံၭ. ထီးယိၦခမျၧး ယီၩအဆၧကၪအဆၧအၧၩ့ဆၧၥၫ့, အဆၧဒဲၩထူၬဆၧ",
			"28": "<sup>28</sup> ဒဲၩဘၭလဂ့ၩ.- ၦခးဖိၪလၧနဒုၭစဲၪ့ထၪ့ခွံၬ ပၧၩလၧအ ကျၩလဖၪနီၪမိစံၭဘၪခိၬ, မွဲယဟိဝၩဒုၭလ့ၩနုၬအဝ့ၫ ၥံၪလၧခးဖၧၩ့ လၧအစံၭ လၧအမိဖ့ၪလၫ့ဝ့ၫၥ့ၪအ့ၬး မွဲ အၥၭဂဲၫ့အဝ့ၫၥံၪတၭ, ဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫဘဲၫၥိၭ အမိမၩ",
			"29": "<sup>29</sup> ၥံၫဝ့ၫလၧၡါမုနၧၫ့ဖၫနီၪလီၫ.- တၭမွဲဝ့ၫလၧၦၡၩခမျၧး ဒၪလ့ၬ, နဆၧန့ၥၫလၧနဒုၭစဲၪ့ထၪ့ခွံၬ လၧနစီၩ့ဒိၪနမၩ့ ဒိၪ, ဒဲလၧနစူၪယၩ့ထၪ့အၥၭ နီၪလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> အဆၧၫ့အထီထီးနီၪ ယဟိဝၩစံၭယၧၩ, တဲၩန့လိး ပၪနံၫဘံၪ့လၧနဂး ဘဲၫလၧအခၪ့ထံၭလဖၪအၥိၭတၭ, ဂဲၫထၪ့လၧယအီၪ လၧခိၪလီၩ့ခိၪတၭ, တဲၩ့တလၫၥံၪ့",
			"2": "<sup>2</sup> လဖျိၪ့လၧနဂးဆံၭ.- တၭဆၧချဲၩ့လၧအအီၪဝ့ၫ လၧလိး ပၪလၧအခၪ့ထံၭအလီၩ့ လၧနမၩထ့ဖၭခွံၬဝ့ၫနီၪ, ယမိ ကွ့ၭလၧလိးပၪအလီၩ့တၭ, နဘၪဒုၭနုၬဝ့ၫလၧအဖၧၩ့",
			"3": "<sup>3</sup> နီၪလီၫ.- တၭယတဲၩ့တလၫလဖျိၪ့ လၧၥံၪ့ၡံၭတၫ, ယ တဲၩန့လိးပၪနံၫဘံၪ့ ဘဲၫလၧအခၪ့ထံၭလဖၪ အၥိၭနီၪ တၭ, ယလ့ၩထၪ့လၧခိၪလီၩ့ခိၪ အီၪလၧလိးပၪနံၫဘံၪ့ ဘဲၫလၧအခၪ့ထံၭလဖၪအၥိၭနီၪတၭ, ယလ့ၩထၪ့လၧ ခိၪလီၩ့ခိၪအီၪလၧလိးပၪနံၫဘံၪ့နီၪ လၧယစူၪဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> တၭယွၩကွ့ၭဝ့ၫလၧလိးပၪအလီၩ့, ဘဲၫအကွ့ၭဆၧလၧ အခၪ့ထံၭအၥိၭ, ဆၧမၪလူၬဆံၫထံၪ, လၧယဟိဝၩချဲၩ့ ဆၧလၧနၥံၪ လၧခိၪလီၩ့ခိၪလၧမ့ၪကျၩ, လၧဆၧအီၪ ကီၪ့အမုလနံၩအထးဖၧၩ့ဂီၩ့တၭ, ယဟိဝၩဖ့ၪလၫ့လၧ",
			"5": "<sup>5</sup> ယစူၪဖၧၩ့လီၫ.- ယကၠၪယၥၭတၭ, ဂဲၫထဲၩ့လၩ့လၧခိၪ လီၩ့ခိၪဒဲဒုၭနုၬလိးပၪလၧတလၫ လၧယတဲၩ့ဝ့ၫနီၪအ ဖၧၩ့တၭ, အီၪဝ့ၫထီးနီၪ, ဘဲၫယဟိဝၩမၪလူၬယၧၩအ ၥိၭနီၪလီၫ.",
			"6": "<sup>6</sup> တၭၦအံၫစရ့လၭဖိၪ စဲၪ့ထၪ့ခွံၬဝ့ၫလၧဘံရီၭဘၪဆဲၫ့ လၧၦယၫကၫ့ဖိၪ ထီၩ့လၧမိၫစံရၫ, ထီးစအၫရၧၫ့ၥံၫဝ့ၫ အလး, ဒဲဘၪဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ ထီးနီၪတၭး အ ဖိၪခွၫစအံၫလအ့ဇၧၫ မၩၦလုဆၧအဆၧမၩလၧအ",
			"7": "<sup>7</sup> လးလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫ ထီးနီၪထီၩ့လၧဂၧၫဒဂိ ဒၫတၭ, လၧဂၧၫဒဂိဒၫနီၪထီၩ့လၧယီၭဘၪၥၫ, ခးလ ဘံၪ့အီၪလၧထံၫချိၬလဖၪလီၫ.",
			"8": "<sup>8</sup> အဆၧၫ့အထီထီးနီၪ ယဟိဝၩအီၪက့ၪလၩ့မဲၩၦလံ ဝဲၫဖိၪလဒီၪ့, ဘဲၫၥိၭအမိဆိၬယဟိဝၩ အဆၧအုၩ့လၩ့ အတလၫ, ဘဲၫၥိၭ အမိဆၧၫ့ထုၪ့ လၧယဟိဝၩ အမ့ၬ ယၫ, ဒဲဘဲၫၥိၭအမိမၩ အခ့ၫအၡၩအဆၧမၩတၭ, ဘဲၫ ၥိၭအမိဆိၪဂ့ၩဆၧလၧအမံၩ့, ထီးမုဆၫလနံၩယီၩ",
			"9": "<sup>9</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ စလံဝဲၫန့ဘၪအလးလၧဆၧ န့ၥၫ လၧအထၧၫ့ဖုဝဲၥံၪအၥိၭအ့ၬ. ယဟိဝၩ မွဲအဝ့ၫ ဒၪအဆၧန့ၥၫ, ဘဲၫယဟိဝၩနယွၩ ချဲၩ့ဝဲၩဝ့ၫအၥိၭနီၪ လီၫ.",
			"10": "<sup>10</sup> ယအီၪလၧခိၪလီၩ့ခိၪ, မၩအၥၭဘဲၫလၧအခၪ့ထံၭ လဘျၩ့အၥိၭနီၪ, အနံၩလံဆံၫ, ဒဲအနၩလံဆံၫတၭ, ယဟိဝၩခိၭနၪယလူ အဆၧၫ့အထီ ထီးနီၪဆ့လီၫ. ယ",
			"11": "<sup>11</sup> ဟိဝၩမၩဂၭဂီၩ့နၧၩအၥၭအီၪအ့ၬ.- တၭယဟိဝၩစံၭ ယၧၩ, ဂဲထုၪ့လ့ၩဆၧလၧ ၦခမျၧးအမ့ၬယၫ ဘဲၫၥိၭအ ဝ့ၫၥံၪမိလ့ၩနုၬမၩန့ ခးလဘံၪ့နီၪ လၧယဆိၪလၩ့ယၥၭ လၧအဖါလဖၪ လၧယမိဖ့ၪလၫ့အဝ့ၫၥံၪလီၫ.",
			"12": "<sup>12</sup> တၭဘိၩ့နဲၪ့ယီၩ အံၫစရ့လၭဧ့, ဘဲၫၥိၭနမိၥၭမဲၪ ယဟိဝၩနယွၩ, ဘဲၫၥိၭနမိဖိၬအဖၧၩ့ၥၭ ထီးအလူၬ, ဒဲအဲၪဝ့ၫ, ဒဲမၩယဟိဝၩနယွၩအဆၧ လၧနၥၭထၧၫ့ဖျိၪ့",
			"13": "<sup>13</sup> ယၫ, ဒဲနၥၭၡီၩ့ထီးအလူၬ,- ဘဲၫၥိၭနမိထီးန့ ယဟိဝၩ အဆၧမၪလူၬ, ဒဲအၥနိၫလဖၪ, လၧယမၪလူၬနၧၩလၧ ဆၧဂ့ၩအဂး လၧမုဆၫလနံၩယီၩး အ့ၪလမွဲဘၪဆၧ နီၪတၭ, မွဲယဟိဝၩနယွၩ အၪ့ကံၩ့ဆၧလၧနၧၩလၧဆၧ",
			"14": "<sup>14</sup> နီၪလမံၩ့လဲၪ.- ယိခွါ, မူၭခိၪဒဲအမူၭခိၪ အမူၭခိၪနီၪ, မွဲ ယဟိဝၩနယွၩအဆၧး ဂၪ့ခိၪဒဲကယဲဆၧအီၪလၧအ",
			"15": "<sup>15</sup> ချိၫ့ဆ့လီၫ.- တၭဘၪယဟိဝၩအၥၭ လၧအအဲၪနဖါလ ဖၪတၭ, ရွံန့အချံၫအၥၪလၧအလးခဲၫ့, နၥံၪဝ့ၫဒၪ, လၧၦ ဆၨၩထီးအလူၬအဖၫ့ခိၪ, ဘဲၫလၧမုဆၫလနံၩယီၩအ",
			"16": "<sup>16</sup> ၥိၭနီၪလီၫ.- အခိးမွဲကူၭတရံၭနၥံၪအၥၭ အခိၪဖံၭနီၪ",
			"17": "<sup>17</sup> ဆံၭး အီၪလၧၩ့လၧနၥံၪအခိၬဆီၪ့လဂ့ၩ.- အဂဲးဘဲၫ ယီၩယဟိဝၩ နၥံၪအယွၩနီၪ မွဲယွၩလဖၪအယွၩ, ဒဲက ဆါလဖၪအကဆါ, ယွၩဖၭဒိၪလၧအအီၪ လၧအစီၩ့ အမၩ့, ဒဲဆၧၥၭမဲၪဖၭဒိၪအလး, လၧအလယိမ့ၬဘၪၦ",
			"18": "<sup>18</sup> ၡၩ, ဒဲမၩန့လၬဆီၪ့နီၪဆ့အ့ၬ.- မွဲအမၩဝ့ၫလၧဆၧစ့ၩ ရၫ့ၦဖိၪဎွ့ၪ, ဒဲၦမုၪမဲၫ, ဒဲအဲၪၦလခီၫဘၩ့မုးဖိၪတၭ, ဖ့ၪ",
			"19": "<sup>19</sup> လၫ့ဝ့ၫလၧဆၧအၪ့ဆၧအီၩ, ဒဲအကီၩ့အၥိၭလီၫ.- အ ခိးမွဲနၥံၪဝ့ၫဒၪယီၩ အဲၪၦလခီၫဘၩ့မုးဖိၪဆံၭး အဂဲး ဘဲၫယီၩ နၥံၪမွဲၦလခီၫဘၩ့မုးဖိၪ လၧအံဇံၭအဖၧၩ့",
			"20": "<sup>20</sup> လီၫ.- နဘၪၥၭမဲၪယဟိဝၩနယွၩး နမိဘၪမၩအဝ့ၫဒၪ အဆၧ, ဒဲနမိဘၪဖီၪ့ထၬအဝ့ၫဒၪ ဒဲဆိၪလၩ့နၥၭလၧအ",
			"21": "<sup>21</sup> မံၩ့လီၫ.- အဝ့ၫနီၪမွဲဆၧစံၭထၪ့အၪ့အူၭအလး, ဒဲအဝ့ၫ ဒၪနီၪ မွဲနယွၩ လၧအမၩယူၭဆၧ အဒိၪအထီၫလဖၪ ယီၩ, ဒဲဆၧၥၭမဲၪဖၭဒိၪအလးလဖၪ လၧနဂးလၧနဒၪ",
			"22": "<sup>22</sup> ဘၪယူၭလၧနမ့ၬၥၪယူၭလီၫ.- နဖါလဖၪလ့ၩလၩ့လၧ အံဇံၭအဖၧၩ့, အီၪၦၡၩနွ့ၫဆံၫတၭး ဘိၩ့နဲၪ့ယီၩယ ဟိဝၩနယွၩ မၩအၪထၪ့ယူၭနၧၩ လၧအအၪဘဲၫၡၪၥံၪ ဖီၫၥံၪလၧမူၭခိၪ အၥိၭနီၪလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭဘဲၫနီၪတၭ နဘၪအဲၪယဟိဝၩနယွၩ ဒဲထီးန့အဆၧယိနီၪ, ဒဲအၥနိၫလဖၪ, ဒဲအဆၧစ့ၩရၫ့ လဖၪ, ဒဲအဆၧမၪလူၬနီၪ ကိၭမုနံၩမုနၩဒ့ၭလီၫ.",
			"2": "<sup>2</sup> ၥ့ၪယၫနၥံၪဝ့ၫ လၧမုဆၫလနံၩယီၩဆံၭ, အဂဲးဘဲၫ ယီၩမွဲယလချဲၩ့ဘၪနၥံၪအဖိၪအလံၩ လၧအလၥ့ၪယၫ ဘၪ, ဒဲလဒၪဘၪယဟိဝၩနၥံၪအယွၩ အၪ့ၥီၪ့ဆၧ, အ",
			"3": "<sup>3</sup> ဆၧဒိၪဆၧထီၫ, အစူၪဆီၪ့ဒဲအစူၪယၩ့ထၪ့အၥၭ,- ဒဲ အဆၧလၩ့လၭလဖၪ, ဒဲအဆၧမၩလၧ အမၩဝ့ၫလၧ အံဇံၭအၥၭခံဖၧၩ့ လၧအံဇံၭအစဎွၩ ဖၫရိၫ, ဒဲအခး",
			"4": "<sup>4</sup> ထၧၫ့ဘံၪ့ယၫ,- ဒဲဆၧလၧအမၩအံဇံၭအၥုၭမုခမျၧး, အကၥ့ၪလဖၪ, ဒဲအလဲၪ့ၥုၭလဖၪ, ဒဲလၧအဒုၭလုၬဘံၭ မၫဆမံၭဝီၩ အထံၫလၧအလီၩ့ လၧအဝ့ၫၥံၪလီၩ့ဆီး နၥံၪအဘိၩ့ဘၭတၭး ယဟိဝၩမၩဂၭဂီၩ့ခွံၬ အဝ့ၫၥံၪ",
			"5": "<sup>5</sup> ထီးမုဆၫလနံၩယီၩ,- ဒဲဆၧလၧအမၩနၥံၪလၧၡါမု",
			"6": "<sup>6</sup> နၧၫ့ဖၫထီးနၥံၪဂဲၫထီၩ့လၧအလးယီၩတၭ,- ဆၧလၧ အမၩစရုဘံၫ့ အဖိၪခွၫ စအလဲအၭ အဖိၪခွၫ လဖၪ, စဒၫၥၫ့, ဒဲစအဘဲရၫ့ လၧဂၪ့ခိၪအၩ့ထၪ့အနိၭ, ဒဲအၪ့ ယုလၩ့ခွံၬဝ့ၫ, ဒဲအဂံၪ့ဖိၪ, ဒဲအတဲၩလဖၪ, ဒဲကယဲအ ဆၧဖိၪဆၧလံၩအီၪလၧအစူၪဖၧၩ့ ထီးအလူၬ အကျၩ",
			"7": "<sup>7</sup> နီၪလီၫ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ နၥံၪအမ့ၬၥၪဒၪဘၪယူၭ ကယဲယဟိဝၩ မၩဆၧအဒိၪ လၧအမၩဝ့ၫထီးအလူၬ လီၫ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ နၥံၪဘၪထီးန့ကယဲဆၧမၪ လူၬ လၧယမၪလူၬနၥံၪ လၧမုဆၫလနံၩယီၩ, ဘဲၫၥိၭန ၥံၪအဂဲးအဘၭမိဆီၪ့ထၪ့, ဒဲနၥံၪမိလ့ၩနုၬမၩန့ခးထီး",
			"9": "<sup>9</sup> နၥံၪလ့ၩနုၬဘဲၫၥိၭနၥံၪမိမၩန့ဝ့ၫး- ဒဲဘဲၫၥိၭနၥံၪမိမၩ အၪထၪ့နၥံၪအမုနံၩလဖၪ လၧထံၫၥံၪခးၥံၪအဖၧၩ့, လၧယဟိဝၩဆိၪလၩ့အၥၭ လၧနၥံၪအဖါလဖၪ လၧ အမိဖ့ၪလၫ့ဝ့ၫလၧ အဝ့ၫၥံၪအချံၫအၥၪ, ခးလဘံၪ့လၧ အယွၩလၩ့ဝ့ၫ လၧဆၧနူထံၫဒဲန့ၫစၩ့လီၫ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩ ထံၫၥံၪခးၥံၪ လၧနလ့ၩနုၬဘဲၫၥိၭနမိ မၩန့ဝ့ၫ, လမွဲဘၪဘဲၫခးအံဇံၭလၧနၥံၪစဲၪ့ထၪ့ခွံၬလၧ အဖၧၩ့အၥိၭ, ထီးနဎွံၪနဆၧချံၫတၭ, မၩဘၪစီၪဝ့ၫလၧ",
			"11": "<sup>11</sup> နခၪ့ဘဲၫနၪ့ၥံၪမံၩ့ၥံၪ အကျိၭအၥိၭနီၪအ့ၬ.- အ့ၪမွဲထံၫ ၥံၪခးၥံၪလၧနလ့ၩနုၬ ဘဲၫၥိၭနမိမၩန့ဝ့ၫလဘံၪ့နီၪ, မွဲ ခးလဘံၪ့အီၪလၧခိၪလီၩ့ထိၩ့ချိၬ, ဒဲခိၪလီၩ့ဆူၭလီၫ.",
			"12": "<sup>12</sup> မွဲအအီၩထံၫလၧမူၭခိၪ အဆၧဆၧၩ့လၩ့လီၫ.- ထံၫၥံၪ ခးၥံၪလၧယဟိဝၩနယွၩ ယိထဲၩ့ခွါထဲၩ့ဝ့ၫလီၫ. ယဟိ ဝၩနယွၩအမ့ၬၥၪလဖၪ ယိဝ့ၫလထံၪဎးလဘီၩ့ဎးလၧ နံၪ့အခၪ့ထံၭထီၩ့လၧနံၪ့အထုၬနီၪလီၫ.",
			"13": "<sup>13</sup> တၭဆၧမိမၩအၥၭ လၧနၥံၪအ့ၪခိၭနၪတၡါ ယဆၧ မၪလူၬလၧယမၪလူၬနၥံၪ လၧမုဆၫလနံၩယီၩ, လၧန ၥံၪမိဘၪအဲၪယဟိဝၩ နၥံၪအယွၩ, ဒဲမၩအဆၧလၧန ၥံၪအၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧနၥံၪအၥၭၡီၩ့ထီးအလူၬ",
			"14": "<sup>14</sup> တၭ,- ယမိဖ့ၪလၫ့နၥံၪ အထံၫအခးအဆၧဆၧၩ့လၧအ ဆၧၫ့အထီဒၪဝ့ၫ, ဆၧဆၧၩ့လၧအဒုၭမဲၪထၪ့ဆၧ, ဒဲ ဆၧဆၧၩ့လၧအဒုၭၥၪထၪ့ဆၧ, ဘဲၫၥိၭနမိအၪ့ထုၫ့ကီၪ့",
			"15": "<sup>15</sup> နဘုၪၥံၪဂူၫၥံၪ, ဒဲစဘံၭၥၪ, ဒဲနၥိၪလီၫ.- တၭယမိဖ့ၪ လၫ့နၪ့ၥံၪမံၩ့ၥံၪ လၧနဆၧပျၩ့ဖၧၩ့ လၧနဆၧဖိၪဆၧဎါ အဂးဘဲၫၥိၭနမိအၪ့ဆၧတၭ ဘျဲၩအၪ့လီၫ.",
			"16": "<sup>16</sup> ထီးလၩ့နၥံၪအၥၭ ဘဲၫၥိၭနၥံၪအၥၭ ထီးဘၪဆၧ အၪ့လီၫဝ့ၫ, ဒဲနၥံၪကၠၪပဲၩခွံၬနၥံၪအၥၭလဂ့ၩး ဒဲနၥံၪ ထီးမၩယွၩဂူၫဂၩလဖၪအဆၧ, ဒဲဘၩထၪ့ဝ့ၫနီၪလဂ့ၩ,",
			"17": "<sup>17</sup> အ့ၪမွဲဘဲၫနီၪတၭ ယဟိဝၩ အၥၭမိထၪ့ဘၪနၥံၪတၭ, မိကၭဘံၭထၬမူၭခိၪအတရၫ့ ဘဲၫၥိၭဆၧထီးဂဲၫဆၧၩ့ လၩ့ဘၪလဂ့ၩး ထံၫၥံၪခးၥံၪ ထီးၥၪထၪ့ အဆၧၥၪလ ဂ့ၩး တၭနၥံၪမိဂၭဂီၩ့ဘၪခိၬချဲၫ့ချံၭ လၧထံၫၥံၪခးၥံၪ အဂ့ၩအဖၧၩ့ လၧယဟိဝၩဖ့ၪလၫ့နၥံၪလီၫ.",
			"18": "<sup>18</sup> အခိးမွဲနၥံၪ ဘၪအီၪက့ၪကီၪ့ ယဆၧချဲၩ့ယီၩလၧ နၥံၪအၥၭဖၧၩ့, ဒဲနၥံၪအၥၭၡီၩ့အဖၧၩ့ ဒဲခဲးနၥံၪအစူၪ လၧအဝ့ၫၥံၪ ဘဲၫၥိၭအမိကဲၪထၪ့ ဘဲၫကွ့ၭနဲၪ့ဆၧအ",
			"19": "<sup>19</sup> ၥိၭ, လၧနၥံၪအမ့ၬၥၪအဘိၩ့ဆၧၩ့နီၪလီၫ.- တၭနၥံၪ ဘၪၥီၪ့လိၪဝ့ၫ လၧနၥံၪအဖိၪအလံၩ, ထီးနဆၧၫ့နၩ့လၧ နဂံၪ့ဖၧၩ့, ဒဲထီးနလ့ၩဆၧလၧဖၧၩ့ၥၭ, ဒဲထီးနမံၫနၩ့, ဒဲထီးနဂဲထုၪ့တၭ, နမိဘၪချဲၩ့ဆၧလၧ အဂဲးအကၠီၪ့နီၪ",
			"20": "<sup>20</sup> လီၫ.- တၭနမိဘၪကွ့ၭအဝ့ၫၥံၪ လၧနဂံၪ့အတရၫ့ထုၪ့",
			"21": "<sup>21</sup> အလီၩ့, ဒဲလၧနတရၫ့အလီၩ့,- ဘဲၫၥိၭနၥံၪအမုနံၩလ ဖၪ, ဒဲနၥံၪအဖိၪအလံၩအမုနံၩလဖၪ လၧထံၫၥံၪခးၥံၪ အဖၧၩ့လၧယဟိဝၩ ဆိၪလၩ့အၥၭ လၧနၥံၪအဖါလ ဖၪလၧအမိဖ့ၪလၫ့ဝ့ၫနီၪ မိအၪထၪ့, ဘဲၫမူၭခိၪအမုနံၩ လဖၪလၧဂၪ့ခိၪအဖၫ့ခိၪအၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ နၥံၪအ့ၪထီးန့တၡါ ဆၧမၪလူၬယီၩ ထီးအလူၬ လၧနၥံၪမိမၩဝ့ၫ, လၧနၥံၪမိဘၪအဲၪယဟိ ဝၩနၥံၪအယွၩ, လၧနၥံၪ မိဘၪဖိၬအဖၧၩ့ၥၭ ထီးအ",
			"23": "<sup>23</sup> လူၬ, ဒဲဖီၪ့ထၬအဝ့ၫဒၪတၭး- ထီးနီၪလဖၧၫ့ယဟိဝၩ မိနၫ့ထၪ့ခွံၬ ၦအဆၨၩထီးအလူၬနီၪ လၧနၥံၪအမ့ၬ ယၫတၭ, နၥံၪမိမၩန့ၦဆၨၩလဖၪ ဒိၪနဲၪ့ဆီၪ့နဲၪ့နၥံၪ",
			"24": "<sup>24</sup> အနၫ့ဆါဒၪနၥံၪဝ့ၫလီၫ.- ကယဲဆၧအလးလၧနၥံၪအ ခၪ့ယၫၥၭယဲးလၩ့နီၪ မိကဲၪထၪ့နၥံၪအဆၧလီၫ. လၧ ၡါမုနၧၫ့ဖၫ, ဒဲလ့ၭဘနၧၫ့, လၧထံၫမိၡါ, ထံၫမိၡါယုၫ ဖ့တံၫ, ဒဲဖိးလၧမၫဆမံၭလၧအထုၬနီၪ, နၥံၪအခးအ",
			"25": "<sup>25</sup> နဲၩ့ထံၭလဖၪမိအီၪဘၪလီၫ.- ၦၡၩဆၧၫ့ထုၪ့ဘၪလၧ နၥံၪအမ့ၬယၫ ၥ့ၪနးဂၩအ့ၬး ယဟိဝၩနၥံၪအယွၩမိ အီၪက့ၪဆၧၥၭမဲၪနၥံၪ, ဒဲမိအီၪက့ၪနၥံၪလၧဆၧၥၭမဲၪ အလးလၧကယဲခးအလး လၧနၥံၪမိယဲးဝ့ၫ လစီၪ့လါ လါနီၪ, ဘဲၫအစံၭနၥံၪအၥိၭနီၪလီၫ.",
			"26": "<sup>26</sup> ယိခွါ, လၧမုဆၫလနံၩယီၩ, ယအီၪက့ၪဆၧဆိၪဂ့ၩ, ဒဲဆၧဆိၪအၧၩ့ လၧနၥံၪအမ့ၬယၫလီၫ.",
			"27": "<sup>27</sup> နၥံၪအ့ၪခိၭနၪ ယဟိဝၩနၥံၪအယွၩ အဆၧမၪလူၬ လဖၪလၧယမၪလူၬနၥံၪ လၧမုဆၫလနံၩယီၩတၭး မွဲ",
			"28": "<sup>28</sup> ဆၧဆိၪဂ့ၩလီၫ.- နၥံၪအ့ၪလခိၭနၪဘၪယဟိဝၩနၥံၪ အယွၩအဆၧမၪလူၬလဖၪတၭ, အ့ၪကၠၪခွံၬ လၧဖၧၩ့ ၥၭလၧယမၪလူၬနၥံၪ လၧမုဆၫလနံၩယီၩ, ဘဲၫၥိၭနၥံၪ မိလ့ၩဖိၬယွၩအဂူၫဂၩလဖၪ လၧနၥံၪလၥ့ၪယၫဘၪဝ့ၫ အခဲၫ့တၭ, မွဲဆၧဆိၪအၧၩ့လီၫ.",
			"29": "<sup>29</sup> ထီးယဟိဝၩနယွၩ အ့ၪဒုၭလ့ၩနုၬနၧၩ လၧထံၫၥံၪခး ၥံၪအဖၧၩ့ လၧနလ့ၩမၩန့ဝ့ၫတၭ, ဆၧမိမၩအၥၭလၧ နမိဘၪအီၪက့ၪဆၧဆိၪဂ့ၩ လၧခိၪလီၩ့ဂ့ၫရဇံၫ့အလီၩ့ ဒဲဆၧဆိၪအၧၩ့ လၧခိၪလီၩ့အံဘလၭ အလီၩ့နီၪလီၫ.",
			"30": "<sup>30</sup> အဝ့ၫၥံၪ အီၪလၧထံၫယီၫဒၫ့ဝါလခီၫအဖၧၩ့ၥၭ ထီးမု လၩ့နုၬလၧၦကၫနအၫ့ဖိၪ အခးဖၧၩ့, လၧအအီၪလၧ ဆၧပျၩ့ဖၧၩ့, လၧဂံလဂၫလၭအမ့ၬယၫ ထီးမိရံၫအၥံၪ့",
			"31": "<sup>31</sup> ထိၭဖၫနီၪ, လမွဲဘၪဧၪ.- အဂဲးဘဲၫယီၩနၥံၪမိခၫ့ဂၬ ယီၫဒၫ့, ဘဲၫၥိၭနၥံၪ မိလ့ၩနုၬမၩန့ ခးလၧယဟိဝၩ နၥံၪအယွၩဖ့ၪလၫ့နၥံၪတၭ, နၥံၪမိမၩန့ဝ့ၫ, ဒဲအီၪလၧ",
			"32": "<sup>32</sup> အဖၧၩ့လီၫ.- တၭနၥံၪဘၪထီးလၩ့နၥံၪအၥၭ ဘဲၫၥိၭ နၥံၪမိထီးန့ၥနိၫလဖၪ, ဒဲဆၧစ့ၩရၫ့လဖၪ လၧယအီၪ က့ၪလၧနၥံၪအမ့ၬယၫ လၧမုလနံၩယီၩလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> အယီၩမွဲၥနိၫလဖၪ, ဒဲဆၧစ့ၩရၫ့လဖၪလၧနၥံၪမိဘၪ ထီးလၩ့နၥံၪအၥၭ ဘဲၫၥိၭနၥံၪမိဘၪမၩဝ့ၫ လၧထံၫၥံၪ ခးၥံၪအဖၧၩ့, လၧယဟိဝၩနၥံၪအဖါလဖၪအယွၩ ဖ့ၪ လၫ့ဝ့ၫလၧနၧၩ ဘဲၫၥိၭနၥံၪမိထီးန့ဝ့ၫ လၧနၥံၪအီၪဝ့ၫ",
			"2": "<sup>2</sup> လၧဂၪ့ခိၪချိၫ့ယီၩ ကိၭမုနံၩမုနၩဒ့ၭနီၪလီၫ.- နၥံၪဘၪ မၩဂၭဂီၩ့ ကယဲအလးထီးၦဆၨၩ လၧနၥံၪမိမၩန့ဝ့ၫ လဖၪမၩအဝ့ၫၥံၪအယွၩအဆၧမၩ, လၧခိၪလီၩ့ထီၫအ လီၩ့, ဒဲလၧဆၧစီၩ့ခိၪအလီၩ့, ဒဲလၧကယဲၥံၪ့ၥံၫ့ဆ့ၬအ",
			"3": "<sup>3</sup> ဖၫ့လၬလီၫ.- တၭနၥံၪဘၪမၩဂၭဂီၩ့ခွံၬ အဆၧလုလး လဖၪ, ဒဲမၩခါခွံၬအထုၪ့လဖၪ, ဒဲဆူၭထၪ့ခွံၬအၡ့ရိၫ လဖၪလၧမ့ၪ, ဒဲခူၬခွံၬအယွၩလဖၪ အဆၧဂၩ့စိၭဖျၩအ ၥၭတၭမၩဂၭဂီၩ့ခွံၬအမံၩ့ လၧအလးထီးနီၪလီၫ.",
			"4": "<sup>4</sup> အ့ၪမွဲယဟိဝၩနၥံၪအယွၩနီၪ နၥံၪမၩဘၪဝ့ၫဘဲၫနီၪ",
			"5": "<sup>5</sup> ၥိၭအ့ၬ.- အ့ၪမွဲထီးဒၪအလး လၧယဟိဝၩ နၥံၪအ ယွၩမိရွံန့ဝ့ၫ လၧနၥံၪအဒီၪ့လဖၪ ထီးအလူၬအကျၩ, ဘဲၫၥိၭအမိအီၪက့ၪလၩ့ အမံၩ့ထီးနီၪ, နၥံၪဘၪအၪ့",
			"6": "<sup>6</sup> ဎၬ, ဒဲနဘၪဂဲၫထီၩ့လၧအလး လၧအအီၪဝ့ၫနီၪ,- ဒဲနၥံၪ ဘၪဂဲၫဆိၬနၥံၪအဆၧလုမ့ၪလဖၪ, ဒဲနၥံၪအဆၧလုလ ဖၪ, ဒဲနၥံၪအဆၧဆံၫပိၩ့လပိၩ့, ဒဲဆၧမၩဘိၪ့ဆိၬထၪ့ ဝံဝါဝ့ၫ လၧနၥံၪအစူၪ, ဒဲနၥံၪအဆၧဆိၪလၩ့ နၥံၪအ ၥၭ, ဒဲနၥံၪအဆၧမၩဘိၪ့ဒၪဆၧ, ဒဲနၥံၪအချီအဒီၪ့အ ဖိၪဝဲၡါလဖၪ, ဒဲနၥံၪအၥိၪအဘ့ၪအဖိၪဝဲၡါလဖၪထီး",
			"7": "<sup>7</sup> နီၪလီၫ.- နၥံၪဘၪအၪ့ဆၧထီးနီၪ လၧယဟိဝၩနၥံၪ အယွၩအမ့ၬယၫတၭ, ကယဲဆၧလၧနၥံၪအီၪက့ၪနၥံၪ အစူၪလၧအလီၩ့နီၪ နၥံၪမိၥၭထိၬ လၧအဖၧၩ့, နၥံၪဝ့ၫ ဒၪ, ဒဲနၥံၪအၡၩဂံၪ့ဖိၪလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩန ယွၩဆိၪဂ့ၩယူၭနၧၩယူၭလီၫ.",
			"8": "<sup>8</sup> ဘဲၫကယဲဆၧလၧပမၩထီးယီၩ လၧမုဆၫလနံၩယီၩ အၥိၭနီၪ, လဂၩထီးဒၪဆၧအတီၩ လၧအမ့ၬၥၪဒၪဝ့ၫ လဂၩထီးဒၪဆၧအတီၩ လၧအမ့ၬၥၪဒၪဝ့ၫနီၪ နၥံၪမၩ",
			"9": "<sup>9</sup> ဘၪအ့ၬ.- အဂဲးဘဲၫယီၩ နၥံၪထီၩ့ဒံၭလၧဆၧအီၪပွံၭ, ဒဲဆၧန့ၥၫ လၧယဟိဝၩနၥံၪအယွၩ ဖ့ၪလၫ့နၥံၪနီၪ",
			"10": "<sup>10</sup> အ့ၬ.- ထီးနၥံၪခၫ့ဂၬထံၫယီၫဒၫ့တၭ, နၥံၪအီၪလၧထံၫ ၥံၪခးၥံၪအဖၧၩ့, လၧယဟိဝၩနၥံၪအယွၩ ဖ့ၪလၫ့နၥံၪ, ဘဲၫၥိၭနၥံၪမိန့ဘၪ, ဒဲဒုၭအီၪပွံၭနၥံၪ လၧနၥံၪအဒုၪအ ဒၩအီၪဝၬဖီၩ့ဝ့ၫ ထီးအလူၬတၭ, နၥံၪအီၪဂုးခၧၫ့တၭ,",
			"11": "<sup>11</sup> ဆၧအလးမိဘၪအီၪလၧယဟိဝၩ နၥံၪအယွၩ မိရွံန့ ဝ့ၫ, ဘဲၫၥိၭအမိဒုၭအီၪအမံၩ့ ထီးနီၪလီၫ. နၥံၪမိဘၪဂဲၫ ဆိၬကယဲဆၧလၧယမၪလူၬနၥံၪ, နၥံၪအဆၧလုမ့ၪလ ဖၪ, နၥံၪအဆၧလုလဖၪ, နၥံၪအဆၧဆံၫပိၩ့လပိၩ့, ဒဲ ဆၧမၩဘိၪ့ဆိၬထၪ့ဝံဝါဝ့ၫ လၧနၥံၪအစူၪ, ဒဲကယဲနၥံၪ မၩဘိၪ့ဆၧရွံန့ဝ့ၫ လၧအဘၪဆဲၫ့လၧဆၧဆိၪလၩ့လၧ နၥံၪဆိၪလၩ့ နၥံၪအၥၭ လၧယဟိဝၩ အဂးထီးနီၪ",
			"12": "<sup>12</sup> လီၫ.- တၭနၥံၪမိၥၭထိၬ လၧယဟိဝၩ နၥံၪအယွၩအ မ့ၬယၫ, နၥံၪဝ့ၫ, ဒဲနၥံၪအဖိၪခွၫၥံၪ, ဒဲနၥံၪအဖိၪမုၪၥံၪ, ဒဲနၥံၪအဎီးခွၫၥံၪ, ဒဲနၥံၪအဎီးမုၪၥံၪ, ဒဲၦလံဝဲၫဖိၪအီၪ ဝ့ၫလၧနၥံၪအတရၫ့အဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫ ဒၪအလး ဒဲအဆၧန့ၥၫလအီၪဘၪ လၧနၥံၪအၥိၭလီၫ.",
			"13": "<sup>13</sup> ထီးလၩ့နၥၭဘဲၫၥိၭနထီးလုထၪ့ နဆၧလုမ့ၪလၧက",
			"14": "<sup>14</sup> ယဲဆၧအလးလစီၪ့စီၪ့ လၧနဒၪဘၪဝ့ၫနီၪလဂ့ၩ,- အ့ၪ မွဲအလးလၧယဟိဝၩနယွၩ ရွံန့ဝ့ၫလၧနၡၩအဒီၪ့လဖၪ လဒီၪ့အဖၧၩ့နီၪ, နမိဘၪလုထၪ့နဆၧလုမ့ၪထီးနီၪ, ဒဲန မိဘၪမၩ ကယဲဆၧလၧယမၪလူၬနၧၩ ထီးအလူၬထီး နီၪလီၫ.",
			"15": "<sup>15</sup> မွဲလါနၫ့နမိမၩၥံၫဘၪ, ဒဲအၪ့ဘၪ ဆၧယၪထီးနၥၭ ဆိၫ့န့ဘၪလမံၩ့လါလါ လၧနတရၫ့ထီးအလူၬအဖၧၩ့, ဘဲၫယဟိဝၩ နယွၩအဆၧဆိၪဂ့ၩနၧၩအၥိၭနီၪ, ၦလ ဆံၫ့ဘၪ, ဒဲၦအဆံၫ့လဖၪနီၪမိအၪ့ဘၪဝ့ၫ, ဘဲၫခံၫဘၩ့",
			"16": "<sup>16</sup> အၥိၭ, ဒဲဘဲၫစဎဲၩအၥိၭနီၪလီၫ.- အ့ၪမွဲအၥွံၪလမံၩ့ ထီးအၪ့လဂ့ၩ, နၥံၪဘၪလူၫလၩ့ခွံၬဝ့ၫ လၧဂၪ့ခိၪချိၫ့ ဘဲၫထံၫအၥိၭနီၪလီၫ.",
			"17": "<sup>17</sup> နဘုၪဒဲနစဘံၭထံၫ, ဒဲနၥိၪအဆၧဆံၫပိၩ့လပိၩ့မွဲဂ့ၩ, ဒဲနချီဖိၪအဝဲၡါမွဲဂ့ၩ, နၥိၪနဘ့ၪအဝဲၡါမွဲဂ့ၩ, နဆၧမၩ ဘိၪ့ဘၪဆဲၫ့လၧဆၧဆိၪလၩ့ လၧနဆိၪလၩ့နၥၭ လမံၩ့ မံၩ့မွဲဂ့ၩ, နမၩဘိၪ့ဒၪဆၧမွဲဂ့ၩ, နမၩဘိၪ့ဆိၬထၪ့ဝံဝါ ဝ့ၫလၧနစူၪမွဲဂ့ၩ, ထီးအၪ့လၧနတရၫ့အဖၧၩ့လဂ့ၩ.",
			"18": "<sup>18</sup> အ့ၪမွဲနဘၪအၪ့ဝ့ၫ လၧယဟိဝၩနယွၩအမ့ၬယၫ, ထီး အလးလၧယဟိဝၩနယွၩမိရွံန့ဝ့ၫ, နဝ့ၫဒၪ, ဒဲနဖိၪခွၫ, ဒဲနဖိၪမုၪ, ဒဲနဎီးခွၫ, ဒဲနဎီးမုၪ, ဒဲၦလံဝဲၫဖိၪလၧအအီၪ ဝ့ၫလၧနတရၫ့အဖၧၩ့လီၫ. တၭကယဲဆၧလၧနအီၪ က့ၪနစူၪလၧအလီၩ့နီၪ, နမိၥၭထိၬလၧအဖၧၩ့ လၧယ",
			"19": "<sup>19</sup> ဟိဝၩနယွၩအမ့ၬယၫလီၫ.- လဆိၩဒၪနၥၭလၧဂၪ့ခိၪ ချိၫ့အဘိၩ့ဘၭနီၪ ထီးလၩ့နၥၭဘဲၫၥိၭ နထီးစဲၪ့ဒၪၦလံ ဝဲၫဖိၪနးဖၧၫ့လဂ့ၩ.",
			"20": "<sup>20</sup> ထီးယဟိဝၩနယွၩမိမၩလဲထၪ့နခးအနဲၩ့, ဘဲၫအချဲၩ့ ဝဲၩဆၧလၧနၧၩအၥိၭနီၪတၭး နစံၭ, ယမိအၪ့ဆၧယၪ တၭ, မွဲလၧနဆိၫ့အၪ့ဘၪဆၧယၪအကၠီၩ့နီၪ, နမိအၪ့ ဘၪဆၧယၪထီးဒၪ နမိအၪ့ဘၪ နၥၭလမံၩ့မံၩ့လီၫ.",
			"21": "<sup>21</sup> ထီးဆၧအလး လၧယဟိဝၩနယွၩရွံန့ လၧအမိအီၪက့ၪ အမံၩ့ထီးနီၪ အ့ၪအီၪယဲၩ့လါ ကဲၪကၩလၧနၧၩတၭ, နဘၪမၩၥံၫဆၧလၧနချီ, နၥိၪနဘ့ၪအကျၩ, လၧယဟိ ဝၩနယွၩဖ့ၪလၫ့နၧၩ, ဘဲၫယမၪလူၬနၧၩအၥိၭတၭ, နမိ အၪ့ဘၪလၧနတရၫ့အဖၧၩ့ ထီးဒၪဆၧလၧ နမိအၪ့ဘၪ",
			"22": "<sup>22</sup> နၥၭလမံၩ့မံၩ့လီၫ.- ဘဲၫခံၫဘၩ့, ဒဲစဎဲၩဘၪဆၧအၪ့ဝ့ၫ အၥိၭနီၪ, နမိအၪ့ဘၪဝ့ၫ ဘဲၫနီၪအၥိၭလီၫ. ၦလဆံၫ့ ဘၪ, ဒဲၦအဆံၫ့လဖၪနီၪ မိအၪ့ဘၪဝ့ၫလစီၪ့ဎးလီၫ.",
			"23": "<sup>23</sup> အ့ၪမွဲအီၪတၡါ လၧနၥၭဆီၪ့ လၧနလအၪ့ဘၪဆၧၥွံၪ နီၪလမံၩ့ဆံၭ. အဂဲးဘဲၫယီၩ ဆၧၥွံၪနီၪ မွဲဆၧအၥၭ တၭး နအၪ့ဘၪဆၧအၥၭ လၧဆၧယၪအၥိၭအ့ၬ.",
			"24": "<sup>24</sup> နအၪ့ဘၪဝ့ၫအ့ၬး နဘၪလူၫလၩ့ခွံၬဝ့ၫ လၧဂၪ့ခိၪအဖၫ့",
			"25": "<sup>25</sup> ခိၪဘဲၫထံၫအၥိၭနီၪလီၫ.- လၧနလအၪ့ဘၪဝ့ၫအကၠီၩ့ နီၪ, မွဲဘဲၫၥိၭဆၧမိဂ့ၩထၪ့လၧနဂး, ဒဲလၧနဖိၪနလံၩလၧ နလးအဂး, ထီးနမၩဆၧလၧအတီၩအလီၩ့လၧယဟိဝၩ အမ့ၬယၫနီၪလီၫ.",
			"26": "<sup>26</sup> အ့ၪမွဲနဆၧဆံၫ့ဎံၪလဖၪ, ဒဲနဆၧမၩဘိၪ့ ဘၪဆဲၫ့ လၧနဆိၪလၩ့နၥၭလဖၪနီၪ, နဘၪမၩန့ဝ့ၫတၭ လ့ၩလၧ",
			"27": "<sup>27</sup> ဆၧအလး လၧယဟိဝၩမိရွံန့ဝ့ၫလီၫ.- တၭနဘၪလု ထၪ့နဆၧလုမ့ၪ, ဆၧယၪဒဲဆၧၥွံၪ လၧယဟိဝၩနယွၩ အဆၧလုလးအဖၫ့ခိၪ, ဒဲနဆၧလုလဖၪအၥွံၪ မိဘၪဆၧ လူၫလၩ့ခွံၬဝ့ၫ လၧယဟိဝၩနယွၩအဆၧလုလးအဖၫ့ ခိၪတၭ, နမိအၪ့ဘၪဆၧယၪနီၪလီၫ.",
			"28": "<sup>28</sup> ထီးန့ဒဲခိၭနၪကယဲဆၧလၧယမၪလူၬနၧၩ, ဘဲၫၥိၭန မၩဆၧအဂ့ၩအဘၪ လၧယဟိဝၩနယွၩအမ့ၬယၫနီၪ, ဆၧမိဂ့ၩထၪ့လၧနဂး, ဒဲလၧနဖိၪနလံၩလၧနလးခဲၫ့နီၪ အဂးအဆိၩအကၠၪဆံၭ.",
			"29": "<sup>29</sup> ထီးယဟိဝၩနယွၩ မိဒၪ့ထ့ၬခွံၬ ၦဆၨၩလဖၪလၧ နမ့ၬယၫထီးအလး လၧနလ့ၩမၩန့နဝ့ၫ, နအီၪလၧအ",
			"30": "<sup>30</sup> လး, ဒဲနအီၪလၧအခးဖၧၩ့တၭ,- ထီးအဝ့ၫၥံၪ ဘၪဆၧ ဂၭဂီၩ့ဂၭစၪ လၧနမ့ၬယၫအလးခဲၫ့နီၪတၭ, ထီးလၩ့န ၥၭလၧနထီးဖိၬ အဝ့ၫၥံၪအခဲၫ့နီၪ, ဒဲဘၪဆၧဖျံၩခွၩ့ လၧအကၠီၩ့လဂ့ၩ. တၭထီးအၪ့စၪ့ဆၧလၧ အဝ့ၫၥံၪအ ယွၩလဖၪအဂဲးအကၠီၪ့တၭစံၭ, ၦဆၨၩလဖၪနီၪမၩအ ယွၩအဆၧမၩဘဲၫၥ့ၪလဲၪ, ယမိမၩဘဲၫနီၪ အၥိၭဆ့လ",
			"31": "<sup>31</sup> ဂ့ၩ.- နမၩဘၪယဟိဝၩ နယွၩဘဲၫနီၪအ့ၬ, အဂဲးဘဲၫ ယီၩကယဲဆၧလၧအၥၭလိၪဘၪ ယဟိဝၩလၧအမ့ၬ လဲၩဝ့ၫလမံၩ့လါလါနီၪ, အဝ့ၫၥံၪမၩဘၪယူၭအယွၩ လဖၪယူၭ, အဂဲးဘဲၫယီၩ မွဲအဝ့ၫၥံၪဆူၭထၪ့ခွံၬယူၭ အဖိၪခွၫၥံၪဒဲအဖိၪမုၪၥံၪဒၪလ့ၬ လၧမ့ၪလၧအယွၩလ ဖၪအဂးယူၭ.",
			"32": "<sup>32</sup> ကယဲဆၧလၧယမၪလူၬနၥံၪ လမံၩ့လါလါနီၪ, ထီး လၩ့နၥၭဘဲၫနမိမၩဝ့ၫဆံၭ. ထီးအီၪက့ၪအၪထၪ့ ဆၧ လၧအဝ့ၫလဂ့ၩ, ဒဲထီးမၩန့ထၪ့ခွံၬ ဆၧလၧအဝ့ၫနီၪ လဂ့ၩ."
		},
		"13": {
			"1": "<sup>1</sup> မီၪလဂၩမွဲဂ့ၩ, ၦမံၫမးဆၧမံၫမးမွဲဂ့ၩ, အ့ၪဂဲထုၪ့ လၧနၥံၪအကျၩတၭ ဖ့ၪလၫ့နၧၩလၧဆၧမၩနဲၪ့မွဲဂ့ၩ,",
			"2": "<sup>2</sup> လၧဆၧမၩနဲၪ့လၩ့လိလၩ့လၭမွဲဂ့ၩ,- တၭဆၧမၩနဲၪ့ မွဲဂ့ၩ, ဆၧလၩ့လိလၩ့လၭမွဲဂ့ၩ, အ့ၪကဲၪထၪ့ဘဲၫအ ချဲၩ့ဆၧအၥိၭတၭ, စံၭဝ့ၫ, မွဲပလ့ၩဖိၬၡီၩ့ယွၩအဂူၫဂၩ လဖၪအခဲၫ့, လၧနလၥ့ၪယၫဘၪဝ့ၫဒဲမၩၡီၩ့အဆၧနီၪ,",
			"3": "<sup>3</sup> မီၪလဂၩနီၪမွဲဂ့ၩ, ၦမံၫမးဆၧမံၫမးလဂၩနီၪမွဲဂ့ၩ, ထီး ခိၭနၪအလူလဂ့ၩ. အဂဲးဘဲၫယီၩ ယဟိဝၩနၥံၪအယွၩ မၩခွါနၥံၪ, မွဲနၥံၪအဲၪယဟိဝၩ နၥံၪအယွၩလၧနၥံၪအ ၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧနၥံၪအၥၭၡီၩ့ထီးအလူၬနီၪဧၪ,",
			"4": "<sup>4</sup> ဘဲၫၥိၭအမိၥ့ၪယၫဝ့ၫလီၫ.- နၥံၪဘၪဖိၬယဟိဝၩနၥံၪ အယွၩအခဲၫ့, ဒဲၥၭမဲၪအဝ့ၫ,ဒဲထီးန့အဆၧမၪလူၬလ ဖၪ,ဒဲခိၭနၪအလူ, ဒဲနၥံၪမိဘၪမၩအဆၧတၭ, ဖီၪ့ထၬ",
			"5": "<sup>5</sup> လၧအဝ့ၫနီၪလီၫ.- တၭမီၪလဂၩနီၪမွဲဂ့ၩ, ၦမံၫမးဆၧ မံၫမးလဂၩနီၪမွဲဂ့ၩ, မိဘၪဆၧမၩၥံၫဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩမွဲအချဲၩ့ဆၧဘဲၫၥိၭ အမိဒုၭကၠၪခွံၬနၥံၪအၥၭ လၧ ယဟိဝၩနၥံၪအယွၩအအီၪ လၧအဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ လၧခးအံဇံၭအဖၧၩ့, ဒဲဎွ့ၩန့ထဲၩ့နၥံၪ လၧဎီးဖိၪအဂံၪ့ ဖၧၩ့,ဘဲၫၥိၭအမိဆၪ့ခွံၬနၧၩ လၧဖၧၩ့ၥၭလၧယဟိ ဝၩ နယွၩမၪလူၬနၧၩ လၧနမိဘၪလ့ၩဆၧလၧအဖၧၩ့ လီၫ. တၭနမိဒၪ့ထ့ၬခွံၬ ဆၧအၧၩ့လၧနၥံၪအကျၩ ဘဲၫ နီၪၥိၭလီၫ.",
			"6": "<sup>6</sup> နထၧၫ့ဖုဝဲခွၫ, နမိအဖိၪခွၫမွဲဂ့ၩ, နဖိၪခွၫမွဲဂ့ၩ,နဖိၪ မုၪမွဲဂ့ၩ, နမၫလၧနၥၭနၫၡါမွဲဂ့ၩ, နထံၩနၥိၭလၧအမၩ အၥၭဘဲၫနၥၭဒၪနဝ့ၫအၥိၭမွဲဂ့ၩ, အ့ၪအၪ့လံၬၥူၪနၧၩ တၭ, စံၭဝ့ၫ, မွဲပလ့ၩဘၩၡီၩ့ယွၩအဂူၫဂၩဘီၪ, ယွၩ",
			"7": "<sup>7</sup> လၧနလၥ့ၪယၫဘၪဝ့ၫ, နဝ့ၫဒၪဒဲနဖါလဖၪ,- ဘဲၫၦစံၭ ဆၧအၥိၭ, ၦခမျၧးလၧအအီၪဝၬဖီၩ့နၧၩအယွၩလဖၪ, အီၪဘူၭလၧနၧၩမွဲဂ့ၩ, အီၪယဲၩ့လၧနၧၩ, လၧဂၪ့ခိၪအ",
			"8": "<sup>8</sup> ထုၬယီၩဖိးလၧဂၪ့ခိၪအထုၬနီၪမွဲဂ့ၩ,- ထီးအုၩ့လၩ့ ဘၪအဝ့ၫလဂ့ၩ, ခိၭနၪအလူလဂ့ၩ, ဒဲနမ့ၬယၫ့ၥၭဘၪ",
			"9": "<sup>9</sup> အဝ့ၫအ့ၬး နလီၫ့ကီၩ့ ဒဲအီၪက့ၪၥူၪဘၪအ့ၬ.- အ့ၪမွဲ နဘၪမၩၥံၫတၡါလ့ၬလခီၫလီၫ. နစူၪဘၪအီၪဆိၫလၧ အလီၩ့ ဘဲၫၥိၭအမိဘၪဆၧမၩၥံၫဝ့ၫတၭ, လၧခဲၫ့ထဲၩ့",
			"10": "<sup>10</sup> နီၪၦခမျၧးထီးအလူၬအစူၪလီၫ.- တၭနဘၪခွံၬၥံၫဝ့ၫ လၧလိးလီၫ. အဂဲးဘဲၫယီၩမွဲအအၪ့ဎၬဝ့ၫ ဘဲၫၥိၭအမိ ဆၪ့ခွံၬနၧၩလၧယဟိဝၩနယွၩ လၧအဒုၭစဲၪ့ထၪ့ခွံၬနၧၩ လၧခးအံဇံၭအဖၧၩ့ လၧၦဎီးဖိၪအဂံၪ့ဖၧၩ့အအီၪလီၫ.",
			"11": "<sup>11</sup> ၦအံၫစရ့လၭဖိၪ ထီးအလူၬ မိနါဂၧၫ့ဆၧတၭ, ၥၭမဲၪ ဆၧ, ဒဲမၩလၧၩ့ဆၧအၧၩ့ ဘဲၫနီၪအၥိၭ လၧနၥံၪအကျၩ အ့ၬ,",
			"12": "<sup>12</sup> တၭနအ့ၪနါဂၧၫ့ ဆၧလၧနဒိၩ့လဒိၩ့အဖၧၩ့ လၧယ ဟိဝၩနယွၩဖ့ၪလၫ့နၧၩ, ဘဲၫၥိၭနမိအီၪထီးနီၪတၭ, ၦ",
			"13": "<sup>13</sup> စံၭဝ့ၫ,- ၦၡၩၥံၪ, ၦဘၫအလၭဖိၪစဲၪ့ထၪ့လၧနၥံၪအ ကျၩဒဲအၪ့လံၬထၪ့ခွံၬ ၦဒိၩ့ဖိၪလဖၪတၭ, စံၭဝ့ၫ, မွဲပ လ့ၩၡီၩ့တၭမၩယွၩအဂူၫဂၩလဖၪအဆၧ, လၧနၥံၪလ",
			"14": "<sup>14</sup> ၥ့ၪယၫဘၪဝ့ၫနီၪဆံၭ.- ထီးနီၪလဖၧၫ့ နၥံၪဘၪအၪ့ဎၬ အၪ့စၪ့, ယိထံၫထံၫဆၭဆၭတၭ, ယိခွါ, ဆၧလမံၩ့နီၪ အ့ၪတီၩ, ၦအ့ၪမၩဝ့ၫတၡါ, ဆၧဘၪၥၭလိၪနီၪ ဆၧမၩ",
			"15": "<sup>15</sup> ဝ့ၫလၧနၥံၪအကျၩတၭ,- နဘၪဖ့ၬခွံၬတၡါ ၦဒိၩ့ဖိၪလ ဖၪနီၪလၧနၭအနါမၩဂၭဂီၩ့ခွံၬဝ့ၫလူၬထူၬဆံၫ့ဘၩ့, ဒဲ ကယဲဆၧလၧအအီၪလၧအဖၧၩ့ ဒဲဆၧဖိၪဆၧဎါလၧနၭ",
			"16": "<sup>16</sup> အနါလီၫ.- နဘၪအီၪက့ၪကီၪ့အဆၧဖိၪဆၧလံၩလၧ ဖၧၩ့ၥၭအၥၭကျၩတၭ, နဘၪဆူၭထၪ့ခွံၬဒိၩ့နီၪ ဒဲအ ဆၧဖိၪဆၧလံၩလူၬထူၬဆံၫ့ဘၩ့ လၧယဟိဝၩနယွၩအ ဂးတၭ, မွဲအမိဘၪကဲၪထၪ့ဆၧအပိၩ့လပိၩ့ အဆိၩအ",
			"17": "<sup>17</sup> ကၠၪတၭ, ၦမၩထၪ့ထဲၩ့ဘၪလၧၩ့ဝ့ၫအ့ၬ.- တၭဆၧဘၪ ဆၧဆိၪအၧၩ့နီၪ, ထီးဘုၭထၬလၧနစူၪနးမံၩ့လဂ့ၩ, ဘဲၫ ၥိၭယဟိဝၩမိကၠၪခွံၬအၥၭ လၧအၥၭထၪ့ဆီၪ့တၭ, မိ ယၫ့ၥၭနၧၩ, ဒဲအၥၭအီၪနၧၩ, ဒဲမၩအၪထၪ့နၧၩ, ဘဲၫ",
			"18": "<sup>18</sup> အဆိၪလၩ့အၥၭလၧနဖါလဖၪအၥိၭနီၪလီၫ.- အဆၧၫ့ အထီနီၪနမိခိၭနၪယဟိဝၩနယွၩအလူ ဘဲၫၥိၭနမိထီးန့ အဆၧမၪလူၬထီးအလူၬ လၧယမၪလူၬနၧၩ လၧမုဆၫ လနံၩယီၩ, လၧနမိမၩဆၧအတီၩအလီၩ့ လၧယဟိဝၩ နယွၩအမ့ၬၥၪဖၧၩ့လီၫ."
		},
		"14": {
			"1": "<sup>1</sup> နၥံၪမွဲယဟိဝၩ နၥံၪအယွၩအဖိၪအလံၩလီၫ. ထီး ဂ့ၬလၩ့နၥံၪအနၫ့ဆါလဂ့ၩ, ထီးမၩချၩဆၧလၧနၥံၪအ",
			"2": "<sup>2</sup> မ့ၬၥၪအဘိၩ့ဆၧၩ့လၧၦၥံၫအကၠီၩ့လဂ့ၩ.- အဂဲးဘဲၫ ယီၩနမွဲၦဆံၫ့ဎံၪလဆၨၩ လၧယဟိဝၩနၥံၪအယွၩအ ဂးတၭ, ယဟိဝၩရွံန့နၥံၪ, ဘဲၫၥိၭနၥံၪမိကဲၪထၪ့ၦလ ဆၨၩလၧအလူဒိၪဎွ့ၩဒိၪလၧအဂး, လၧၦကိၭဆၨၩဒ့ၭ လၧဂၪ့ခိၪချိၫ့အဖၫ့ခိၪလီၫ.",
			"3": "<sup>3</sup> ထီ:အၪ့ဆၧဘၪၥၭလိၪန:မံၩ့လဂ့ၩ. အယီၩမွဲဆၧ",
			"5": "<sup>5</sup> ဖိၪဆၧဎါ လၧနၥံၪမိအၪ့ဘၪ, ချီ, ဒဲၥိၪဒဲဘ့ၪ.- စဎဲၩ, ဒဲခံၫဘၩ့, ဒဲစဎဲၩယၭဎမိၫဒဲဘ့ၪမံၩ့, ဒဲစဖၭဒၡိၫ,",
			"6": "<sup>6</sup> ဒဲစဖၭၥအိမံၩ, ဒဲစဖၭစမ့ၫ,- ဒဲကယဲဆၧလၧအခၪ့ ဒဲအခၪ့မံၪထ့ဖၭနံၫခီၫ, ဒဲအအဲၪ့ယဲၩအဆၪလၧဆၧဖိၪ ဆၧဎါလမံၩ့လါလါအကျၩနီၪ, နၥံၪမိအၪ့ဘၪဝ့ၫလီၫ.",
			"7": "<sup>7</sup> မွဲလါနၫ့အယီၩ မွဲဆၧလၧအအဲၪ့ယဲၩ အဆၪအကျၩ, ဒဲဆၧလၧအခၪ့မံၪထ့ဖၭအကျၩလၧနၥံၪလအၪ့ဘၪဘၪဝ့ၫ, ကလအူၭ, ဒဲယူၪ, ဒဲၡၩဖၭလီၫ. အဂဲးဘဲၫယီၩ, အဲၪ့ ယဲၩအဆၪလါနၫ့တၭ, အခၪ့မံၪထ့ဖၭအ့ၬ, မွဲဆၧလ",
			"8": "<sup>8</sup> ဆံၫ့ဘၪ လၧနၥံၪအဂးလီၫ.- ဒဲထိၭဆ့, အဂဲးဘဲၫယီၩ အခၪ့မံၪထ့ဖၭလါနၫ့တၭ, အဲၪ့ယဲၩအဆၪအ့ၬ. မွဲဆၧ လဆံၫ့ဘၪလၧနၥံၪအဂးလီၫ. ထီးအၪ့အယၪလဂ့ၩ, ဒဲထီးထိၭဘၪအစွၪလဂ့ၩ.",
			"9": "<sup>9</sup> အယီၩမွဲဆၧလၧနၥံၪမိအၪ့ဘၪ လၧအအီၪလၧထံၫ ကျၩထီးအလူၬအကျၩနီၪ, ကယဲဆၧလၧအအီၪလၧအ ဒံၭဒဲအဘံၪ့လဖၪနီၪ, နၥံၪမိအၪ့ဘၪ,-",
			"10": "<sup>10</sup> တၭဆၧလၧအ လအီၪဘၪလၧအဒံၭ ဒဲအဘံၪ့လဖၪနီၪ ထီးအၪ့ဝ့ၫလ ဂ့ၩ, မွဲလဆံၫ့ဘၪလၧနၥံၪအဂးလီၫ.",
			"11": "<sup>11</sup> တၭကယဲထိၪၥံၪလၧအဆံၫ့ထီးအလူၬနီၪ နၥံၪမိအၪ့",
			"12": "<sup>12</sup> ဘၪလီၫ.- အ့ၪမွဲလၧနၥံၪလအၪ့ဘၪဝ့ၫနီၪ မွဲအယီၩ,",
			"13": "<sup>13</sup> လံၬကျီၫ့ကျီၫ့, လံၬထိၪၡၭ, လံၬထိၪၡၭမၫဆမံၭ,- ဒဲ",
			"14": "<sup>14</sup> လံၬယၪအုၪ, ဒဲလၫ့ကထၭ, ဘဲၫအဆၨၩအၥိၭ,- ဒဲက",
			"15": "<sup>15</sup> ယဲကျၭဘဲၫအဆၨၩအၥိၭ,- ဒဲထိၪကလအူၭဒဲထိၪနၪ,",
			"16": "<sup>16</sup> ထိၪလဲၫဘွၩ, လံၬၥံၫ့ဘဲၫအဆၨၩအၥိၭ,- ထိၪပဂူၪဘဲၫ",
			"17": "<sup>17</sup> အဆၨၩအၥိၭ, ထိၪဝီၩဖံၭ, ထိၪယၩ့ဖီၩ့,- စၭကဝၭ, လၫ့",
			"18": "<sup>18</sup> ကထၭဘွၩ, ဒဲယီၩ့,- ထိၪထၩမံၩ့, ထၧးကလါဘဲၫအ",
			"19": "<sup>19</sup> ဆၨၩအၥိၭ, ဒဲထိၪဆၫ့ဖၫ, ဒဲဖျၪၥံၪလဖၪနီၪလီၫ.- တၭ ကယဲဆၧလၧအစွၩ ဒဲယူၩဝ့ၫထီးအလူၬနီၪ, မွဲလဆံၫ့ ဘၪလၧနၥံၪအဂးလီၫ. ၦၡၩအၪ့ဘၪဝ့ၫအ့ၬ.",
			"20": "<sup>20</sup> ကယဲထိၪၥံၪလံၪၥံၪ လၧအဆံၫ့ထီးအလူၬနီၪနၥံၪ မိအၪ့ဘၪလီၫ.",
			"21": "<sup>21</sup> ဆၧလၧအၥံၫဒၪအဆၧနီၪ နၥံၪထီးအၪ့ဝ့ၫနးမံၩ့လ ဂ့ၩ. နမိဖ့ၪလၫ့ဘၪဝ့ၫလၧ ၦလခီၫဘၩ့မုးဖိၪလၧအအီၪ လၧနတရၫ့အဖၧၩ့, ဘဲၫၥိၭအမိအၪ့ဘၪတၭ, အ့ၪလမွဲ ဘၪနီၪ နအၪ့ဆၫခွံၬဘၪဝ့ၫ လၧၦလခီၫဘၩ့မုးဖိၪလီၫ. အဂဲးဘဲၫယီၩ နမွဲၦဆံၫ့ဎံၪလဆၨၩလၧယဟိဝၩနယွၩ အဂးလီၫ. အၪ့ဎွံထၪ့ဘ့ၪဖိၪ လၧအမိအနူထံၫအဖၧၩ့ လဂ့ၩ.",
			"22": "<sup>22</sup> ဆၧချံၫဆၧၥၪ လၧနဂၪ့ခိၪအလး ဒုၭအီၪထၪ့ဝ့ၫလ နံၪ့ဘၪလနံၪ့နီၪး နဘၪအၪ့နၩ့ဖၭဆံၫပိၩ့လပိၩ့လၩ့ထံး",
			"23": "<sup>23</sup> လၩ့ဆ့ၭလီၫ.- ထီးဒၪအလးလၧယဟိဝၩနယွၩရွံန့ဝ့ၫ ဘဲၫအမိအီၪက့ၪအမံၩ့နီၪတၭ, နဘုၪဒဲနစဘံၭထံၫ, ဒဲန ၥိၪ, ဒဲနချီ, ဒဲနၥိၪနဘ့ၪအဖိၪဝဲၡါၥံၪ, နဘၪအၪ့ဝ့ၫဆံၫ ပိၩ့လပိၩ့ထီးအလးနီၪ လၧယဟိဝၩနယွၩအမ့ၬယၫ, ဘဲၫၥိၭနမိမၩလိၪဆၧၥၭမဲၪ ယဟိဝၩနယွၩကိၭမုနံၩ ကိၭမုနၩဒ့ၭလီၫ.",
			"24": "<sup>24</sup> ဖၧၩ့ၥၭအ့ၪယဲၩ့လါကဲၪကၩ လၧနဂးထီးနလ့ၩဆိၬ ဆၧနီၪလၥ့ၪဘၪ, ဆၧအလးထီးယဟိဝၩ နယွၩရွံန့ ဝဲၩအမံၩ့နီၪအ့ၪယဲၩ့လါကဲၪကၩ လၧနၧၩတၭ, ထီးယ",
			"25": "<sup>25</sup> ဟိဝၩနယွၩဆိၪဂ့ၩနၧၩတၭ,- နမိဘၪအၪ့လဲၩဆၧနီၪ လၧစ့ၩအဂးတၭ, နဘၪဘီၪ့ထၪ့စ့ၩနီၪ လၧနစူၪဖၧၩ့ တၭ,လ့ၩလၧအလးလၧယဟိဝၩနယွၩ မိရွံန့ဝ့ၫလီၫ.",
			"26": "<sup>26</sup> တၭနမိဖ့ၪလၫ့ဘၪစ့ၩနီၪ လၧထီးဒၪဆၧလၧနဆိၫ့န့ဘၪ ဝ့ၫလမံၩ့မံၩ့အဂး, လၧချီအဂးမွဲဂ့ၩ, လၧၥိၪလၧဘ့ၪ အဂးမွဲဂ့ၩ, လၧစဘံၭထံၫအၥၫ့မွဲဂ့ၩ, စဘံၭထံၫအလး လံၩမွဲဂ့ၩ, ထီးဒၪနၥၭဆိၫ့န့ဘၪ ဆၧလမံၩ့မံၩ့တၭ, န ဘၪအၪ့ဆၧထီးနီၪ လၧယဟိဝၩနယွၩအမ့ၬယၫတၭ,",
			"27": "<sup>27</sup> နမိၥၭထိၬ နဝ့ၫဒၪ, ဒဲနၡၩဂံၪ့ဖိၪ,- ဒဲၦလံဝဲၫဖိၪလၧ အအီၪလၧနတရၫ့အဖၧၩ့လီၫ. နလ့ၩဒၪခွံၬ ဘၪအဝ့ၫ အ့ၬး အဂဲးဘဲၫယီၩ မွဲအလးဒဲအဆၧန့ၥၫအီၪလၧနၥိၭ လီၫ.",
			"28": "<sup>28</sup> လၧၥၧၫ့နံၪ့အထုၬနီၪ နဘၪဂဲၫဆိၬနဆၧအၪထၪ့ဆံၫ ပိၩ့လပိၩ့ထီးအလူၬလနံၪ့ဎးနီၪတၭ, နဘၪအီၪက့ၪကီၪ့",
			"29": "<sup>29</sup> ဝ့ၫလၧနတရၫ့အဖၧၩ့,- ဒဲၦလံဝဲၫဖိၪ, (အဂဲးဘဲၫယီၩ မွဲအလးဒဲအဆၧန့ၥၫအီၪလၧနၥိၭအ့ၬ), ဒဲၦလခီၫဘၩ့ မုးဖိၪ, ဒဲၦဖိၪဎွ့ၪ, ဒဲၦမုၪမဲၫလၧအအီၪလၧနတရၫ့အ ဖၧၩ့နီၪမိဂဲၫဘၪတၭ, မိအၪ့ဘၪဆၧတၭဘျဲၩအၪ့, ဘဲၫ ၥိၭယဟိဝၩနယွၩမိဆိၪဂ့ၩနၧၩ လၧကယဲနဆၧမၩအ ဖၧၩ့လၧနစူၪမၩဝ့ၫလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> လၧနွ့ၫနံၪ့အထုၬနီၪ နဘၪမၩဆၧဂၭဖျ့ၭလီၫ. တၭ ဆၧဂၭဖျ့ၭလမံၩ့နီၪမွဲအယီၩ, ကယဲဒ့ၪၥံၪမါၥံၪအက ဆါလၧအဒုၭအၪ့လီး ဆၧလၧၦလၧအနဲၩ့ထံၭလဂၩ လါလါနီၪ မိဘၪဖျါခွံၬဝ့ၫလီၫ. လၧၦအီၪလၧအနဲၩ့ ထံၭမွဲဂ့ၩ, လၧအထၧၫ့ဖုဝဲမွဲဂ့ၩ, မွဲအအၪ့ကံၩ့ဘၪလၧၩ့ အ့ၬ, အဂဲးဘဲၫယီၩ ဆၧကိၭဝ့ၫလၧယဟိဝၩအဆၧဖျါ",
			"3": "<sup>3</sup> ခွံၬဝ့ၫလီၫ.- ၦလခီၫဘၩ့မုးဖိၪနီၪ နမိအၪ့ကံၩ့ဘၪဆၧ လၧအဝ့ၫလီၫ. အ့ၪမွဲနဆၧလၧအအီၪ လၧနထၧၫ့ဖုဝဲ",
			"4": "<sup>4</sup> နီၪနစူၪဘၪဖျါခွံၬဝ့ၫလီၫ.- မွဲဘဲၫၥိၭၦၡၪ့ဖိၪ ယၬဖိၪ ထီးအီၪလၧနၥံၪအကျၩလဂ့ၩ. အဂဲးဘဲၫယီၩ ယဟိ ဝၩမိဆိၪဂ့ၩနၧၩတၡါ လၧထံၫၥံၪခးၥံၪအဖၧၩ့ လၧ ယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩ လၧဆၧန့ၥၫလၧနမိမၩန့ဝ့ၫ",
			"5": "<sup>5</sup> လီၫ.- န့ၫနအ့ၪခိၭနၪတၡါ ယဟိဝၩနယွၩအလူဘဲၫၥိၭ နမိထီးလၩ့နၥၭ လၧနမိမၩကယဲဆၧမၪလူၬလၧယမၪ",
			"6": "<sup>6</sup> လူၬနၧၩ လၧမုဆၫလနံၩယီၩလီၫ.- အဂဲးဘဲၫယီၩယ ဟိဝၩနယွၩဆိၪဂ့ၩနၧၩ, ဘဲၫအချဲၩ့ဝဲၩဆၧလၧနၧၩအ ၥိၭနီၪတၭ, နမိဒုၭအၪ့လီးဆၧလၧၦအၪဆၨၩ, လါနၫ့ တၭ, နဝ့ၫဒၪနမိအၪ့လီးန့ဘၪဆၧအ့ၬ. တၭနမိပၧၩ့ၦ အၪဆၨၩလါနၫ့တၭ, အဝ့ၫၥံၪနီၪမိပၧၩ့ဘၪနၧၩအ့ၬ.",
			"7": "<sup>7</sup> တၭနထၧၫ့ဖုဝဲလဂၩ ၦၡၪ့ဖိၪယၬဖိၪ, အ့ၪအီၪလၧ နၥံၪအကျၩ, လၧနၥံၪအတရၫ့ဖၧၩ့လစီၪ့စီၪ့ လၧနခး ဖၧၩ့ လၧယဟိဝၩနယွၩ ဖ့ၪလၫ့နၧၩတၭ, နမၩနီၩ့ဘၪ နၥၭ, ဒဲနထီၩ့ဒူၪဘၪနစူၪ လၧနထၧၫ့ဖုဝဲအၡၪ့အယၬနီၪ",
			"8": "<sup>8</sup> အ့ၬ.- နဘၪပၠၪလၩ့နစူၪဖၭလဲတၭ, နမိဒုၭဘၪအၪ့လီး ဘၪအဝ့ၫ, လၧဆၧလၧအန့ဘၪအလးအီၪ အလၧၫ့အ",
			"9": "<sup>9</sup> ဎွ့ၩလီၫ.- ထီးလၩ့နၥၭဘဲၫၥိၭဆၧဆီၫ့မီၪ့ထီးအီၪထၪ့ လၧနၥၭအၧၩ့အဖၧၩ့စံၭဝ့ၫ, နွ့ၫနံၪ့လနံၪ့နီၪ ဆၧဖျါခွံၬ အနံၪ့အီၪဘူၭထၪ့ယူၭနီၪလဂ့ၩး တၭနမ့ၬအၧၩ့ထၪ့လၧ နထၧၫ့ဖုဝဲအၡၪ့အယၬ အလီၩ့တၭ, နဖ့ၪလၫ့ဝ့ၫလၧ ဆၧနးမံၩ့အ့ၬ, တၭအဝ့ၫဒၪကိၭထၪ့ထၫ့ဒုၪဒၩနၧၩလၧ",
			"10": "<sup>10</sup> ယဟိဝၩတၭ, ဆၧဒဲၩဘၭမိဘၪနၧၩလီၫ.- နဘၪဖ့ၪ လၫ့ဆၧလၧအဝ့ၫတၡါတၭ, ထီးနဖ့ၪလၫ့ဝ့ၫနီၪ, မွဲနၥၭ ထီးအုၭထၪ့လဂ့ၩ. အဂဲးဘဲၫယီၩ လၧဆၧနီၪလမံၩ့ အကၠီၩ့, ယဟိဝၩနယွၩမိဆိၪဂ့ၩနၧၩ လၧနဆၧမၩထီး အလူၬအဖၧၩ့, ဒဲကယဲဆၧလၧနအီၪက့ၪနစူၪ လၧအ",
			"11": "<sup>11</sup> လီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ၦၡၪ့ဖိၪယၬဖိၪမိလၩ့မါဝ့ၫ လၧခးဖၧၩ့အ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, ယမၪလူၬနၧၩ တၭ, စံၭ, နမိဘၪပၠၪလၩ့နစူၪဖၭလဲ လၧနထၧၫ့ဖုဝဲအ ဂး, လၧနၡၩၡၪ့ဖိၪယၬဖိၪအဂး, ဒဲလၧနၡၩန့ဘၪဆၧ လမံၩ့မံၩ့အလး အီၪလၧအဘၪၡၪ့ဘၪယၬ လၧနခး ဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> နထၧၫ့ဖုဝဲ ၦဟံဘြူၫခွၫမွဲဂ့ၩ, ယဟိဝၩၦဟံဘြူၫမုၪမွဲဂ့ၩ, အ့ၪဘၪဆၧအၪ့ဆၫခွံၬဝ့ၫ လၧနၧၩတၭ, မၩနဆၧဎူၫ နံၪ့တၭ, နွ့ၫနံၪ့လနံၪ့နီၪ, နမိဘၪဖျါခွံၬဝ့ၫပျီၩဖျ့ၭလၧ",
			"13": "<sup>13</sup> နအီၪလီၫ.- တၭထီးနဖျါခွံၬဝ့ၫလၧနအီၪပျီၩဖျ့ၭနီၪ,",
			"14": "<sup>14</sup> နမိဖျါခွံၬဘၪပျီၩပျီၩအ့ၬး- နမိဘၪဖ့ၪလၫ့လၧၫ့ဎွ့ၩဝ့ၫ လၧနၥိၪဒဲနဘ့ၪအကျၩ, ဒဲလၧနဘုၪၥံၪဂူၫၥံၪအကျၩ, ဒဲလၧနယဲးစဘံၭၥၪအလးအဖၧၩ့လီၫ. နမိဘၪဖ့ၪလၫ့ ဝ့ၫလၧဆၧလၧ ယဟိဝၩနယွၩ ဆိၪဂ့ၩနၧၩနီၪလီၫ.",
			"15": "<sup>15</sup> နဘၪနၪ့ထၪ့ထဲၩ့ လၧနမွဲဎီးဖိၪ လၧခးအံဇံၭအဖၧၩ့ တၭ, ယဟိဝၩနယွၩဎွ့ၩန့နၧၩလီၫ. မၩအၥၭဘဲၫနီၪ တၭ, ယမၪလူၬနၧၩလၧဆၧလမံၩ့နီၪ လၧမုဆၫလနံၩ ယီၩလီၫ.",
			"16": "<sup>16</sup> တၭအဝ့ၫဒၪအ့ၪစံၭနၧၩ, ယစဲၪ့ထၪ့ခွံၬ လၧနအီၪ အ့ၬး အဂဲးဘဲၫယီၩ မွဲအအဲၪနၧၩ, ဒဲနၡၩဂံၪ့ဖိၪလီၫ. အဂဲးဘဲၫယီၩ လၧအအီၪလၧနၥိၭနီၪ မုၬဝ့ၫလၧနစူၪ",
			"17": "<sup>17</sup> ဖၧၩ့လီၫ.- ဆၧမိမၩအၥၭလၧနဘၪမၩန့ထၭဖျံၬတၭ, ထူဖိးအနါလၧတရၫ့ထုၪ့လီၩ့တၭ အဝ့ၫမိကဲၪထၪ့နဎီး နၡၩလဆိၩဒၪဝ့ၫလီၫ. တၭ, နဎီးမုၪနီၪနဘၪမၩဝ့ၫဘဲၫ",
			"18": "<sup>18</sup> နီၪၥိၭဆ့လီၫ.- ထီးနဖျါခွံၬဝ့ၫပျီၩဖျ့ၭလၧနအီၪတၭ, မွဲအထီးကဲၪထၪ့ ဆၧကၪလၧနမ့ၬယၫလဂ့ၩး အဂဲး ဘဲၫယီၩ လၧအမၩဆၧဎူၫနံၪ့နီၪ ဂ့ၩလၧနဂးန့ၫဎီၩ့လၧ ၦၡၩဒိၭအၪ့လံၩ့ဖိၪနံၫစၩလီၫ. တၭယဟိဝၩယွၩမိ ဆိၪဂ့ၩနၧၩ လၧကယဲဆၧလၧနမၩနဝ့ၫလီၫ.",
			"19": "<sup>19</sup> ကယဲနချီဖၫဖိၪအဝဲၡါ ဒဲနၥိၪဖၫနဘ့ၪဖၫအဖိၪဝဲၡါ လၧအဖိၪဆါ ထီးအလူၬနီၪ နမိဘၪအီၪက့ၪဆံၫ့ဎံၪ လၧယဟိဝၩနယွၩအဂးလီၫ. နမၩဘၪဆၧမၩလၧန ချီဖၫအဖိၪဝဲၡါအ့ၬး တၭနထံၬဘၪနၥိၪအဖိၪဝဲၡါအ",
			"20": "<sup>20</sup> ဆီၪ့အ့ၬ.- နဘၪအၪ့ဝ့ၫလၧယဟိဝၩနယွၩအမ့ၬယၫ လနံၪ့ဘၪလနံၪ့ လနံၪ့ဘၪလနံၪ့ ထီးအလးလၧယဟိ ဝၩနယွၩမိရွံန့ဝ့ၫ, နဝ့ၫဒၪဒဲနၡၩဂံၪ့ဖိၪလီၫ.",
			"21": "<sup>21</sup> တၭအဆၧလလၧၫ့လဎွ့ၩဘၪ အ့ၪအီၪလၧအဖၧၩ့, အခၪ့အ့ၪဂၭဂီၩ့မွဲဂ့ၩ, အမ့ၬအ့ၪဘျီၪမွဲဂ့ၩ, အဂၭဂီၩ့ အၧၩ့လမံၩ့မံၩ့အ့ၪအီၪတၭ, မွဲနထီးလုထၪ့ဝ့ၫလၧယ ဟိဝၩနယွၩအဂးလဂ့ၩ.",
			"22": "<sup>22</sup> နဘၪအၪ့ဝ့ၫ လၧနတရၫ့အဖၧၩ့လီၫ. ၦအဆံၫ့ဒဲၦ လဆံၫ့ဘၪလစီၪ့ဎး ဘဲၫခံၫဘၩ့အၥိၭ, ဒဲဘဲၫစဎဲၩအ ၥိၭနီၪလီၫ.",
			"23": "<sup>23</sup> အ့ၪမွဲအၥွံၪနီၪထီးအၪ့လဂ့ၩ, နမိဘၪဂါလၩ့ခွံၬဝ့ၫ လၧဂၪ့ခိၪချိၫ့ဘဲၫထံၫအၥိၭနီၪလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> ထီးန့လၩအၫဘံၭတၭ, မၩဘိၪ့လ့ၩဖၬလၧယဟိ ဝၩနယွၩအဂးဆံၭ, အဂဲးဘဲၫယီၩ လၧလၩအၫဘံၭအ ထးဖၧၩ့နီၪ ယဟိဝၩနယွၩ ဒုၭစဲၪ့ထၪ့ခွံၬနၧၩ လၧအံ",
			"2": "<sup>2</sup> ဇံၭလၧမုနၩ လခီၫနီၪလီၫ.- တၭလၧၥိၪ လၧဘ့ၪမွဲ ဂ့ၩ, ချီမွဲဂ့ၩ, နမိဘၪလုထၪ့ဆၧလ့ၩဖၬလၧယဟိဝၩန ယွၩအဂး, ထီးအလးလၧယဟိဝၩမိရွံန့လၧအမိအီၪ",
			"3": "<sup>3</sup> က့ၪအမံၩ့နီၪလီၫ.- တၭနအၪ့ဎုၬဘၪလၧကိၪအီၪလၧ မံၪနီၪအ့ၬး နမိဘၪအၪ့ကိၪလအီၪဘၪ လၧမံၪနွ့ၫနံၩ, ကိၪဘၪဆဲၫ့လၧဆၧၡၪ့ဆၧနၭး အဂဲးဘဲၫယီၩ မွဲနစဲၪ့ ထၪ့ခွံၬလၧအံဇံၭချဲၫ့ချဲၫ့, ဘဲၫၥိၭနမိနၪ့ထၪ့ထဲၩ့မုလ နံၩလၧနစဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭအဖၧၩ့ လဆိၩဒၪနၧၩ",
			"4": "<sup>4</sup> ကိၭမုနံၩကိၭမုနၩဒ့ၭလီၫ.- တၭလၧမုနွ့ၫနံၩအထး ဖၧၩ့ကိၪအီၪလၧမံၪနီၪ ထီးအီၪဘၪလၧနစူၪဖၧၩ့လဂ့ၩ. တၭဆၧယၪ လၧနလုထၪ့ဝ့ၫ လၧအခၪ့ထံၭလနံၩနီၪ,",
			"5": "<sup>5</sup> အီၪလၩ့ထးဘၪၥၫ့နၩချီၩ့ ထီးဆၧဖၩ့ထၪ့အ့ၬ.- နလု ထၪ့ဆၧလ့ၩဖၬလၧနတရၫ့အဖၧၩ့ လၧယဟိဝၩနယွၩ",
			"6": "<sup>6</sup> ဖ့ၪလၫ့နၧၩနီၪနးစီၪ့အ့ၬ.- အ့ၪမွဲလၧအလးထီးယဟိ ဝၩနယွၩမိရွံန့ဝ့ၫလၧအမိအီၪက့ၪအမံၩ့အဂး, ထီးနီၪ နမိဘၪလုထၪ့ဆၧလ့ၩဖၬ လၧမုဂၪလၩ့ လၧမုလၩ့နုၬ, အဆၧၫ့အထီလၧအစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭအဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> ထီးနီၪလဖၧၫ့နဘၪအၪ့ကၪအၪ့တၭ, အၪ့ဝ့ၫထီးအလး ဖၧၩ့လၧယဟိဝၩနယွၩမိရွံန့ဝ့ၫတၭ, နဘၪကၠၪနၥၭလၧ မုဆဲၪ့ထၪ့တၭ, ထဲၩ့ထဲၩ့လၧနတဲၩလဖၪအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> ဎူၫနံၩနအၪ့ဘၪကိၪလအီၪဘၪ လၧမံၪတၭ နွ့ၫနံၩလ နံၩဆၧအီၪကီၪ့လၧယဟိဝၩနယွၩအဂးနီၪ မိအီၪတၭး နမိမၩဘၪဆၧနးမံၩ့အ့ၬ.",
			"9": "<sup>9</sup> နဘၪဝံထၪ့နၬထၪ့ နွ့ၫနွ့ၫလၧနဂးလီၫ. လၧနဒုၭနုၬ ၥၫ့ထၭဂ့ၬလၧနဘုၪကျၩနီၪ နမိဘၪဝံထၪ့နၬထၪ့နွ့ၫနွ့ၫ",
			"10": "<sup>10</sup> နီၪလီၫ.- တၭနဘၪမၩဆၧမၩဘိၪ့နွ့ၫလဖၪလၧဆၧမၩ ဘိၪ့ဒၪဝ့ၫ လၧနစူၪဖၧၩ့ လၧနမိဘၪဖ့ၪလၫ့ ဆၧလၧယ ဟိဝၩနယွၩဘဲၫယဟိဝၩ နယွၩဆိၪဂ့ၩယူၭနၧၩအၥိၭ",
			"11": "<sup>11</sup> နီၪလီၫ.- တၭနမိၥၭထိၬ လၧယဟိဝၩနယွၩအမ့ၬ ယၫ, နဝ့ၫဒၪ, ဒဲနဖိၪခွၫ,ဒဲနဖိၪမုၪ, ဒဲနဎီးခွၫ,ဒဲနဎီးမုၪ, ဒဲၦလံဝဲၫဖိၪ လၧအအီၪလၧနတရၫ့အဖၧၩ့, ဒဲၦလခီၫ ဘၩ့မုးဖိၪ, ဒဲၦဖိၪဎွ့ၪ,ဒဲၦမုၪမဲၫ, လၧအအီၪလၧနၥံၪအ ကျၩထီးအလး လၧယဟိဝၩနယွၩ ရွံန့ဝဲၩဝ့ၫလၧအမိ",
			"12": "<sup>12</sup> အီၪက့ၪအမံၩ့အဂးလီၫ.- တၭနဘၪနၪ့ထၪ့ထဲၩ့လၧန မွဲၦဎီးဖိၪလၧအံဇံၭအဖၧၩ့တၭ, နဘၪထီးန့, ဒဲမၩဆၧ ၥနိၫလဖၪယီၩလီၫ.",
			"13": "<sup>13</sup> တၭနအီၪက့ၪကီၪ့နဘုၪ, ဒဲစဘံၭထံၫ အလးခဲၫ့နီၪ,",
			"14": "<sup>14</sup> နမိဘၪမၩဆၧဘိၪ့တဲၩနွ့ၫနံၩလီၫ.- နမိၥၭထိၬ လၧန ဘိၪ့ဖၧၩ့, နဝ့ၫဒၪ, ဒဲနဖိၪခွၫ, ဒဲနဖိၪမုၪ, ဒဲနဎီးခွၫ, ဒဲနဎီး မုၪ, ဒဲၦလံဝဲၫဖိၪ, ၦမွံၩဖိၪ, ဒဲၦဖိၪဎွ့ၪ, ဒဲၦမုၪမဲၫ, လၧအ",
			"15": "<sup>15</sup> အီၪလၧနတရၫ့အဖၧၩ့လီၫ.- နွ့ၫနံၩနီၪ နဘၪမၩဘိၪ့ လၧယဟိဝၩနယွၩအဂး, ထီးအလးလၧယဟိဝၩမိရွံ န့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩနယွၩမိဆိၪဂ့ၩနၧၩ လၧနဆၧအၪထၪ့ထီးအလူၬ, ဒဲကယဲဆၧလၧနမၩဆၧ လၧနစူၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, နမိၥၭထိၬတၡါ လီၫ.",
			"16": "<sup>16</sup> လနံၪ့အထးဖၧၩ့နီၪကယဲနဖိၪအခွၫၥံၪ မိဘၪအီၪဖျီၪ ထၪ့ၥၧၫ့ဘျၩ့လၧယဟိဝၩနယွၩအမ့ၬယၫ, ထီးအလး လၧအမိရွံန့ဝ့ၫ, လၧဘိၪ့ကိၪလအီၪဘၪလၧမံၪအဖၧၩ့, ဒဲလၧဘိၪ့နွ့ၫလဖၪအဖၧၩ့, ဒဲလၧဘိၪ့တဲၩလဖၪအဖၧၩ့ လီၫ. တၭမွဲအထီးအီၪဖျီၪဘၪလၧယဟိဝၩအမ့ၬယၫ",
			"17": "<sup>17</sup> ပျီၩပျီၩလဂ့ၩ.- လဂၩလဂၩလၥ့ၪထီးဒၪအၥ့ၪဆုၬ ဆုၬနီၪဘၪဖ့ၪလၫ့ ဘဲၫယဟိဝၩနယွၩအဆၧဆိၪဂ့ၩ လၧအဖ့ၪလၫ့နၧၩအၥိၭနီၪလီၫ.",
			"18": "<sup>18</sup> တၭနဘၪအီၪက့ၪၦစ့ၩရၫ့ခွး ဒဲၦကွ့ၭလံၬလၧကယဲ နတရၫ့အဖၧၩ့လၧယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩ လၧနၡၩ အဒီၪ့ထီးအလူၬအကျၩလီၫ. တၭအဝ့ၫၥံၪနီၪမိစ့ၩရၫ့",
			"19": "<sup>19</sup> နၡၩခမျၧးလၧဆၧစ့ၩရၫ့တီၩလီၫ.- ထီးဘိၭကၠၪပဲၩ ဘၪဆၧစ့ၩရၫ့လဂ့ၩး နထီးယိမ့ၬဘၪၦၡၩလဂ့ၩတၭ, နထီးဒိၭန့ဘၪလၬဆီၪ့လဂ့ၩ. အဂဲးဘဲၫယီၩလၬဆီၪ့ နီၪမၩခံၭၦကိၪ့ဆၧၥ့ၪအမ့ၬ ဒဲဒုၭကဲၪ့ၦတီၩၦလီၩ့အ",
			"20": "<sup>20</sup> ဆၧချဲၩ့နီၪလီၫ.- နဘၪဖိၬဆၧတီၩတီၩလီၩ့လီၩ့အခဲၫ့ ဘဲၫၥိၭနမိမၧၫ့ ဒဲန့ၥၫထံၫၥံၪခးၥံၪလၧယဟိဝၩနယွၩဖ့ၪ လၫ့နၧၩလီၫ.",
			"21": "<sup>21</sup> ထီးၥုၪ့လၩ့ အၡ့ရိၫဘူၭလၧယဟိဝၩ နယွၩအဆၧ",
			"22": "<sup>22</sup> လုလး, လၧနမိမၩလၧနဂးနးမံၩ့လဂ့ၩ.- တၭထီးဘိၭ ဆၧၫ့ထုၪ့နဆၧဂၩ့ဆၧဖၪ့ လၧယဟိဝၩနယွၩမ့ၬလဲၩဝ့ၫ နီၪလဂ့ၩ."
		},
		"17": {
			"1": "<sup>1</sup> ချီဖၫမွဲဂ့ၩ, ၥိၪ,ဘ့ၪမွဲဂ့ၩ, လၧအအီၪလၧဆၧလလၧၫ့ လဎွ့ၩဘၪ, လၧဆၧအၧၩ့လမံၩ့မံၩ့အီၪလၧအလီၩ့နီၪ, ထီးလုထၪ့ လၧယဟိဝၩနယွၩအဂးနီၪလဂ့ၩး အဂဲး ဘဲၫယီၩ အနီၪမွဲဆၧၥၭလိၪ လၧယဟိဝၩနယွၩအမ့ၬ",
			"2": "<sup>2</sup> ယၫလီၫ.- တၭလၧနတရၫ့အဖၧၩ့လၧယဟိဝၩနယွၩဖ့ၪ လၫ့နၧၩနီၪ, ဆၧအ့ၪဒၪန့ၦခွၫမွဲဂ့ၩ, ၦမုၪမွဲဂ့ၩ, လၧန ၥံၪအကျၩလၧအလၨၪခၫ့ဖၬ ယဟိဝၩနယွၩ အဆၧအုၩ့ လၩ့တၭ, မၩဆၧအၧၩ့လၧယဟိဝၩနယွၩအမ့ၬယၫ,",
			"3": "<sup>3</sup> ဒဲလ့ၩမၩယွၩအဂူၫဂၩလဖၪ အဆၧဒဲဘၩထၪ့ဝ့ၫ, မုမွဲ ဂ့ၩ, လၩမွဲဂ့ၩ, မူၭခိၪအၥုၭမုလမံၩ့လါလါမွဲဂ့ၩ, လၧ",
			"4": "<sup>4</sup> ယလမၪလူၬဘၪ,- တၭၦဒုၭနဲၪနၧၩ, ဒဲနနါဂၧၫ့ဘၪ တၭ, နအၪ့ဎၬတၡါဝ့ၫနီၪ ဒၪဘၪလၧအမွဲဆၧအတီၩ တၭ,ယိခွါ, မွဲဆၧနီၪအီၪတၡါတၭ, ဆၧဘၪၥၭလိၪနီၪ",
			"5": "<sup>5</sup> ဆၧမၩဝ့ၫလၧအံၫစရ့လၭအကျၩ,- တၭၦခွၫမွဲဂ့ၩ, ၦ မုၪမွဲဂ့ၩ, လၧအမၩဆၧအၧၩ့နီၪ, နဘၪဂဲၫဆိၬဝ့ၫလၧ နတရၫ့တၭ, ဆၧလၧၦခွၫနီၪမွဲဂ့ၩ, ၦမုၪနီၪမွဲဂ့ၩနဘၪ ခွံၬဝ့ၫလၧလိးထီးအၥံၫလီၫ.",
			"6": "<sup>6</sup> ထီးဒၪၦထိးအၥၭနံၫဂၩ, ၥၧၫ့ဂၩအနိၭနီၪၦလၧအ ကြၨၭၥံၫ မိဘၪဆၧမၩၥံၫဝ့ၫလီၫ. အ့ၪမွဲထီးဒၪၦထိး",
			"7": "<sup>7</sup> အၥၭလဂၩဎးအနိၭနီၪမိဘၪဆၧမၩၥံၫဝ့ၫအ့ၬ.- ၦထိး အၥၭလဖၪအစူၪမိဘၪအီၪဆိၫ လၧအလီၩ့ဘဲၫၥိၭအမိ မၩၥံၫဝ့ၫတၭ, လၧခဲၫ့ထဲၩ့နီၪ ၦခမျၧးထီးအလူၬအစူၪ လီၫ. တၭနဘၪအီၪက့ၪခွံၬဆၧအၧၩ့ လၧနၥံၪအကျၩ ဘဲၫနီၪလီၫ.",
			"8": "<sup>8</sup> ဆၧကၪလါကဲၪကၩ လၧနဂးအ့ၪအီၪထၪ့လမံၩ့မံၩ့ လၧဆၧစ့ၩရၫ့, လၧဆၧၥွံၪဒဲဆၧၥွံၪအဘိၩ့ဆၧၫ့, လၧ ဆၧချဲၩ့ခွးဒဲဆၧချဲၩ့ခွးအဘိၩ့ဆၧၫ့, လၧဆၧထးဒဲဆၧ ထးအဘိၩ့ဆၧၫ့, ဆၧချဲၩ့ခွးလဖၪလၧနတရၫ့အဖၧၩ့ တၭ,ထီးနီၪလဖၧၫ့နဘၪဂဲထုၪ့တၭ လ့ၩထၪ့လၧအလး",
			"9": "<sup>9</sup> လၧယဟိဝၩနယွၩမိရွံန့ဝ့ၫတၭ,- နဘၪလ့ၩလၧၦလု ဆၧဒဲၦလံဝဲၫဖိၪ, ဒဲၦစ့ၩရၫ့ခွးလၧအမိအီၪလၧမုနံၩလ ဖၪနီၪအအီၪတၭ, နဘၪအၪ့စၪ့ဆၧတၭ, အဝ့ၫၥံၪမိဒုၭ",
			"10": "<sup>10</sup> နဲၪနၧၩလၧဆၧစ့ၩရၫ့လီၫ.- နဘၪမၩဘဲၫဆၧစ့ၩရၫ့ဝ့ၫ ဒၪအၥိၭ, လၧၦလၧအလးထီးယဟိဝၩမိရွံန့ဝ့ၫနီၪမိ ဒုၭနဲၪနၧၩတၭ, နဘၪထီးလၩ့နၥၭဘဲၫၥိၭ နမိမၩဆၧ",
			"11": "<sup>11</sup> ဘဲၫကယဲဆၧလၧအဝ့ၫၥံၪနီၪ မိၥီၪ့လိၪနၧၩလီၫ.- ထီး ဒၪဆၧၥနိၫ အဆၧစ့ၩရၫ့ လၧအဝ့ၫၥံၪ မိၥီၪ့လိၪနၧၩ, ဒဲ ဘဲၫဆၧစ့ၩရၫ့လၧအဝ့ၫၥံၪ မိလီၩဘၪနၧၩနီၪ, နမိဘၪ မၩလီၫ. လၧဆၧၥနိၫ လၧအဝ့ၫၥံၪမိဒုၭနဲၪနၧၩနီၪ, လၧနစူၪထွ့ၪလခီၫမွဲဂ့ၩ, လၧနစူၪစ့ၪလခီၫမွဲဂ့ၩ, ထီး ကၠၪပဲၩခွံၬနၥၭလဂ့ၩ.",
			"12": "<sup>12</sup> တၭၦလၧအအီၪက့ၪဖိၫအၥၭ, ဒဲလခိၭနၪဘၪၦလု ဆၧအလူလၧ အဆၧၫ့ထုၪ့ ဘဲၫၥိၭအမိမၩဆၧလၧယ ဟိဝၩနယွၩအမ့ၬယၫမွဲဂ့ၩ, ၦစ့ၩရၫ့ခွးအလူမွဲဂ့ၩ, အ ဝ့ၫဒၪမိဘၪဆၧမၩၥံၫဝ့ၫလီၫ. နမိဘၪအီၪက့ၪခွံၬဆၧ",
			"13": "<sup>13</sup> အၧၩ့ လၧအံၫစရ့လၭအဖၧၩ့လီၫ.- တၭၦခမျၧး မိနါ ဂၧၫ့, ဒဲၥၭမဲၪဆၧတၭ, အီၪက့ၪဖိၫလၧၩ့အၥၭအ့ၬ.",
			"14": "<sup>14</sup> ထီးနလ့ၩထီၩ့လၧခးဖၧၩ့ လၧယဟိဝၩနယွၩမိဖ့ၪ လၫ့နၧၩတၭ, မိန့ဘၪဝ့ၫဒဲမိအီၪဘၪလၧအဖၧၩ့, ဒဲမိစံၭ, ယမိအီၪက့ၪစဎွၩလၧယဖၫ့ခိၪ, ဘဲၫၦဆၨၩထီးအ",
			"15": "<sup>15</sup> လူၬလၧအအီၪဝၬဖီၩ့ယၧၩ အၥိၭနီၪတၭ,- နမိဘၪ အီၪတၡါစဎွၩ လၧနဖၫ့ခိၪလၧယဟိဝၩ နယွၩ ရွံန့ဝ့ၫ လီၫ. ၦလၧနထၧၫ့ဖုဝဲအကျၩနီၪ နမိဘၪအီၪက့ၪဝ့ၫလၧ စဎွၩလၧနဖၫ့ခိၪလီၫ. နအီၪက့ၪဘၪၦလခီၫဘၩ့မုးဖိၪ",
			"16": "<sup>16</sup> ၦလၧအလမွဲဘၪနထၧၫ့ဖုဝဲလၧနဖၫ့ခိၪအ့ၬ.- မွဲလါနၫ့ အဝ့ၫဒၪမၩအၪထၪ့ဘၪကၥ့ၪလဖၪ လၧအဂးဒၪဝ့ၫအ့ၬ, ဒဲဒုၭထဲၩ့ထဲၩ့ၦခမျၧး လၧအံဇံၭအဖၧၩ့, ဘဲၫၥိၭအမိ မၩအၪထၪ့ကၥ့ၪလဖၪနီၪအ့ၬ. အဂဲးဘဲၫယီၩယဟိဝၩ စံၭယူၭနၥံၪ, ထီးထဲၩ့ဖိၬလၧၩ့ဖၧၩ့ၥၭအဝ့ၫနီၪလဂ့ၩ.",
			"17": "<sup>17</sup> တၭအဝ့ၫဒၪ မၩအၪထၪ့ဘၪအမၫလဖၪ လၧအဂးဒၪ ဝ့ၫအ့ၬ, ဘဲၫၥိၭအၥၭထီးကၠၪပဲၩခွံၬအၥၭလဂ့ၩး မၩ အၪထၪ့ဆ့ကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫၥံၪ အၪအၪလ့ၬ",
			"18": "<sup>18</sup> ဆ့အ့ၬ.- တၭဆၧမိမၩအၥၭထီးအဆၧၫ့နၩ့လၧအဘၩ့ အမုးအလးဆီၩ့ဆီအဖၫ့ခိၪတၭ, ဆၧမိမၩအၥၭလၧ အမိဘၪကွ့ၭဆဲၫလံၬဆၧၥီၪ့ဆၧၥၫ့ယီၩ လၧလံၬလၧ",
			"19": "<sup>19</sup> အအီၪလၧၦလုဆၧၦလံဝဲၫဖိၪအမ့ၬယၫလီၫ.- မွဲအမိ ဘၪအီၪ လၧအစူၪဖၧၩ့တၭ, အဝ့ၫဒၪမိဘၪဖီလၧအ ဖၧၩ့လဆိၩဒၪဝ့ၫကိၭမုနံၩဒ့ၭ, ဘဲၫၥိၭအမိမၩလိၪဆၧ ၥၭမဲၪယဟိဝၩအယွၩ ဒဲထီးန့ဆၧၥီၪ့ဆၧၥၫ့ယီၩ, ဒဲၥနိၫ လဖၪယီၩအလူအထၫထီးအလူၬ, ဘဲၫၥိၭအမိမၩဝ့ၫ,",
			"20": "<sup>20</sup> ဘဲၫၥိၭအထီးအီၪက့ၪထၪ့ထီၫအၥၭ လၧအထၧၫ့ဖုဝဲ အဖၫ့ခိၪ, ဒဲဘဲၫၥိၭအထီးကၠၪပဲၩခွံၬအၥၭ လၧဆၧမၪ လူၬအအီၪ, လၧစူၪထွ့ၪလခီၫမွဲဂ့ၩ, လၧစူၪစ့ၪလခီၫ မွဲဂ့ၩနီၪလဂ့ၩး မွဲဘဲၫၥိၭအမိမၩအၪထၪ့အမုနံၩလဖၪ လၧအဘၩ့အမုးအဖၧၩ့, အဝ့ၫဒၪ, ဒဲအဖိၪလဖၪလၧ အံၫစရ့လၭအကျၩလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ၦလုဆၧၦလံဝဲၫဖိၪလဖၪ, ဒဲၦလံဝဲၫဖိၪလဒီၪ့ထီးအ လူၬနီၪ, အလးမွဲဂ့ၩ, အဆၧန့ၥၫမွဲဂ့ၩ, အီၪဘၪလၧၦ အံၫစရ့လၭဖိၪအကျၩအ့ၬ. အဝ့ၫၥံၪ မိဘၪအၪ့ယဟိ",
			"2": "<sup>2</sup> ဝၩအဆၧလုမ့ၪ, ဒဲအဆၧန့ၥၫလီၫ.- အခိးမွဲအဝ့ၫၥံၪ အီၪဘၪလၧအဆၧန့ၥၫ လၧအထၧၫ့ဖုဝဲအကျၩအ့ၬ. ယဟိဝၩ မွဲအဆၧန့ၥၫ, ဘဲၫအစံၭဆၧလၧအဝ့ၫၥံၪအ ၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> တၭအယီၩမွဲဆၧစ့ၩရၫ့ဘၪဆဲၫ့ လၧၦလုဆၧလၧအ မိန့ဘၪဝ့ၫလၧၦခမျၧး, ဒဲလၧၦလၧအလုထၪ့ဆၧလုချီ ဖၫမွဲဂ့ၩ, ၥိၪ, ဘ့ၪမွဲဂ့ၩ, မိဘၪဖ့ၪလၫ့ၦလုဆၧလၧအ",
			"4": "<sup>4</sup> ခိၬထံၭခိၪ, ဒဲအနိၭပၩထံၭနံၫခီၫ, ဒဲအကဖူၫလီၫ.- ဆၧ အဆိၫဘၪဆဲၫ့လၧနဘုၪၥံၪဂူၫၥံၪး နစဘံၭထံၫ, ဒဲနၥိၪ, ဒဲၥိၪအဆီၪ့လၧနထံၬဆိၫနီၪ နမိဘၪဖ့ၪလၫ့အဝ့ၫလီၫ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩနယွၩရွံန့ယူၭအဝ့ၫဒၪလၧဆၧ ဒီၪ့ထီးအလူၬအကျၩ, ဘဲၫၥိၭအမိဆၧၫ့ထုၪ့မၩဆၧလၧ ယဟိဝၩအမံၩ့, အဝ့ၫဒၪ, ဒဲအဖိၪခွၫ ကိၭမုနံၩမုနၩဒ့ၭ",
			"6": "<sup>6</sup> လီၫ.- ၦလံဝဲၫဖိၪအ့ၪဂဲၫထၪ့လၧ နတရၫ့လစီၪ့စီၪ့လၧ ကယဲအံၫစရ့လၭဖိၪအကျၩ ထီးအအီၪဝ့ၫအလးတၭ, ဂဲၫဝ့ၫ လၧဆၧအလး လၧယဟိဝၩမိရွံန့ဝ့ၫ, ဆိၫ့ဆၧ",
			"7": "<sup>7</sup> လၧအၥၭထၧၫ့ဖျိၪ့ယၫတၭ,- ထီးနီၪလဖၧၫ့မိမၩဘၪ ဆၧလၧယဟိဝၩအယွၩအမံၩ့, ဘဲၫအထၧၫ့ဖုဝဲထီးအ လူၬၦလံဝဲၫဖိၪ လၧအဆၧၫ့ထုၪ့ထီးနီၪလၧယဟိဝၩအ",
			"8": "<sup>8</sup> မ့ၬယၫအၥိၭနီၪလီၫ.- လၧအမိအၪ့ဘၪအဂးမိန့ဘၪ ဝ့ၫဘဲၫအဝ့ၫၥံၪအၥိၭနီၪလီၫ. လၧနီၪအမ့ၬယၫမိန့ဘၪ ဆၧအၪ့ဆၫခွံၬဆၧလၧအဖါလဖၪလီၫ.",
			"9": "<sup>9</sup> ထီးနအ့ၪလ့ၩထီၩ့လၧခးဖၧၩ့ လၧယဟိဝၩနယွၩဖ့ၪ လၫ့နၧၩတၭ, နမၩလိၪဘၪ လၧနမိမၩဆၧဘဲၫၦဆၨၩ",
			"10": "<sup>10</sup> လဖၪအဆၧၥၭလိၪအၥိၭနီၪအ့ၬ.- ၦလၧအအၪ့မၧၫ့ အဖိၪခွၫမွဲဂ့ၩ, အဖိၪမုၪမွဲဂ့ၩ, ခၫ့ဂၬမ့ၪနီၪ, မွဲအထီး အီၪလၧနၥံၪအကျၩလဂ့ၩး ၦဖၭဆၧဖိၪမွဲဂ့ၩ, ၦလၧအ ဒုၪဆၧအဆၧၫ့အထီမွဲဂ့ၩ, ၦလၧအအၪ့ဖၩ့ဆၧခါဆၧ",
			"11": "<sup>11</sup> မွဲဂ့ၩ, ဆၧယူၬမုၪမွဲဂ့ၩ,- ၦၥ့ၪဆၧအူၪဆၧပီၩမွဲဂ့ၩ, ၦ ဖံၭၥိၭလိၬအၥၭလၧဆၧနၪလဖၪမွဲဂ့ၩ, ၦလၧအအၪ့စၪ့ ၦၥံၫအလၩမွဲဂ့ၩ, အီၪဘၪလၧနၥံၪအကျၩဆ့အ့ၬ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩ ကယဲၦလၧအမၩဆၧလဖၪနီၪမွဲဆၧၥၭ လိၪလၧယဟိဝၩအမ့ၬယၫလီၫ. တၭယဟိဝၩနယွၩ နၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ လၧနမ့ၬယၫ လၧဆၧဘၪၥၭလိၪလ",
			"13": "<sup>13</sup> ဖၪအကၠီၩ့လီၫ.- နဘၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧယဟိဝၩ",
			"14": "<sup>14</sup> နယွၩအမ့ၬယၫလီၫ.- အဂဲးဘဲၫယီၩ ၦဆၨၩလၧနမိမၩ န့ဝ့ၫလဖၪနီၪ ခိၭနၪၦအမ့ၬဖိး, ဒဲၦလၧအအၪ့ဖၩ့ဆၧ ခါဆၧလဖၪအလူလီၫ. အ့ၪမွဲနဝ့ၫဒၪယီၩ ယဟိဝၩန ယွၩဖ့ၪလၫ့နမၩဘဲၫနီၪအ့ၬ.",
			"15": "<sup>15</sup> ယဟိဝၩနယွၩမိဒုၭဂဲထုၪ့မီၪလဂၩ လၧနထၧၫ့ဖုဝဲအ ကျၩ ဘဲၫယၧၩအၥိၭနီၪ, နၥံၪမိဘၪခိၭနၪအဝ့ၫဒၪအ",
			"16": "<sup>16</sup> လူလီၫ.- ဘဲၫကယဲဆၧလၧနအၪ့ကံၩ့ လၧယဟိဝၩန ယွၩ လၧဟိရ့ၭအဖၧၩ့ လၧဆၧအီၪကီၪ့အမုနံၩအၥိၭ နီၪ,လၧနစံၭ, မွဲယထီးနါဂၧၫ့ဘၪလၧၩ့ ယဟိဝၩယယွၩ အလူ, ဒဲမွဲယထီးဒၪဘၪလၧၩ့ မ့ၪဖၭဒိၪယီၩ လဂ့ၩ,",
			"17": "<sup>17</sup> ဘဲၫၥိၭယထီးၥံၫလဂ့ၩနီၪလီၫ.- တၭယဟိဝၩစံၭယၧၩ,",
			"18": "<sup>18</sup> ဆၧလၧအဝ့ၫၥံၪချဲၩ့ဆၧနီၪ ဂ့ၩမၬလီၫ.- ယမိဒုၭဂဲထုၪ့ မီၪလဂၩလၧအထၧၫ့ဖုဝဲအကျၩ, ဘဲၫနၧၩအၥိၭတၭ, ယမိအီၪက့ၪဆၧချဲၩ့လၧအနိၭတၭ, အဝ့ၫဒၪမိချဲၩ့ဆၧ လၧအဝ့ၫၥံၪ လၧကယဲဆၧလၧယမိမၪလူၬ အဝ့ၫနီၪ",
			"19": "<sup>19</sup> လီၫ.- တၭဆၧမိမၩအၥၭ လၧထီးဒၪၦလၧအလခိၭနၪ ဘၪယလူလၧအဝ့ၫဒၪမိချဲၩ့ဆၧ လၧယမံၩ့လဂၩဂၩနီၪ ယမိအၪ့ဎၬဆၧလၧအဝ့ၫလီၫ.",
			"20": "<sup>20</sup> အ့ၪမွဲမီၪလၧအအီၪက့ၪဖိၫလိၫအၥၭ, ဒဲချဲၩ့ဆၧချဲၩ့ လထံၪလၧယမံၩ့ လၧယလမၪလူၬဘၪဝ့ၫဘဲၫၥိၭအမိ ချဲၩ့ဆၧမွဲဂ့ၩ, အ့ၪချဲၩ့ဆၧလၧယွၩအဂူၫဂၩလဖၪအမံၩ့",
			"21": "<sup>21</sup> မွဲဂ့ၩ, ဆၧလၧမီၪလဂၩနီၪမိဘၪဆၧမၩၥံၫဝ့ၫလီၫ.- တၭ ဆၧချဲၩ့လၧနအ့ၪစံၭ, လၧနၥၭခံဖၧၩ့ ယဟိဝၩလချဲၩ့",
			"22": "<sup>22</sup> ဘၪနီၪပမိၥ့ၪယၫဘဲၫၥ့ၪလဲၪနီၪ, တၭ,- ထီးမီၪလဂၩ ချဲၩ့ဆၧလၧယဟိဝၩအမံၩ့တၭ, အ့ၪဆၧလမၩဘၪ, ဒဲ လကဲၪထၪ့ဘၪဆၧတၭ, ဆၧနီၪလမံၩ့မွဲဆၧလၧယဟိ ဝၩချဲၩ့ဝ့ၫအ့ၬ, မွဲမီၪလဂၩနီၪ အီၪက့ၪဖိၫအၥၭတၭ, ချဲၩ့ဆၧနီၪ, မွဲနထီးၥၭမဲၪအဝ့ၫဒၪလဂ့ၩ."
		},
		"19": {
			"1": "<sup>1</sup> ထီးယဟိဝၩနယွၩအ့ၪဒၪ့ထ့ၬခွံၬ ၦဆၨၩလဖၪလၧ ယဟိဝၩနယွၩ ဖ့ၪလၫ့အထံၫအခးလၧနၧၩတၭ, နမၩ န့ဘၪအဆၧ, ဒဲနအီၪလၧအဝ့ၫၥံၪအဒိၩ့ဖၧၩ့, ဒဲအဂံၪ့",
			"2": "<sup>2</sup> ဖၧၩ့တၭ,- နဘၪအၪ့နၩ့ဖၭဒိၩ့ၥၧၫ့ဖျိၪ့လၧနဂး လၧနခး လဘံၪ့အၥၭကျၩ, လၧယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩဘဲၫ",
			"3": "<sup>3</sup> ၥိၭနမိမၩန့ဝ့ၫလီၫ.- နဘၪတဲၩ့ဝဲၩဖၧၩ့ၥၭလဘီၩ့ လၧ နဂး, ဒဲအၪ့နၩ့ဖၭနခးအနဲၩ့ လၧယဟိဝၩနယွၩဖ့ၪလၫ့ နၧၩဘဲၫၥိၭနမိန့ၥၫဝ့ၫ, လၧၥၧၫ့စီၪ့, ဘဲၫၥိၭကယဲၦလၧ",
			"4": "<sup>4</sup> အမၩၥံၫၦၡၩမိစဲၪ့ထီးနီၪကိၭဂၩဒ့ၭလီၫ.- ၦလၧအမၩ ၥံၫၦၡၩတၭ, စဲၪ့ထီးနီၪဘဲၫၥိၭအမိမၧၫ့ဝ့ၫနီၪ, မွဲဆၧ မၩအၥၭဘဲၫယီၩ, ၦလၧအလၥ့ၪယၫဘၪတၭ, မၩၥံၫ ၦလၧအနဲၩ့ထံၭလၧအလၥၭဂဲၫ့ဘၪဝ့ၫ လၧမုဂၪတဂၪ",
			"5": "<sup>5</sup> လီၫ.- မွဲဘဲၫယီၩ, ၦလၧအလ့ၩဆၧလၧၦလၧအနဲၩ့ထံၭ လဂၩအၥိၭ လၧမံၩ့လၬကျၩ ဘဲၫၥိၭအမိခူၬၥံၪ့တၭ, ယၩ့ထၪ့အစူၪအီၪလၧကွၩလဘံၪ့, ဘဲၫၥိၭအမိခူၬလၩ့ ခွံၬၥံၪ့တၭ, ကွၩအနါဖျႃၪထၪ့ခွံၬလၧအထိတၭ, ဘၪၦ လၧအနဲၩ့ထံၭလဂၩတၭ, အဝ့ၫဒၪၥံၫဝ့ၫလီၫ. အနီၪ လဂၩမိစဲၪ့ဘၪလၧဒိၩ့နီၪလဖျိၪ့ဖျိၪ့အဖၧၩ့တၭ မၧၫ့ဝ့ၫ",
			"6": "<sup>6</sup> လီၫ.- အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ၦအၪ့ဎၬန့ဆၧၥွံၪလၧ အၥၭခိအဘိၩ့ဘၭနီၪ မိလီၩ့ဆီၪ့ၦမၩၥံၫဆၧတၭ, ဖၧၩ့ၥၭအ့ၪယဲၩ့နီၪ, မိချႃၭန့ဝ့ၫတၭ, မိမၩၥံၫဘၪခိၬဝ့ၫ လီၫ. မွဲလါနၫ့ ဆၧစ့ၩရၫ့ၥံၫအီၪအ့ၬး အဂဲးဘဲၫယီၩ ၥၭဂဲၫ့ဝ့ၫလၧမုဂၪတဂၪအ့ၬ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, ယမၪလူၬနၧၩဘဲၫယီၩ, နမိဘၪ",
			"8": "<sup>8</sup> အၪ့နၩ့ဖၭဒိၩ့ၥၧၫ့ဒိၩ့လၧနဂးလီၫ.- တၭယဟိဝၩနယွၩ အ့ၪမၩလဲထၪ့နခးအနဲၩ့ထံၭလဖၪ, ဘဲၫအဆိၪလၩ့အ ၥၭလၧနဖါလဖၪ, ဒဲဖ့ၪလၫ့နခးထၧၫ့ဘံၪ့ယၫ, လၧအစံၭ",
			"9": "<sup>9</sup> ဝဲၩဝ့ၫလၧအမိဖ့ၪလၫ့နဖါလဖၪတၭ,- ကယဲဆၧမၪလူၬ လၧအမၪလူၬနၧၩ လၧမုဆၫလနံၩယီၩ, နအ့ၪထီးန့ဝ့ၫ ထီးအလူၬ, ဘဲၫၥိၭနမိမၩဝ့ၫလၧနမိအဲၪယဟိဝၩနယွၩ ဒဲဖိၬအဖၧၩ့ၥၭလဖၪ ကိၭမုနံၩမုနၩဒ့ၭတၭ, နမိဘၪအီၪ က့ၪအၪထၪ့ဒံၭ ဒိၩ့ၥၧၫ့ဒိၩ့လၧနဂး လၧဒိၩ့ၥၧၫ့ဒိၩ့နီၪ",
			"10": "<sup>10</sup> အဖၫ့ခိၪ,- ဘဲၫၥိၭဆၧၥွံၪ လၧအဆၧဒဲၩဘၭလအီၪ ဘၪ, ထီးဘၪဆၧဂါလၩ့ဝ့ၫလၧနခးဖၧၩ့ လၧယဟိဝၩ နယွၩဖ့ၪလၫ့နၧၩ လၧဆၧန့ၥၫအဂးလဂ့ၩတၭ, ဆၧၥွံၪ ထီးဘၪနလီၩ့လဂ့ၩလီၫ.",
			"11": "<sup>11</sup> အ့ၪမွဲၦအ့ၪမ့ၬလဲၩၦလၧအနဲၩ့ထံၭတၭ, အီၪခိၭၥူၪ တၭ,ဂဲထုၪ့ထၫ့ဒုၪဒၩအဝ့ၫတၭ, ဖ့ၬဝ့ၫထီးအၥံၫ, ဒဲစဲၪ့",
			"12": "<sup>12</sup> ဖျိၭနုၬဝ့ၫလၧဒိၩ့နီၪလဖျိၪ့ဖျိၪ့တၭ,- ထီးနီၪလဖၧၫ့ၦ ၥုၪ့က့ၭၥၭၡါလၧအဒိၩ့နီၪ မိဘၪအၪ့မၧၫ့လၩ့ၦဂဲၫထဲၩ့ ဆိၬဝ့ၫတၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦအၪ့ဎၬန့ဆၧၥွံၪအစူၪဖၧၩ့",
			"13": "<sup>13</sup> ဘဲၫၥိၭအမိၥံၫဝ့ၫလီၫ.- နမ့ၬၥၪလီၫ့ကီၩ့ဘၪအ့ၬ. တၭန ဘၪအီၪက့ၪခွံၬဆၧၥွံၪ လၧအဆၧဒဲၩဘၭလအီၪဘၪ လၧအံၫစရ့လၭအဖၧၩ့, ဘဲၫၥိၭဆၧမိဂ့ၩထၪ့လၧနဂး လီၫ.",
			"14": "<sup>14</sup> ၦလၧနနဲၩ့ထံၭအဂၪ့ခိၪအဆၧမၩနဲၪ့ လၧၦလၧဖျိၩ့ လံၩလံၩအီၪက့ၪလၧဆၧန့ၥၫ လၧနမိန့ၥၫလၧခးဖၧၩ့, လၧယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩဘဲၫၥိၭ နမိမၩန့ဝ့ၫနီၪ, နၥုၭဘၪအလးအ့ၬ.",
			"15": "<sup>15</sup> ၦထိးအၥၭလဂၩဎး ဂဲထုၪ့ထၫ့ဒုၪဒၩဘၪၦၡၩလၧ အဆၧအၧၩ့လမံၩ့မံၩ့အကၠီၩ့မွဲဂ့ၩ, လၧဆၧမၪလမံၩ့ မံၩ့လၧအမၩမၪဆၧအကၠီၩ့မွဲဂ့ၩ, နီၪအ့ၬ. ထီးၦထိး အၥၭနံၫဂၩအနိၭမွဲဂ့ၩ, ထီးၦထိးအၥၭၥၧၫ့ဂၩအနိၭ",
			"16": "<sup>16</sup> မွဲဂ့ၩ, ဆၧအခွးမိအီၪဂုးအီၪခၧၫ့လီၫ.- ၦထိးဘျံၭထိး ဘျၪအၥၭလဂၩ အ့ၪဂဲထုၪ့ထၫ့ဒုၪဒၩၦလဂၩဂၩ ဘဲၫ",
			"17": "<sup>17</sup> ၥိၭအမိထိးအၥၭ လၧဆၧအၧၩ့လၧအဂဲးတၭ,- ၦနံၫ ဂၩလၧအချဲၩ့ခွးနီၪ မိဘၪဆၧၫ့ထုၪ့လၧယဟိဝၩအမ့ၬ ယၫလၧၦလုဆၧ ဒဲၦစ့ၩရၫ့ခွးလဖၪအမ့ၬယၫ, လၧအ",
			"18": "<sup>18</sup> အီၪဝ့ၫလၧမုနံၩလဖၪနီၪ,- တၭၦစ့ၩရၫ့ခွးမိဘၪအၪ့စၪ့ ဆၧအ့ၪဂ့ၩတၭ, ယိခွါ, ၦထိးအၥၭအ့ၪမွဲၦထိးဆၧအ",
			"19": "<sup>19</sup> ဘျံၭအဘျၪလၧအထၧၫ့ဖုဝဲအဂဲးတၭ,- နၥံၪမိဘၪမၩ အဝ့ၫ ဘဲၫအဆီၫ့မီၪ့လၧအမိမၩအထၧၫ့ဖုဝဲ အၥိၭနီၪ လီၫ. တၭနၥံၪ မိဘၪအီၪက့ၪခွံၬဆၧအၧၩ့ လၧနၥံၪအ",
			"20": "<sup>20</sup> ကျၩလီၫ.- တၭၦလၧအအီၪလၩ့ထးလဖၪနီၪ, မိနါဂၧၫ့, ဒဲၥၭမဲၪဆၧ, ဒဲမၩလၧၩ့ဆၧအၧၩ့ဘဲၫနီၪၥိၭလၧနၥံၪအ",
			"21": "<sup>21</sup> ကျၩအ့ၬ.- နမ့ၬၥၪမိယၫ့ၥၭဘၪအဝ့ၫအ့ၬး ၥၭမၧၫ့လၧ ၥၭမၧၫ့အဂး, မ့ၬလတီၪ့လၧမ့ၬလတီၪ့အဂး, ၥွၫလဘံၪ့ လၧၥွၫလဘံၪ့အဂး, စူၪလၧစူၪအဂး, ခၪ့လၧခၪ့အဂး လီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ထီးနအ့ၪလ့ၩထၪ့ဒုၭၥုၭ လၧနဒုၪနဒၩတၭ, နဒၪဘၪ ကၥ့ၪလဖၪ, ဒဲလဲၪ့ၥုၭလဖၪ, ဒဲၦခမျၧးအၪနဲၪ့နၧၩဒံၭ တၭ, ထီးၥၭမဲၪအဝ့ၫၥံၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ယဟိ ဝၩနယွၩအီၪလၧနၥိၭ လၧအဒုၭစဲၪ့ထၪ့ခွံၬနၧၩ လၧ",
			"2": "<sup>2</sup> ခးအံဇံၭအဖၧၩ့လီၫ.- တၭထီးနလ့ၩဘူၭလၧဆၧဒုၭ ၥုၭတၭ, ဆၧမိမၩအၥၭလၧၦလုဆၧလဂၩ, မိဘၪၥုၭ ဘူၭအၥၭ ဒဲချဲၩ့ဆၧလၧၦခမျၧးလီၫ. တၭအဝ့ၫမိဘၪ",
			"3": "<sup>3</sup> စံၭအဝ့ၫၥံၪ, အံၫစရ့လၭဧ့, ခိၭနၪဘီၪ,- လၧမုဆၫလ နံၩယီၩ နၥံၪလ့ၩဒုၭၥုၭလၧနၥံၪအဒုၪအဒၩလီၫ. မွဲန ၥံၪအၥၭအဂဲးအဘၭထီးလၩ့ဆါလဂ့ၩ, ၥၭမဲၪဆၧလ ဂ့ၩ, ဝၭထိၬလဂ့ၩ, အၪ့ယိၪဆၧလၧအကၠီၩ့လဂ့ၩ,",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩယဟိဝၩနၥံၪအယွၩ, မွဲၦလၧအလ့ၩဆၧ လၧနၥံၪအၥိၭ ဘဲၫၥိၭအမိဒုၭဆၧထၫ့ဒၩနၥံၪအဒုၪအ ဒၩလၧနဂး, ဘဲၫၥိၭအမိထိးထဲၩ့တၩ့ထဲၩ့နၥံၪလီၫ.",
			"5": "<sup>5</sup> ၦဒိၪလဖၪမိဘၪချဲၩ့ဆၧလၧၦခမျၧးတၭ, စံၭ, ၦလၧ အၥုၪ့အဂံၪ့ၥၫ့တၭ, လမၩဒံၭဘၪ ဆၧမၩဘိၪ့ ဖလါ ဆၧနီၪ, မွဲၦလဂၩလဲၪး မွဲအဝ့ၫဒၪထဲၩ့ကဒၩထဲၩ့လၧ အဂံၪ့ဘီၪ. မိၥံၫဘၪခိၬလၧဆၧဒုၭၥုၭအဖၧၩ့တၭ, ၦ",
			"6": "<sup>6</sup> ဂူၫဂၩမိမၩဘိၪ့ဖလါဆၧနီၪလီၫ.- ၦလၧအၥုၪ့စဘံၭ မုအလးတၭ, လအၪ့ဒံၭဘၪအဆၧၥၪနီၪ, မွဲၦလဂၩ လဲၪး မွဲအဝ့ၫဒၪ ထဲၩ့ကဒၩထဲၩ့ လၧအဂံၪ့ဘီၪ. မိၥံၫ ဘၪခိၬလၧဆၧဒုၭၥုၭအဖၧၩ့တၭ, ၦဂူၫဂၩ မိအၪ့အ",
			"7": "<sup>7</sup> ဆၧၥၪနီၪလီၫ.- ၦလၧအအဲၪတၩ့အမၫတၭ, လအၪ့ မၩန့ဒံၭဘၪနီၪ, မွဲၦလဂၩလဲၪး မွဲအဝ့ၫဒၪထဲၩ့ကဒၩ ထဲၩ့လၧအဂံၪ့ဘီၪ. မိၥံၫဘၪခိၬလၧဆၧဒုၭၥုၭအဖၧၩ့",
			"8": "<sup>8</sup> တၭ, ၦဂူၫဂၩမိမၩန့ၦမုၪလီၫ.- တၭၦဒိၪလဖၪနီၪ မိ ဘၪချဲၩ့ဒံၭလၧၦခမျၧးတၭ, ဘၪစံၭ, မွဲၦၥၭမဲၪဆၧဒဲ အၥၭလၩ့ဘဲၩ လဂၩလဲၪး မွဲအဝ့ၫဒၪ ထဲၩ့ကဒၩထဲၩ့ လၧအဂံၪ့ဘီၪ. အထၧၫ့ဖုဝဲအၥၭမိလၩ့ဘဲၩဘၪခိၬဘဲၫ",
			"9": "<sup>9</sup> အဝ့ၫဒၪအၥၭအၥိၭနီၪလီၫ.- ၦဒိၪလဖၪနီၪ ချဲၩ့ဆၧ လၧၦခမျၧးဂီၩ့တၭ, ဆၧမိမၩအၥၭ လၧအမိဘၪအီၪ က့ၪၥုၭမုအခိၪလဖၪ ဘဲၫၥိၭအမိၥိၫ့ၦခမျၧးၥံၪလီၫ.",
			"10": "<sup>10</sup> ထီးနလ့ၩဘူၭ လၧဒိၩ့လဖျိၪ့ လၧနမိဒုၭဆၧထၫ့ဒၩ ဝ့ၫတၭ, နမိဘၪကိၭထၪ့ဆၧဘၪလိၬအိၭလိၬလၧအဂး",
			"11": "<sup>11</sup> လီၫ.- တၭဆၧမိမၩအၥၭ ထီးအ့ၪစံၭဆၧၫ့နၧၩ လၧ ဆၧဘၪလိၬအိၭလိၬလခီၫ, ဒဲဝဲထၪ့ဆၧလၧနဂးနီၪ, ထီးနီၪလဖၧၫ့ ဆၧမိမၩအၥၭ လၧၦခမျၧးလၧဆၧဒၪန့ လၧအဖၧၩ့ထီးအလူၬနီၪ မိကဲၪထၪ့ၦဖ့ၪအခီၫ့လၧနၧၩ",
			"12": "<sup>12</sup> တၭမိဘၪမၩနဆၧလီၫ.- တၭအ့ၪလမၩဘၪဆၧဘၪ လိၬအိၭလိၬလၧနၧၩ, ဒဲအ့ၪဒုၭၥုၭထၫ့ဒၩနၧၩတၭ, နမိ",
			"13": "<sup>13</sup> ဘၪဝၩ့ထၬဝ့ၫလီၫ.- ထီးယဟိဝၩနယွၩ အ့ၪဖ့ၪလၫ့ ဝ့ၫလၧနစူၪဖၧၩ့တၭ, နမိဘၪဖ့ၬၥံၫခွံၬၦခွၫလၧနၭအနါ",
			"14": "<sup>14</sup> ကိၭအဂၩဒ့ၭလီၫ.- အ့ၪမွဲၦမုၪၦမၧၩ့ ဖိၪဒံၩဖိၪၥၪ, ဒဲ ဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲကယဲဆၧအီၪလၧဒိၩ့ဖၧၩ့, အ ဆၧဖိၪဆၧလံၩထီးအလူၬနီၪ, နမိဘၪမၩန့လၧနဂးဒၪ နဝ့ၫ, တၭနမိအၪ့ဘၪနဒုၪနဒၩ အဆၧဖိၪဆၧလံၩလၧ ယဟိဝၩနယွၩ ဖ့ၪလၫ့နၧၩလီၫ.",
			"15": "<sup>15</sup> တၭနမိဘၪမၩ ကယဲဒိၩ့ လၧအအီၪယဲၩ့ယဲၩ့လ့ၬ လၧနၧၩလၧအလမွဲဘၪ ၦဆၨၩလဖၪယီၩ အဒိၩ့ဘဲၫ",
			"16": "<sup>16</sup> နီၪအၥိၭလီၫ.- အ့ၪမွဲလၧဒိၩ့လၧၦဆၨၩလဖၪလၧယ ဟိဝၩနယွၩဖ့ၪလၫ့နၧၩ လၧဆၧန့ၥၫအဂးနီၪ နဒုၭမၧၫ့",
			"17": "<sup>17</sup> ဘၪဆၧလၧအၥၪထၪ့နးမံၩ့အ့ၬ,- နဘၪမၩဂၭဂီၩ့ဝ့ၫ ဆံၫ့ဆၫ့ပျၩ့း ၦဟံၥၭဖိၪ, ဒဲၦအၫမိၫဖိၪ, ၦကၫနအၫ့ဖိၪ, ဒဲၦပံရ့ၭဖိၪ, ၦဟံဝဲၫဖိၪ, ဒဲၦယ့ဘုၫဖိၪ, ဘဲၫယဟိဝၩ",
			"18": "<sup>18</sup> နယွၩမၪလူၬနၧၩအၥိၭနီၪ,- ဘဲၫၥိၭအဝ့ၫၥံၪ ထီးၥီၪ့ လိၪနၥံၪ လၧနၥံၪမိမၩထွ့ၫအဆၧ ဘၪၥၭလိၪ ထီးအ လူၬအခဲၫ့ လၧအဝ့ၫၥံၪ မၩအယွၩလဖၪ, ဘဲၫၥိၭနၥံၪ ထီးမၩမၪဘၪယဟိဝၩ နၥံၪအယွၩလဂ့ၩ.",
			"19": "<sup>19</sup> ထီးနဒုၭဆၧ ဝၩ့ထၬဒိၩ့လဖျိၪ့ ဘဲၫၥိၭနမိမၩန့ဝ့ၫ တၭ,မၩထံၬထၬဝ့ၫ အၪနံၩအၪၥၫ့တၭ, နခူၬအၥံၪ့လဖၪ လၧကွၩ ဒဲနမၩဂၭဂီၩ့ဘၪဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩ နမိ အၪ့ဘၪအၥူၪအၥၪး တၭနခူၬလၩ့ခွံၬဘၪဝ့ၫအ့ၬ, (အ ဂဲးဘဲၫယီၩၥံၪ့လၧမံၩ့လၬကျၩမွဲၦၡၩအဆၧ), ဘဲၫၥိၭ နမိလ့ၩနုၬလၧဆၧလၧနမ့ၬယၫ လၧနမၩဝၩ့ထၬဆၧ",
			"20": "<sup>20</sup> နီၪလီၫ.- နမိမၩဂၭဂီၩ့ဒဲခူၬလၩ့ခွံၬဘၪ န့ၫၥံၪ့လၧနၥ့ၪ ယၫလၧအလမွဲဘၪၥံၪ့ လၧဆၧအၪ့ဘၪဝ့ၫအဂးတၭ, နမိမၩဘၪဆၧမၩထံၬထၬ ဆၧလၧဒိၩ့အနဲၩ့လၧအဒုၭ ဆၧထၫ့ဒုၪဒၩနၧၩထီးအစၪဝ့ၫလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> ဆၧအ့ၪဒၪန့ ၦဘၪဆၧမၩၥံၫဝ့ၫလဂၩ လၩ့ထံၩဖါ ဝ့ၫလၧဆၧပျၩ့ဖၧၩ့, လၧခးဖၧၩ့လၧယဟိဝၩနယွၩဖ့ၪ လၫ့နၧၩလၧဆၧဖီၪ့ထၬအဂးနီၪ, ၦလၧအမၩၥံၫဝ့ၫနီၪ",
			"2": "<sup>2</sup> ဆၧအ့ၪလၥ့ၪယၫဘၪတၭး- နၡၩၥုၪ့က့ၭၥၭၡါၥံၪ, ဒဲနၡၩစ့ၩရၫ့ခွးၥံၪမိဘၪဂဲၫထၪ့တၭ, မိဘၪထိးဆၧလၧ ဒိၩ့လဖၪအီၪဝၬဖီၩ့ၦလၧအဘၪဆၧမၩၥံၫဝ့ၫလဂၩး",
			"3": "<sup>3</sup> တၭဆၧမိမၩအၥၭ လၧဒိၩ့လဖျိၪ့လၧအအီၪဘူၭလၧ ၦလၧအဘၪဆၧမၩၥံၫဝ့ၫ ဒိၩ့လဖျိၪ့နီၪ, အၡၩၥုၪ့က့ၭ ၥၭၡါၥံၪမိအၪ့မၩန့ ချီမိလၧၦၡၩ လအၪ့မၧၫ့ဒံၭဘၪ အမၩဆၧနီၪ, လၧအလထုၭဒံၭဘၪ ဆၧလၧနိၪယိၭ",
			"4": "<sup>4</sup> ဘီၩ့အဖၧၩ့လဒုၩ,- တၭၦၥုၪ့က့ၭၥၭၡါၥံၪ မိၥိၫ့လၩ့ချီ မိနီၪလၧထံၫဖိၪချိၬအနဲၩ့ လၧအလၩ့ယွၩဝ့ၫလထံၪဎး လၧၦလထဲၫဘၪဝ့ၫ, လဎွံၪဘၪဆၧလၧအဖၧၩ့တၭ, မိ ဘၪဒၪ့ထ့ၬခွံၬချီမိအခိၬ ထီးနီၪလၧခိၪလီၩ့အဆူၭဖၧၩ့",
			"5": "<sup>5</sup> လီၫ.- တၭၦလုဆၧလဖၪ စလံဝဲၫအဖိၪခွၫၥံၪ မိဘၪ ၥုၭဘူၭအၥၭလီၫ. (အဂဲးဘဲၫယီၩယဟိဝၩနယွၩရွံန့ အဝ့ၫၥံၪနီၪဘဲၫၥိၭ အမိမၩအဆၧ, ဒဲဆိၪဂ့ၩဆၧ လၧ ယဟိဝၩအမံၩ့တၭး ထီးဒၪအဝ့ၫၥံၪအနိၭ ကယဲဆၧ",
			"6": "<sup>6</sup> အခွး,ဒဲဆၧထးနီၪ မိဘၪဆၧစ့ၩရၫ့ဝ့ၫလီၫ.)- တၭက ယဲၦၥုၪ့က့ၭၥၭၡါ လၧဒိၩ့အီၪဘူၭထုၬ လၧၦလၧအ ဘၪဆၧမၩၥံၫဝ့ၫ ထီးအလူၬနီၪ မိဘၪၥူၫဝၭခွံၬ အစူၪ လၧချီမိအဖၫ့ခိၪလၧအဘၪဆၧဒၪ့ထ့ၬခွံၬ အခိၪဎွံၪလၧ",
			"7": "<sup>7</sup> ထံၫချိၬဖၧၩ့နီၪလီၫ.- အဝ့ၫၥံၪမိဘၪစံၭဆၧၫ့ဆၧတၭ စံၭ, ပစူၪဂါလၩ့ဆၧၥွံၪယီၩအ့ၬ, ဒဲပမ့ၬၥၪဒၪဘၪဆ့",
			"8": "<sup>8</sup> အ့ၬ,- ယဟိဝၩဧ့, မၩဖီၩ့ဖျ့ၭဆၧလၧအံၫစရ့လၭနၡၩ ခမျၧးလၧနဎွ့ၩန့ထဲၩ့ဝ့ၫနီၪဆံၭ. တၭအီၪက့ၪဆၧၥွံၪ လၧအဆၧဒဲၩဘၭလအီၪဘၪ လၧနၡၩခမျၧးအံၫစရ့ လၭအလီၩ့လဂ့ၩ. တၭဆၧၥွံၪနီၪ မိဖီၩ့ဖျ့ၭ အဝ့ၫၥံၪ လီၫ.",
			"9": "<sup>9</sup> ထီးနအ့ၪမၩဆၧအတီၩအလီၩ့ လၧယဟိဝၩအ မ့ၬယၫတၭ, နမိမၩလၩ့မါခွံၬ ဆၧၥွံၪလၧၦလၧအဆၧ ဒဲၩဘၭလအီၪဘၪလၧနၥံၪအကျၩလီၫ.",
			"10": "<sup>10</sup> ထီးနအ့ၪလ့ၩထၪ့ဒုၭၥုၭထၫ့ဒၩနဒုၪနဒၩလဖၪတၭ, ယဟိဝၩနယွၩအ့ၪဖ့ၪလၫ့အဝ့ၫၥံၪ လၧနစူၪဖၧၩ့တၭ,န",
			"11": "<sup>11</sup> ဖီၪ့န့အၪ့မၧၫ့ဎီးယူၭအဝ့ၫၥံၪ,- ဒဲနဒၪဘၪလၧၦကဲၪဎီး ဖိၪအကျၩ, ၦမုၪလဂၩလၧအခံးအဂၩ့ဂ့ၩ, ဒဲဆၧမိန့",
			"12": "<sup>12</sup> ဘၪနၥၭလၧနမၫတၭ,- နမိဘၪဂဲၫဆိၬဝ့ၫလၧနဂံၪ့ဖၧၩ့ တၭ,အဝ့ၫဒၪမိဘၪလိၩ့အခိၪ, ဒဲဘၪၥွၪခွံၬအစူၪမံၪ,",
			"13": "<sup>13</sup> ဒဲမိဘၪဘဲၪ့လၩ့ခွံၬ အဆၧအဎီးအၡၩ အကီၩ့အၥိၭ တၭ, မိအီၪလၧနဂံၪ့ဖၧၩ့, ဒဲဂၪ့လၧအမိအဖါအကၠီၩ့ လၩထၧၫ့ဘံၪ့ယၫတၭ, လၧအလးခဲၫ့နီၪ နမိလ့ၩနုၬ ဘၪလၧအအီၪ, ဒဲကဲၪထၪ့အဝၩတၭ, အဝ့ၫဒၪမိကဲၪ",
			"14": "<sup>14</sup> ထၪ့နမၫလီၫ.- အ့ၪလဘၪဘၪနၥၭလၧအဝ့ၫဒၪတၭ, ဆၧမိမၩအၥၭ လၧနမိဘၪဖ့ၪလၫ့ အလ့ၩထီးဒၪအၥၭ လီၫ. နအၪ့ဆၫခွံၬဘၪဝ့ၫ လၧစ့ၩအဂးလါလါအ့ၬ. န ကဲၪဘၪအကဆါအ့ၬး အဂဲးဘဲၫယီၩ နဆၪ့လၩ့ယူၭ အဝ့ၫလီၫ.",
			"15": "<sup>15</sup> ၦအ့ၪအီၪလၧအမၫနံၫဂၩ, လဂၩဘၪဆၧအဲၪဝ့ၫ,ဒဲ လဂၩဘၪဆၧမ့ၬလဲၩဝ့ၫတၭ, အဝ့ၫၥံၪအ့ၪအီၪဖျဲၪန့အ ဖိၪလၧအဂး, ၦလၧအဘၪဆၧအဲၪဝ့ၫ, ဒဲၦလၧအဘၪ ဆၧမ့ၬလဲၩဝ့ၫနံၫဂၩလူၬတၭ, အဖိၪခွၫဝဲၡါမွဲၦမုၪလၧ",
			"16": "<sup>16</sup> အဘၪဆၧမ့ၬလဲၩဝ့ၫအဖိၪတၭ,- ထီးအဒုၭန့ၥၫအဖိၪ ခွၫလဖၪလၧဆၧလၧအအီၪဝ့ၫ လၧအစူၪဖၧၩ့တၭ, ဆၧ မိမၩအၥၭ လၧအမိအီၪက့ၪဘၪ ၦလၧအဘၪဆၧအဲၪ ဝ့ၫလဂၩ အဖိၪခွၫ လၧၦလၧအဘၪ ဆၧမ့ၬလဲၩဝ့ၫလ",
			"17": "<sup>17</sup> ဂၩ အဖိၪခွၫအဖိၪ ဝဲၡါအမ့ၬယၫအ့ၬ.- အ့ၪမွဲဘၪ ဖ့ၪလၫ့ဝ့ၫအဂးနံၫစၩ လၧကယဲဆၧအီၪဝ့ၫ လၧအစူၪ ဖၧၩ့နီၪ, မိဘၪအုၩ့လၩ့ၦလၧအဘၪဆၧမ့ၬလဲၩဝ့ၫလ ဂၩအဖိၪလၧအမွဲအဖိၪဝဲၡါလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫ နီၪမွဲအဂဲးအဘၭအခၪ့ထံၭး ဆၧစ့ၩရၫ့ဘၪဆဲၫ့လၧဝဲ ၡါအလးနီၪ မွဲအဝ့ၫဒၪနီၪအဆၧလီၫ.",
			"18": "<sup>18</sup> ၦလဂၩအ့ၪအီၪလၧအဖိၪခွၫလၧအနါကဲၪ့, လၧအ ပိၩ့ထၪ့အဖါအလူမွဲဂ့ၩ, လခိၭနၪဘၪအမိအလူမွဲဂ့ၩ,",
			"19": "<sup>19</sup> ထီးအဝ့ၫၥံၪအၪ့ၥီၪ့ဝ့ၫတၭ, လခိၭနၪဘၪ,- ထီးနီၪလ ဖၧၫ့အမိအဖါမိဘၪဖီၪ့န့, ဒဲဂဲၫဆိၬဝ့ၫလၧအဒိၩ့အၦ ၥုၪ့က့ၭၥၭၡါၥံၪအအီၪ, ဒဲလၧအလး အတရၫ့လီၫ.",
			"20": "<sup>20</sup> တၭမိဘၪစံၭလၧဒိၩ့ အၦၥုၪ့က့ၭၥၭၡါလဖၪ, ပဖိၪခွၫ လဂၩယီၩမွဲအနါကဲၪ့, ဒဲပိၩ့ထၪ့ဆၧတၭ, ခိၭနၪပလူ အ့ၬ,မွဲၦလီၩ့ဖိၬထွ့ၫ ၦၥၭအၧၩ့, ဒဲၦအီၩလၨၪဆၧအ",
			"21": "<sup>21</sup> ခဲၫ့လီၫ.- တၭၦဒိၩ့ဖိၪထီးအလူၬနီၪ မိဘၪခွံၬဝ့ၫလၧ လိးထီးအၥံၫလီၫ. တၭနမိဘၪအီၪက့ၪခွံၬ ဆၧအၧၩ့ လၧနၥံၪအကျၩဘဲၫနီၪတၭ, အံၫစရ့လၭထီးအလူၬမိ နါဂၧၫ့ဝ့ၫတၭမိၥၭမဲၪဆၧလီၫ.",
			"22": "<sup>22</sup> ၦအ့ၪမၩမၪဆၧလမံၩ့မံၩ့ လၧအကြၨၭၥံၫနီၪ, ဆၧ အ့ၪစ့ၩရၫ့လၧအဘၪၥံၫတၭ, အ့ၪဘၪဆၧမၩၥံၫဝ့ၫနီၪ,",
			"23": "<sup>23</sup> နအ့ၪစၧၩ့လၩ့ၥံၫဝ့ၫလၧၥံၪ့လီၩ့နီၪ,- အစွၪမိအီၪဘၪ လၧၥံၪ့လီၩ့ၥၫ့နၩချီၩ့အ့ၬ. နမိဘၪခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧမုလနံၩဎးနီၪ, (အဂဲးဘဲၫယီၩ ၦလၧအဘၪဆၧ စၧၩ့လၩ့ၥံၫ လၧၥံၪ့လီၩ့နီၪ ဘၪဆၧဆိၪအၧၩ့ လၧယွၩ လီၫ.) ဘဲၫၥိၭနခးလၧယဟိဝၩ နယွၩဖ့ၪလၫ့နၧၩလၧ ဆၧန့ၥၫအဂးနီၪ ထီးဘၪဆၧမၩဘၪၥၭလိၪဝ့ၫလဂ့ၩ လီၫ."
		},
		"22": {
			"1": "<sup>1</sup> နအ့ၪဒၪဘၪနထၧၫ့ဖုဝဲအချီမွဲဂ့ၩ အၥိၪအဘ့ၪမွဲဂ့ၩ, ဂၭဖျိၭတၭ, အီၪက့ၪနၥၭဘဲၫနလဒၪဘၪအၥိၭလဂ့ၩး နဘၪဒုၭထဲၩ့ထဲၩ့ဝ့ၫ လၧနထၧၫ့ဖုဝဲအအီၪတၡါလီၫ.",
			"2": "<sup>2</sup> နထၧၫ့ဖုဝဲအ့ၪလအီၪဘူၭဘၪလၧနၧၩမွဲဂ့ၩ, နအ့ၪလ ၥ့ၪယၫဘၪဝ့ၫမွဲဂ့ၩ, နမိဘၪဆိၬဝ့ၫ လၧနဂံၪ့ဒၪနဝ့ၫ တၭ, ဘၪအီၪဝ့ၫလၧနစူၪဖၧၩ့ထီးနထၧၫ့ဖုဝဲအၪ့ဎၬဝ့ၫ",
			"3": "<sup>3</sup> တၭ, နမိဘၪဖ့ၪလၫ့ထဲၩ့ဒီၭဝ့ၫလၧအဝ့ၫဒၪလီၫ.- နမိ ဘၪမၩလၧအကၥ့ၪယီၩ့ ဘဲၫနီၪအၥိၭတၭ, နမိဘၪမၩ လၧအကီၩ့အၥိၭဘဲၫနီၪအၥိၭတၭ, နမိဘၪမၩကယဲန ထၧၫ့ဖုဝဲအဆၧလမံၩ့လါလါလၧအလၩ့မါ, ဒဲနဒၪန့ ဘၪဝ့ၫထီးအလူၬနီၪ ဘဲၫနီၪအၥိၭလီၫ. ထီးအီၪက့ၪၥူၪ",
			"4": "<sup>4</sup> နၥၭလဂ့ၩ.- နထၧၫ့ဖုဝဲအကၥ့ၪယီၩ့မွဲဂ့ၩ, အချီမွဲ ဂ့ၩ, နအ့ၪဒၪဘၪအလၩ့ထံၩဖါ လၧဖၧၩ့ၥၭနီၪ, ထီး အီၪက့ၪၥူၪနၥၭလဂ့ၩ. နဘၪမၩဆၧၩ့ဝ့ၫတၡါဘဲၫနမိ ဘိၭဂဲထုၪ့ဝ့ၫအၥိၭလီၫ.",
			"5": "<sup>5</sup> ၦမုၪကီၩ့ဘၪၥိၭဘၪဆၧလၧ အဘၪဆဲၫ့လၧၦခွၫအ့ၬ, ၦခွၫၥိၭဘၪ ၦမုၪအဆဲၫ့အ့ၬ. အဂဲးဘဲၫယီၩ ကယဲၦ လၧအမၩဆၧဘဲၫနီၪလဖၪ မွဲဆၧဘၪၥၭလိၪလၧယဟိ",
			"6": "<sup>6</sup> ဝၩနယွၩအမ့ၬယၫလီၫ.- နအ့ၪဒၪဘၪထိၪၥွံၫအီၪလၧ ၥံၪ့ခံၫလၧဖၧၩ့ၥၭမွဲဂ့ၩ, လၧဂၪ့ခိၪအလီၩ့မွဲဂ့ၩ, ထိၪ ဖိၪအီၪမွဲဂ့ၩ ထိၪဒံၪအီၪမွဲဂ့ၩတၭ, အမိၡါဂုၪဝ့ၫလၧ ထိၪဖိၪအဖၫ့ခိၪမွဲဂ့ၩ လၧထိၪဒံၪအဖၫ့ခိၪမွဲဂ့ၩ, နမၩန့",
			"7": "<sup>7</sup> ဘၪအမိၡါဒဲအဖိၪအ့ၬ,- နမိဘၪဖျါခွံၬအမိၡါတၡါ တၭမၩန့အဖိၪလၧနဂး, ဘဲၫၥိၭဆၧမိဂ့ၩထၪ့လၧနဂး,",
			"8": "<sup>8</sup> ဒဲဘဲၫၥိၭနမိဒုၭအၪထၪ့နမုနံၩလဖၪလီၫ.- ထီးနမၩဂံၪ့ ၥၫ့လဖျိၪ့တၭ, နဘၪမၩဆၧခိၪဒၧၩ့ဝၬဖီၩ့ နဂံၪ့ခိၪနီၪ, ဘဲၫၥိၭၦအ့ၪလၩ့ထ့ၬတၭ, နထီးဘၪဆၧၥွံၪလၧနဂံၪ့",
			"9": "<sup>9</sup> အကၠီၩ့လဂ့ၩလီၫ.- နဎွံၪဘၪနစဘံၭမုအလးလၧဆၧ ချံၫအၪမံၩ့အ့ၬ. ဆၧချံၫလၧနဎွံၪလၩ့ဝ့ၫအၥၪ, ဒဲစဘံၭ အလးလၧအဆၧၥၪ မိကဲၪထၪ့ဘၪခိၬ ဆၧလဆံၫ့ဘၪ",
			"10": "<sup>10</sup> လီၫ.- နထဲၫဎုၬဘၪချီ ဒဲကၥ့ၪယီၩ့ လစီၪ့ဎးအ့ၬ.",
			"11": "<sup>11</sup> နကီၩ့နၥိၭဘၪဆၧအကီၫ့အၥိၭ မၩဝ့ၫလၧလူၪအၪမံၩ့, လၧၥၭကလၭဒဲၥီၫကဘၩ့မၩလစီၪ့ဎးအ့ၬ.",
			"12": "<sup>12</sup> နဖၬဘဲၩ့ လၧနလုၬနီၪ နဘၪမၩအနွံၫ လံခီၫလီၫ.",
			"13": "<sup>13</sup> ၦအ့ၪမၩန့အမၫ, ဒဲလ့ၩနုၬလၧအအီၪတၭ, မ့ၬလဲၩဝ့ၫ",
			"14": "<sup>14</sup> နီၪ,- ဒဲအီၪက့ၪဆၧမၪလၧအမၫအလီၩ့ လၧအဆၧချဲၩ့ တၭ, ဒုၭအီၪထၪ့အမံၩ့အၧၩ့တၭ, စံၭ, ယမၩန့ၦမုၪ ယီၩ, ထီးယလ့ၩနုၬလၧအအီၪတၭ, ယဒၪန့လၧအမွဲ",
			"15": "<sup>15</sup> ၦမုၪနၩ့တၡါအ့ၬ.- တၭၦမုၪနီၪအမိအဖါမိဘၪမၩန့ဒဲ ဂဲၫဆိၬဆၧဘၪဆဲၫ့ လၧအမွဲၦမုၪနၩ့နီၪ လၧၦၥုၪ့က့ၭ",
			"16": "<sup>16</sup> ၥၭၡါအအီၪလၧဒိၩ့အတရၫ့အဖၧၩ့နီၪ,- တၭၦမုၪနီၪ အဖါမိဘၪစံၭၦၥုၪ့က့ၭၥၭၡါလဖၪ, ယဖ့ၪလၫ့ ယဖိၪ မုၪလၧၦလဂၩယီၩ အမၫတၭ, အဝ့ၫဒၪ မ့ၬလဲၩဝ့ၫ",
			"17": "<sup>17</sup> လီၫ.- တၭယိခွါ, အီၪက့ၪဆၧမၪ လၧအမၫအလီၩ့ လၧအဆၧချဲၩ့တၭစံၭဝ့ၫ, ယဒၪန့ဘၪနဖိၪမုၪလၧအမွဲ ၦမုၪနၩ့တၡါအ့ၬ. မွဲလါနၫ့တၭဆၧလဖၪယီၩ မွဲဆၧ ဘၪဆဲၫ့လၧယဖိၪမုၪ အမုၪနၩ့တၡါလီၫ. တၭမွဲအဝ့ၫ ၥံၪမိဘၪဒၩလၩ့ ဆၧကဲၩ့ယၬလဘံၪ့နီၪ လၧဒိၩ့အၥုၪ့",
			"18": "<sup>18</sup> က့ၭၥၭၡါအမ့ၬယၫလီၫ.- တၭဒိၩ့နီၪ အၦၥုၪ့က့ၭၥၭ",
			"19": "<sup>19</sup> ၡါလဖၪ မိဘၪမၩန့ၦခွၫတၭ, အၪ့ၥီၪ့ဝ့ၫလီၫ.- တၭ မိဘၪဒုၭလိၭဝ့ၫလၧစ့ၩၡက့လၭလယၩ, ဒဲဖ့ၪလၫ့ဝ့ၫ လၧၦမုၪအဖါလီၫ. အဂဲးဘဲၫယီၩ မွဲအဒုၭအီၪထၪ့ၦ မုၪနၩ့တၡါ လၧအံၫစရ့လၭအကျၩလဂၩအမံၩ့အၧၩ့ လီၫ. မွဲအမိဘၪကဲၪအမၫတၭ, လဆိၩဒၪအၥၭနီၪခွံၬ",
			"20": "<sup>20</sup> ၡိၭဘၪဝ့ၫအ့ၬ.- အ့ၪမွဲဆၧလမံၩ့နီၪအ့ၪမွဲအတီၩ, ဆၧ ဘၪဆဲၫ့လၧအမုၪနၩ့တၡါနီၪ, အ့ၪလအီၪဘၪ လၧၦ",
			"21": "<sup>21</sup> မုၪအဂး,- ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪမိဘၪဂဲၫဆိၬၦမုၪ လၧအဖါအဂံၪ့အတရၫ့တၭ, ၦဒိၩ့ဖိၪနီၪ မိဘၪခွံၬဝ့ၫ လၧလိးထီးအၥံၫလီၫ. အဂဲးဘဲၫယီၩမွဲအမၩဆၧအၧၩ့ လၧအံၫစရ့လၭအကျၩ လၧအမၩဆၧလဲးဆၧဘျၪ လၧအဖါအဂံၪ့ဖၧၩ့လီၫ. တၭနမိဘၪအီၪက့ၪခွံၬဆၧ အၧၩ့လၧနၥံၪအကျၩဘဲၫနီၪလီၫ.",
			"22": "<sup>22</sup> ၦအ့ၪဒၪန့ၦလဂၩဂၩမံၫဎုၬ လၧၦမုၪလၧအအီၪလၧ အဝၩတၭ, မိဘၪဆၧမၩၥံၫဝ့ၫနံၫဂၩလူၬလီၫ. ၦခွၫ လၧအမံၫဎုၬလၧၦမုၪ, ဒဲၦမုၪနီၪလီၫ. နမိဘၪအီၪက့ၪ ခွံၬဆၧအၧၩ့လၧအံၫစရ့လၭအဖၧၩ့လီၫ.",
			"23": "<sup>23</sup> ၦမုၪလဂၩလၧအမွဲၦမုၪနၩ့ အ့ၪဘၪအဲၪတၩ့လိၬအ ၥၭလၧအဝၩတၭ, ၦအ့ၪဒၪန့ဝ့ၫလၧဒိၩ့ဖၧၩ့, ဒဲမံၫဎုၬဝ့ၫ",
			"24": "<sup>24</sup> တၭ,- နၥံၪမိဘၪဂဲၫဆိၬအဝ့ၫၥံၪနံၫဂၩလူၬလၧဒိၩ့အ တရၫ့တၭ, နၥံၪမိဘၪခွံၬဝ့ၫလၧလိးထီးအၥံၫလီၫ. မွဲ လၧၦမုၪလဂၩနီၪ အီၪဝ့ၫလၧဒိၩ့ဖၧၩ့တၭ, လကိၭၡၭ ထၪ့ဘၪအကၠီၩ့, ဒဲၦခွၫလၧအဆၪ့လၩ့ ၦလၧအနဲၩ့ ထံၭအမၫအကၠီၩ့လီၫ. တၭနၥံၪမိဘၪမၩလၩ့မါဆၧ အၧၩ့လၧနၥံၪအကျၩဘဲၫနီၪလီၫ.",
			"25": "<sup>25</sup> အ့ၪမွဲၦအ့ၪဒၪန့ၫၦမုၪ လၧအဘၪဆၧအဲၪတၩ့လဂၩ လၧမံၩ့လၬကျၩတၭအ့ၪဖိၭဆီၪ့န့ဝ့ၫတၭ, မံၫဎုၬဝ့ၫနီၪ မိဘၪၥံၫန့ၫၦခွၫလၧအမံၫဎုၬ လၧၦမုၪလဂၩနီၪလီၫ.",
			"26": "<sup>26</sup> အ့ၪမွဲၦမုၪလဂၩနီၪ နမၩဘၪဝ့ၫလၧဆၧနးမံၩ့အ့ၬ. ဆၧ ဒဲၩဘၭဘၪဆဲၫ့လၧဆၧၥံၫအီၪလၧ ၦမုၪနီၪအလီၩ့အ့ၬ. အဂဲးဘဲၫယီၩ မၩအၥၭဘဲၫၦဂဲထုၪ့ထၫ့ဒၩဘၪ ၦလၧ အနဲၩ့ထံၭတၭ, မၩၥံၫဝ့ၫအၥိၭနီၪ, ဆၧလမံၩ့ယီၩမွဲ",
			"27": "<sup>27</sup> ဘဲၫနီၪအၥိၭလီၫ.- အဂဲးဘဲၫယီၩၦဒၪၦမုၪလၧမံၩ့လၬ ကျၩ, ၦမုၪလၧအဘၪဆၧအဲၪတၩ့ဝ့ၫလဂၩနီၪကိၭၡၭ ထၪ့တၭ, ၦလၧအမိမၩဖီၩ့ဖျ့ၭဝ့ၫအီၪနးဂၩအ့ၬ.",
			"28": "<sup>28</sup> ၦအ့ၪဒၪန့ ၦမုၪလၧအမွဲၦမုၪနၩ့ လၧအလဘၪဆၧ",
			"29": "<sup>29</sup> အဲၪတၩ့ဘၪတၭ, ဖိၭဆီၪ့န့ဒဲမံၫဎုၬဝ့ၫတၭ,- ၦလၧအ မံၫဎုၬၦမုၪနီၪ မိဘၪဖ့ၪလၫ့ၦမုၪနီၪ အဖါအစ့ၩယဲဆံၫ, ဒဲၦမုၪနီၪ မိဘၪကဲၪထၪ့အမၫလီၫ. မွဲလၧအဆၪ့လၩ့ ဝ့ၫအကၠီၩ့တၭ, လဆိၩဒၪအၥၭနီၪခွံၬၡိၭဘၪဝ့ၫအ့ၬ.",
			"30": "<sup>30</sup> ၦအၪ့မၩန့ဘၪအဖါအမၫအ့ၬး တၭဝဲထၪ့ဘၪအဖါ အဆဲၫ့ခၪ့ထံၭဆ့အ့ၬ."
		},
		"23": {
			"1": "<sup>1</sup> ၦလၧအဒံၪၥၪဘၪထံၭဆၫမွဲဂ့ၩ, အထ့ၪဘၪဒၪ့ထ့ၬ ခွံၬမွဲဂ့ၩ, မွဲအလ့ၩနုၬဘၪလၧယဟိဝၩအဆၧအီၪကီၪ့",
			"2": "<sup>2</sup> အဖၧၩ့အ့ၬ.- ၦဒၧၩ့ဘၧၩ့ဖိၪလ့ၩနုၬဘၪလၧယဟိဝၩ အဆၧအီၪကီၪ့အဖၧၩ့အ့ၬ. ထီၩ့လၩ့ လၧအဆိၩဆံၫ ဆိၩလဆိၩလ့ၩနုၬဘၪ လၧယဟိဝၩ အဆၧအီၪကီၪ့",
			"3": "<sup>3</sup> အဖၧၩ့အ့ၬ.- ၦအၫမၧၫ့ဖိၪမွဲဂ့ၩ, ၦမိအၭဖိၪမွဲဂ့ၩ, လ့ၩနုၬဘၪလၧယဟိဝၩ အဆၧအီၪကီၪ့အဖၧၩ့အ့ၬ. ထီၩ့လၩ့လၧအဆိၩဆံၫဆိၩလဆိၩဒၪလ့ၬ, လၧယဟိ ဝၩအဆၧအီၪကီၪ့အဖၧၩ့ အဆိၩဆိၩ အကၠၪကၠၪနီၪ",
			"4": "<sup>4</sup> လ့ၩနုၬဘၪဝ့ၫအ့ၬ.- အဂဲးဘဲၫယီၩလၧနၥံၪစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭနီၪ, အဝ့ၫၥံၪဂဲၫအၪ့ဂၬ နၥံၪလၧဆၧအၪ့ဒဲ ထံၫလၧဖၧၩ့ၥၭအဂးအ့ၬ. ဒဲလၧအဝ့ၫၥံၪအၪ့လံၩ့စဘံ အီၫအဖိၪခွၫ စဘၫလၫ့ၦပံၥီၫဖိၪ လၧခးမ့ၬစိၫပတ့မၠၫ အဖၧၩ့လဂၩ, ဘဲၫၥိၭ အမိဆိၪအၧၩ့နၧၩ အဂဲးလီၫ.",
			"5": "<sup>5</sup> မွဲလါနၫ့ယဟိဝၩနယွၩခိၭနၪစဘၫလၫ့အလူအ့ၬ. အ့ၪ မွဲယဟိဝၩနယွၩမၩဆၧဆိၪအၧၩ့နီၪ ကဲၪထၪ့ဆၧဆိၪ ဂ့ၩလၧနဂးလီၫ. အဂဲးဘဲၫယီၩယဟိဝၩနယွၩအဲၪနၧၩ",
			"6": "<sup>6</sup> လီၫ.- အဝ့ၫၥံၪအဆၧဘၪလိၬအိၭလိၬ, ဒဲအဆၧဘီၪ ဆၧယီၫနီၪ လဆိၩဒၪနၥၭလၩ့ဆိၩလၩ့ကၠၪ နအၪ့ဎၬ",
			"7": "<sup>7</sup> ဘၪအ့ၬ.- နမ့ၬလဲၩဘၪ ၦအံဒၧၫ့ဖိၪအ့ၬး အဂဲးဘဲၫ ယီၩမွဲနထၧၫ့ဖုဝဲလီၫ. နၥၭဂဲၫ့ဘၪၦအံဇံၭဖိၪအ့ၬး အ ဂဲးဘဲၫယီၩ နမွဲယူၭၦလခီၫဘၩ့မုးဖိၪ လၧအခးဖၧၩ့",
			"8": "<sup>8</sup> လီၫ.- အဖိၪအလံၩလၧအအီၪဖျဲၪ လၧအဝ့ၫၥံၪၥၧၫ့ဆိၩ လဆိၩနီၪ မိလ့ၩနုၬဘၪဝ့ၫ လၧယဟိဝၩ အဆၧအီၪ ကီၪ့အဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ထီးၦၥုၭမုလ့ၩထၫ့ဒၩနဒုၪနဒၩလဖၪတၭ, ထီးနီၪ လဖၧၫ့ထီးလၩ့နၥၭ လၧကယဲဆၧအၧၩ့ဆၧၥၫ့ဆံၭ.",
			"10": "<sup>10</sup> ၦအ့ၪအီၪလၧနၥံၪအကျၩ လၧအလဆံၫ့ဘၪလၧအဘၪ န့ဆၧလဆံၫ့ဘၪ လၧမုနၩလခီၫအကၠီၩ့လဂၩဂၩတၭ, မွဲအမိဘၪစဲၪ့ထၪ့လၧၦၥုၪ့တဲၩအလး လၧခီၫ့လီၫ. လ့ၩ",
			"11": "<sup>11</sup> နုၬဘၪဝ့ၫလၧၦၥုၪ့တဲၩအလးဖၧၩ့အ့ၬ.- အ့ၪမွဲဆၧမိ မၩအၥၭ ထီးမုဂၪလၩ့နီၪ, မိအၪ့လူထံၫတၭး ထီးမု",
			"12": "<sup>12</sup> လၩ့နုၬနီၪမိဂဲၫထဲၩ့ လၧၦၥုၪ့တဲၩအလးဖၧၩ့လီၫ.- နမိ ဘၪအီၪဆ့လၧအလး လၧၦၥုၪ့တဲၩအလးလၧခီၫ့တၭ,",
			"13": "<sup>13</sup> နမိဘၪလ့ၩထၪ့လၧခီၫ့ထီးနီၪလီၫ.- တၭနမိဘၪအီၪ လၧဎ့ၬချီၩ့ဘၪဆဲၫ့လၧနစူၪဝဲၩ, ထီးနလ့ၩဂၭလိၫလၧ ခီၫ့တၭ,နမိဘၪခုၪ့လၩ့ဆၧတၭ, နမိဘၪကၠၪနၥၭတၭ,",
			"14": "<sup>14</sup> မၩဘံၭခွံၬဆၧလၧအဂဲၫလၩ့ခွံၬ လၧနၧၩလီၫ.- အဂဲး ဘဲၫယီၩယဟိဝၩနယွၩ လ့ၩဆၧလၧနၥုၪ့တဲၩအလး အၥၭကျၩဘဲၫၥိၭ အမိမၩဖီၩ့ဖျ့ၭနၧၩ, ဒဲဘဲၫၥိၭအမိ ဖ့ၪလၫ့ခွံၬနဒုၪနဒၩ လၧနမ့ၬယၫလီၫ. တၭနၥုၪ့တဲၩ အလးမိဘၪအီၪဆံၫ့ဎံၪ, ဘဲၫၥိၭအထီးဒၪဘၪဆၧလ ဆံၫ့ဘၪလၧနဖၧၩ့း ဒဲကၠၪဒိၭချိၫ့အၥၭလၧနၧၩလဂ့ၩ လီၫ.",
			"15": "<sup>15</sup> ၦဎီးဖိၪ လၧအစဲၪ့ဖီၩ့ဖျ့ၭ လၧအကဆါထီၩ့ဝ့ၫလၧ နအီၪလဂၩဂၩနီၪ, နဖ့ၪလၫ့ထဲၩ့ဘၪဝ့ၫလၧအကဆါ",
			"16": "<sup>16</sup> အ့ၬ.- မိဘၪအီၪလၧနၥိၭ, လၧနၥံၪအကျၩလၧအလး ထီးအမိရွံန့ဝ့ၫလၧနၥံၪအတရၫ့ဖၧၩ့လစီၪ့စီၪ့, ထီးဒၪ အဂ့ၩလၧအမ့ၬယၫလစီၪ့လီၫ. နမၩနၭမၩၡၪ့ဘၪဝ့ၫ အ့ၬ.",
			"17": "<sup>17</sup> ၦအ့ၭကံၫမုၪအီၪဘၪလၧၦအံၫစရ့လၭအဖိၪမုၪလ ဖၪအကျၩအ့ၬ. တၭၦစၩ့ပခၧၩ့ဖိၪအီၪဘၪ လၧၦအံၫ",
			"18": "<sup>18</sup> စရ့လၭအဖိၪခွၫလဖၪအကျၩဆ့အ့ၬ.- ၦအ့ၭကံၫမုၪ အလံၩ့အလဲၫမွဲဂ့ၩ, ထွံၪအဎွ့ၩမွဲဂ့ၩ, နဂဲၫဆိၬဘၪဝ့ၫ လၧယဟိဝၩနယွၩအဂံၪ့ဖၧၩ့ လၧနဆၧမၩဘိၪ့ ဘၪ ဆဲၫ့လၧဆၧဆိၪလၩ့အၥၭ လမံၩ့မံၩ့အဂးအ့ၬ. အဂဲး ဘဲၫယီၩ အဝ့ၫနံၫမံၩ့လူၬဒၪလ့ၬမွဲဆၧဘၪၥၭလိၪလၧ ယဟိဝၩအမ့ၬယၫလီၫ.",
			"19": "<sup>19</sup> စ့ၩအအ့ၪမွဲဂ့ၩ, ဆၧအၪ့အအ့ၪမွဲဂ့ၩ, ထီးဒၪဆၧလ မံၩ့မံၩ့ လၧၦဒုၭအၪ့လီးလၧအအ့ၪအဂးနီၪ, နဒုၭအၪ့ လီးဘၪ ဆၧလၧနထၧၫ့ဖုဝဲ လၧဆၧအအ့ၪထၪ့ အဂး",
			"20": "<sup>20</sup> အ့ၬ.- နဒုၭအၪ့လီးဘၪဆၧလၧၦလခီၫဘၩ့မုးဖိၪလၧ အအ့ၪထၪ့အဂးလီၫ. အ့ၪမွဲနထၧၫ့ဖုဝဲနီၪ နဒုၭအၪ့လီး ဘၪ ဆၧလၧအအ့ၪထၪ့အဂးအ့ၬ. ဘဲၫၥိၭယဟိဝၩန ယွၩမိဆိၪဂ့ၩနၧၩ လၧကယဲဆၧလၧနအီၪက့ၪနစူၪလၧ အလီၩ့လၧခးဖၧၩ့ထီးနလ့ၩမၩန့ဝ့ၫအဂဲးလီၫ.",
			"21": "<sup>21</sup> ထီးနဆိၪလၩ့နၥၭ လၧနမိမၩဘိၪ့ဆၧလၧယဟိဝၩ နယွၩတၭ, ထီးၥုၭနံၩၥုၭၥၫ့လၧနမိဖ့ၪလၫ့ဝ့ၫလဂ့ၩ. အဂဲးဘဲၫယီၩ ယဟိဝၩနယွၩမိအၪ့ဎၬန့ဝ့ၫလၧနၧၩတ ၡါတၭ, မွဲအမိကဲၪထၪ့ဆၧဒဲၩဘၭ လၧနလီၩ့လီၫ.",
			"22": "<sup>22</sup> အ့ၪမွဲနအ့ၪအီၪက့ၪနၥၭ ဘဲၫနထီးဆိၪလၩ့ နၥၭလဂ့ၩ",
			"23": "<sup>23</sup> တၭ,ဆၧဒဲၩဘၭအီၪလၧနလီၩ့အ့ၬ.- ဆၧလၧအထၪ့ ဖျ့ၭလၧနနိၭနီၪထီးန့တၭမၩဆံၭး ဆၧလၧနမိမၩဘိၪ့ ဒၪဆၧနီၪ, ဘဲၫနဆိၪလၩ့နၥၭ လၧယဟိဝၩနယွၩအမ့ၬ ယၫအၥိၭ, ဘဲၫနချဲၩ့ဆၧလၧနနိၭအၥိၭနီၪ နဘၪမၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလီၫ.",
			"24": "<sup>24</sup> ထီးနလ့ၩနုၬ လၧၦလၧနနဲၩ့ထံၭအစဘံၭမုအလး ဖၧၩ့တၭ, နမိအၪ့ဘၪစဘံၭၥၪထီးဒၪနၥၭထီးအဘျဲၩ အၪ့နၧၩလီၫ. မွဲလါနၫ့နဒုၭနုၬဘၪဆၧၥၪ လၧဆၧဖၧၩ့",
			"25": "<sup>25</sup> အ့ၬ.- ထီးနလ့ၩလၧၦလၧနနဲၩ့ထံၭ အဘုၪအီၪဆၧၫ့ ထုၪ့အကျၩတၭ, နမိအၪ့ဒ့ၭဘၪအဆဲၩ လၧနစူၪလီၫ. အ့ၪမွဲၦလၧနနဲၩ့ထံၭအဘုၪ လၧအအီၪဆၧၫ့ထုၪ့နီၪ နကူၭဘၪလၧထၭဂ့ၬအ့ၬ."
		},
		"24": {
			"1": "<sup>1</sup> ထီးၦၡၩမၩန့အမၫတၭ, အီၪဎုၬဝ့ၫနီၪအ့ၪလဘၪခိး ဘၪတၩ လၧအမ့ၬၥၪဖၧၩ့ လၧဆၧဘၪၥၭလိၪလမံၩ့ လၧအဒၪန့ဝ့ၫ လၧအလီၩ့အကၠီၩ့တၭ, ထီးနီၪလဖၧၫ့ မွဲအမိဘၪကွ့ၭဒၪဝ့ၫ လၧအလံၬလၩ့ၡၪလဘံၪ့ လၧအ ဂးတၭ, ဖ့ၪလၫ့ဝ့ၫလၧအစူၪဖၧၩ့နီၪတၭ ဒုၭစဲၪ့ထၪ့ခွံၬ",
			"2": "<sup>2</sup> အဝ့ၫဒၪလၧအဂံၪ့လီၫ.- ထီးအဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬ လၧ အဂံၪ့ဖၧၩ့တၭ, အ့ၪမိလ့ၩကဲၪထၪ့ဘၪအၥၭ ၦခွၫဂူၫ",
			"3": "<sup>3</sup> ဂၩအမၫနီၪမိလ့ၩဘၪဝ့ၫလီၫ.- အဝၩလၧခဲၫ့လဂၩအ့ၪ ၥၭဂဲၫ့ဝ့ၫတၭ, ကွ့ၭန့ဝ့ၫလၧအလံၬလၩ့ၡၪဒဲဖ့ၪလၫ့ဝ့ၫ လၧအစူၪဖၧၩ့, ဒဲအၪ့မၧၫ့အစဲၪ့ထၪ့ခွံၬလၧအဂံၪ့ဖၧၩ့ မွဲဂ့ၩ, အဝၩလၧခဲၫ့လဂၩလၧအန့မၫလၧအဝ့ၫအ့ၪၥံၫ",
			"4": "<sup>4</sup> မွဲဂ့ၩ,- အဝၩလၧအခၪ့ထံၭ လၧအဒုၭစဲၪ့ထၪ့ခွံၬအ ဝ့ၫဒၪလဂၩနီၪ, မၩန့ထဲၩ့ဘၪအမၫလၧအဘၪဆၧမၩ ဝ့ၫလဆံၫ့ဘၪအလးခဲၫ့နီၪအ့ၬ. အဂဲးဘဲၫယီၩဆၧနီၪ မွဲဆၧဘၪၥၭလိၪလၧယဟိဝၩအမ့ၬယၫလီၫ. တၭနဒုၭ မၪဘၪထံၫၥံၪခးၥံၪလၧယဟိဝၩနယွၩ ဖ့ၪလၫ့နၧၩလၧ ဆၧန့ၥၫအဂးအ့ၬ.",
			"5": "<sup>5</sup> ထီးၦမၩန့ၥၫ့အမၫတၭလ့ၩဒုၭဘၪၥုၭအ့ၬး တၭၦ အီၪက့ၪဆၧမၩကၩလၧအစူၪဖၧၩ့နးမံၩ့ဆ့အ့ၬ. မိအီၪ ဘၪပျီၩဖျ့ၭ လၧအဂံၪ့ဖၧၩ့ထၧၫ့နံၪ့ယၫတၭ, မိဒုၭၥၭ ထိၬအမၫလၧအမၩန့ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> ဆုၪ့ဂူၬလိးလၧအဖၫ့လၬမွဲဂ့ၩ, လၧအဖၫ့ခိၪလဖျိၪ့ မွဲဂ့ၩ, ၦမိမၩန့ဘၪလၧပီၩ့လၩ့ဆၧအ့ၬ. အဂဲးဘဲၫယီၩ မွဲအမၩန့ၦၡၩအၥၭမၧၫ့လၧပီၩ့လၩ့ဆၧလီၫ.",
			"7": "<sup>7</sup> ၦအ့ၪဒၪဘၪဆၧအၪ့ဂူၪန့အထၧၫ့ဖုဝဲ ၦအံၫစရ့လၭ ဖိၪလဂၩဂၩနီၪဒဲအၪ့မၧၫ့ဎီးဝ့ၫမွဲဂ့ၩ, အၪ့ဆၫခွံၬဝ့ၫမွဲ ဂ့ၩ, ၦလၧအအၪ့ဂူၪဆၧလဂၩနီၪ မိဘၪဆၧမၩၥံၫဝ့ၫ လီၫ. တၭနမိဘၪအီၪက့ၪခွံၬဆၧအၧၩ့ လၧနၥံၪအကျၩ လီၫ.",
			"8": "<sup>8</sup> လၧဆၧခံၫထူၬဆၫအၧၩ့ အဖၧၩ့နီၪ, ထီးလၩ့နၥၭ ဘဲၫၥိၭနမိထီးန့ဆၧလၩ့ထံးလၩ့ဆ့ၭတၭ, မၩဘဲၫကယဲ ဆၧလၧၦလုဆၧၦလံဝဲၫဖိၪ မိၥီၪ့လိၪနၥံၪအၥိၭနီၪဆံၭး ဘဲၫယမၪလူၬဝ့ၫအၥိၭနီၪ, နၥံၪမိဘၪထီးလၩ့နၥံၪအ",
			"9": "<sup>9</sup> ၥၭလၧနၥံၪမိမၩလီၫ.- လၧနၥံၪစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭ အလးခဲၫ့နီၪ ယဟိဝၩနယွၩမၩနးမံရအၫ့ ဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪ နၪ့ထၪ့ထဲၩ့ဆံၭ.",
			"10": "<sup>10</sup> ထီးနဒုၭအၪ့လီးနထၧၫ့ဖုဝဲ လၧဆၧလမံၩ့မံၩ့တၭ, နလ့ၩနုၬမၩန့ဘၪအပီၩ့လၩ့ဆၧ လၧအဂံၪ့ဖၧၩ့အ့ၬ.",
			"11": "<sup>11</sup> နမိဘၪဆၧၫ့ထုၪ့လၧခီၫ့တၭ, ၦလၧနဒုၭအၪ့လီးဆၧ လၧအဝ့ၫလဂၩနီၪ မိဘၪဂဲၫဆိၬထၪ့အပီၩ့လၩ့ဆၧလၧ",
			"12": "<sup>12</sup> နအီၪလၧခီၫ့လီၫ.- တၭၦလဂၩနီၪ အ့ၪၡၪ့အ့ၪယၬ တၭ,နမံၫဘၪလၧအပီၩ့လၩ့ဆၧအီၪ လၧနစူၪဖၧၩ့အ့ၬ.",
			"13": "<sup>13</sup> ထီးမုလၩ့နုၬတၭ, နမိဘၪဖ့ၪထဲၩ့တၡါအပီၩ့လၩ့ဆၧ နီၪဘဲၫၥိၭအမိမံၫလၧအဖၬဘဲၩ့ဒၪဝ့ၫအဖၧၩ့, ဒဲဆိၪဂ့ၩ နၧၩလီၫ. တၭဆၧမိကဲၪထၪ့ ဆၧတီၩဆၧလီၩ့လၧနဂး လၧယဟိဝၩနယွၩအမ့ၬယၫလီၫ.",
			"14": "<sup>14</sup> ၦဒိၭအၪ့လံၩ့ဖိၪလၧအၡၪ့အယၬ, ဒဲကြၨၭန့ဆၧလ မံၩ့မံၩ့လၧနထၧၫ့ဖုဝဲအကျၩမွဲဂ့ၩ, လၧၦလခီၫဘၩ့မုး ဖိၪလၧနခးဖၧၩ့အီၪလၧနတရၫ့ဖၧၩ့မွဲဂ့ၩ, နမၩနၭမၩ",
			"15": "<sup>15</sup> ၡၪ့ဘၪဝ့ၫအ့ၬ.- နမိဘၪဖ့ၪလၫ့ဝ့ၫလၧအလံၩ့အလဲၫ လၧအမုနံၩနီၪတၭ, မုလၩ့နုၬဘၪလၧအဖၫ့ခိၪအ့ၬး အ ဂဲးဘဲၫယီၩ မွဲအၡၪ့အယၬတၭ, ဒိၭနဲၩ့အၥၭလၧအ ဝ့ၫလီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, မွဲအမိကိၭထၪ့ထၫ့ ဒၩဘၪခိၬနၧၩလၧယဟိဝၩတၭ, ဆၧဒဲၩဘၭမိအီၪလၧ နလီၩ့လီၫ.",
			"16": "<sup>16</sup> အဖါလဖၪဘၪဆၧမၩၥံၫဝ့ၫ လၧအဖိၪလဖၪအကၠီၩ့, အ့ၬး ဒဲအဖိၪလဖၪဘၪဆၧမၩၥံၫဝ့ၫ လၧအဖါလဖၪအ ကၠီၩ့ဆ့အ့ၬ. ၦမိဘၪဆၧမၩၥံၫဝ့ၫ လၧအဆၧဒဲၩဘၭ ဒၪဝ့ၫအကၠီၩ့လီၫ.",
			"17": "<sup>17</sup> ၦလခီၫဘၩ့မုးဖိၪမွဲဂ့ၩ, ၦဖိၪဎွ့ၪမွဲဂ့ၩ, နဘိၭကၠၪပဲၩ ခွံၬဘၪအဆၧစ့ၩရၫ့အ့ၬ. တၭနမၩန့ထၪ့ဘၪၦမုၪမဲၫ",
			"18": "<sup>18</sup> အကီၩ့အၥိၭ လၧပီၩ့လၩ့ဆၧအဂးအ့ၬ.- နမိဘၪနၪ့ ထၪ့ထဲၩ့လၧနမွဲၦဎီးဖိၪ လၧအံဇံၭအဖၧၩ့, ဒဲလၧယဟိ ဝၩနယွၩ ဎွ့ၩန့ထဲၩ့နၧၩထီးနီၪလီၫ. မၩအၥၭဘဲၫနီၪ တၭယမၪလူၬနၧၩ ဘဲၫၥိၭနမိမၩဆၧလမံၩ့နီၪလီၫ.",
			"19": "<sup>19</sup> ထီးနကူၭဘုၪလၧဆံၬဖၧၩ့တၭ, ဘုၪလၧနၥၭနၪ့လ ထူနီၪ, နထဲၩ့ထဲၩ့မၩန့ဘၪဝ့ၫအ့ၬ. မိအီၪဘၪဝ့ၫလၧၦ လခီၫဘၩ့မုးဖိၪအဂး, လၧၦဖိၪဎွ့ၪအဂး, ဒဲၦမုၪမဲၫအ ဂး, ဘဲၫၥိၭယဟိဝၩနယွၩမိဆိၪဂ့ၩနၧၩ လၧကယဲနမၩ",
			"20": "<sup>20</sup> ဆၧလၧနစူၪလီၫ.- ထီးနဒိၪလၩ့န့နၥံၪ့အလဲအိၫ့အၥၪ တၭ, နဒိၪဘၪဒီၭအထဲၩ့လဖၪလၧခဲၫ့အ့ၬ. မိဘၪအီၪ ဝ့ၫလၧၦလခီၫဘၩ့မုးဖိၪအဂး, ဒဲလၧၦဖိၪဎွ့ၪ အဂး,",
			"21": "<sup>21</sup> ဒဲလၧၦမုၪမဲၫအဂးလီၫ.- ထီးနအၪ့ထုၫ့ကီၪ့ စဘံၭၥၪ လၧနစဘံၭမုအလးအဖၧၩ့တၭ, နအၪ့ထုၫ့ဘၪဆၧလၧ အအီၪလၩ့ထးလၧခဲၫ့အ့ၬ. မိအီၪဝ့ၫလၧၦလခီၫဘၩ့မုး ဖိၪအဂး ဒဲလၧၦဖိၪဎွ့ၪအဂး ဒဲလၧၦမုၪမဲၫအဂးလီၫ.",
			"22": "<sup>22</sup> တၭနမိဘၪနၪ့ထၪ့လၧနမွဲၦဎီးဖိၪ လၧခးအံဇံၭအဖၧၩ့ လီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယမၪလူၬနၧၩ, ဘဲၫၥိၭနမိ မၩဆၧလမံၩ့နီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> ၦၡၩအ့ၪချဲၩ့လိၬအၥၭလၧခွးတၭ, အဝ့ၫၥံၪဂဲၫလၧ စ့ၩရၫ့ခွး, လၧဆၧမိစ့ၩရၫ့အဝ့ၫၥံၪတၭ, ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪမိဘၪအီၪက့ၪတီၩၦအတီၩ, ဒဲစ့ၩရၫ့စၪၦအ",
			"2": "<sup>2</sup> အၧၩ့လီၫ.- ဆၧမိမၩအၥၭ လၧၦအအၧၩ့ အ့ၪကြၨၭ ဘၪဆၧထးဝ့ၫတၭ, ၦစ့ၩရၫ့ခွးလဂၩနီၪ မိဘၪဒုၭမံၫ နၩ့ဝ့ၫ, ဒဲဒုၭထးဝ့ၫလၧအမ့ၬယၫ အဘျၩ့ဎွ့ၩအံၩဎွ့ၩ",
			"3": "<sup>3</sup> အိၩဘဲၫအဆၧမၪအီၪဝ့ၫအၥိၭနီၪလီၫ.- မိထးဘၪဝ့ၫ အထံၪလံဆံၫတၭ, မၩအၪထၪ့ဘၪဝ့ၫအ့ၬ. အ့ၪမၩ အၪထၪ့ဆၧလဖၪ, ဒဲထးဝ့ၫအၪနဲၪ့အနီၪ လၧဆၧထး အၪထံၪအကၠီၩ့တၭ, နထၧၫ့ဖုဝဲမိမၩအၥၭဘဲၫလဆံၫ့ ဘၪအၥိၭလၧနမ့ၬယၫလီၫ.",
			"4": "<sup>4</sup> ထီးချီနီၪအ့ၪယဲးဘုၪတၭ, ၥံၫ့ထၬအနိၭလဂ့ၩ.",
			"5": "<sup>5</sup> နထၧၫ့ဖုဝဲခွၫလဖၪ အ့ၪအီၪဝ့ၫစီၪ့ဎးတၭ, ၦလဂၩ အ့ၪၥံၫတၭ, အဖိၪလအီၪဘၪနီၪ ၦလၧအၥံၫလဂၩအ မၫနီၪန့ဘၪအဝၩလၧၦဂူၫဂၩအဒီၪ့အဖိၪအ့ၬး အဝၩ အထၧၫ့ဖုဝဲလဂၩ, မိဘၪလ့ၩနုၬ လၧအအီၪ, ဒဲန့မၫ လၧအဝ့ၫဒၪတၭ, မၩအဝၩအထၧၫ့ဖုဝဲအဆၧလၧအဂး",
			"6": "<sup>6</sup> လီၫ.- တၭဆၧမိမၩအၥၭ လၧၦအဖိၪဝဲၡါလၧအအီၪ ဖျဲၪန့ဝ့ၫလဂၩ မိထၪ့ဘၭဝ့ၫလၧအထၧၫ့ဖုဝဲ လၧအၥံၫ လဂၩအမံၩ့, ဘဲၫၥိၭအမံၩ့ထီးလၩ့မါဘၪလၧအံၫစရ့",
			"7": "<sup>7</sup> လၭအဖၧၩ့လဂ့ၩလီၫ.- တၭမၩန့အထၧၫ့ဖုဝဲခွၫအမၫ နီၪအ့ၪလဘၪဘၪၦလဂၩနီၪအၥၭတၭ, အထၧၫ့ဖုဝဲအ မၫမိလ့ၩဒၪဝ့ၫ လၧဆၧတရၫ့ လၧၦၥုၪ့က့ၭၥၭၡါအ အီၪတၭ,စံၭ, ယဝၩအထၧၫ့ဖုဝဲအုၩ့လၩ့ဒုၭအီၪထၪ့အ ထၧၫ့ဖုဝဲအမံၩ့လၧအံၫစရ့လၭအဖၧၩ့အ့ၬ. မၩယဝၩ",
			"8": "<sup>8</sup> အထၧၫ့ဖုဝဲအဆၧနီၪအၥၭအီၪအ့ၬ.- ဒိၩ့အၡၩၥုၪ့က့ၭ ၥၭၡါမိဘၪကိၭန့ဝ့ၫတၭ, ချဲၩ့ဆၧလၧအဝ့ၫဒၪတၭ,အ လဂၩနီၪအ့ၪဆၧၫ့ထုၪ့စံၭ, မၩန့ၦမုၪနီၪ ယၥၭလအီၪ",
			"9": "<sup>9</sup> ဘၪတၭ,- အထၧၫ့ဖုဝဲအမၫမိဘၪလ့ၩလၧအအီၪလၧ ၦၥုၪ့က့ၭၥၭၡါအမ့ၬယၫ, ဒဲဘဲၪ့လၩ့ခွံၬအဝ့ၫနီၪအခၪ့ ဖံၭလၧအခၪ့လီၩ့ဒဲထိၪဖျံၭလၧအမ့ၬတၭ, မိစံၭဆၧၫ့ ဆၧ,ၦလၧအလမၩထၪ့ဘၪ အထၧၫ့ဖုဝဲအဂံၪ့လဂၩ",
			"10": "<sup>10</sup> နီၪ,မိဘၪဆၧမၩဝ့ၫဘဲၫနီၪၥိၭလီၫ.- တၭဆၧမိကိၭအ မံၩ့လၧအံၫစရ့လၭအဖၧၩ့, ၦလၧအဘၪဆၧဘဲၪ့လၩ့ ခွံၬအခၪ့ဖံၭအဂံၪ့နီၪလီၫ.",
			"11": "<sup>11</sup> ၦၡၩလဖၪအ့ၪအဲၪ့လိၬ ဆိၭချဲၩ့လိၬအၥၭလဂၩဒဲ လဂၩတၭ, အဝ့ၫလဂၩအမၫၥုၭဘူၭအၥၭ ဘဲၫၥိၭအ မိမၩဖျ့ၭအဝၩ, လၧၦလၧအထးဝ့ၫအစူၪဖၧၩ့, ဒဲယၩ့,",
			"12": "<sup>12</sup> ထၪ့အစူၪတၭ, ဖီၪ့န့ဝ့ၫလၧဆၧမ့ၬမဲအလးနီၪ,- ထီးနီၪ လဖၧၫ့ နမိဘၪဒၪ့ထ့ၬခွံၬအစူၪနီၪ, နလီၫ့ကီၩ့ယၫ့ၥၭ ဘၪအ့ၬ.",
			"13": "<sup>13</sup> နအီၪဘၪလၧခံၫ့ၥၪလမံၩ့, ဒဲခံၫ့ၥၪလမံၩ့ဒၪ, အဒိၪ",
			"14": "<sup>14</sup> ဒဲအဆံၭလၧနထိၪ့ဖၧၩ့အ့ၬ.- နအီၪဘၪလၧဆၧတိၪ့လ မံၩ့, ဒဲဆၧတိၪ့လမံၩ့ဒၪ, အဒိၪဒဲအဆံၭ လၧနဂံၪ့ဖၧၩ့",
			"15": "<sup>15</sup> အ့ၬ.- နမိဘၪအီၪလၧခံၫ့ၥၪဆၧအလၧၫ့အဎွ့ၩအတီၩ အလီၩ့, နမိဘၪအီၪလၧဆၧတိၪ့ဆၧအလၧၩ့အဎွ့ၩ,အ တီၩအလီၩ့, ဘဲၫၥိၭနမုနံၩလၧနအီၪ လၧထံၫၥံၪခးၥံၪ အဖၧၩ့လၧယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩ လဖၪနီၪမိအၪ",
			"16": "<sup>16</sup> ထၪ့ဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩ ကယဲၦလၧအမၩဆၧ နီၪလဖၪ, ကယဲၦလၧအမၩဆၧလတီၩလလီၩ့ဘၪနီၪ, မွဲဆၧဘၪၥၭလိၪလၧယဟိဝၩနယွၩအမ့ၬယၫလီၫ.",
			"17": "<sup>17</sup> လၧနၥံၪစဲၪ့ထၪ့ခွံၬလၧအံဇံၭနီၪ အၫမလ့ၭမၩနၧၩ",
			"18": "<sup>18</sup> လၧဖၧၩ့ၥၭနီၫလဲၪနီၫလဲၪနီၪ, နၪ့ထၪ့ထဲၩ့ဘီၪ,- လၧ နၥၭလၩ့ဘဲၩဆၧပွံၭနၥၭတၭ, အဝ့ၫဒၪဂဲၫထၪ့ကျီၪ့ခွံၬ ၦလၧအဂဲးဆါ အဘၭဆါလၧနလးခဲၫ့ထုၬတၭ, မွဲအ",
			"19": "<sup>19</sup> ၥၭမဲၪယွၩအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧမိမၩအၥၭ ထီးယဟိဝၩနယွၩမိဒုၭအီၪပွံၭနၧၩ လၧနဒုၪနဒၩအီၪ ဝၬဖီၩ့နၧၩ လၧထံၫၥံၪခးၥံၪအဖၧၩ့ လၧယဟိဝၩနယွၩ ဖ့ၪလၫ့နၧၩ လၧဆၧန့ၥၫအဂး လၧနၥံၪမိမၩန့ဝ့ၫတၭ, နမိထူၭခွံၬဆၧနၪ့ထၪ့ထဲၩ့ အၫမလ့ၭလၧမူၭခိၪဖၫ့လၬ တၭ,ထီးၥၭနၪ့လဂ့ၩ."
		},
		"26": {
			"1": "<sup>1</sup> ဆၧမိမၩအၥၭ, ထီးနလ့ၩနုၬလၧခးဖၧၩ့လၧယဟိ ဝၩနယွၩဖ့ၪလၫ့နၧၩ လၧဆၧန့ၥၫအဂး, ဒဲန့ဘၪဝ့ၫ, ဒဲ",
			"2": "<sup>2</sup> အီၪထီးနီၪတၭ,- နမိဘၪမၩန့ဆၧလၧကယဲဆၧၥၪဆိၫ လၧဂၪ့ခိၪဒုၭၥၪထၪ့ လၧထံၫၥံၪခးၥံၪ လၧယဟိဝၩန ယွၩဖ့ၪလၫ့နၧၩနီၪ, နမိဘၪဂဲၫဆိၬ ဒဲအီၪက့ၪလၩ့လၧ ဒၩ့ဖၧၩ့, ဒဲလ့ၩထီၩ့လၧအလးထီးယဟိဝၩနယွၩ မိရွံ",
			"3": "<sup>3</sup> န့ဝ့ၫဘဲၫၥိၭမိအီၪက့ၪအမံၩ့ထီးနီၪလီၫ.- တၭနမိဘၪ လ့ၩလၧၦလုဆၧလဂၩ, လၧအမိအီၪ လၧမုနံၩလဖၪ နီၪတၭ, စံၭအဝ့ၫ, လၧမုဆၫလနံၩယီၩ ယဒုၭနဲၪယဟိ ဝၩနယွၩ လၧယဂဲၫနုၬယူၭ လၧခးဖၧၩ့ လၧယဟိဝၩ ဆိၪလၩ့အၥၭ လၧပဖါလဖၪ လၧအမိဖ့ၪလၫ့ပၧၩနီၪ",
			"4": "<sup>4</sup> ယူၭ.- ၦလုဆၧလဂၩနီၪမိဘၪမၩန့ဒၩ့လဖျိၪ့နီၪ လၧန စူၪဖၧၩ့တၭ, အီၪက့ၪလၩ့ဝ့ၫလၧယဟိဝၩနယွၩအမ့ၬ ယၫလီၫ.",
			"5": "<sup>5</sup> နမိဘၪချဲၩ့ဆၧတၭ, စံၭလၧယဟိဝၩနယွၩအမ့ၬယၫ, ယဖါနီၪမွဲၦခးစံရအၫဖိၪ, ၦဂၭဝံၩ့ဝၩ့ဖိၪတၭ, လ့ၩလၩ့ လၧအံဇံၭအဖၧၩ့တၭ, အီၪၦမွံၩထီးနီၪၡၩခိၬဂၩတၭ, ကဲၪထၪ့လၧၦလဆၨၩဒိၪဝ့ၫ, ဒဲဆီၪ့ဝ့ၫ, ဒဲၦခမျၧးအီၪ",
			"6": "<sup>6</sup> အၪဂၩထီးနီၪလီၫ.- တၭၦအံဇံၭဖိၪမၩအၧၩ့မၩၥၫ့",
			"7": "<sup>7</sup> ပၧၩတၭ, အီၪက့ၪဆၧမၩကၪလၧပလီၩ့လီၫ.- တၭထီး ပကိၭထၪ့ယဟိဝၩ ပဖါလဖၪအယွၩတၭ, ယဟိဝၩ ခိၭနၪပလူ, ဒဲယိလၩ့ပဆၧနၭဆၧၡၪ့, ဒဲပဆၧမၩ, ဒဲဆၧ",
			"8": "<sup>8</sup> မၩအၧၩ့ပၧၩ,- တၭယဟိဝၩဒုၭစဲၪ့ထၪ့ခွံၬပၧၩ လၧ အံဇံၭအဖၧၩ့ လၧအစူၪဆီၪ့, ဒဲအစူၪယၩ့ထၪ့အၥၭ, ဒဲဆၧၥၭမဲၪအလးဖၭဒိၪ, ဒဲဆၧမၩနဲၪ့လၩ့လၭ, ဒဲဆၧ",
			"9": "<sup>9</sup> လၩ့လိလၩ့လၭ,- ဒဲဒုၭဂဲၫနုၬပၧၩ လၧအလးထီးယီၩ, ဒဲဖ့ၪလၫ့ပၧၩလၧခးလဘံၪ့ယီၩ, ခးလၧအယွၩလၩ့လၧ",
			"10": "<sup>10</sup> ဆၧနူထံၫ, ဒဲန့ၫစၩ့လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ယိခွါ, ယဂဲၫဆိၬဆၧၥၪဘၪဆဲၫ့လၧဂၪ့ခိၪလၧနဝ့ၫဒၪ, ယဟိ ဝၩဧ့,နဖ့ၪလၫ့ယူၭယၧၩယူၭလီၫ. တၭနမိဘၪအီၪက့ၪ လၩ့လၧယဟိဝၩနယွၩအမ့ၬယၫ, ဒဲဘိၪ့ထၪ့ဘၩထၪ့",
			"11": "<sup>11</sup> လၧယဟိဝၩနယွၩအမ့ၬယၫလီၫ.- နမိဘၪၥၭထိၬလၧ ကယဲဆၧဂ့ၩလၧယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩ, ဒဲနၡၩဂံၪ့ ဖိၪ, နဝ့ၫဒၪ, ဒဲၦလံဝဲၫဖိၪ, ဒဲၦလခီၫဘၩ့မုးဖိၪလၧအ အီၪဝ့ၫလၧနၥံၪအကျၩလီၫ.",
			"12": "<sup>12</sup> တၭထီးနအၪ့နၩ့ဖၭနဆၧအၪထၪ့ လၧဆံၫပိၩ့လပိၩ့ လၧနံၪ့ၥၧၫ့နံၪ့လနံၪ့, ဆၧဆံၫပိၩ့လပိၩ့အနံၪ့တၭ, ဖ့ၪ လၫ့ယူၭဆၧလၧၦလံဝဲၫဖိၪ, ၦလခီၫဘၩ့မုးဖိၪ, ၦဖိၪ ဎွ့ၪ,ၦမုၪမဲၫ, ဘဲၫၥိၭအမိအၪ့ဆၧလၧနတရၫ့ဖၧၩ့ ဒဲဘျဲၩ",
			"13": "<sup>13</sup> အၪ့ဂီၩ့တၭ,- ထီးနီၪလဖၧၫ့ နမိဘၪစံၭလၧယဟိဝၩ နယွၩအမ့ၬယၫ, ယဂဲၫဆိၬထၪ့ခွံၬယူၭဆၧဆံၫ့ဎံၪလၧ ယဂံၪ့ဖၧၩ့တၭ, ယဖ့ၪလၫ့ဆ့ယူၭလၧၦလံဝဲၫဖိၪ,ဒဲလၧ ၦလခီၫဘၩ့မုးဖိၪ, ၦဖိၪဎွ့ၪဒဲၦမုၪမဲၫ,ဘဲၫကယဲနဆၧ မၪလူၬလဖၪလၧနမၪလူၬယၧၩအၥိၭနီၪယူၭ, ယလၨၪ ခၫ့ဖၬနဆၧမၪလူၬလဖၪအ့ၬး တၭယၥၭနၪ့ဘၪဆၧဆ့",
			"14": "<sup>14</sup> အ့ၬ,- ယအၪ့ဘၪဝ့ၫနီၪ လၧယၥုၪ့အုၭယၥၭအုၭအ့ၬ. ယလမၩဘၪဆၧနီၪ လၧဆၧလဆံၫ့ဘၪအဖၧၩ့, ဒဲယ ဖ့ၪလၫ့ဆၧနီၪလၧဆၧၥံၫအကၠီၩ့အ့ၬ. ယခိၭနၪယူၭယ ဟိဝၩယယွၩအလူယူၭး ယမၩယူၭဘဲၫကယဲဆၧလၧ",
			"15": "<sup>15</sup> နမၪလူၬယၧၩအၥိၭနီၪယူၭ.- ယိလၩ့လၧနအီၪအလး ဆံၫ့ဎံၪလၧမူၭခိၪတၭ, ဆိၪဂ့ၩဆိၪဘွၩနၡၩခမျၧးအံၫ စရ့လၭ, ဒဲထံၫၥံၪခးၥံၪလၧနဖ့ၪလၫ့ပၧၩ, ဘဲၫနဆိၪလၩ့ နၥၭလၧပဖါလဖၪအၥိၭ, ခးလဘံၪ့လၧအယွၩလၩ့လၧ ဆၧနူထံၫဒဲန့ၫစၩ့ဆံၭ.",
			"16": "<sup>16</sup> ဆၧလၧမုဆၫလနံၩယီၩ ယဟိဝၩနယွၩမၪလူၬနၧၩ ဘဲၫၥိၭနမိထီးန့ဆၧၥနိၫလဖၪ, ဒဲဆၧစ့ၩရၫ့လဖၪယီၩ လီၫ. တၭနမိဘၪထီးန့ဒဲမၩဝ့ၫ လၧနၥၭထၧၫ့ဖျိၪ့ယၫ,",
			"17": "<sup>17</sup> ဒဲလၧနၥၭၡီၩ့ ထီးအလူၬလီၫ.- လၧမုဆၫလနံၩယီၩ နစံၭလၧယဟိဝၩမိကဲၪထၪ့နယွၩ, ဒဲလၧနမိဖိၬအဖၧၩ့ ၥၭလဖၪ, ဒဲလၧနမိထီးန့အၥနိၫလဖၪ, ဒဲအဆၧမၪလူၬ လဖၪ, ဒဲအဆၧစ့ၩရၫ့လဖၪ, ဒဲလၧနမိခိၭနၪအလူလီၫ.",
			"18": "<sup>18</sup> တၭလၧမုဆၫလနံၩယီၩ ယဟိဝၩစံၭနၧၩ လၧနမိကဲၪ ထၪ့အၡၩခမျၧးလၩ့မဲၩဒၪဆၧ, ဘဲၫအချဲၩ့ဝဲၩဆၧလၧ နၧၩအၥိၭ, ဒဲလၧနမိဘၪထီးန့ အဆၧမၪလူၬ ထီးအ",
			"19": "<sup>19</sup> လူၬ,- ဒဲလၧအမိအီၪက့ၪနၧၩ လၧၦကိၭဆၨၩဒ့ၭလၧ အတဲၩ့ဝ့ၫထီးအလူၬအဖၫ့ခိၪ, လၧဆၧစံၭထၪ့အၪ့အူၭ အဖၧၩ့, ဒဲလၧဆၧအမံၩ့အဖၧၩ့, ဘဲၫၥိၭနမိကဲၪထၪ့ၦ ဆံၫ့ဎံၪလဆၨၩ လၧယဟိဝၩ နယွၩအဂး, ဘဲၫအချဲၩ့ ဆၧအၥိၭနီၪလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> စမိစ့ၭဒဲအံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါ မၪလူၬၦခမျၧး တၭ,စံၭဝ့ၫဒၪ, ဆၧမၪလူၬလၧယမၪလူၬနၥံၪ လၧမုဆၫ",
			"2": "<sup>2</sup> လနံၩယီၩထီးန့နၥံၪဝ့ၫထီးအလူၬဆံၭ.- တၭဆၧမိမၩ အၥၭလၧမုနံၩလၧနၥံၪမိခၫ့ဂၬ ထံၫယီၫဒၫ့ထီၩ့လၧခး ဖၧၩ့လၧယဟိဝၩနယွၩ ဖ့ၪလၫ့နၧၩလၧနမိဘၪအီၪက့ၪ ထၪ့ထီၫလိးဖၭဒိၪလဖၪ, ဒဲဂုၪဝ့ၫလၧအၩ့ကထၨလီၫ.",
			"3": "<sup>3</sup> တၭထီးနအ့ၪခၫ့ဂၬဘၪယူၭတၭ, နမိဘၪကွ့ၭဆၧၥီၪ့ ဆၧၥၫ့အဆၧချဲၩ့ယီၩ ထီးအလူၬလၧအလီၩ့, ဘဲၫၥိၭ နမိလ့ၩနုၬဘၪ လၧထံၫၥံၪခးၥံၪအဖၧၩ့ လၧယဟိဝၩ နယွၩဖ့ၪလၫ့နၧၩ, ခးလဘံၪ့လၧအယွၩလၩ့ဝ့ၫလၧဆၧ နူထံၫ, ဒဲန့ၫစၩ့ဘဲၫယဟိဝၩနဖါလဖၪ အယွၩချဲၩ့ဆၧ",
			"4": "<sup>4</sup> လၧနၧၩအၥိၭနီၪလီၫ.- ထီးနၥံၪအ့ၪခၫ့ဂၬဘၪယူၭထံၫ ယီၫဒၫ့တၭ, ဆၧမိမၩအၥၭလၧနၥံၪမိဘၪအီၪက့ၪထၪ့ လိးလဖၪလၧယမၪလူၬနၥံၪ လၧမုဆၫလနံၩယီၩလၧ ခိၪလီၩ့အံဘလၭအလီၩ့တၭ, နၥံၪမိဘၪဂုၪဝ့ၫလၧအၩ့",
			"5": "<sup>5</sup> ကထၨလီၫ.- တၭနမိဘၪမၩဆၧလုလးလၧယဟိဝၩ နယွၩအဂး ထီးအလးနီၪ, ဆၧလုလးလိးလီၫ. နမၩ",
			"6": "<sup>6</sup> ဘၪထၭလၧအလီၩ့အ့ၬ.- နမိဘၪမၩယဟိဝၩနယွၩ အဆၧလုလးလၧလိးလဖၪ ထၧၫ့ထၧၫ့ဖျိၪ့ယၫတၭ,နမိ ဘၪလုထၪ့ဆၧလုမ့ၪ လၧအဖၫ့ခိၪ လၧယဟိဝၩနယွၩ",
			"7": "<sup>7</sup> အဂးလီၫ.- နမိဘၪလုထၪ့ဆၧလုဘၪလိၬအိၭလိၬ,ဒဲ အၪ့ဆၧထီးနီၪ, ဒဲၥၭထိၬလၧယဟိဝၩနယွၩအမ့ၬယၫ",
			"8": "<sup>8</sup> လီၫ.- တၭနမိဘၪကွ့ၭဆၧၥီၪ့ဆၧၥၫ့ယီၩ အဆၧချဲၩ့ ထီးအလူၬလၧလိးၥံၪအလီၩ့အ့ၪဖျီၪလီၫ.",
			"9": "<sup>9</sup> စမိစ့ၭ, ဒဲၦလုဆၧလဖၪ, ၦလံဝဲၫဖိၪၥံၪ, ချဲၩ့ဆၧလၧ အံၫစရ့လၭထီးအလူၬတၭ, စံၭဝ့ၫဒၪ, ထီးလၩ့နၥၭ တၭ,ခိၭနၪဆံၭ, အံၫစရ့လၭဧ့, ဆၧလၧမုဆၫလနံၩ ယီၩနကဲၪထၪ့ယူၭ ယဟိဝၩနယွၩအၡၩခမျၧးယူၭ,",
			"10": "<sup>10</sup> တၭနမိဘၪခိၭနၪ ယဟိဝၩနယွၩအလူ ဒဲထီးန့အဆၧ မၪလူၬ, ဒဲၥနိၫလဖၪ လၧယမၪလူၬနၧၩ လၧမုဆၫလ နံၩယီၩလီၫ.",
			"11": "<sup>11</sup> ဆၧလၧမုလနံၩနီၪစမိစ့ၭမၪလူၬၦခမျၧးတၭ, စံၭဝ့ၫ",
			"12": "<sup>12</sup> ဒၪ,- ထီးနၥံၪအ့ၪလ့ၩခၫ့ဂၬ ထံၫယီၫဒၫ့တၭ, ၦလဖၪ ယီၩမိဆၧၫ့ထုၪ့လၧခိၪလီၩ့ဂၧရဇံၫ့အလီၩ့ ဘဲၫၥိၭအမိ ဆိၪဂ့ၩၦခမျၧး, စစံမအၧၫ့, ဒဲစလံဝဲၫ, ဒဲစယုဒၫ, ဒဲစအံ",
			"13": "<sup>13</sup> စခၫ,ဒဲစယိၥၭ, ဒဲစဘံၪ့ယမံၫ့လီၫ.- တၭၦလဖၪယီၩမိ ဘၪဆၧၫ့ထုၪ့လၧခိၪလီၩ့အံဘလၭ, ဘဲၫၥိၭ အမိဆိၪ အၧၩ့ဆၧ,စရုဘံၫ့,စဂၭ, ဒဲစအၭၡၧၫ, ဒဲစဇ့ၭဘလၧၫ့,",
			"14": "<sup>14</sup> စဒၫ့ဒဲစနၭၥလဲၫလီၫ.- တၭၦလံဝဲၫဖိၪမိဘၪချဲၩ့ဆၧ လၧၦအံၫစရ့လၭဖိၪ ထီးအလူၬ လၧအလူဖၭဒိၪနီၪ, စံၭအဝ့ၫၥံၪ,",
			"15": "<sup>15</sup> ၦလၧအတဲၩ့ဆၧဂၩ့စိၭဖျၩအၥၭ, ဆၧဂၩ့ၥိၫ့အၥၭ, ဆၧဘၪၥၭလိၪလၧယဟိဝၩအမ့ၬယၫ, ဆၧမၩလၧၦ အစူၪလၧၦမၩဆၧဖိၪ, ဒဲအီၪက့ၪၥူၪဝ့ၫလဂၩနီၪ, မွဲအ ဘၪဆၧဆိၪအၧၩ့ဆံၭ. တၭၦခမျၧးထီးအလူ မိဘၪ",
			"16": "<sup>16</sup> စံၭဆၧၫ့ဆၧတၭစံၭ,အၩမံၩ့.- ၦလဂၩလၧအမၩကြၩ့ ထမးအမိအဖါနီၪ, မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦ",
			"17": "<sup>17</sup> ခမျၧးထီးအလူၬမိဘၪစံၭ, အၩမံၩ့.- ၦလၧအၥုၭၦလၧ အနဲၩ့ထံၭ အဂၪ့ခိၪ အဆၧမၩနဲၪ့အလးလဂၩနီၪ, မွဲ အဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီးအလူၬမိဘၪ",
			"18": "<sup>18</sup> စံၭ,အၩမံၩ့.- ၦလၧအဒုၭဂၭဖျိၭၦမ့ၬဘျီၪလၧဖၧၩ့ၥၭ လဂၩနီၪ, မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီး",
			"19": "<sup>19</sup> အလူၬမိဘၪစံၭ, အၩမံၩ့.- ၦလၧအဘိၭကၠၪခွံၬၦလခီၫ ဘၩ့မုးဖိၪ, ၦဖိၪဎွ့ၪ, ဒဲၦမုၪမဲၫအဆၧစ့ၩရၫ့လဂၩနီၪ, မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီးအလူၬ မိ",
			"20": "<sup>20</sup> ဘၪစံၭ, အၩမံၩ့.- ၦလၧအမံၫဎုၬလၧအဖါအမၫလဂၩ နီၪ,မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩ မွဲအဝဲ ထၪ့အဖါအဆဲၫ့ခၪ့ထံၭလီၫ. တၭၦခမျၧးထီးအလူၬမိ",
			"21": "<sup>21</sup> ဘၪစံၭ, အၩမံၩ့.- ၦလၧအမံၫဎုၬလၧဆၧဖိၪဆၧဎါလ မံၩ့မံၩ့နီၪ, မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီး",
			"22": "<sup>22</sup> အလူၬမိဘၪစံၭ, အၩမံၩ့.- ၦလၧအမံၫဎုၬလၧအထၧၫ့ ဖုဝဲမုၪလဂၩအဖါအဖိၪမုၪမွဲဂ့ၩ, အမိအဖိၪမုၪမွဲဂ့ၩ, မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီးအလူၬမိ",
			"23": "<sup>23</sup> ဘၪစံၭ,အၩမံၩ့.- ၦလၧအမံၫဎုၬလၧအမံၩ့ၡါမုၪလဂၩ နီၪ,မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီးအလူၬ",
			"24": "<sup>24</sup> မိဘၪစံၭ, အၩမံၩ့.- ၦလၧအဖ့ၬၥူၪၦလၧအနဲၩ့ထံၭ လဂၩနီၪ,မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီး",
			"25": "<sup>25</sup> အလူၬမိဘၪစံၭ, အၩမံၩ့.- ၦလၧအမၩန့အလံၩ့အလဲၫ ဘဲၫၥိၭအမိမၩၥံၫ ၦလၧအဆၧဒဲၩဘၭလအီၪဘၪလဂၩ နီၪ,မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီးအလူၬ",
			"26": "<sup>26</sup> မိဘၪစံၭ,အၩမံၩ့.- ၦလၧအလဒုၭအီၪဂုးအီၪခၧၫ့ဘၪ ဆၧၥနိၫယီၩ အဆၧချဲၩ့ဘဲၫၥိၭ အမိမၩဝ့ၫလဂၩနီၪ, မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး တၭၦခမျၧးထီးအလူၬမိ ဘၪစံၭ, အၩမံၩ့."
		},
		"28": {
			"1": "<sup>1</sup> တၭဆၧမိမၩအၥၭလၧနအ့ၪခိၭနၪတၡါ ယဟိဝၩ နယွၩအလူဘဲၫၥိၭနမိထီးန့, ဘဲၫၥိၭနမိမၩအဆၧမၪ လူၬထီးအလူၬလၧယမၪလူၬနၧၩ လၧမုဆၫလနံၩယီၩ တၭ, ယဟိဝၩနယွၩမိအီၪက့ၪနၧၩ လၧၦကိၭဆၨၩဒ့ၭ",
			"2": "<sup>2</sup> လၧဂၪ့ခိၪချိၫ့အဖၫ့ခိၪလီၫ.- နအ့ၪခိၭနၪယဟိဝၩနယွၩ အလူတၭ, ကယဲဆၧဆိၪဂ့ၩယီၩ မိဘၪနၧၩဒဲချႃၭန့နၧၩ",
			"3": "<sup>3</sup> လီၫ.- နမိဘၪဆၧဆိၪဂ့ၩနၧၩလၧဒိၩ့ဖၧၩ့, ဒဲနမိဘၪ",
			"4": "<sup>4</sup> ဆၧဆိၪဂ့ၩနၧၩလၧမံၩ့လၬကျၩလီၫ.- တၭဆၧဆိၪဂ့ၩ မိဘၪနဒၧၩ့လးအၥၪ, ဒဲနဂၪ့ခိၪအဆၧၥၪ, ဒဲနဆၧဖိၪ ဆၧဎါအဒိၩ့အဆၧၥၪ, ဒဲနချီ, ဒဲနၥိၪနဘ့ၪ အဆၧအၪ",
			"5": "<sup>5</sup> ထၪ့လီၫ.- တၭဆၧဆိၪဂ့ၩမိဘၪနဒၩ့ၥံၪ့နဲၩ့ၥံၪ, ဒဲနဆၧ",
			"6": "<sup>6</sup> အီၪလၩ့ထးလီၫ.- ထီးနဂဲၫနုၬနမိဘၪဆၧဆိၪဂ့ၩတၭ,",
			"7": "<sup>7</sup> ထီးနစဲၪ့ထၪ့နီၪနမိဘၪဆၧဆိၪဂ့ၩဆ့လီၫ.- နဒုၪနဒၩ လၧအဂဲထုၪ့ထၫ့ဒုၪဒၩနၧၩ လဖၪနီၪ, ယဟိဝၩမိဒုၭ ကျီၪ့ခွံၬဝ့ၫလၧနမ့ၬယၫလီၫ. အဝ့ၫၥံၪမိဂဲၫထၪ့ထၫ့ဒုၪ ဒၩနၧၩ လၧဖၧၩ့ၥၭလဘီၩ့တၭ, မိစဲၪ့ထၪ့ခွံၬလၧနမ့ၬ",
			"8": "<sup>8</sup> ယၫဖၧၩ့ၥၭနွ့ၫဘီၩ့လီၫ.- ယဟိဝၩမိမၪလူၬဆၧဆိၪ ဂ့ၩလၧနၥိၪၥံၪဖၫ့ၥံၪအဖၧၩ့, ဒဲလၧကယဲဆၧလၧနအီၪ က့ၪနစူၪလၧအလီၩ့, ဒဲမိဆိၪဂ့ၩနၧၩ လၧထံၫၥံၪခးၥံၪ",
			"9": "<sup>9</sup> အဖၧၩ့လၧယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩလီၫ.- နအ့ၪထီး န့ယဟိဝၩနယွၩအဆၧမၪလူၬ, ဒဲဖိၬအဖၧၩ့ၥၭလဖၪ တၭ,ယဟိဝၩမိဒုၭအီၪဂုးအီၪခၧၫ့နၧၩ လၧၦဆံၫ့ဎံၪ လဆၨၩ,လၧအဂးဒၪဝ့ၫ, ဘဲၫအဆိၪလၩ့အၥၭလၧနၧၩ",
			"10": "<sup>10</sup> အၥိၭနီၪလီၫ.- ၦကိၭဆၨၩဒ့ၭ မိဒၪဘၪဆၧကိၭနၧၩ",
			"11": "<sup>11</sup> လၧယဟိဝၩအမံၩ့တၭ, မိၥၭမဲၪနၧၩလီၫ.- တၭယ ဟိဝၩမိမၩအၪထၪ့နၧၩ လၧဆၧဂ့ၩ, လၧနဒၧၩ့လးအ ဆၧၥၪ, လၧနဆၧဖိၪဆၧဎါအဆၧၥၪ, ဒဲလၧနဂၪ့ခိၪအ ဆၧၥၪ လၧထံၫၥံၪခးၥံၪအဖၧၩ့ လၧယဟိဝၩဆိၪလၩ့",
			"12": "<sup>12</sup> အၥၭလၧနဖါလဖၪ လၧအမိဖ့ၪလၫ့နၧၩလီၫ.- ယဟိ ဝၩမိဝဲထၪ့အအီၪက့ၪကီၪ့ဆၧဂ့ၩအလး, မူၭခိၪလၧန ဂး,ဘဲၫၥိၭအမိဖ့ၪလၫ့နခး လၧအဆၧဆၧၩ့ လၧအဆၧၫ့ အထီဒၪဝ့ၫ, ဒဲဘဲၫၥိၭအမိဆိၪဂ့ၩ ကယဲနမၩဆၧလၧ နစူၪထီးအလူၬလီၫ. တၭနမိဒုၭအၪ့လီးဆၧလၧၦအၪ",
			"13": "<sup>13</sup> ဆၨၩတၭ, နအၪ့လီးဘၪဆၧအ့ၬ.- နအ့ၪခိၭနၪယဟိ ဝၩနယွၩအဆၧမၪလူၬ လၧယမၪလူၬနၧၩ လၧမုဆၫ လနံၩယီၩ, လၧနမိထီးန့ ဒဲမၩဝ့ၫတၭ, ယဟိဝၩမိအီၪ က့ၪနၧၩလၧအဆၧအခိၪတၭ, မွဲဆၧအမ့အ့ၬး တၭနမိ",
			"14": "<sup>14</sup> အီၪန့ၫလၧအဖၫ့ခိၪ, အီၪဘၪလၧအဖၫ့လၬအ့ၬ.- ဘဲၫ ၥိၭနမိဖိၬယွၩအဂူၫဂၩလဖၪ အခဲၫ့ဒဲမၩအဆၧနီၪ, လၧ နစူၪထွ့ၪမွဲဂ့ၩ, လၧနစူၪစ့ၪမွဲဂ့ၩ, ထီးကၠၪပဲၩခွံၬနၥၭ လၧဆၧချဲၩ့ၥံၪလၧယမၪလူၬနၧၩ လၧမုဆၫလနံၩယီၩ နးထံၪလဂ့ၩ.",
			"15": "<sup>15</sup> တၭဆၧမိမၩအၥၭလၧနအ့ၪ လခိၭနၪဘၪယဟိဝၩ နယွၩအလူ, ဘဲၫၥိၭနမိထီးန့ဘဲၫၥိၭ နမိမၩအဆၧမၪ လူၬလဖၪ, ဒဲအဆၧၥနိၫလဖၪထီးအလူၬ လၧယမၪလူၬ နၧၩလၧမုဆၫ လနံၩယီၩတၭ, ကယဲဆၧဆိၪအၧၩ့လ",
			"16": "<sup>16</sup> ဖၪယီၩမိဘၪနၧၩ ဒဲချႃၭန့နၧၩလီၫ.- နမိဘၪဆၧဆိၪ အၧၩ့နၧၩ လၧနဒိၩ့ဖၧၩ့, ဒဲနမိဘၪ ဆၧဆိၪအၧၩ့နၧၩ",
			"17": "<sup>17</sup> လၧမံၩ့လၬကျၩလီၫ.- ဆၧဆိၪအၧၩ့မိဘၪနဒၩ့ၥံၪနဲၩ့",
			"18": "<sup>18</sup> ၥံၪ,ဒဲဆၧအီၪလၩ့ထးလီၫ.- ဆၧဆိၪအၧၩ့မိဘၪနဒၧၩ့ လးအဆၧၥၪ, ဒဲနဂၪ့ခိၪအဆၧၥၪ, ဒဲနချီ, ဒဲနၥိၪနဘ့ၪအ",
			"19": "<sup>19</sup> ဆၧအၪထၪ့လီၫ.- ထီးနဂဲၫနုၬ နမိဘၪဆၧဆိၪအၧၩ့ တၭ, ထီးနစဲၪ့ထၪ့ခွံၬနီၪ, နမိဘၪဆၧဆိၪအၧၩ့ဆ့",
			"20": "<sup>20</sup> လီၫ.- ကယဲဆၧလၧနအီၪက့ၪနစူၪ လၧအလီၩ့ဘဲၫၥိၭ နမိမၩဆၧထီးအလူၬအဖၧၩ့နီၪ, ယဟိဝၩမိအၪ့မၧၫ့ လၩ့ဆၧဆိၪအၧၩ့, ဒဲဆၧခိဆၧဝီၩ, ဆၧၡၪ့ဆၧနၭလၧန အီၪ,ထီးနမိထီၩ့လၧဆၧဂၭဂီၩ့, ဒဲထီးနမိထီၩ့လၧဆၧ ဂၭဂီၩ့ဂၭစၪချဲၫ့ချံၭနီၪ, အဂဲးဘဲၫယီၩ လၧနမၩဆၧ",
			"21": "<sup>21</sup> အၧၩ့,လၧနလ့ၩဒၪယၧၩအကၠီၩ့နီၪလီၫ.- ယဟိဝၩမိ ဒုၭဘုၭထၬဆၧဆၫဖျဲၪလၧနၧၩ ထီးအမၩလူၬခွံၬနၧၩ လၧထံၫၥံၪခးၥံၪအဖၧၩ့ လၧနလ့ၩနုၬ ဘဲၫၥိၭနမိမၩန့",
			"22": "<sup>22</sup> ဝ့ၫနီၪလီၫ.- တၭယဟိဝၩမိကျီၪ့ခွံၬနၧၩ လၧဆၧဆၫဎွ့ လၩ့ခွံၬ, ဒဲဆၧဆူၪဂိၬ, ဒဲဆၧခိဆၧဝီၩ, ဒဲဆၧခိအၪ့ဆၧ, ဒဲလၧနၭ, ဒဲလၧဂၪ့ခိၪဎဲၫ့ထၬ, ဒဲလၧအဘုၪဆဲၩၥိၪ, ဒဲ လၧဘုၪဘၪဆၧဆၫ, ဒဲမိလီၩ့ဆီးနၧၩ ထီးနထီၩ့လၧ",
			"23": "<sup>23</sup> ဆၧဂၭဂီၩ့ဂၭစၪလီၫ.- တၭမူၭခိၪလၧနခိၪအဖၫ့ခိၪမိ ကဲၪထၪ့ထီးဝီၩ, ဂၪ့ခိၪလၧနအီၪအဖၫ့လၬ မိကဲၪထၪ့",
			"24": "<sup>24</sup> ထၭလီၫ.- တၭယဟိဝၩမိအီၪက့ၪ နခးအဆၧဆၧၩ့ လၧဆၧလွံၩပွံၪ, ဒဲဂၪ့ခိၪအမုၬတၭ, မိဂဲၫလၩ့ဝ့ၫလၧ မူၭခိၪလၧနလီၩ့ထီးနထီၩ့လၧဆၧဂၭဂီၩ့ဂၭစၪလီၫ.",
			"25": "<sup>25</sup> ယဟိဝၩမိဒုၭကျီၪ့ခွံၬနၧၩ လၧနဒုၪနဒၩ အမ့ၬယၫ လီၫ. နမိလ့ၩထၪ့ ထၫ့ဒုၪဒၩ အဝ့ၫၥံၪလၧဖၧၩ့ၥၭလ ဘီၩ့တၭ, နမိဘၪစဲၪ့ထၪ့ခွံၬလၧအမ့ၬယၫ လၧဖၧၩ့ၥၭ နွ့ၫဘီၩ့လီၫ. တၭနမိဘၪဆၧဆိၬထၪ့ခွံၬနၧၩ လၧကယဲ",
			"26": "<sup>26</sup> ဘၩ့မုးအဖၧၩ့ လၧဂၪ့ခိၪထီးအလူၬလီၫ.- တၭနစွၪမိ ကဲၪထၪ့ဆၧအၪ့လၧကယဲထိၪၥံၪလံၪၥံၪလၧမူၭဖိၭဖၫ့ ထီးအလူၬအဂး, ဒဲလၧဆၧဖိၪဆၧဎါလၧဂၪ့ခိၪချိၫ့အ",
			"27": "<sup>27</sup> ဂးတၭ, ၦအီၪမၩဎီဝ့ၫအ့ၬ.- တၭယဟိဝၩမိဒိၪနၧၩ လၧအံဇံၭအဆၧဝံၫ့, ဒဲလၧဆၧဆၫၥိၫလၩ့, ဒဲလၧဆၧ ဎၭအၧၩ့, ဒဲလၧဆၧဎၭလၧနမၩဘျၪထဲၩ့လၥ့ၪဘၪနီၪ",
			"28": "<sup>28</sup> လီၫ.- တၭယဟိဝၩမိဒိၪနၧၩ လၧဆၧဖျႃထၪ့, ဒဲလၧ",
			"29": "<sup>29</sup> ဆၧမ့ၬဘျီၪ ဒဲလၧၥၭထီၫမံၪထီၫမၪလီၫ.- တၭနမိလုး ဆၧလၧမုထုၪ့, ဘဲၫၦမ့ၬဘျီၪလုးဆၧလၧဆၧခံၭကျၩ အၥိၭနီၪတၭ, နလဘီၪလယီၫဘၪလၧနဖၧၩ့ၥၭလဖၪ အဖၧၩ့တၭ, နမိဘၪန့ၫဆၧမၩခိမၩဝီၩ, ဒဲဆၧအၪ့ဂူၬန့ နဆၧကိၭမုနံၩကိၭမုနၩဒ့ၭတၭ, ဆၧမၩဖီၩ့ဖျ့ၭနၧၩမိ",
			"30": "<sup>30</sup> အီၪနးဂၩအ့ၬ.- နမိအဲၪတၩ့နမၫတၭ, ၦဂူၫဂၩမိမံၫဎုၬ လၧအဝ့ၫလီၫ. နမိၥုၪ့ဂံၪ့တၭ, နအီၪဘၪလၧအဖၧၩ့ အ့ၬ. နမိၥုၪ့နစဘံၭမုအလးတၭ, နအၪ့ထုၫ့ကီၪ့ဘၪအ",
			"31": "<sup>31</sup> စဘံၭၥၪအ့ၬ.- နချီမိဘၪဆၧမၩၥံၫဝ့ၫ လၧနမ့ၬယၫတၭ, နအၪ့ဘၪဆၧလၧအဝ့ၫအ့ၬး နကၥ့ၪယီၩ့မိဘၪဆၧမၩ န့ဆီၪ့ခွံၬဝ့ၫ လၧနမ့ၬယၫတၭ, ဆၧဖ့ၪထဲၩ့ဝ့ၫလၧနၧၩ အ့ၬ. နၥိၪနဘ့ၪ မိဘၪဆၧ ဖ့ၪလၫ့ခွံၬဝ့ၫ လၧနဒုၪနဒၩ",
			"32": "<sup>32</sup> တၭ, ဆၧမၩဖီၩ့ဖျ့ၭနၧၩ မိအီၪနးဂၩအ့ၬ.- နဖိၪခွၫ ၥံၪဒဲနဖိၪမုၪၥံၪ မိဘၪဆၧဖ့ၪလၫ့ဝ့ၫလၧ ၦဆၨၩဂူၫဂၩ လဖၪတၭ, နမ့ၬမိဒၪဘၪ, ဒဲလီၫ့ကီၩ့လါနၫ့ ၥံၫ့နံၩချီၩ့",
			"33": "<sup>33</sup> တၭ,ဆၧအစီၩ့အမၩ့ အီၪလၧနစူၪဖၧၩ့အ့ၬ.- တၭနခး အဆၧၥၪ, ဒဲနမၩဆၧထီးအလူၬနီၪ ၦလၧနလၥ့ၪယၫ ဘၪဝ့ၫလဆၨၩနီၪ, မိဘၪအၪ့ခွံၬဝ့ၫတၭ, နမိဘၪန့ၫဆၧ မၩခိမၩဝီၩ, ဒဲဆၧမၩနၭမၩၡၪ့နၧၩ ကိၭမုနံၩကိၭမုနၩ",
			"34": "<sup>34</sup> ဒ့ၭလီၫ.- တၭနမိဖျႃထၪ့လၧဆၧအီၪဖျီၪလၧနမ့ၬလၧ",
			"35": "<sup>35</sup> ဆၧမိဒၪဘၪဆၧအကၠီၩ့လီၫ.- တၭယဟိဝၩမိထးနခၪ့ လုးခိၪ, ဒဲနခၪ့လၧဝံၫ့အၧၩ့ လၧအဘျၪလၥ့ၪဘၪတၭ, မိကဲၪထၪ့အဖၧၩ့လးလၧနခၪ့ယၫၥၭထီၩ့ထၪ့လၧနခိၪ",
			"36": "<sup>36</sup> ဒၩ့လီၫ.- ယဟိဝၩမိဂဲၫဆိၬနၧၩ ဒဲနစဎွၩ လၧနမိအီၪ က့ၪလၧနဖၫ့ခိၪနီၪ, လၧၦလဆၨၩလၧနဝ့ၫဒၪ, ဒဲနဖါလ ဖၪၥ့ၪယၫဝ့ၫအ့ၬ. ထီးနီၪနမိမၩယွၩ အဂူၫဂၩလဖၪ,",
			"37": "<sup>37</sup> ဒဲၥံၪ့ၥံၪဝၪၥံၪဒဲလိးၥံၪလဲၫ့ၥံၪအဆၧလီၫ.- တၭနမိကဲၪ ထၪ့ဆၧထီၫမံၪထီၫမၪအလး, ဒဲဆၧချဲၩ့ဒီၩ့အလး, ဒဲ ဆၧဒုၪဒွ့ၪအလးလၧ ၦကိၭဆၨၩဒ့ၭအကျၩ, ထီးဒၪ",
			"38": "<sup>38</sup> အလးလၧယဟိဝၩၥိၫ့နၧၩလီၫ.- နမိလ့ၩဆိၬထၪ့ဆၧ အချံၫအၪဖျိၪ့လၧနဆံၬဖၧၩ့တၭ, နမိအၪ့ထုၫ့ကီၪ့ဆၧ လၧအၡၩလီၫ. အဂဲးဘဲၫယီၩ ထွ့ၥံၪခၩ့ၥံၪမိအၪ့ခွံၬဝ့ၫ",
			"39": "<sup>39</sup> လီၫ.- နမိၥုၪ့စဘံၭမုအလးလဖၪ, ဒဲတဲၩ့ဝဲၩဝ့ၫလါနၫ့ တၭ, နအီၩဘၪစဘံၭထံၫအ့ၬ, ဒဲနအၪ့ထုၫ့ကီၪ့ဘၪဆ့ အ့ၬ. အဂဲးဘဲၫယီၩ ဆၧဖိၪဆၧဎါ မိအၪ့ခွံၬဝ့ၫလီၫ.",
			"40": "<sup>40</sup> နမိအီၪလၧၥံၪ့အလဲအိၫ့ လၧခးအနဲၩ့ထံၭ ထီးအလူၬ လါနၫ့တၭ, နဂုၪဘၪလၧၥိၪအ့ၬ. အဂဲးဘဲၫယီၩ နၥံၪ့",
			"41": "<sup>41</sup> အလဲအိၫ့အၥၪမိလၩ့ဘၩ့လီၫ.- နမိထၪ့ဖိၪ, ဖိၪခွၫလ ဖၪဒဲဖိၪမုၪလဖၪလါနၫ့တၭ, နမုၬလၩဘၪဝ့ၫအ့ၬ. အ",
			"42": "<sup>42</sup> ဂဲးဘဲၫယီၩ ဆၧမိဖီၪ့န့အၪ့မၧၫ့ဎီးအဝ့ၫၥံၪလီၫ.- ကယဲ ၥံၪ့ၥံၪဝၪၥံၪ, ဒဲဆၧၥူၪဆၧၥၪလၧနခးဖၧၩ့ ထီးအလူၬနီၪ",
			"43": "<sup>43</sup> ထွ့ၥံၪခၩ့ၥံၪမိအၪ့ခွံၬဝ့ၫလီၫ.- ၦလခီၫဘၩ့မုးဖိၪလၧ အအီၪလၧနၥံၪအကျၩနီၪ မိထၪ့ထီၫနဲၪ့ဒံၭနၧၩထီၫ",
			"44": "<sup>44</sup> ထီၫလ့ၬတၭ, နမိလၩ့ဘၪလၧဆၧအဖၫ့လၬလီၫ.- အ ဝ့ၫဒၪမိဒုၭအၪ့လီးဆၧလၧနၧၩတၭ, နဒုၭအၪ့လီးဘၪ ဆၧလၧအဝ့ၫဒၪအ့ၬ. အဝ့ၫဒၪ မိကဲၪထၪ့ ဆၧအခိၪ တၭ,နဝ့ၫဒၪနမိကဲၪထၪ့အမ့လီၫ.",
			"45": "<sup>45</sup> ဆၧဆိၪအၧၩ့ထီးအလူၬနီၪ မိဘၪနၧၩတၭ, မိလီၩ့ ဆီးနၧၩ ဒဲချႃၭန့နၧၩ ထီးနထီၩ့လၧ ဆၧဂၭဂီၩ့ဆၧဂၭ စၪလီၫ. အဂဲးဘဲၫယီၩ နလခိၭနၪဘၪယဟိဝၩနယွၩ အလူဘဲၫၥိၭနမိထီးန့အဆၧမၪလူၬ, ဒဲအဆၧၥနိၫလ",
			"46": "<sup>46</sup> ဖၪလၧအမၪလူၬနၧၩလီၫ.- တၭမွဲအမိဘၪနၧၩလၧအ ဆၧမၩနဲၪ့လၩ့လၭအဂး, ဒဲလၧဆၧလၩ့လိလၩ့လၭအ",
			"47": "<sup>47</sup> ဂးလီၫ. တၭမိဘၪနချံၫနၥၪအဆိၩအကၠၪလီၫ.- အဂဲး ဘဲၫယီၩ နလမၩဘၪယဟိဝၩ နယွၩအဆၧလၧၥုၪ့ဎွံၫ ၥၭယီၫအဖၧၩ့, ဒဲနၥုၪ့ထိၬနၥၭထိၬလၧဆၧထီးအလူၬ",
			"48": "<sup>48</sup> အၪထၪ့အကၠီၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ နမိဘၪမၩ နဒုၪနဒၩ လၧယဟိဝၩ မိအၪ့မၧၫ့အထၫ့ဒၩနၧၩလဖၪ အဆၧလၧဆၧၥၭဝံနၥၭ, ဒဲဆၧၥူၫအီၩနၥၭ လၧထံၫ, ဒဲလၧဆၧအီၪဘိၪ့အဖၧၩ့, ဒဲလၧဆၧကြၨၭန့ဘၪ ကိၭ မံၩ့ဒ့ၭလါနၫ့အီၪအ့ၬ. တၭအဝ့ၫနီၪမိအီၪက့ၪနိၪယိၭ ဘီၩ့ထၭ လၧနခိၬအလီၩ့ ထီးအမၩဂၭဂီၩ့ဂၭစၪ နၧၩ",
			"49": "<sup>49</sup> လီၫ.- ယဟိဝၩမိဂဲၫဆိၬ ၦလဆၨၩထၫ့ဒၩနၧၩလၧအ ယဲၩ့, လၧဂၪ့ခိၪအထုၬ, ဘဲၫလံၬၥံၪထိၪၥံၪယူၩဝ့ၫအ",
			"50": "<sup>50</sup> ၥိၭနီၪး ၦလဆၨၩလၧနနၪအလၨလၥ့ၪဘၪတၭ,- ၦ လဆၨၩလၧအမ့ၬဒူၩနၭလ့ၬ လၧအလယိမ့ၬဘၪၦၥုၪ့ က့ၭၥၭၡါ, ဒဲမိဖ့ၪလၫ့လၧအခိးအတၩ လၧၦၥၭဘၪ့",
			"51": "<sup>51</sup> အ့ၬ.- တၭမွဲအမိအၪ့ဝ့ၫလၧနဆၧဖိၪဆၧဎါအဒိၩ့အ ဆၧၥၪ, ဒဲနဂၪ့ခိၪအဆၧၥၪ, ထီးနထီၩ့လၧဆၧဂၭဂီၩ့ ဂၭစၪလီၫ. တၭဘုၪၥံၪဂူၫၥံၪမွဲဂ့ၩ, စဘံၭထံၫမွဲဂ့ၩ, ၥိၪမွဲဂ့ၩ, နချီဒဲနၥိၪဒဲနဘ့ၪအဆၧအၪထၪ့မွဲဂ့ၩ, လအီၪ က့ၪလၩ့ထးဘၪ လၧနဂး ထီးအမၩဂၭဂီၩ့ ဂၭစၪနၧၩ",
			"52": "<sup>52</sup> လီၫ.- တၭအဝ့ၫဒၪမိမၩထံၬထၬနၧၩ လၧနတရၫ့ထီး အလူၬအဖၧၩ့ ထီးနခိၪဒၧၩ့ထီၫ လၧနဒိၭနဲၩ့နၥၭလၧ အဝ့ၫမိလၩ့ဎီးလၧနထံၫၥံၪခးၥံၪထၧၫ့ဘံၪ့ယၫအဖၧၩ့ လီၫ. တၭမိမၩထံၬထၬနၧၩ လၧနတရၫ့ထီးအလူၬအ ဖၧၩ့လၧထံၫၥံၪခးၥံၪထၧၫ့ဘံၪ့ယၫ လၧယဟိဝၩနယွၩ",
			"53": "<sup>53</sup> ဖ့ၪလၫ့နၧၩလီၫ.- တၭလၧဆၧမၩထံၬထၬ ဒဲလၧနဘၪ ဆၧကထံၬကထၬအဖၧၩ့ လၧနဒုၪနဒၩ မၩနၭမၩၡၪ့ နၧၩအကၠီၩ့နီၪ, နမိအၪ့ဘၪနဒၧၩ့လးအဆၧၥၪ, နဖိၪ ခွၫၥံၪ ဒဲနဖိၪမုၪၥံၪ, လၧယဟိဝၩနယွၩဖ့ၪလၫ့နၧၩအ",
			"54": "<sup>54</sup> ယၪလီၫ.- ၦခွၫလၧအဂဲးဆါအဘၭဆါ လၧနၥံၪအ ကျၩ, ၦလၧအၥၭလၩ့ပွံၭလၩ့ထၩ့လဂၩနီၪအမ့ၬမိယိ အၧၩ့ အထၧၫ့ဖုဝဲ, ဒဲအမၫ လၧအၥၭနၫၡါအလီၩ့, ဒဲ အဖိၪအီၪလၩ့ထးလဖၪ လၧအမိအီၪက့ၪလၩ့ထးဝ့ၫ",
			"55": "<sup>55</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧအဖိၪအ ယၪ လၧအမိအၪ့ဝ့ၫနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧ လအီၪလၩ့ထးဘၪလၧအဂး, လၧဆၧမၩထံၬထၬအ ဖၧၩ့, ဒဲလၧနဘၪဆၧကထံၬကထၬအဖၧၩ့ လၧနဒုၪန ဒၩ မိမၩနၭမၩၡၪ့နၧၩအကၠီၩ့ လၧနတရၫ့ထီးအလူၬ",
			"56": "<sup>56</sup> အဖၧၩ့လီၫ.- ၦမုၪလၧအဂဲးဆါအဘၭဆါ, လၧအၥၭ လၩ့ပွံၭလၩ့ထၩ့လၧနၥံၪအကျၩ, လၧအအီၪက့ၪလၩ့ အခၪ့ယၫၥၭလၧဂၪ့ခိၪအဖၫ့ခိၪ လဘုၪ့ဘၪလၧအၥၭ လၩ့ပွံၭလၩ့ထၩ့အကၠီၩ့လဂၩနီၪ, အမ့ၬမိယိအၧၩ့လၧ အဝၩလၧအၥၭနၫၡါအလီၩ့, ဒဲအဖိၪခွၫ, ဒဲအဖိၪမုၪ,",
			"57": "<sup>57</sup> ဒဲအဖိၪဆံၭလၧအဂဲၫလၩ့လၧအခၪ့ဆူၭ, ဒဲအဖိၪလၧ အမိအီၪဖျဲၪန့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ မိအၪ့ၥူၪဝ့ၫလၧ ဆၧထီးအလူၬလဘၪဘၪအကၠီၩ့ လၧဆၧမၩထံၬထၬ, ဒဲလၧနဘၪဆၧကထံၬကထၬအဖၧၩ့ လၧနဒုၪနဒၩမိမၩ နၭမၩၡၪ့နၧၩအကၠီၩ့ လၧနတရၫ့လဖၪအဖၧၩ့လီၫ.",
			"58": "<sup>58</sup> နအ့ၪလထီးလၩ့ဘၪနၥၭ ဘဲၫၥိၭနမိမၩ ကယဲဆၧ ၥီၪ့ဆၧၥၫ့ယီၩ အဆၧချဲၩ့လၧအကွ့ၭအၥၭ လၧလံၬလ ဘံၪ့ယီၩအဖၧၩ့ ဘဲၫၥိၭနမိၥၭမဲၪဆၧအမံၩ့, အီၪလၧ အလၩအဖၧၩ့ ဒဲဆၧၥၭမဲၪအလး, ယဟိဝၩနယွၩ",
			"59": "<sup>59</sup> နီၪး- ထီးနီၪလဖၧၫ့ ယဟိဝၩ မိမၩနၧၩ လၧဆၧဆၫ ဖျဲၪလၩ့လၭဝ့ၫ, ဒဲနချံၫနၥၪအဆၧဆၫဖျဲၪဒိၪဝ့ၫ, ဒဲအီၪ ခၧၫ့ဝ့ၫ, ဒဲဆၧဆၫအၧၩ့လဖၪလၧအအီၪခၧၫ့ဝ့ၫလီၫ.",
			"60": "<sup>60</sup> တၭမွဲအမိဒုၭဘၪနၧၩ လၧအံဇံၭအဆၧစူၭဆၧဆၫ လၧနၥၭမဲၪဝ့ၫကိၭအဆၨၩဒ့ၭနီၪ မိဘုၭထၬလၧနလီၩ့",
			"61": "<sup>61</sup> လီၫ.- တၭကယဲဆၧဆၫ, ဒဲကယဲဆၧၥံၫချဲၫ့လၧအလ ကွ့ၭဘၪအၥၭ လၧလံၬဆၧၥီၪ့ဆၧၥၫ့ယီၩ အဖၧၩ့ထီး အလူၬနီၪ, ယဟိဝၩမိဒုၭဘၪနၧၩ ထီးနထီၩ့လၧဆၧ",
			"62": "<sup>62</sup> ဂၭဂီၩ့ဂၭစၪလီၫ.- တၭနၥံၪအ့ၪအီၪအၪဘဲၫမူၭခိၪအ ၡၪၥံၪဖီၫၥံၪအၥိၭ လါနၫ့ဘိၩ, နၥံၪမိအီၪလၩ့ထးၡၩ ခိၬဂၩလီၫ. အဂဲးဘဲၫယီၩ နလခိၭနၪဘၪ ယဟိဝၩန",
			"63": "<sup>63</sup> ယွၩအလူလီၫ.- တၭဘဲၫယၥၭထိၬလၧနၥံၪအဖၫ့ခိၪ ဘဲၫၥိၭအမိမၩဂ့ၩနၥံၪ, ဒဲမၩအၪထၪ့နၥံၪအၥိၭနီၪ, ဆၧမိမၩအၥၭ လၧယဟိဝၩမိၥၭထိၬ လၧနၥံၪအဖၫ့ ခိၪ, ဘဲၫၥိၭအမိမၩဂၭဂီၩ့နၥံၪ, ဒဲမၩလူၬခွံၬနၥံၪဘဲၫ နီၪၥိၭလီၫ. တၭဆၧမိထ့ၭထၪ့ခွံၬနၥံၪ လၧခးဖၧၩ့ထီး",
			"64": "<sup>64</sup> နလ့ၩမၩန့ဝ့ၫလီၫ.- တၭယဟိဝၩ မိမၩလၩ့ပြံၩလၩ့ ပၩနၧၩ လၧၦကိၭဆၨၩဒ့ၭအကျၩ လၧဂၪ့ခိၪအထုၬ လခီၫယီၩ, ထီၩ့လၧဂၪ့ခိၪအထုၬလခီၫဒၪနီၪတၭ, ထီး နီၪနမိမၩယွၩအဂူၫဂၩလဖၪအဆၧ, လၧနဝ့ၫဒၪ, ဒဲန ဖါလဖၪလၥ့ၪယၫဘၪဝ့ၫ, ၥံၪ့ၥံၪဝၪၥံၪ, ဒဲလိးၥံၪလဲၫ့ၥံၪ",
			"65": "<sup>65</sup> လီၫ.- လၧၦဆၨၩလဖၪအကျၩနီၪ နအီၪပွံၭဘၪအ့ၬး နခၪ့ယၫၥၭအီၪပွံၭအလး မိအီၪဘၪဆ့အ့ၬး အ့ၪမွဲယ ဟိဝၩမိဖ့ၪလၫ့နၧၩ ထီးနီၪလၧဆၧအၥၭဝၭထိၬ, ဒဲဆၧ",
			"66": "<sup>66</sup> အမ့ၬခံၭ, ဒဲဆၧအၥၭလၩ့ဘဲၩလီၫ.- တၭနၥၭမၧၫ့မိ လၩ့ဆဲၩလၧနမ့ၬယၫတၭ, နမိၥၭမဲၪဆၧၥံၫ့ၥံၫ့နံၩၥၫ့",
			"67": "<sup>67</sup> ၥၫ့နၩတၭ, နၥၭအီၪဂုးအီၪခၧၫ့ဘၪအ့ၬ.- လၧဂီၩလ ခီၫနီၪနမိစံၭ, အ့ၪမွဲလါလၧမုဂၪလၩ့ဖီၩၬ တၭလၧမုဂၪ လၩ့လခီၫနီၪနမိစံၭ, အ့ၪမွဲလါလၧမုဂီၩလခီၫဖီၩၬ လၧ နဆၧၥၭမဲၪလၧနမိၥၭမဲၪဘၪအကၠီၩ့တၭ, လၧဆၧအီၪ",
			"68": "<sup>68</sup> ဖျီၪလၧနမ့ၬဒၪဘၪဝ့ၫအကၠီၩ့နီၪလီၫ.- တၭယဟိဝၩ မိဒုၭလ့ၩဒီၭနၧၩ လၧအံဇံၭလၧကဘၩ့ဖၧၩ့, လၧဖၧၩ့ ၥၭလၧယစံၭနၧၩ, နလဒၪလၧၩ့ဘၪဝ့ၫနီၪလီၫ. တၭန ၥံၪမိအၪ့ဆၫခွံၬဒၪ နၥံၪအနၫ့ဆါၥံၪ လၧနၥံၪအဒုၪအ ဒၩလၧဎီးမုၪ, ဒဲဎီးခွၫအဂးနီၪတၭ, ၦဎွ့ၩန့ဝ့ၫအီၪနး ဂၩအ့ၬ."
		},
		"29": {
			"1": "<sup>1</sup> ဆၧအုၩ့လၩ့အဆၧချဲၩ့ လၧယဟိဝၩမၪလူၬစမိစ့ၭ ဘဲၫၥိၭအမိမၩဝ့ၫ လၧအံၫစရ့လၭဖိၪ လၧအခးမိအၭ အဖၧၩ့, လၧဆၧအုၩ့လၩ့လၧအမၩဝ့ၫ လၧအဝ့ၫၥံၪလၧ ဟိရ့ၭအလီၩ့နီၪ အဖၫ့ခိၪမွဲအယီၩလဖၪလီၫ.",
			"2": "<sup>2</sup> တၭစမိစ့ၭကိၭထၪ့ လၧအံၫစရ့လၭထီးအလူၬတၭ စံၭအဝ့ၫၥံၪ, နၥံၪဒၪဘၪယူၭ ကယဲဆၧလၧယဟိဝၩ မၩဝ့ၫလၧနၥံၪအမ့ၬယၫ လၧခးအံဇံၭအဖၧၩ့, လၧဖၫ ရိၫ,ဒဲလၧအခ့ၫအၡၩထီးအလူၬ, ဒဲလၧအခးထၧၫ့ဘံၪ့",
			"3": "<sup>3</sup> ယၫ,- ဆၧကျဲၩ့ဖစီၩ့ဖၭဒိၪ လၧနမ့ၬၥၪဒၪဘၪယူၭ, ဆၧ မၩနဲၪ့လၩ့လၭ, ဒဲဆၧလၩ့လိလၩ့လၭလဖၪနီၪယူၭ.",
			"4": "<sup>4</sup> မွဲလါနၫ့ ယဟိဝၩလဖ့ၪလၫ့ဘၪနၥံၪအၥၭ လၧအၥ့ၪ ယၫဆၧ, ဒဲနၥံၪအမ့ၬၥၪလၧအဒၪဆၧ, ဒဲနၥံၪအနါလၧ",
			"5": "<sup>5</sup> အနါဂၧၫ့ဆၧခီၫမုဆၫလနံၩယီၩလီၫ.- တၭယၥိၫ့နၥံၪ လၧၡါမုနၧၫ့ဖၫအနံၪ့လံဆံၫလီၫ. နၥံၪအကီၩ့အၥိၭလၩ့ လံၩ လၧနၥံၪအလီၩ့အ့ၬ. တၭနခၪ့ဖံၭလၩ့လံၩလၧန",
			"6": "<sup>6</sup> ခၪ့လီၩ့အ့ၬ.- နၥံၪလအၪ့ဘၪကိၪ, ဒဲစဘံၭထံၫအၥၫ့ မွဲဂ့ၩ, စဘံၭထံၫအလးလံၩမွဲဂ့ၩ, နၥံၪလအီၩဘၪနီၪး ဘဲၫၥိၭနၥံၪမိၥ့ၪယၫ လၧယမွဲယဟိဝၩနၥံၪအယွၩလီၫ.",
			"7": "<sup>7</sup> တၭထီးနၥံၪဂဲၫထီၩ့လၧအလးထီးယီၩတၭ, ဟ့ၭၡ ဘၫ့အစဎွၩစဲဟၫ့, ဘၫၡၫ့အစဎွၩအီၭဂဲၫထၪ့ထၫ့ဒၩ",
			"8": "<sup>8</sup> ဒုၭၥုၭလၧပၧၩတၭ, ပဖ့ၬခွံၬဝ့ၫလီၫ. တၭပမၩန့အဝ့ၫ ၥံၪအထံၫအခးတၭ, ပဖ့ၪလၫ့ဝ့ၫဆၧန့ၥၫ လၧၦရုဘံၫ့ ဖိၪ, ဒဲၦဂၭဖိၪ, ဒဲလၧၦမနၭစ့ၫဖိၪ လခီၫဒီၪ့နီၪ အဂး",
			"9": "<sup>9</sup> လီၫ.- ထီးန့ဆၧအုၩ့လၩ့ယီၩအဆၧချဲၩ့တၭ, မၩဝ့ၫ ဘဲၫၥိၭနၥံၪမိဘီၪထၪ့ယီၫထၪ့ လၧကယဲဆၧလၧနၥံၪ မၩဝ့ၫနီၪဆံၭ.",
			"10": "<sup>10</sup> ဆၧလၧမုဆၫလနံၩယီၩ နၥံၪဆၧၫ့ထုၪ့ ထီးအလူၬ လၧယဟိဝၩနၥံၪအယွၩအမ့ၬယၫ, နၥံၪအဒီၪ့လဖၪအ ခိၪ,နၥံၪအၡၩၥုၪ့က့ၭၥၭၡါၥံၪ, နၥံၪအၦဒိၪၥံၪ, အံၫစရ့",
			"11": "<sup>11</sup> လၭအၡၩထီးအလူၬ,- နၥံၪအဖိၪဒံၩဖိၪၥၪၥံၪ, နၥံၪအ ဖိၪအမၫၥံၪ, နၥံၪအၡၩလခီၫဘၩ့မုးဖိၪ လၧအအီၪလၧ နၥံၪၥုၪ့တဲၩအလး, ၦလၧအဖ့ၬနၥံၪ့မု, ဒဲၦအၪ့ဒုၪ့န",
			"12": "<sup>12</sup> ထံၫ,- ဘဲၫၥိၭနမိနုၬလၧဆၧအုၩ့လၩ့လၧယဟိဝၩန ယွၩအဖၧၩ့, ဒဲလၧယဟိဝၩနယွၩဆိၪလၩ့အၥၭအဖၧၩ့",
			"13": "<sup>13</sup> လၧနၧၩလၧမုဆၫလနံၩယီၩ,- ဘဲၫၥိၭအမိဒုၭအီၪဂုး ခၧၫ့နၧၩလၧၦဆၨၩလၧအဂးဒၪဝ့ၫတၭ, ကဲၪထၪ့နယွၩ ဘဲၫအချဲၩ့ဆၧလၧနၧၩအၥိၭ, ဘဲၫအဆိၪလၩ့အၥၭလၧ နဖါလဖၪ, ဒဲလၧစအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစယၫကူၭ",
			"14": "<sup>14</sup> နီၪလီၫ.- တၭယမၩဆၧအုၩ့လၩ့ဒဲဆၧဆိၪလၩ့အၥၭ",
			"15": "<sup>15</sup> ယီၩန့ၫလၧနၥံၪဝ့ၫမွဲအ့ၬ.- မွဲၦလၧအဆၧၫ့ထုၪ့လၧပ ၥိၭလၧမုဆၫလနံၩယီၩ, လၧယဟိဝၩပယွၩအမ့ၬယၫ, ဒဲၦလၧအလဘၪအီၪလၧပၥိၭ လၧမုဆၫလနံၩယီၩဆ့",
			"16": "<sup>16</sup> လီၫ.- အဂဲးဘဲၫယီၩ နၥံၪၥ့ၪယၫလၧပအီၪလၧခးအံ ဇံၭအဖၧၩ့း ဒဲလၧပခၫ့ဂၬၦဆၨၩလဖၪ လၧအကျၩလၧ",
			"17": "<sup>17</sup> ပခၫ့ဂၬဝ့ၫ,- တၭနၥံၪဒၪဘၪယူၭ အဆၧဘၪၥၭလိၪ, ဒဲ ဆၧဂၩ့,ၥံၪ့ၥံၪဝၪၥံၪ, လိးၥံၪလဲၫ့ၥံၪ, ကျိၪၥံၪစ့ၩၥံၪ, ဒဲ",
			"18": "<sup>18</sup> ထီၫ့ၥံၪလွ့ၫၥံၪလၧအအီၪ လၧအကျၩယူၭး- ၦခွၫလဂၩ ဂၩမွဲဂ့ၩ, ၦမုၪလဂၩဂၩမွဲဂ့ၩ, ၦဂံၪ့လဒီၪ့မွဲဂ့ၩ, ၦလ ဒီၪ့မွဲဂ့ၩ, မိအီၪဘၪခိၬလၧနၥံၪအကျၩ လၧအၥၭကၠၪ ခွံၬအၥၭလၧယဟိဝၩပယွၩလၧမုဆၫလနံၩယီၩ, ဘဲၫ ၥိၭအမိလ့ၩမၩၦဆၨၩလဖၪနီၪ အယွၩလဖၪအဆၧမၩ လီၫ. မိအီၪဘၪခိၬလၧနၥံၪအကျၩ လၧဆၧအဝံလမံၩ့",
			"19": "<sup>19</sup> လၧအဒုၭမဲၪထၪ့ၥံၪ့ဖိၪစုၪ, ဒဲရီးခၥီၫနီၪ,- ထီးအနါ ဂၧၫ့ဆၧဆိၪအၧၩ့ယီၩ အဆၧချဲၩ့တၭ, ဆၧမိမၩအၥၭ လၧအမိဆိၪဂ့ၩလၩ့အၥၭ လၧအၥၭခံဖၧၩ့တၭ, စံၭ, ယအ့ၪလ့ၩဆၧလၧယၥၭကဲၪ့ ဘဲၫၥိၭယမိအီၪက့ၪဆၧ အီၩမၧၩ့ၥံၭထံၫဂၬထံၫ လၧဆၧၥူၫယၥၭလၧထံၫလါ နၩ့ဘိၩ, ယမိအီၪလၧဆၧမုၬလၩနီၪလီၫ. ယဟိဝၩမိ",
			"20": "<sup>20</sup> ဖျါခွံၬဝ့ၫလါလါအ့ၬ.- ထီးနီၪလဖၧၫ့ ယဟိဝၩအၥၭ ထၪ့, ဒဲအၥၭကဲၪ့နီၪ မိခူၪထၪ့ဘၪၦလဂၩနီၪ, ဒဲကယဲ ဆၧဆိၪအၧၩ့လဖၪ လၧအကွ့ၭအၥၭလၧလံၬဖၧၩ့ယီၩ ထီးအလူၬမိဘၪဝ့ၫတၭ, ယဟိဝၩမိထူၭခွံၬအမံၩ့လၧ",
			"21": "<sup>21</sup> မူၭခိၪအဖၫ့လၬလီၫ.- တၭယဟိဝၩမိအၪ့နၩ့ဖၭအဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ ကိၭဒီၪ့ဒ့ၭအကျၩ လၧဆၧအၧၩ့ အဂး, ဘဲၫဆၧအုၩ့လၩ့အဆၧဆိၪအၧၩ့ ထီးအလူၬလၧ အကွ့ၭအၥၭလၧလံၬဆၧၥီၪ့ဆၧၥၫ့ယီၩ အဖၧၩ့အၥိၭ နီၪလီၫ.",
			"22": "<sup>22</sup> တၭၦလဆိၩလၧနၥံၪအလးခဲၫ့, နၥံၪအဖိၪအလံၩ, လၧအမိဂဲထုၪ့လၧနၥံၪအလးခဲၫ့, ဒဲၦလခီၫဘၩ့မုးဖိၪ လၧအမိဂဲၫလၧထံၫယဲၩ့ခးယဲၩ့လဖၪနီၪ ထီးအဒၪဘၪ ထံၫၥံၪခးၥံၪအဆၧနၭဆၧၡၪ့ ဒဲဆၧစူၭဆၧဆၫလဖၪ",
			"23": "<sup>23</sup> လၧယဟိဝၩ အီၪက့ၪလၧအဖၧၩ့,- ဒဲမ့ၪအၪ့ခးထၧၫ့ ဘံၪ့ယၫဒဲကးဒဲထံၫလၪ, ဒဲလဒိၭဘၪဆၧဎွံၪဆၧတၭ, ၥၪထၪ့အ့ၬး တၭနၪ့ၥံၪမံၩ့ၥံၪ လမဲၪထၪ့ဘၪ လၧအ ဖၧၩ့, မၩအၥၭဘဲၫဆၧမၩဂၭဂီၩ့စီဒၧၫ့, ဒဲဂမိရၫ, အၫဒ မၫ,ဒဲဇံၫဘိအံၫ့လၧယဟိဝၩ မၩဂၭဂီၩ့လၧအၥၭထၪ့,",
			"24": "<sup>24</sup> ဒဲအၥၭခိလူၬနီၪတၭ, မိစံၭဝ့ၫ,- ၦဆၨၩထီးအလူၬနီၪ ဒၪလ့ၬမိစံၭ, ယဟိဝၩမၩခးလဘံၪ့ယီၩ လၧဆၧမၩ အၥၭဘဲၫယီၩ, မွဲဘၪလဲၪ, ဆၧၥၭခဲၩထၪ့ဖၭဒိၪယီၩမွဲ",
			"25": "<sup>25</sup> ဘၪလဲၪ.- ထီးနီၪလဖၧၫ့ၦၡၩမိစံၭ, အဂဲးဘဲၫယီၩမွဲ အဝ့ၫၥံၪစဲၪ့ဒၪယဟိဝၩ အဝ့ၫၥံၪအဖါလဖၪအယွၩအ ဆၧအုၩ့လၩ့ လၧအအုၩ့လၩ့ဝ့ၫလၧအဝ့ၫၥံၪ, ထီးအ",
			"26": "<sup>26</sup> ဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧခးအံဇံၭအဖၧၩ့လီၫ.- အဂဲးဘဲၫ ယီၩမွဲအလ့ၩမၩဝ့ၫ လၧယွၩအဂူၫဂၩလဖၪအဆၧ, ဒဲ ဘၩထၪ့ယွၩလဖၪ လၧအဝ့ၫၥံၪ လၥ့ၪယၫဘၪဝ့ၫ, ဒဲ",
			"27": "<sup>27</sup> လၧဆၧလအၪ့နၩ့ဖၭဘၪ လၧအဂးနီၪလီၫ.- တၭယ ဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪခးလဘံၪ့ယီၩ ထီးအဒုၭ ဘၪဝ့ၫလၧကယဲဆၧဆိၪအၧၩ့လဖၪ, လၧအကွ့ၭအၥၭ",
			"28": "<sup>28</sup> လၧလံၬဖၧၩ့ယီၩ,- တၭယဟိဝၩထ့ၭထၪ့ခွံၬအဝ့ၫၥံၪ လၧခးဖၧၩ့ လၧဆၧၥုၪ့ထၪ့, ဒဲဆၧၥၭဂဲၫ့, ဒဲဆၧၥၭခိ ဒိၪဒိၪလ့ၬတၭ, ခွံၬၡိၭခွံၬဝ့ၫလၧအခးဂူၫဂၩလဘံၪ့အ",
			"29": "<sup>29</sup> ဖၧၩ့,ဘဲၫမုဆၫလနံၩယီၩအၥိၭနီၪလီၫ.- ဆၧအီၪၥူၪ လဖၪနီၪအီၪလၧယဟိဝၩ ပယွၩလီၫ. အ့ၪမွဲဆၧလၧ ဆၧနဲၪဖျီၪဝ့ၫလဖၪနီၪ, အီၪလၧပၧၩဒဲပဖိၪပလံၩအဂး လၩ့ဆိၩလၩ့ကၠၪ, ဘဲၫၥိၭပမိထီးန့ဆၧၥီၪ့ဆၧၥၫ့ယီၩ အဆၧချဲၩ့ထီးအလူၬလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> ထီးဆၧနီၪလဖၪ ထီးအလူၬနီၪ မိဘၪနၧၩတၭ,ဆၧ ဆိၪဂ့ၩ, ဒဲဆၧဆိၪအၧၩ့, လၧယအီၪက့ၪလၩ့ယူၭလၧ နၥံၪအမ့ၬယၫတၭ, နၥံၪမိနၪ့ထၪ့ထဲၩ့ဝ့ၫလၧၦဆၨၩလ ဖၪထီးအလူၬအကျၩ လၧယဟိဝၩ နယွၩနၫ့ထၪ့ခွံၬ",
			"2": "<sup>2</sup> နၧၩ,- နမိဂဲၫထဲၩ့ကဒၩထဲၩ့ လၧယဟိဝၩနယွၩတၭ,မိ ခိၭနၪအလူလၧနၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧနၥၭၡီၩ့ထီးအ လူၬ ဘဲၫကယဲဆၧလၧယမၪလူၬနၧၩ လၧမုဆၫလနံၩ",
			"3": "<sup>3</sup> ယီၩအၥိၭနီၪ, နဝ့ၫဒၪဒဲနဖိၪနလံၩလဖၪနီၪ,- ထီးနီၪလ ဖၧၫ့ဆၧမိမၩအၥၭ လၧယဟိဝၩ နယွၩမိဒုၭထဲၩ့ထဲၩ့ ဆၧလၧနကဲၪဎီး, ဒဲအၥၭမိအီၪနၧၩတၭ, မိဂဲၫထဲၩ့,ဒဲမၩ န့ထဲၩ့နၧၩ, လၧကယဲၦဆၨၩလဖၪအကျၩ, လၧယဟိ",
			"4": "<sup>4</sup> ဝၩနယွၩမၩလၩ့ပြံၩလၩ့ပၩယူၭနၧၩလီၫ.- တၭၦဘၪ ဆဲၫ့လၧနၧၩ အ့ၪဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫဖိးလၧမူၭခိၪအ ထုၬတၭ, ယဟိဝၩနယွၩမိအၪ့ထုၫ့ထဲၩ့နၧၩ ထီးနီၪ,",
			"5": "<sup>5</sup> ဒဲမၩန့ဂဲၫထဲၩ့ဆိၬနၧၩလၧအလးထီးနီၪလီၫ.- တၭယ ဟိဝၩနယွၩမိဒုၭထဲၩ့နုၬထဲၩ့နၧၩလၧ ထံၫၥံၪခးၥံၪအ ဖၧၩ့လၧနဖါလဖၪမၩန့ထဲၩ့ဝ့ၫတၭ, အဝ့ၫဒၪမိမၩဂ့ၩ နၧၩ, ဒဲဒုၭအၪထၪ့နၧၩ လၧနဖါလဖၪအဖၫ့ခိၪလီၫ.",
			"6": "<sup>6</sup> တၭယဟိဝၩနယွၩမိကူၭတရံၭနၥၭ, ဒဲနချံၫနၥၪအၥၭ, ဘဲၫၥိၭနမိအဲၪယဟိဝၩနယွၩ လၧနၥၭထၧၫ့ဖျိၪ့ယၫဒဲ",
			"7": "<sup>7</sup> နၥၭၡီၩ့ထီးအလူၬဘဲၫၥိၭနမိမၧၫ့လီၫ.- တၭယဟိဝၩ နယွၩမိအီၪက့ၪလၩ့ ဆၧဆိၪအၧၩ့လဖၪယီၩ ထီးအ လူၬလၧနဒုၪနဒၩအလီၩ့, ဒဲလၧၦလၧအမ့ၬလဲၩနၧၩ, ဒဲ",
			"8": "<sup>8</sup> လၧအမၩအၧၩ့မၩၥၫ့နၧၩအလီၩ့လီၫ.- တၭနမိဂဲၫ ထဲၩ့ဒဲခိၭနၪယဟိဝၩနယွၩအလူ ဒဲထီးန့အဆၧမၪလူၬ လဖၪထီးအလူၬ လၧယမၪလူၬနၧၩ လၧမုဆၫလနံၩ",
			"9": "<sup>9</sup> ယီၩလီၫ.- တၭယဟိဝၩနယွၩမိမၩအၪထၪ့နၧၩလၧ ကယဲနမၩဆၧလၧနစူၪ, လၧနဒၧၩ့လးအဆၧၥၪ,ဒဲလၧ နဆၧဖိၪဆၧဎါအဆၧၥၪ ဒဲလၧနဂၪ့ခိၪအဆၧၥၪလၧ ဆၧဂ့ၩအဂးလီၫ. အဂဲးဘဲၫယီၩယဟိဝၩမိၥၭထိၬဒီၭ လၧနဖၫ့ခိၪလၧဆၧဂ့ၩအဂး, ဘဲၫအၥၭထိၬလၧနဖါလ",
			"10": "<sup>10</sup> ဖၪအဖၫ့ခိၪအၥိၭနီၪလီၫ.- နအ့ၪခိၭနၪယဟိဝၩနယွၩ အလူဘဲၫၥိၭနမိထီးန့အဆၧမၪလူၬ, ဒဲအဆၧၥီၪ့ဆၧ ၥၫ့လၧအဘၪဆၧကွ့ၭဝ့ၫ လၧလံၬဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့ ယီၩတၭ, နအ့ၪကၠၪလီၩ့နၥၭ လၧယဟိဝၩနယွၩအ အီၪလၧနၥၭထၧၫ့ဖျိၪ့ယၫ ဒဲလၧနၥၭၡီၩ့ ထီးအလူၬ တၭ,ဆၧမိမၩအၥၭဘဲၫနီၪလီၫ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩဆၧမၪလူၬယီၩ လၧယမၪလူၬနၧၩလၧ မုဆၫလနံၩယီၩ အီၪဘံၭလၧနၧၩအ့ၬ. ဒဲအီၪလၧအ",
			"12": "<sup>12</sup> ယဲၩ့ဆ့အ့ၬး- အီၪလၧမူၭခိၪလၧနမိစံၭ, မွဲၦမိလ့ၩထၪ့ လၧမူၭခိၪတၭ, ဂဲၫလၩ့ဆိၬဝ့ၫလၧပအီၪဘဲၫၥိၭပမိနါ",
			"13": "<sup>13</sup> ဂၧၫ့,ဒဲထီးန့ဝ့ၫလဂၩလဲၪနီၪအ့ၬ.- တၭအီၪလၧမၫ ဆၧမံၭဝါလခီၫလၧနမိစံၭ, မွဲၦမိလ့ၩခၫ့ဂၬ မၫဆၧမံၭ လၧပဂး, ဒဲဂဲၫထဲၩ့ဆိၬဝ့ၫလၧပအီၪဘဲၫၥိၭပမိနါဂၧၫ့,",
			"14": "<sup>14</sup> ဒဲထီးန့လဂၩနီၪလဲၪ, မွဲဆ့အ့ၬ.- အ့ၪမွဲဆၧချဲၩ့နီၪအီၪ ဘူၭလၧနၧၩ, လၧနနိၭဖၧၩ့ဒဲလၧနၥၭခံဖၧၩ့, ဘဲၫၥိၭန မိထီးန့ဝ့ၫလီၫ.",
			"15": "<sup>15</sup> ယိခွါ, ဆၧလၧမုဆၫလနံၩယီၩ, ယအီၪက့ၪလၩ့ ဆၧမၧၫ့ ဒဲဆၧဂ့ၩ, ဆၧၥံၫ ဒဲဆၧအၧၩ့ လၧနမ့ၬယၫ",
			"16": "<sup>16</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယမၪလူၬနၧၩ လၧမုဆၫလနံၩ ယီၩ,လၧနမိဘၪအဲၪယဟိဝၩနယွၩ, လၧနမိဘၪဖိၬအ ဖၧၩ့ၥၭလဖၪ, ဒဲထီးန့အဆၧမၪလူၬလဖၪ, ဒဲအၥနိၫလ ဖၪ,ဒဲအဆၧစ့ၩရၫ့လဖၪ, ဘဲၫၥိၭနမိမၧၫ့, ဒဲအၪထၪ့ဝ့ၫ လီၫ. တၭယဟိဝၩနယွၩမိဆိၪဂ့ၩနၧၩ လၧခးဖၧၩ့ထီး",
			"17": "<sup>17</sup> နလ့ၩမၩန့ဝ့ၫလီၫ.- အ့ၪမွဲနၥၭအ့ၪကၠၪခွံၬအၥၭ, ဒဲန လခိၭနၪဘၪ, ဒဲဆၧအၪ့လံၬန့နၧၩတၭ, နဘၩထၪ့ယွၩ",
			"18": "<sup>18</sup> အဂူၫဂၩလဖၪ, ဒဲမၩအဆၧတၭ,- ယဒုၭနဲၪနၥံၪလၧ မုဆၫလနံၩယီၩ, လၧနၥံၪမိဂၭဂီၩ့တၡါ, လၧခးဖၧၩ့ ထီးနလ့ၩခၫ့ဂၬထံၫယီၫဒၫ့ ဘဲၫၥိၭနၥံၪမိမၩန့ဝ့ၫနီၪန",
			"19": "<sup>19</sup> ၥံၪမိအီၪကိၩ့အီၪခိၭဘၪအ့ၬ.- ဆၧလၧမုဆၫလနံၩ ယီၩယကိၭထၪ့မူၭခိၪ, ဒဲဂၪ့ခိၪလၧဆၧထိးအၥၭလၧ နၥံၪအဂဲး, လၧယအီၪက့ၪလၩ့ယူၭဆၧမၧၫ့ဒဲဆၧၥံၫ, ဆၧဆိၪဂ့ၩဒဲဆၧဆိၪအၧၩ့ လၧနၥံၪအမ့ၬယၫယူၭ,မၩ အၥၭဘဲၫနီၪတၭ, ရွံန့ဆၧမၧၫ့ဘီၪ, မွဲဘဲၫၥိၭနဝ့ၫဒၪဒဲ",
			"20": "<sup>20</sup> နချံၫနၥၪမိမၧၫ့ဘၪ,- ဒဲဘဲၫၥိၭနမိအဲၪ ယဟိဝၩနယွၩ, ဘဲၫၥိၭနမိခိၭနၪအလူ, ဘဲၫၥိၭနမိဖီၪ့ထၬအဝ့ၫ, အဂဲး ဘဲၫယီၩအဝ့ၫဒၪမွဲနဆၧမၧၫ့, ဒဲနၥုၪ့ကိၩ့နၥၭကိၩ့လီၫ. ဘဲၫၥိၭနမိအီၪလၧခးဖၧၩ့ လၧယဟိဝၩဆိၪလၩ့အၥၭ လၧနဖါလဖၪ, ဒဲစအၫဘြဟၫ့ ဒဲစအံစၭ, ဒဲစယၫကူၭ လၧအမိဖ့ၪလၫ့ဝ့ၫ လၧအဝ့ၫၥံၪ အစူၪဖၧၩ့လီၫ."
		},
		"31": {
			"1": "<sup>1</sup> စမိစ့ၭလ့ၩချဲၩ့ဆၧလဖၪယီၩ လၧအံၫစရ့လၭထီးအ လူၬတၭး စံၭဝ့ၫဒၪ, ဆၧလၧမုဆၫလနံၩယီၩ ယၥၭ",
			"2": "<sup>2</sup> အီၪအနံၪ့လယၩနံၫဆံၫလီၫ.- ယလ့ၩထၪ့ဒဲဂဲၫနုၬ ကဲၪလၧၩ့အ့ၬ. တၭယဟိဝၩစံၭယၧၩဆ့, နဝ့ၫဒၪနခၫ့",
			"3": "<sup>3</sup> ဂၬထံၫယီၫဒၫ့အ့ၬ.- ယဟိဝၩနယွၩမိလ့ၩခၫ့ဂၬလၧန မ့ၬယၫလီၫ. အဝ့ၫဒၪမိမၩဂၭဂီၩ့ခွံၬ ၦဆၨၩလဖၪနီၪ လၧနမ့ၬယၫတၭ, နမိမၩန့အဝ့ၫၥံၪလီၫ. စယီရှုၫအ့ၫ နီၪအဝ့ၫဒၪမိခၫ့ဂၬဆၧလၧနမ့ၬယၫ ဘဲၫယဟိဝၩချဲၩ့",
			"4": "<sup>4</sup> ဆၧအၥိၭနီၪလီၫ.- တၭယဟိဝၩမိမၩဝ့ၫဘဲၫအမၩၦ အၫမိၫဖိၪအစဎွၩလဖၪ, စစဲဟၫ့, ဒဲစအီၭ, အထံၫအခး",
			"5": "<sup>5</sup> လၧအမၩအီၪယူဝ့ၫ အၥိၭနီၪလီၫ.- တၭယဟိဝၩမိ ဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ လၧနၥံၪအမ့ၬယၫ, ဘဲၫၥိၭနၥံၪမိ မၩဘၪဝ့ၫ, ဘဲၫကယဲဆၧမၪလူၬလဖၪ လၧယမၪလူၬ",
			"6": "<sup>6</sup> ယူၭနၥံၪအၥိၭနီၪလီၫ.- အီၪက့ၪဆီၪ့နၥၭ ဒဲအီၪလၧန ၥၭဒူၩတၡါဆံၭ, အၪ့ယိၪဆၧလဂ့ၩ, ၥၭမဲၪအဝ့ၫၥံၪလ ဂ့ၩးအဂဲးဘဲၫယီၩ ယဟိဝၩနယွၩမွဲၦလၧအလ့ၩဆၧ လၧနၥိၭလီၫ. အဝ့ၫဒၪမိခွံၬၡိၭနၧၩအ့ၬ, ဒဲမိစဲၪ့ဒၪနၧၩ ဆ့အ့ၬ.",
			"7": "<sup>7</sup> စမိစ့ၭကိၭန့ စယီရှုၫအ့ၫတၭ, စံၭအဝ့ၫလၧအံၫစရ့ လၭထီးအလူၬအမ့ၬယၫ, အီၪက့ၪဆီၪ့နဂဲး ဒဲမၩဒူၩ နၥၭဆံၭး အဂဲးဘဲၫယီၩ နမိဘၪလ့ၩလၧၦခမျၧးယီၩ အၥိၭလၧထံၫၥံၪခးၥံၪ လၧယဟိဝၩဆိၪလၩ့အၥၭလၧ အဝ့ၫၥံၪအဖါလဖၪ လၧအမိဖ့ၪလၫ့ဝ့ၫလီၫ. တၭနမိ",
			"8": "<sup>8</sup> ဘၪဒုၭမၩန့ၥၫအဝ့ၫၥံၪလၧခးနီၪလီၫ.- တၭယဟိဝၩ နီၪမွဲၦလၧအလ့ၩဆၧလၧနၥံၪအမ့ၬယၫလီၫ. အဝ့ၫဒၪ မိအီၪလၧနၥိၭလီၫ. မွဲအမိခွံၬၡိၭနၧၩအ့ၬး ဒဲစဲၪ့ဒၪနၧၩ ဆ့အ့ၬး ထီးၥၭမဲၪလဂ့ၩး ထီးအၪ့ယိၪဆၧလဂ့ၩ.",
			"9": "<sup>9</sup> စမိစ့ၭကွ့ၭဆၧၥီၪ့ဆၧၥၫ့ယီၩတၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦလု ဆၧစလံဝဲၫအဖိၪခွၫၥံၪ လၧအဆိၬယဟိဝၩအဆၧအုၩ့ လၩ့အတလၫ, ဒဲလၧအံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါထီး",
			"10": "<sup>10</sup> အလူၬလီၫ.- စမိစ့ၭမၪလူၬဝ့ၫတၭ, စံၭဝ့ၫဒၪ, နွ့ၫနံၪ့အ ထုၬ, ဆၧဖျါခွံၬအနံၪ့အဆၧအီၪကီၪ့အခၫလၧဘိၪ့တဲၩ",
			"11": "<sup>11</sup> အဖၧၩ့နီၪ,- ထီးအံၫစရ့လၭထီးအလူၬအ့ၪဂဲၫဒုၭနဲၪ အၥၭလၧယဟိဝၩနယွၩ အမ့ၬယၫထီးအလး လၧအ ရွံန့ဝ့ၫတၭ, နမိဘၪဖီဆၧၥီၪ့ ဆၧၥၫ့ယီၩ လၧအံၫစရ့",
			"12": "<sup>12</sup> လၭထီးအလူၬအမ့ၬယၫလၧအနါဖၧၩ့လီၫ.- ဒုၭအီၪ ကိၩ့အီၪကီၪ့ၦခမျၧး, ၦခွၫဒဲၦမုၪ, ဒဲဖိၪဒံၩဖိၪၥၪ, ဒဲၦလ ခီၫဘၩ့မုးဖိၪလၧအအီၪလၧနတရၫ့အဖၧၩ့, ဘဲၫၥိၭအ မိနါဂၧၫ့,ဒဲမိမၩလိၪဆၧ, ဒဲၥၭမဲၪယဟိဝၩနၥံၪအယွၩ တၭ,ဘဲၫၥိၭအမိထီးလၩ့အၥၭ လၧအမိမၩဆၧၥီၪ့ဆၧ",
			"13": "<sup>13</sup> ၥၫ့ယီၩအဆၧချဲၩ့ထီးအလူၬ,- ဘဲၫၥိၭအဖိၪလဖၪလၧ အလၥ့ၪယၫဘၪဆၧလဖၪနီၪမိနါဂၧၫ့, ဒဲမၩလိၪဆၧၥၭ မဲၪယဟိဝၩနၥံၪအယွၩ လဆိၩဒၪနၥံၪအၥၭ လၧထံၫ ၥံၪခးၥံၪအဖၧၩ့ လၧနၥံၪလ့ၩခၫ့ဂၬယီၫဒၫ့ဘဲၫၥိၭနၥံၪ မိမၩန့ဝ့ၫလီၫ.",
			"14": "<sup>14</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ယိခွါ,နမုနံၩလၧနမိဘၪၥံၫ နီၪၥုၭဘူၭအၥၭလီၫ. ကိၭန့စယီရှုၫအ့ၫတၭ,ဆၧၫ့ထုၪ့ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့ ဘဲၫၥိၭယမိမၪ လူၬဝ့ၫနီၪဆံၭ. စမိစ့ၭဒဲစယီရှုၫအ့ၫလ့ၩဆၧဆၧၫ့ထုၪ့",
			"15": "<sup>15</sup> လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့လီၫ.- ယဟိဝၩ အီၪဖျီၪထၪ့လၧတဲၩဆံၫ့ဎံၪအဖၧၩ့ လၧဆၧအုၪ့အထုၪ့ အဖၧၩ့တၭ, ဆၧအုၪ့အထုၪ့နီၪဆၧၫ့ထုၪ့လၧတဲၩဆံၫ့ ဎံၪအတရၫ့အဖၫ့ခိၪလီၫ.",
			"16": "<sup>16</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ယိခွါ,နမိဘၪမံၫလၧနဖါလ ဖၪအၥိၭလီၫ. ၦခမျၧးယီၩမိဂဲထုၪ့တၭလ့ၩမၩလဲးမၩ ဘျၪအၥၭဖိၬၦလခီၫဘၩ့မုးဖိၪ လၧထံၫၥံၪခးၥံၪအဖၧၩ့ အယွၩလဖၪအခဲၫ့ ထီးအလး လၧအဝ့ၫၥံၪ လ့ၩအီၪ လၧအကျၩနီၪတၭ, မိခွံၬၡိၭယၧၩ, ဒဲမၩဂၭဂီၩ့ယဆၧ",
			"17": "<sup>17</sup> အုၩ့လၩ့လၧယမၩလၧအဝ့ၫၥံၪလီၫ.- လၧမုလနံၩနီၪ ယၥၭထၪ့မိခဲၩထၪ့ဘၪဝ့ၫတၭ, ယမိခွံၬၡိၭ အဝ့ၫၥံၪ တၭ,ယမိအီၪက့ၪၥူၪခွံၬယမ့ၬ လၧအဝ့ၫၥံၪတၭ,ဆၧမိ အၪ့ခွံၬအဝ့ၫၥံၪတၭ, ဆၧအၧၩ့ဆၧၥၫ့ ဒဲဆၧခိဆၧဝီၩ အၪမံၩ့မိဘၪဝ့ၫလီၫ. တၭလၧမုနံၩနီၪ အဝ့ၫၥံၪမိစံၭ ဆၧအၧၩ့ဆၧၥၫ့ယီၩဘၪပၧၩ လၧပယွၩလအီၪဘၪလၧ",
			"18": "<sup>18</sup> ပကျၩအကၠီၩ့နီၪမွဲအ့ၬဧၪ.- တၭယမိအီၪက့ၪၥူၪခွံၬတ ၡါယမ့ၬလၧမုလနံၩနီၪလီၫ. အဂဲးဘဲၫယီၩလၧအဆၧ အၧၩ့ဆၧၥၫ့ထီးအလူၬ လၧအမၩဝ့ၫအကၠီၩ့နီၪတၭ, အဝ့ၫၥံၪကၠၪအၥၭ လၧယွၩဂူၫဂၩလဖၪ အအီၪလီၫ.",
			"19": "<sup>19</sup> တၭဘိၩ့နဲၪ့ယီၩ, ကွ့ၭဆၧၥံၫကျံၩလၧနၥံၪအဂးတၭ, ၥီၪ့လိၪၦအံၫစရ့လၭဖိၪလၧအဝ့ၫဆံၭ. အီၪက့ၪဝ့ၫလၧ အနိၭဖၧၩ့, ဘဲၫၥိၭဆၧၥံၫကျံၩယီၩမိကဲၪထၪ့ဆၧထိး",
			"20": "<sup>20</sup> အၥၭလၧအဂးထၫ့ဒၩၦအံၫစရ့လၭဖိၪနီၪဆံၭ.- အဂဲး ဘဲၫယီၩ ထီးယအ့ၪဒုၭလ့ၩနုၬအဝ့ၫၥံၪ လၧထံၫၥံၪခး ၥံၪအဖၧၩ့လၧယဆိၪလၩ့ယၥၭ လၧအဂဲးလၧအဝ့ၫၥံၪ အဖါလဖၪ, လၧအယွၩလၩ့ဝ့ၫ လၧဆၧနူထံၫဒဲန့ၫစၩ့ တၭ,အဝ့ၫၥံၪမိအၪ့ဝ့ၫဘျဲၩအၪ့, ဒဲဘီၪ့ထၪ့တၭ, မိကၠၪ အၥၭလၧယွၩအဂူၫဂၩလဖၪအအီၪ, ဒဲမၩအဆၧ, ဒဲမၩ",
			"21": "<sup>21</sup> ၥၭထၪ့ယၧၩ, ဒဲမၩဂၭဂီၩ့ယဆၧအုၩ့လၩ့လီၫ.- ထီး အဝ့ၫၥံၪဘၪဆၧအၧၩ့ဆၧၥၫ့, ဒဲဆၧခိဆၧဝီၩ အၪမံၩ့ တၭ,ဆၧမိမၩအၥၭလၧဆၧၥံၫကျံၩယီၩ မိထိးအၥၭ ထၫ့ဒၩအဝ့ၫၥံၪ, ဘဲၫၦထိးအၥၭအၥိၭနီၪလီၫ. အဂဲး ဘဲၫယီၩဘၪဆၧၥၭနၪ့ဝ့ၫ လၧအချံၫအၥၪအနိၭအ့ၬ. အဂဲးဘဲၫယီၩ ယၥ့ၪယၫအဆၧဆီၫ့မီၪ့ဆၧလၧမုနံၩလ ဖၪလၧယလချႃၭဒုၭလ့ၩနုၬဒံၭဘၪဝ့ၫ လၧခးဖၧၩ့လၧ ယဆိၪလၩ့ယၥၭလၧအဂဲးလီၫ.",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ စမိစ့ၭကွ့ၭဆၧၥံၫကျံၩယီၩလၧ",
			"23": "<sup>23</sup> မုလနံၩနီၪဒဲၥီၪ့လိၪဝ့ၫလၧၦအံၫစရ့လၭဖိၪလီၫ.- မွဲအ မၪလူၬစနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫတၭစံၭဝ့ၫ, အီၪက့ၪ ဆီၪ့နဂဲးဒဲမၩဒူၩနၥၭဆံၭ, အဂဲးဘဲၫယီၩနမိဒုၭလ့ၩနုၬ ၦအံၫစရ့လၭဖိၪ လၧခးလဘံၪ့အဖၧၩ့ လၧယဆိၪလၩ့ ယၥၭလၧအဝ့ၫၥံၪလၧအဂဲးတၭ, ယမိအီၪလၧနၥိၭလီၫ.",
			"24": "<sup>24</sup> ထီးစမိစ့ၭကွ့ၭဆၧၥီၪ့ဆၧၥၫ့ယီၩအဆၧချဲၩ့လၧလံၬ",
			"25": "<sup>25</sup> ဖၧၩ့ထီးအလူၬဂီၩ့တၭ,- ဆၧမၩအၥၭလၧစမိစ့ၭမၪ လူၬၦလံဝဲၫဖိၪလၧအဆိၬ ယဟိဝၩအဆၧအုၩ့လၩ့အ",
			"26": "<sup>26</sup> တလၫတၭ, စံၭဝ့ၫဒၪ,- မၩန့လံၬဆၧၥီၪ့ဆၧၥၫ့ယီၩ တၭ,အီၪက့ၪဝ့ၫလၧ ယဟိဝၩနၥံၪအယွၩအဆၧအုၩ့ လၩ့အတလၫဖၧၩ့နီၪ, ဘဲၫၥိၭအမိအီၪထီးနီၪလၧဆၧ",
			"27": "<sup>27</sup> ထိးအၥၭထၫ့ဒၩနၧၩအဂးနီၪဆံၭ.- အဂဲးဘဲၫယီၩယ ၥ့ၪယၫလၧနပိၩ့ထၪ့ဆၧ, ဒဲနခိၬဆီၪ့လီၫ. ယိခွါ, လၧ ယမၧၫ့ဒံၭလၧနၥံၪအကျၩအဘိၩ့ဘၭလၧမုဆၫလနံၩ ယီၩတၭ, နၥံၪပိၩ့ထၪ့ယဟိဝၩတၭး ယၥံၫအလးခဲၫ့",
			"28": "<sup>28</sup> နီၪ,မိအၪနဲၪ့အနီၪဆံၭအၪလဲၪၬ- ဒုၭအီၪကီၪ့နၥံၪ အဒီၪ့အၥုၪ့က့ၭၥၭၡါလဖၪ ဒဲနၥံၪအၦဒိၪလဖၪလၧယ အီၪ,ဘဲၫၥိၭယမိချဲၩ့ဆၧချဲၩ့ယီၩ လၧအဝ့ၫၥံၪအနါ ဖၧၩ့,ဒဲကိၭထၪ့မူၭခိၪ, ဒဲဂၪ့ခိၪလၧဆၧထိးအၥၭထၫ့",
			"29": "<sup>29</sup> ဒၩအဝ့ၫၥံၪလီၫ.- အဂဲးဘဲၫယီၩ ယၥ့ၪယၫလၧယၥံၫ အလးခဲၫ့နီၪ, နၥံၪမိမၩဘၪၥၭလိၪနၥံၪအၥၭဒဲကၠၪပဲၩ ခွံၬလၧဖၧၩ့ၥၭ လၧယမၪလူၬနၥံၪ, ဒဲဆၧအၧၩ့မိဘၪန ၥံၪလၧမုနံၩအလးခဲၫ့လဖၪနီၪလီၫ. အဂဲးဘဲၫယီၩနၥံၪ မိမၩအၧၩ့ဆၧ လၧယဟိဝၩအမ့ၬယၫ ဒဲမိဒုၭၥၭထၪ့ အဝ့ၫလၧနၥံၪမၩဆၧလၧနၥံၪအစူၪအကၠီၩ့လီၫ.",
			"30": "<sup>30</sup> စမိစ့ၭချဲၩ့ဆၧလၧအံၫစရ့လၭအဆၧအီၪကီၪ့ထီး အလူၬအနါဖၧၩ့ လၧဆၧၥံၫကျံၩယီၩ အဆၧချဲၩ့ထီး အလူၬလီၫ."
		},
		"32": {
			"1": "<sup>1</sup> ခိၭနၪ, မူၭခိၪၥံၪဧ့, တၭယမိချဲၩ့ဆၧ, ဂၪ့ခိၪၥံၪဧ့, ခိၭနၪယနိၭအဆၧချဲၩ့ဆံၭ.",
			"2": "<sup>2</sup> ယဆၧၥီၪ့ဆၧၥၫ့ မိဂဲၫလၩ့ ဘဲၫဆၧဂဲၫဆၧၩ့အၥိၭ, ယလူမိလၩ့ဘဲၫဆၩ့ထံၫအၥိၭ, ဘဲၫဆၧဆၧၩ့လၩ့ပြံၩပၩ လၧဆၧမဲၪထၪ့ၥၫ့ အဖၫ့ခိၪ အၥိၭ, တၭဘဲၫဆၩ့ထံၫအဖျိၪ့လဖၪ လၧနၪ့ၥံၪမံၩ့ၥံၪအဖၫ့ခိၪ အၥိၭ,",
			"3": "<sup>3</sup> မွဲယမိဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ယဟိဝၩအမံၩ့တၭ, အီၪက့ၪဆၧဒိၪလၧပယွၩဆံၭ.",
			"4": "<sup>4</sup> မွဲဝ့ၫလၧလဲၫ့လဖျိၪ့, အမၩဆၧလၧၫ့ဎွ့ၩဝ့ၫ, အဖၧၩ့ၥၭထီးအလူၬ မွဲဆၧစ့ၩရၫ့အဂဲးလီၫ. မွဲဆၧမွဲဆၧတီၩအယွၩ, ဒဲဆၧအၧၩ့လအီၪဘၪလၧအ ဝ့ၫ, ဆၧတီၩဒဲဆၧလီၩ့မွဲအဝ့ၫဒၪလီၫ.",
			"5": "<sup>5</sup> အဝ့ၫၥံၪမၩၥၭလိၪအနၫ့ဆါဒၪဝ့ၫတၭ, လမွဲဘၪယွၩ အဖိၪ, မွဲဆၧအမဲၪ, မွဲၦလဆိၩလၧအၥၭကဲၪ့, ဒဲအၪ့လီၫဆၧလီၫ.",
			"6": "<sup>6</sup> နၥံၪမၩထဲၩ့ယဟိဝၩဘဲၫနီၪၥိၭဆ့ဧၪ, ၦဂၭဂီၩ့ဖိၪ, ဒဲကိၪ့ဆၧလၥ့ၪဘၪၦခမျၧးၥံၪဧ့, ၦလၧအဎွ့ၩန့ထဲၩ့နၧၩမွဲနဖါနီၪအ့ၬဧၪ. အဝ့ၫဒၪမၩကဲၪထၪ့နၧၩ, ဒဲဒုၭအီၪခၧၫ့နၧၩမွဲအ့ၬဧၪ.",
			"7": "<sup>7</sup> နၪ့ထၪ့ထဲၩ့မုနံၩလဖၪလၧဖျိၩ့, အီၪက့ၪနၥၭ လၧလဆိၩဘၪလဆိၩအနံၪ့လဖၪနီၪ, အၪ့စၪ့နဖါတၭ, မိဒုၭနဲၪနၧၩ, နၡၩၥုၪ့က့ၭၥၭၡါၥံၪတၭ, မိလီၩဘၪနၧၩ,",
			"8": "<sup>8</sup> ထီးဆၧထီၫထုၬ အၪ့နၩ့ဖၭ ၦဆၨၩ အဆၧန့ၥၫအ ဆၧၫ့, ထီးအမၩလၩ့မုလၩ့ဖၭၦၡၩဖိၪလဖၪ, အီၪက့ၪၦခမျၧးအနဲၩ့လဖၪ, ဘဲၫၦအံၫစရ့လၭဖိၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ.",
			"9": "<sup>9</sup> အဂဲးဘဲၫယီၩယဟိဝၩအဂးနီၪမွဲအၡၩခမျၧး, တၭ အဆၧန့ၥၫအဂးနီၪမွဲစယၫကူၭ,",
			"10": "<sup>10</sup> မွဲအဒၪန့ဝ့ၫလၧခးၡါမုနၧၫ့ဖၫလဘံၪ့အဖၧၩ့, ဒဲလၧ ၡါမုနၧၫ့ဖၫလၧအအီၪယူဝ့ၫ, ဒဲဆၧအိၩ့ယိၩ့ဝ့ၫတၭ, ၥိၫ့ဝံၩ့ဝၩ့ဝ့ၫ, ဒဲၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဝ့ၫ, ယိထဲၩ့ဝ့ၫဘဲၫအမ့ၬၡၩအၥိၭလီၫ.",
			"11": "<sup>11</sup> ဘဲၫလံၬကျီၫ့ကျီၪ့ထိၪဂဲၩအၥွံၫဂုၪအဖိၪ, ယၩ့ထၪ့အဒံၭမၩန့ဝ့ၫ, ဆိၬထၪ့ဝ့ၫလၧအဒံၭအဖၫ့ခိၪအၥိၭ,",
			"12": "<sup>12</sup> ယဟိဝၩလဂၩဎးၥိၫ့အဝ့ၫ, ၦလခီၫဘၩ့မုးဖိၪအယွၩအီၪလၧအဝ့ၫအ့ၬ.",
			"13": "<sup>13</sup> မွဲအဒုၭထူၬဝ့ၫလၧဂၪ့ခိၪအလးထၪ့ထီၫလဖၪ, ဘဲၫၥိၭအမိအၪ့ဘၪဆံၬၥံၪနၩၥံၪ အဆၧအၪထၪ့, မွဲအဒုၭအၪ့ဆူၭဝ့ၫန့ၫစၩ့ လၧလိးဖၧၩ့, ဒဲၥိၪလၧလိး မ့ၪဖၧၩ့,",
			"14": "<sup>14</sup> ချီအနူထံၫလၩ့ဒၭ, ဒဲၥိၪအနူထံၫ, အီၪလၧၥိၪဖိၪအၥိၪ, ဒဲဘၫၡၫ့အၥိၪဖၫ, ဒဲဘ့ၪ, အီၪလၧဘုၪကၠိၩ့အလ့အၥိၪ, ဒဲနအီၩစဘံၭၥၪအၥွံၪ, စဘံၭထံၫလီၫ.",
			"15": "<sup>15</sup> တၭယ့ၭၡရၧၫ့ဘီၪ့ထၪ့, ဒဲထၧၫ့ထၪ့ဆၧ, နဘီၪ့ထၪ့ယူၭ, နတၪ့ယူၭ, နဘီၪ့ထၪ့ယူၭလၧၥိၪထၧၫ့ ဂၩယၫယူၭ. ထီးနီၪလဖၧၫ့မွဲအစဲၪ့ဒၪယွၩ လၧအမၩကဲၪထၪ့ဝ့ၫ,ဒဲမၩ ကြၩ့ထမးအဆၧထိးထဲၩ့တၩ့ထဲၩ့အလိးလဖျိၪ့လီၫ.",
			"16": "<sup>16</sup> အဝ့ၫၥံၪဒုၭကဲၪထၪ့အၥၭ လၧၦလခီၫဘၩ့မုးဖိၪအ ဆၧ,မၩၥၭထၪ့ဝ့ၫလၧဆၧဘၪၥၭလိၪလဖၪ,",
			"17": "<sup>17</sup> အဝ့ၫၥံၪလုထၪ့ဆၧလၧဆၧဂၩ့, မွဲလၧယွၩအ့ၬး ယွၩလဖၪလၧအလၥ့ၪယၫဘၪဝ့ၫ, လၧဆၧၥၫ့လၧအဂဲၫထၪ့ၥၫ့, လၧနၥံၪအဖါလဖၪလၥၭမဲၪဘၪဝ့ၫ,",
			"18": "<sup>18</sup> လဲၫ့လၧအထၪ့ဖိၪနၧၩလဖျိၪ့နီၪ နလဒူၩယၪ့ဘၪ,တၭ နၥၭနၪ့ယူၭယွၩလၧအတဲၩ့လၩ့နၧၩယူၭ.",
			"19": "<sup>19</sup> ထီးယဟိဝၩဒၪဘၪဝ့ၫတၭ, ၥၭထၪ့ဝ့ၫ,လၧအဖိၪမုၪ ဒဲအဖိၪခွၫၥံၪမၩထံၬထၬဆၧအကၠီၩ့,",
			"20": "<sup>20</sup> တၭမွဲအစံၭဝ့ၫ, ယမိအီၪက့ၪၥူၪယမ့ၬ လၧအဝ့ၫၥံၪ, တၭအထုၬမိမၩအၥၭ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ ယမိ ယိဝ့ၫ, အဂဲးဘဲၫယီၩမွဲၦလဆိၩလၧအမၩကဲၪ့အၥၭ, ဒဲဖိၪၥၪ လၧအဆၧမွဲဆၧတီၩလအီၪး",
			"21": "<sup>21</sup> အဝ့ၫၥံၪဒုၭကဲၪ့ယၥၭ လၧဆၧလၧအလမွဲဘၪယွၩ, မၩၥၭထၪ့ယၧၩလၧအဆၧပျီၩပျီၩ, ယမိဒုၭၥၭကဲၪ့အဝ့ၫၥံၪ လၧအလမွဲဘၪၦလဆၨၩ, ယမိမၩၥၭထၪ့အဝ့ၫၥံၪ လၧၦဂၭဂီၩ့ဖိၪလဆၨၩ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ မ့ၪဆူၭခဲၩထၪ့အၥၭ လၧယဆၧၥၭ ထၪ့အဖၧၩ့, လၧအမိအၪ့ဆၧဖိးလၧဖျႃဖၧၩ့အခဲၫ့ဒၭ, တၭမိအၪ့ခွံၬဂၪ့ခိၪဒဲအဆၧအၪထၪ့, တၭမိဆူၭထၪ့ခွံၬ အခိၪလီၩ့ ထိၩ့ချိၬ အခၪ့ထံၭလဖၪ လီၫ.",
			"23": "<sup>23</sup> ယမိအီၪက့ၪကီၪ့ဆၧအၧၩ့လဖၪ လၧအဝ့ၫၥံၪအဖၫ့ ခိၪ, ယမိမၩလူၬယဖျါၥံၪလၧအလီၩ့လီၫ.",
			"24": "<sup>24</sup> ဆၧမိလူၬအဝ့ၫၥံၪလၧဆၧၥၭဝံလၩ့ဒိၩ, ဒဲလၧဆၧၥံၫချဲၩ့အမ့ၪ, ဒဲဆၧမၩဂၭဂီၩ့နၭနၭလ့ၬ, တၭယမိအၪ့မၧၫ့လၩ့ ဆၧဖိၪဆၧဎါအမဲၪၥံၪအၥွၫၥံၪ လၧအအီၪ, ဒဲဆၧစွၩလၧဂၪ့ခိၪအမုၬအကျၩလဖၪအ ဆၧစုၪလီၫ.",
			"25": "<sup>25</sup> နၭၥံၪဖၩ့ၥံၪလၧခီၫ့, ဒဲဆၧၥၭမဲၪၥၭဖျဲၩ့လၧအဖၧၩ့, မိမၩဂၭဂီၩ့ၦဖိၪၥၪခွၫဒဲၦမုၪနၩ့, ဒဲဖိၪၥၪအၪ့နူထံၫဒဲၦခိၪဘွၩ,",
			"26": "<sup>26</sup> ယစံၭယမိအူၪပြံၩပၩဝ့ၫ, ယမိဒုၭထုၬဆၧနၪ့ထၪ့ထဲၩ့ဝ့ၫ လၧၦၡၩအကျၩ, အ့ၪ လမွဲဘၪ,",
			"27": "<sup>27</sup> ယအၪ့ယိၪဆၧလၧဆၧအဒုၪအဒၩ မိအီၪက့ၪအၥၭ ထၪ့ထီၫ, တၭယမိမၩလီၫ. ၦထၫ့ဒၩဝ့ၫလဖၪမိမၩလၩ့လၭဘၪခိၬအၥၭ, မိစံၭဘၪခိၬ, ပစူၪအီၪထၪ့ထီၫ, တၭယဟိဝၩမၩဆၧထီးအလူၬယီၩအ့ၬ.",
			"28": "<sup>28</sup> မွဲၦလဆၨၩလၧဆၧကိၪ့လိၬလအီၪ, ဒဲဆၧၥုၪ့ဆၭၥၭဆၭလအီၪဘၪလၧအဖၧၩ့လီၫ.",
			"29": "<sup>29</sup> မွဲအအီၪလါလၧအၥၭကိၪ့ဆၧၥ့ၪဘီၪး ဒဲလၧအနၪဆၧယီၫမိၥ့ၪ, ဒဲလၧအမိဆီၫ့မီၪ့ဆၧဘၪဆဲၫ့လၧယၫလခီၫနီၪဘီၪၬ",
			"30": "<sup>30</sup> အလဲၫ့လဖျိၪ့အ့ၪလအၪ့ဆၫခွံၬဘၪအဝ့ၫၥံၪ, ဒဲယဟိဝၩအ့ၪလကၭဘံၭထၬအခဲၫ့တၭ, ၦလဂၩမိလ့ၩနၫ့ထၪ့ခွံၬၦလထီၫ့, ဒဲၦနံၫဂၩမိဒုၭစဲၪ့ထၪ့ခွံၬၦလလၬ, ဘဲၫၥ့ၪလဲၪၬ",
			"31": "<sup>31</sup> အဂဲးဘဲၫယီၩပဒုၪပဒၩ အနၫ့ဆါဒၪဝ့ၫလါနၫ့အ့ၪစ့ၩ ရၫ့ဆၧတၭ,အဝ့ၫၥံၪအလဲၫ့လဖျိၪ့မီၪ့ဎီၩ့လၧပလဲၫ့အ့ၬ.",
			"32": "<sup>32</sup> အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအစဘံၭမုမွဲစီဒၧၫ့အစဘံၭမု, ဒဲလၧဂမိရၫအစဘံၭမုအလးလီၫ. အဝ့ၫၥံၪအစဘံၭၥၪမွဲစဘံၭၥၪအစုၪ, အဆူၬလဖၪခၪဝ့ၫ,",
			"33": "<sup>33</sup> အဝ့ၫၥံၪအစဘံၭထံၫမွဲၡီၩ့အစုၪ, ဒဲဂူၥၫ့အစုၪအၧၩ့လီၫ.",
			"34": "<sup>34</sup> ဆၧယီၩအီၪက့ၪကီၪ့လၧယၧၩ, ဘၪဆၧစဲၩနဲၪ့ထၬ လၧယဆၧလူဒိၪဎွ့ၩဒိၪအဖၧၩ့မွဲ အ့ၬဧၪ.",
			"35": "<sup>35</sup> ဆၧဖ့ၪထဲၩ့ဆၧအၧၩ့အီၪလၧယၧၩ, ဒဲဆၧမိဖ့ၪထဲၩ့ ဆၧ,လၧအထီနီၪအခၪ့မိဖျၭလီၫ. အဂဲးဘဲၫယီၩ အဆၧနၭဆၧၡၪ့ အမုလနံၩလၩ့ဘူၭ ယူၭတၭ, ဆၧလၧအအီၪတဲၩ့ဝဲၩအၥၭ လၧအဂးနီၪဂဲၫ ချဲၫ့လီၫ.",
			"36": "<sup>36</sup> ဘၪဝ့ၫလါနၫ့ထီးအဒၪ လၧအစီၩ့အမၩ့လအီၪလၧၩ့ ဘၪ,ဒဲဆၧအီၪကၭဘံၭထၬအခဲၫ့တၭ, ၦအီၪလၩ့ထး လအီၪဘၪနီၪ, ယဟိဝၩမိစ့ၩရၫ့အၡၩခမျၧး, ဒဲနၪ့ထၪ့နီၫ့ယါလၩ့ထဲၩ့အၥၭလၧအခ့ၫအၡၩအကၠီၩ့,",
			"37": "<sup>37</sup> ထီးနီၪလဖၧၫ့မွဲအမိစံၭအယွၩလဖၪအီၪခီၫခီၫလဲၪ, လဲၫ့လဖျိၪ့လၧအဒိၭနဲၩ့အၥၭလၧအဖၧၩ့,",
			"38": "<sup>38</sup> လၧအအၪ့အဆၧလုအၥိၪ, လၧအအီၩ အဆၧလုအီၩ အစဘံၭထံၫနီၪ အီၪခီၫခီၫ လဲၪ. မွဲအဝ့ၫၥံၪဂဲထုၪ့ဒၪဝ့ၫတၭ, မၩဆၧၩ့နၥံၪဆံၭ. မွဲအကဲၪထၪ့ဒၪဝ့ၫလၧအဆၧယိထဲၩ့နၥံၪဆံၭ.",
			"39": "<sup>39</sup> ယိခွါဘိၩ့နဲၪ့ယီၩ, လၧယၧၩဒၪလ့ၬ, မွဲအဝ့ၫဒၪတၭ, ယွၩအီၪလၧယၥိၭနးဂၩအ့ၬ. ယမၩၥံၫဆၧယဝ့ၫ, ဒဲယမၩမၧၫ့ဆၧယဝ့ၫ, ယမၩဆၫဆၧယဝ့ၫ, ဒဲယမၩဘျၪထဲၩ့ဆၧယဝ့ၫ, တၭဆၧမၩဖီၩ့ဖျ့ၭခွံၬလၧယစူၪဖၧၩ့အီၪအ့ၬ.",
			"40": "<sup>40</sup> အဂဲးဘဲၫယီၩယယူၬထၪ့ယစူၪလၧမူၭခိၪ, တၭယစံၭ, ယမၧၫ့ယဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"41": "<sup>41</sup> ယအ့ၪကျဲၩ့ထၪ့ယနၭယုၩ့ယဲလဘံၪ့, ဒဲယစူၪဖီၪ့ထၬဆၧစ့ၩရၫ့တၭ, ယမိဖ့ၪထဲၩ့ယဒုၪယဒၩ လၧဆၧမၩဆၧၫ့ဆၧအၧၩ့, တၭယမိမၩဆၧၫ့ဆၧလၧၦအၥၭဂဲၫ့ယၧၩ,",
			"42": "<sup>42</sup> ယမိဒုၭအီၩမၧၩ့ယဖျါလၧဆၧၥွံၪ, ဒဲယနၭမိအၪ့ဆၧယၪ, လၧၦဘၪဆၧမၩၥံၫ, ဒဲလၧၦဘၪဆၧအၪ့မၧၫ့ဎီးဝ့ၫအ ၥွံၪ, လၧဆၧအဒုၪအဒၩအၦဒိၪလဖၪအခိၪလီၫ.",
			"43": "<sup>43</sup> ၥုၪ့ဎွံၫၥၭယီၫၦဆၨၩလဖၪအၡၩခမျၧးၥံၪဧ့, အဂဲးဘဲၫယီၩအဝ့ၫဒၪမိမၩအၧၩ့ဆၧၫ့လၧအခ့ၫအၡၩ အၥွံၪအကၠီၩ့, ဒဲမိဖ့ၪထဲၩ့ဆၧမၩဆၧၩ့လၧၦအထၫ့ဒၩအဝ့ၫ, ဒဲမိမၩဖီၩ့ဖျ့ၭဆၧလၧအခး, အၡၩခမျၧးအဂးလီၫ.",
			"44": "<sup>44</sup> တၭစမိစ့ၭဂဲၫချဲၩ့ လံၬၥံၫကျံၩယီၩအဆၧချဲၩ့ထီးအ လူၬလၧၦခမျၧးအနါဖၧၩ့အဝ့ၫဒၪ, ဒဲစနိၫ့အဖိၪခွၫစယီ ရှုၫအ့ၫလီၫ.",
			"45": "<sup>45</sup> တၭစမိစ့ၭချဲၩ့ကယဲဆၧချဲၩ့ယီၩလၧအံၫစရ့လၭ",
			"46": "<sup>46</sup> ထီးအလူၬနီၪဂီၩ့တၭ,- စံၭဝ့ၫ, အီၪက့ၪနၥံၪအၥၭလၧ ကယဲဆၧချဲၩ့လၧယထိးယၥၭ လၧမုဆၫလနံၩယီၩ, လၧနၥံၪမိဘၪမၪလူၬနၥံၪအဖိၪအလံၩ လၧအမိဘၪ ထီးလၩ့အၥၭဘဲၫၥိၭအမိထီးန့ ဆၧၥီၪ့ဆၧၥၫ့ယီၩအ",
			"47": "<sup>47</sup> ဆၧချဲၩ့ထီးအလူၬနီၪဆံၭ.- အဂဲးဘဲၫယီၩ မွဲဆၧပျီၩ ပျီၩလၧနၥံၪအဂးအ့ၬ, မွဲနၥံၪအဆၧမၧၫ့လီၫ. တၭနၥံၪ မိမၩအၪထၪ့ နၥံၪအနံၩအၥၫ့လၧခးဖၧၩ့ လၧနၥံၪခၫ့ဂၬ ယီၫဒၫ့ဘဲၫၥိၭနၥံၪမိမၩန့ဝ့ၫ လၧဆၧနီၪအကၠီၩ့လီၫ.",
			"48": "<sup>48</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ လၧမုလနံၩဎးနီၪတၭ,",
			"49": "<sup>49</sup> စံၭဝ့ၫဒၪ,- လ့ၩထၪ့ဘၭ ခိၪလီၩ့အၭဘရံၫ့ယီၩ, ခိၪ လီၩ့နံဘိၫ, လၧအအီၪလၧမိအၭအခးဖၧၩ့ဆဲၫဎၩ့လၧ ယ့ၫရခိၫတၭ, ယိခးကၫနအၫ့လၧယဖ့ၪလၫ့ၦအံၫစရ့",
			"50": "<sup>50</sup> လၭဖိၪလၧဆၧန့ၥၫ အဂးနီၪဘီၪ.- ဒဲၥံၫလၧခိၪလီၩ့ ထီးနလ့ၩထၪ့ဘၭ, ဒဲဘၪဆၧအီၪက့ၪကီၪ့နၧၩ လၧန ၡၩခမျၧး, ဘဲၫနထၧၫ့ဖုဝဲစအၫရၧၫ့ၥံၫဝ့ၫ လၧခိၪလီၩ့ ဟီၫအလီၩ့တၭ, ဘၪဆၧအီၪက့ၪကီၪ့အဝ့ၫလၧအၡၩ ခမျၧးအၥိၭနီၪဆံၭ.",
			"51": "<sup>51</sup> အဂဲးဘဲၫယီၩ နၥံၪမၩမၪဘၪယၧၩ လၧၦအံၫစရ့ လၭဖိၪအကျၩ ထီးထံၫမ့ရဘၫကၫဒ့ၭလၧၡါမုနၧၫ့ဖၫ ဇံၫ့နီၪလီၫ. အဂဲးဘဲၫယီၩ နၥံၪအီၪက့ၪဆံၫ့ဎံၪယၧၩ",
			"52": "<sup>52</sup> လၧၦအံၫစရ့လၭဖိၪအကျၩအ့ၬ.- မွဲလါနၫ့နမိဒၪဘၪ ထံၫၥံၪခးၥံၪနီၪလၧနမ့ၬယၫလီၫ. အ့ၪမွဲလၧထံၫၥံၪခး ၥံၪလၧယဖ့ၪလၫ့ၦအံၫစရ့လၭဖိၪ နလ့ၩနုၬဘၪထီးနီၪ အ့ၬ."
		},
		"33": {
			"1": "<sup>1</sup> တၭအယီၩမွဲဆၧဆိၪဂ့ၩ လၧယွၩအၡၩစမိစ့ၭ,လၧ အလချႃၭ ၥံၫဒံၭဘၪဆိၪဂ့ၩ ၦအံၫစရ့လၭဖိၪနီၪလီၫ. တၭစံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ယဟိဝၩဂဲၫထၪ့လၧစဲနၫ, ဒဲဂဲထုၪ့ဝ့ၫလၧစံအၫ, ဖၩ့ထၪ့ဝ့ၫလၧခိၪလီၩ့ပၫရၫ့, ဒဲဂဲၫဝ့ၫလၧအၡၩဆံၫ့ဎံၪအလၬၥံၪ, လၧအစူၪထွ့ၪနီၪ, ဆၧမၪလူၬမ့ၪလၧအဂးလီၫ.",
			"3": "<sup>3</sup> မွဲမၬ, အဲၪအၡၩခမျၧးၥံၪ, အၡၩဆံၫ့ဎံၪထီးအလူၬအီၪလၧနစူၪဖၧၩ့, တၭအဝ့ၫၥံၪဆၧၫ့နၩ့လၧနခၪ့ထံၭ, မိထီးန့နလူနထၫလီၫ.",
			"4": "<sup>4</sup> တၭစမိစ့ၭမၪလူၬန့ပၧၩလၧဆၧၥီၪ့ဆၧၥၫ့, မွဲစယၫကူၭအဆၧအီၪကီၪ့အဆၧန့ၥၫ,",
			"5": "<sup>5</sup> တၭလၧၦခမျၧးအခိၪလဖၪအီၪကီၪ့, အံၫစရ့လၭအဒီၪ့လဖၪအီၪစီၪ့ဎးနီၪ, အဝ့ၫဒၪမွဲစဎွၩလၧယ့ၭၡရၧၫ့လီၫ.",
			"6": "<sup>6</sup> မွဲစရုဘံၫ့မၧၫ့ဆံၭ, မွဲအထီးၥံၫလဂ့ၩ. ဒဲအၡၩနီၪမွဲအအီၪၡၩခိၬဂၩလဂ့ၩ.",
			"7": "<sup>7</sup> တၭအယီၩမွဲလၧစယုဒၫအဂဲးအကၠီၪ့, ဒဲအစံၭဝ့ၫ ဒၪ, ယဟိဝၩဧ့, ခိၭနၪစယုဒၫအလူ, ဒဲဒုၭလ့ၩနုၬဝ့ၫလၧအၡၩခမျၧးအကျၩဆံၭ. မွဲအစူၪလဖၪလၧၫ့လၧအဂးဆံၭ. တၭကဲၪထၪ့နဝ့ၫ ဆၧမၩဆၧၩ့ဝ့ၫ လၧအဒုၪအဒၩအ ကၠီၩ့နီၪဆံၭ.",
			"8": "<sup>8</sup> တၭလၧစလံဝဲၫအဂဲးအကၠီၪ့အဝ့ၫနီၪစံၭဝ့ၫဒၪ, မွဲနၥုၪ့မံၫ့ဒဲနယုရံၫ့အီၪလၧနၡၩဆံၫ့ဎံၪလဂၩ, လၧနဖစီၩ့မၩခွါလၧမၭစၫ, လၧနမၩခွါဝ့ၫထီးထံၫမ့ရဘၫ,",
			"9": "<sup>9</sup> လၧအစံၭအမိအဖါ, ယလဒၪဘၪဝ့ၫ, တၭလအီၪက့ၪၥ့ၪယၫ အၥၭ လၧအထၧၫ့ဖုဝဲလဖၪ, တၭၥ့ၪယၫအဖိၪဒၪဝ့ၫအ့ၬး အဂဲးဘဲၫယီၩအဝ့ၫၥံၪထီးန့နလူနထၫ, ဒဲယိထဲၩ့နဆၧအုၩ့လၩ့လီၫ.",
			"10": "<sup>10</sup> အဝ့ၫၥံၪမိၥီၪ့လိၪစယၫကူၭလၧနဆၧစ့ၩရၫ့လဖၪ, ဒဲအံၫစရ့လၭလၧနဆၧၥီၪ့ဆၧၥၫ့, အဝ့ၫၥံၪမိအီၪက့ၪလၩ့ဆၧဆူၭခဲၩနၧၫ့မၧၫ့လၧနမ့ၬယၫ, ဒဲနဆၧလုမ့ၪထၧၫ့ဒုၩယၫလၧနဆၧလုလးအဖၫ့ခိၪ,",
			"11": "<sup>11</sup> ယဟိဝၩဧ့, ဆၧဆိၪဂ့ၩအဆၧဖိၪဆၧလံၩ, ဒဲအမၩဆၧလၧအစူၪနီၪ, မွဲအဘၪနၥၭဆံၭ. ၦလၧအဂဲထုၪ့ထၫ့ဒုၩဒၩဝ့ၫ, ဖ့ၬဖျီၫ့အယးဒံၩ့ဆံၭ, ဒဲၦလၧအၥၭဂဲၫဝ့ၫ, ဘဲၫၥိၭအထီးဂဲထုၪ့ထဲၩ့လဂ့ၩ.",
			"12": "<sup>12</sup> တၭလၧစဘံၪ့ယမံၫ့အဂဲးအကၠီၪ့, အဝ့ၫနီၪစံၭဝ့ၫဒၪ, ၦလၧယဟိဝၩအဲၪဝ့ၫမိအီၪလၧအနဲၩ့ထံၭအီၪဂုးခၧၫ့, မိယိထဲၩ့ဝ့ၫၥံၫ့နံၩချီၩ့, တၭမိအီၪဝ့ၫလၧအခိၬထံၭခိၪအဆူၭဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> တၭလၧစယိၥၭအဂဲးအကၠီၪ့း အဝ့ၫနီၪစံၭဝ့ၫဒၪ, မွဲယဟိဝၩဆိၪဂ့ၩအထံၫအခးဆံၭ. လၧမူၭခိၪအဆၧလူဒိၪဎွ့ၩဒိၪ, လၧဆၩ့ထံၫ, တၭလၧဆၧယိၬဖၧၩ့လၧအခိၬလၩ့လၧလၬလခီၫ,",
			"14": "<sup>14</sup> တၭလၧဆၧလူဒိၪဎွ့ၩဒိၪလၧမုဒုၭဂဲၫၥၪထၪ့, တၭလၧဆၧလူဒိၪဎွ့ၩဒိၪလၧလၩဒုၭဂဲၫၥၪထၪ့,",
			"15": "<sup>15</sup> တၭလၧခိၪလီၩ့ထိၩ့ချိၬ လၧဖျိၩ့အဆၧအခိၪလဖၪ တၭလၧဆၧစီၩ့ခိၪ အဆိၩအကၠၪ အဆၧလူဒိၪဎွ့ၩဒိၪ,",
			"16": "<sup>16</sup> လၧဂၪ့ခိၪအဆၧလူဒိၪဎွ့ၩဒိၪ, ဒဲအဆၧဎွ့ၩ, တၭလၧဆၧဘၪ ၦအၥၭလၧအအီၪ လၧဆၧၡိၬကျၩ, မွဲအဂဲၫဘၪစယိၥၭအခိၪ, လၧအထၧၫ့ဖုဝဲအၦဒိၪဖၭဒိၪအခိၪဒၩ့ခိၪဆံၭ.",
			"17": "<sup>17</sup> အချီဖၫဝဲၡါနီၪ မွဲအကယးကဖး, အနိၩ့နီၪမွဲဘဲၫဆၧဒိၪအနိၩ့အၥိၭ, မိဘျႃၪ့ထၪ့ၦခမျၧးလစီၪ့ဎးလၧအဝ့ၫၥံၪ, ဖိးလၧဂၪ့ခိၪအထုၬလီၫ. အဝ့ၫၥံၪနီၪမွဲစအံဖြံၫ့အၡၩအလၬလဖၪ, တၭအဝ့ၫၥံၪနီၪမွဲစမနၭစ့ၫအထီၫ့လဖၪနီၪလီၫ.",
			"18": "<sup>18</sup> တၭလၧစဇ့ၭဘလၧၫ့ အဂဲးအကၠီၪ့, အဝ့ၫနီၪစံၭဝ့ၫ ဒၪ, ၥၭထိၬ, ဇ့ၭဘလၧၫ့ဧ့, လၧနလ့ၩထၪ့ဆၧ, ဒဲစအံစခၫဧ့, လၧနတဲၩဖၧၩ့နီၪဆံၭ.",
			"19": "<sup>19</sup> အဝ့ၫၥံၪမိကိၭန့ၦခမျၧးလၧခိၪလီၩ့လဖျိၪ့နီၪ, ထီးနီၪမိလုထၪ့ဆၧတီၩအဆၧလုလဖၪ, အဂဲးဘဲၫယီၩမိအၪ့ဆူၭထၪ့မၫဆမံၭအဆၧလၧၫ့ဎွ့ၩ, ဒဲဆၧလူဒိၪအီၪၥူၪလၧမ့ၭကျၩလီၫ.",
			"20": "<sup>20</sup> တၭလၧစဂၭအဂဲးအကၠီၪ့, အဝ့ၫနီၪစံၭဝ့ၫဒၪ, ၦလၧအမၩလဲထၪ့စဂၭမွဲအဘၪဆၧဆိၪဂ့ၩဆံၭ. အီၪဝ့ၫဘဲၫဆၬလၥၧၫ့မိအၥိၭ, တၭအဲၪ့ၡၫ့ဆၧအစူၪဒဲအခိၪဒၩ့လီၫ.",
			"21": "<sup>21</sup> တၭဒၪဘၪဆၧအခိၪအဂ့ၩထုၬလၧအဂးဒၪဝ့ၫ, အဂဲးဘဲၫယီၩထီးနီၪဆၧအဂးလၧၦမၪလူၬဝ့ၫနီၪအီၪ ဂုးခၧၫ့, တၭဂဲၫလၧၦခမျၧးအခိၪလဖၪ, မၩဝ့ၫလၧယဟိဝၩဆၧတီၩဆၧလီၩ့, ဒဲအဆၧစ့ၩရၫ့လၧအံၫစရ့လၭလီၫ.",
			"22": "<sup>22</sup> တၭစဒၫ့အဂဲးအကၠီၪ့ အဝ့ၫနီၪစံၭဝ့ၫဒၪ, စဒၫ့မွဲဆၬလၥၧၫ့အဖိၪလဒုၩ, အဝ့ၫဒၪမိစဲၪ့ဝ့ၫလၧဘၫၡၫ့လီၫ.",
			"23": "<sup>23</sup> တၭလၧစနၭၥလဲၫအဂဲးအကၠီၪ့, အဝ့ၫနီၪစံၭဝ့ၫဒၪ, စနၭၥလဲၫဧ့, ဘၪဆၧအၥၭနီၪနန့ဘျဲၩန့, တၭနဎွ့ၩလၧယဟိဝၩအဆၧဆိၪဂ့ၩနီၪ, မၩန့ဝ့ၫလၧမုနုၬဒဲလၧမုခံၫ့လခီၫနီၪဆံၭ.",
			"24": "<sup>24</sup> တၭလၧစအၭၡၧၫ အဂဲးအကၠီၪ့, အဝ့ၫနီၪစံၭဝ့ၫဒၪ, မွဲစအၭၡၧၫဘၪဆၧဆိၪဂ့ၩလၧဖိၪၥၪလဖၪဆံၭး မွဲအဘၪအထၧၫ့ဖုဝဲအၥၭ, မွဲအဘၧၩ့လၩ့အခၪ့လၧၥိၪဖၧၩ့ဆံၭ.",
			"25": "<sup>25</sup> နခၪ့ဖံၭနီၪမွဲထၭဒဲထီးဝီၩ, တၭဘဲၫနမုနံၩလဖၪအၥိၭနီၪနဂဲးနဘၭမိအီၪလီၫ.",
			"26": "<sup>26</sup> တၭဘဲၫယ့ၭၡရၧၫ့အယွၩအၥိၭလအီၪဘၪ, ၦထူၬမူၭခိၪလၧအမိမၩဆၧၩ့နၧၩ, ဒဲအထူၬဆၧအုၪ့လၧအလၩအဖၩ့အဖၧၩ့လီၫ.",
			"27": "<sup>27</sup> ယွၩအဆိၩအကၠၪနီၪမွဲနဆၧဖလ့ၬအလး, တၭဆၧအစူၪအဆိၩအကၠၪလဖၪနီၪအီၪလၧနဖၫ့လၬ, တၭအဝ့ၫမိနၫ့ထၪ့ခွံၬ ဆၧအဒုၪအဒၩလၧနမ့ၬယၫ, ဒဲအမိစံၭ, မၩဂၭဂီၩ့အဝ့ၫၥံၪဘီၪ.",
			"28": "<sup>28</sup> တၭအံၫစရ့လၭမိအီၪဂုးအီၪခၧၫ့လစီၪ့ဎး, စယၫကူၭအထံၫထၪ့ဖျိၭအဖၧၩ့, လၧထံၫၥံၪခးၥံၪအီၪလၧဘုၪကၠိၩ့, ဒဲစဘံၭထံၫအဖၧၩ့, အမူၭခိၪမိဒုၭလၩ့ဆၩ့ထံၫဆ့လီၫ.",
			"29": "<sup>29</sup> အံၫစရ့လၭဧ့, နဘၪဆၧဆိၪဂ့ၩလီၫ. မွဲၦလၩ့ဂၬနၧၩလဂၩလဲၪ, ၦၡၩခမျၧးဧ့, လၧအဘၪဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫလၧယဟိဝၩ, ဆၧမၩဆၧၩ့နၧၩအထၩ့ဖံးလဘံၪ့, ဒဲနကယးကဖးအနၭလဘံၪ့, တၭနဒုၪနဒၩၥံၪမိဆၪ့လၩ့ကျဲၩ့မၩလၧနစူၪအဖၫ့လၬ, တၭနမိယဲးဘၪအဝ့ၫၥံၪ အလးထၪ့ထီၫလဖၪနီၪလီၫ."
		},
		"34": {
			"1": "<sup>1</sup> တၭစမိစ့ၭစဲၪ့ထၪ့ခွံၬ လၧမိအၭအဆၧပျၩ့ဖၧၩ့ထီၩ့ လၧခိၪလီၩ့နံဘိၫလၧပံစဂၫအဒၩ့ခိၪ လၧအအီၪဆဲၫဎၩ့ လၧယ့ၫရခိၫနီၪလီၫ. တၭယဟိဝၩဒုၭနဲၪဝ့ၫခးဂံလအၭ",
			"2": "<sup>2</sup> ထၧၫ့ဘံၪ့ယၫဖိးလၧဒၫ့,- ဒဲနၭၥလဲၫထၧၫ့ဘံၪ့ယၫ, ဒဲခး အံဖြံၫ့,ဒဲခးမနၭစ့ၫ, ဒဲခးယုဒၫထၧၫ့ဘံၪ့ယၫဖိးလၧမၫ",
			"3": "<sup>3</sup> ဆမံၭအယဲၩ့ထုၬနီၪ,- ဒဲဆၧလၧမုခံၫ့ဒဲယ့ၫရခိၫအခိၪ လီၩ့ဆူၭအဆၧပျၩ့ဖၧၩ့, ဒဲဒိၩ့ၥံၪ့စီၩ့မလီၫ့ဖိးလၧဇိအၫ",
			"4": "<sup>4</sup> လီၫ.- တၭယဟိဝၩစံၭအဝ့ၫ, အယီၩမွဲခးလၧယဆိၪ လၩ့ယၥၭလၧအဂဲးလၧစအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစ ယၫကူၭတၭ, စံၭ,ယမိဖ့ၪလၫ့နချံၫနၥၪလီၫ. ယဒုၭဒၪ ဘၪယူၭနၧၩ လၧနမ့ၬၥၪယူၭး မွဲလါနၫ့နလ့ၩခၫ့ဂၬ ထီးနီၪအ့ၬ.",
			"5": "<sup>5</sup> တၭစမိစ့ၭယဟိဝၩအခ့ၫအၡၩ ၥံၫဝ့ၫထီးနီၪလၧခး မိအၭအဖၧၩ့, ဘဲၫယဟိဝၩအလူအၥိၭနီၪလီၫ. တၭ ဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧခိၪလီၩ့ဆူၭဖၧၩ့ လၧခးမိ",
			"6": "<sup>6</sup> အၭအဖၧၩ့အီၪဝ့ၫဆဲၫဎၩ့လၧဘ့ၭၥပံအီၫလီၫ.- မွဲလါ နၫ့ထီးမုဆၫလနံၩယီၩ ၦၡၩၥ့ၪယၫအၥွၪခိၪ နးဂၩ အ့ၬ.",
			"7": "<sup>7</sup> တၭလၧစမိစ့ၭၥံၫဝ့ၫနီၪ အၥၭၡါယူၭအနံၪ့လယၩ နံၫဆံၫလီၫ. အမ့ၬၥၪခံၭဒံၭအ့ၬ, ဒဲအၥၭဘၪ့အဂဲးအ ဘၭလၩ့ဆါဒံၭအ့ၬ.",
			"8": "<sup>8</sup> ၦအံၫစရ့လၭဖိၪဂၪ့ဝ့ၫ လၧစမိစ့ၭအကၠီၩ့လၧမိအၭ အဆၧပျၩ့ဖၧၩ့အနံၩၥၧၫ့ဆံၫလီၫ. တၭမုနံၩလဖၪလၧ အဂၪ့ဝ့ၫ, ဒဲၥုၪ့အုၭၥၭအုၭလၧစမိစ့ၭအကၠီၩ့နီၪလူၬဝ့ၫ",
			"9": "<sup>9</sup> လီၫ.- တၭစနိၫ့အဖိၪခွၫစယီရှုၫအ့ၫ ဎွ့ၩဝ့ၫလၧဆၧကိၪ့ ၥ့ၪကိၪ့ဘၪအဂးလီၫ. အဂဲးဘဲၫယီၩ စမိစ့ၭအီၪက့ၪ ယူၭအစူၪလၧအလီၩ့နီၪး တၭၦအံၫစရ့လၭဖိၪခိၭနၪ အဝ့ၫဒၪအလူဒဲမၩဝ့ၫဘဲၫ ယဟိဝၩမၪလူၬစမိစ့ၭအၥိၭ နီၪလီၫ.",
			"10": "<sup>10</sup> တၭမီၪလဂၩအီၪထၪ့လၧၩ့လၧအံၫစရ့လၭအကျၩ ဘဲၫစမိစ့ၭအၥိၭနးဂၩအ့ၬး ၦလၧယဟိဝၩယိမ့ၬၥကိၭ",
			"11": "<sup>11</sup> မ့ၬတၭ,- ၥ့ၪယၫဝ့ၫလၧကယဲအဆၧမၩနဲၪ့လၩ့လၭ, ဒဲဆၧလၩ့လိလၩ့လၭထီးအလူၬ လၧယဟိဝၩအၪ့မၧၫ့ လၩ့အလ့ၩမၩဝ့ၫလၧခးအံဇံၭအဖၧၩ့, လၧဖၫရိၫအ လီၩ့, ဒဲလၧအခ့ၫအၡၩအလီၩ့ထီးအလူၬ, ဒဲလၧအ",
			"12": "<sup>12</sup> ခးထၧၫ့ဘံၪ့ယၫအဖၧၩ့,- ဒဲလၧအဆၧအစူၪဆီၪ့နီၪ ထီးအလူၬ, ဒဲလၧဆၧမၩၥၭမဲၪဖၭဒိၪထီးအလူၬလၧ စမိစ့ၭဒုၭနဲၪအံၫစရ့လၭထီးအလူၬအမ့ၬယၫလီၫ."
		}
	}
};
module.exports = book;